INSERT INTO `castmember` VALUES ('Mohamed El Tokhy',1000057,'Egypt','14 March 1998','NONE','4 November 1926','https://media.elcinema.com/uploads/_315x420_1f10ff8e7b5dced6f103d72aae7c66e1ee405add08b09b84a79adcf5b75c53b4.jpg'),('Rageh Daoud',1000239,'Egypt','Egypt','NONE','23 November 1954','https://media.elcinema.com/uploads/_315x420_9d85b72167f1bb95af89c6e92c7192a16a640a18fb2036400e59bbc82a7573f1.jpg'),('‎‏‎‏Kariman Mahdi',1000287,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1ae60c74044f69af290239acd5833d899da000292e9808d1c41e3ffffa8da0b4.jpg'),('Mohamed Mohsen',1000416,'Syria','Syria','NONE','13 February 2007','https://media.elcinema.com/blank_photos/315x420.jpg'),('Diaa Abdulkhaliq',1000693,'Egypt','Egypt','An Egyptian actor, famous for his evil roles. From his leading films was \"Tito\" ','13 June 1965','https://media.elcinema.com/uploads/_315x420_b4c6174768d429b7a7d78c82db1b6a157204ccde6622001ed035c87e5b42dd11.jpg'),('Khaled Bahgat',1000695,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4abcae0a1e0ad3d3f644e341d9e3aed3424eb08a1531273c3af1a844a3c535d1.jpg'),('Abdelrahman El Abnoudy',1000935,'Egypt','21 April 2015','Al-Abanoudy was born in the village of Abanoud in the Egyptian governorate of Qena. His father was a “Maazoun” – a religious man who formalizes weddings. Al-Abanoudy later moved to the city of Qena where he was influenced by the songs of “al-Seera al-Hilaliyah”. He is married to the Egyptian television announcer Nehal Kamal and the couple have two daughters, Ayyah and Nour. \nAl-Abanoudy is among the best recognized Egyptian colloquial poets of all time, among the best known of his works is “al-Seera al-Hilaliyah” which is in fact a compilation of poetry authored by poets across Upper Egypt. His work “Ayyami al-Helwa” (“My Sweet Days”) is perhaps his best known novel – the work was published over several phases in the Egyptian newspaper “al-Ahram”. Throughout the book al-Abanoudy recalls different stories garnered from his experiences living in Upper Egypt.\n','11 April 1938','https://media.elcinema.com/uploads/_315x420_b5d153de4aed04f63048409646b043a890f369fb249cad4af56d5d37b7a31bd7.jpg'),('Menna Fadaly',1001149,'Egypt','Egypt','Menna Fadaly is an Egyptian actress. She was born in Cairo in 1983, and started acting in 2002 in the television series “Ayna Qalby?” (Where\'s my Heart?), after she was introduced by her mother to director Magdy Abu Emeira. She then appeared in numerous television series, including “Almalek Farouq” (King Farouq), “El Nas fi Kafr Askar” (People in Kafr Askar), “Lahazat harega” (Critical Moments) and “Afarit El Sayala” (The Ghosts of El Sayala).  ','4 September 1983','https://media.elcinema.com/uploads/_315x420_748a56f197e5e0f2928f19199388da7ed4e943b3631d70c4fcfe841363e8a7f9.jpg'),('Ayman Naguib',1001183,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_075fa6053db913fb87959ccdde16c6a612171d605582ade7fb87f889d5c9c3ea.jpg'),('Karim Abdulaziz',1001574,'Egypt','Egypt','Son of famous director Mohamed Abdel Aziz, Karim was no stranger to the world of film making. He graduated from the institute of high arts, directing division, in 1997. He worked as an assistant director for a short time before deciding to jump in front of the camera. Director Sherif Emara gave him his first role, but Karim\'s notoriety grew after his TV role in the series \"Lady from the Era of Love\" starring Samira Ahmed. Following the show, he was given his first lead role on the silver screen in the movie \"Why did you Make me Love You?\" opposite Mona Zaki and Hala Sheeha.','17 August 1975','https://media.elcinema.com/uploads/_315x420_2b2a9c81d61f9b446bf6ff1232b86e7c4f5fae96d3eae40faff0eccdeba3b391.jpg'),('Mona Hala',1001601,'Egypt','Egypt','Mona Hala is an Egyptian actress who got her start on the children\'s show \"Yalla Bina.\" Afterwards, she got a small role in the film \"Basha Telmeez\" (His Excellency the Student) in 2004, which she followed with a bigger role in \"Leilet al-Baby-Baby Doll\" (The Baby Doll Night) in 2008. Her stints on \"Qalb Mayyet\" (Dead Heart), \"Kessat Hob\" (Love Story), and \"October Al-Akhar\" (The Other October) are among her most famous television roles. Mona played Princess Fawzeyya, King Farouk\'s sister, in two television series \"Al-Malek Farouk\" (King Farouk) and \"Maleka fel-Manfa\" (A Queen in Exile). Her calm features help her play a variety of roles. ','25 October 1984','https://media.elcinema.com/uploads/_315x420_be4109f3a7770bd0b60584015fa272ecaf2ad5f2fcd57506259f5ae9dd8df461.jpg'),('Hussein Fahmy',1001614,'Egypt','Egypt','Hussein Fahmy is an Egyptian actor who was born in Cairo. He graduated from the Higher Institute for Cinema in 1963 and then studied directing in the United States of America. Following his return he was recruited by Hassan al-Imam for an acting role and thus he put off his directing project so that he could work as an actor in cinema, theater and television. Plays in which Fahmy has participated in include “Inqilab” (“Coup”), “Ahlan ya Bakawwat”, “Embrator ‘Emad al-Deen”, “Sahlab” and “Ka’b ‘Aaly” (“High Heels”. His television works include “Alf Leila wa Leila” (“A Thousand and One Nights”) and “al-Mal wa al-Banoun” (“Children and Property”). Fahmy first married a woman outside of art circles, he later married actress Mervat Amin and the couple had a daughter. Fahmy assumed the leadership of the International Cairo Film Festival beginning in 1998 and up to 2000. He received the award for best actor for the films “Damy wa Dimoo’y wa Ibtisamaty” (“My Blood, My Tears and My Smile”), “al-Ikhwa al-A’daa” (“Inmical Brothers”), “al-Rasasa La Tazal fee Habiby” (“The Bullet Remains in My Loved One”) and “Intabiho ayoha al-Sada” (“Your Attention Gentlemen”). Fahmy also received the award for best cinema research at the al-Neilein Festival in 1983 for his research into the relationship between the director and the performer. He has three children named Mahmoud, Neira and Mennat Allah. Fahmy successfully portrayed the role of the blonde haired handsome youth in many of his earlier movies before demonstrating that he is a first rate talented actor in films of the likes of “al-A’adaa” (“The Enemies”), “al-‘Aar” (“The Shame”) and “Intabiho ayoha al-Sada” (“Your Attention Gentlemen”). He may be observed in his best form in “al-Le’ib ma’a al-Kibar” (“Playing with the Elders”), moreover he matured as an actor with age and experience.','22 March 1940','https://media.elcinema.com/uploads/_315x420_b795b23c808aa362b57ed2a0341ac6ea0866a2e823e2348e4da75442cdcb9e8a.jpg'),('Samah Anwar',1001916,'Egypt','Egypt','Samah’s  father was the writer Anwar ‘Abd Allah and her mother was actress So’aad Hussein. She studied French at Cairo University’s faculty of Arts and thereafter earned fame for her vivacious roles in Egyptian cinema. Among her best known film works are “Halat Tilabis” and “Bint Mushaghba Gidan” (“Mischievious Girl”). Samah has also performed on stage and television. Her TV works include “Zeaab al-Geel” (“Wolves”) and “al-Hissab” (“The Account”) while her stage works include “Raqisat Qita’ ‘Amm” (“Public Sector Dancer”) and “Awlad al-Shaware’” (“Street Kids”).\nSamah withdrew from acting for several years following an auto accident but returned to the spotlight on the “Tagribty” (“My Experience”) program which aired on satellite TV.\n','22 April 1965','https://media.elcinema.com/uploads/_315x420_0a3e9a39969fcd16ea10a975e5b96631832c2ebef55224b61ec4f501d4d6e82b.jpg'),('Mahmoud Elwan',1002053,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9b483d3d27d89e609db02780899fcb248a0ecd9e1d80d913dfe27bc292915bd8.jpg'),('Ahmed Zaher',1002070,'Egypt','Egypt','Ahmed Zaher graduated from the Faculty of Commerce before receiving a bachelors degree from the Higher Institute for Theatrical Arts. His television works include “Al Ragol al Akhir” (The Last Man), “Amshir,” “Li al ‘Adalah Wojooh Kathira” (Justice Has Many Faces), “Hadeeth al Sabah wal Masaa” (Morning and Evening Talk), “Al ‘Ussyan” (Disobedience), “Al Haqeeqa wal Sarrab” (Mirage and Truth), “Samehoony Makansh Qasdy” (Forgive Me I Didn’t Mean It), “Khalf al Abwab al Mughlaqa” (Behind Closed Doors), “Umm Kalthoum” and “Harat al-Tablawy” (al Tablawy’s Neighborhood). He has also worked on the 2002 play “Edla’y ya Doussa” in addition to “Wada’an ya Bakawat” (Farewell Tears). ','27 April 1975','https://media.elcinema.com/uploads/_315x420_632e04f155cf8e8e0c634b7a609d2c3d42d9b6b2c8033e6bbe3c620a66df6da1.jpg'),('Ahmed Safwat',1002111,'Egypt','Egypt','Egyptian actor, graduated from the High Institute of Dramatic Arts. Nour al-Shereef chose him to play the role of “Khaaled al-Daaly” in the series “Al-Daaly”, for which he was awarded best young actor prize, after his success in “Sekkat al-Helaaly”with Yahia al-Fakharaany.\nSafwat also played the role of “Marshal Abdul Hakeem Aamer” in the series “Naasser”.','11 October 1977','https://media.elcinema.com/uploads/_315x420_63573b38fa5c9c60ecaa20dc36aeffb7aea6b9665b95f006e5e0e76807ae657e.jpg'),('Hany Fawzy',1002113,'Egypt','هانى فوزى قزمان ','Script writer Hani Fawzi had a unique way of writing. His topics were always new and tricky. Although he started writing very early, but his first presented idea was through the movie “The Land of Dreams” in 1993 starring legendary Fatin Hamama. Hani Fawzi worked with many directors such as Dawood Abdel Sayed, Osama Fawzi and Khaled Fawzi.  ','NONE','https://media.elcinema.com/uploads/_315x420_17a4fbfc5b1886e731b11792b21e583a7c9ee9b86e19053499c1e022215ee248.jpg'),('Amr Abed',1002134,'Egypt','Egypt','NONE','10 June 1984','https://media.elcinema.com/uploads/_315x420_874fd2af55886a13b27c23664a9ae83e0d9774bf5492ea0702583f1a3cba3421.jpg'),('Ali Khalifa',1002254,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_22cafd2b815886e5a294701399d0878d8b06f13d5a4491ace8866b489ca30f37.jpg'),('Mohamed Abo Seif',1002388,'Egypt','Egypt','He is an Egyptian director and script writer. His father was the infamous director Salah Abu Seif. Mohamed wanted to be like his dad so he studied directing at the High Institute for Cinema and graduated in 1976. He worked with several directors as an assistant director, including his dad in the movie “The Malateeli Bathroom” in 1973, then directed his attention to commercial advertising. His first ever movie was “The Apple and the Skull”.','9 October 1950','https://media.elcinema.com/uploads/_315x420_80aff2270627b9a1cb1ba66f1d7c25674e9be6891d8d999dd62041d0d2d406f0.jpg'),('Abdullah Ellkatib',1002610,'Egypt','Egypt','NONE','13 March 1978','https://media.elcinema.com/uploads/_315x420_3e2660c90cf8c3a0ba2c76dc526ea7306506a335701c4d0ce82ea0b23cd6a343.jpg'),('Emad Rashad',1002692,'Egypt','Egypt','NONE','3 December 1951','https://media.elcinema.com/uploads/_315x420_c76e2e945e1ad214e576d890c4910fc6cd954a0cb848c56e0c341bd595b8ef4b.jpg'),('Mahmoud Suleiman',1002914,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3630d2d7308a61e7e6f05f90d69a273d3a168064ec3666dd09b22b4f078d952c.jpg'),('Ali Ragab',1003085,'Egypt','12 September 2020','Aly Ragab was born on the 25th of March 1964 in the city of Alexandria in Egypt. He studied engineering at Alexandria University. His extreme passion to art made his shift his interest art directing. Initially he worked as an assistant director in several movies such as “Maganeeno”, “Dantella”, “Hassan and Aziza” and in the year 2000 he directed his first movie “Macho Guy” or “Shagee El Ceema” starring Ahmed Adam. He then did several other movies such as “Saye Bahr”, “Khalti Faransa” and “Bolteya El Ayma” in 2008. He also directed his only television series called “Al Wadeea wal Theaab”. He is currently preparing for his new movie “Innocent Heart” or “Kalb Bareei”','25 March 1964','https://media.elcinema.com/uploads/_315x420_ba655fc6a7cb42cd1ed73d13d382badfecea8929af5fb095c7a99dddb78899cd.jpg'),('Karim Kojok',1003154,'Egypt','Egypt','He fell in love with acting even before being an actor, and worked for 11 years as a TV presenter in various movie channels, and on Arab Radio and Television.\nHe never asked for help in regards to being introduced to the field of cinema. Until his friend director Wael Ihsan offered him a role in the movie “AL Lembi”\nAs for television he was nominated by director Adel Hossni for the series “The Lord’s Daughter”\n','22 September 1972','https://media.elcinema.com/uploads/_315x420_281f5e1ebf9dec64f1b879d94f27e8e3ce1a84e3f1c277aac524dc156f17e51d.jpg'),('Alaa Awad',1003183,'Egypt','Egypt','NONE','1 January 1960','https://media.elcinema.com/uploads/_315x420_e4cf345d91f43b42a7dd208ba935caf1d65f80b2398662c220556b96f1a6e316.jpg'),('Amr Kamel',1003363,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mustafa Imam',1003580,'Egypt','Egypt','NONE','12 January 1934','https://media.elcinema.com/blank_photos/315x420.jpg'),('Zeina',1003694,'Egypt','Egypt','Egyptian actress young - born in Aquarius - began her career when played a little in front of the star of the late Ahmed Zaki in the film (Fear Factor) and then disappeared until slightly appeared again in one of the clips music with singer / Tamer Hosni in one of his songs - andnd then quickly spread quickly claimed the rocket and the stardom and fame, and proved it has a special talent - so it jumped into the top ranks and occupied a privileged position among the stars of the first row were also able to win the best actress title for the years 2005.2006 in public referendums. - Launched by the late artist / title of Ahmad Zaki (Penelope Cruz) for close similarities between them - also praised by film director / Youssef Chahine when seen in the film (Joys) and was named (Sophia Loren the Arabs). - Participated in the radio series, Ramadan (Holiday at Real Madrid), with the artists / Ahmed Ezz, Nour, Antsarouselah Abdallah and Lotfi Labib - Stars and ball / Mohammed Abu Trika, Khaled Ghandour','4 February 1981','https://media.elcinema.com/uploads/_315x420_3c9b41501b68ab5ae22e36347891320f2622f711d8f0e7fd14993b791528835f.jpg'),('Sharif Hilal',1003705,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fbbcd3fa62877ae68edf62c4e4aad345151d7e96ee990e406621beb8aff2a356.jpg'),('Sahar Kamel',1003808,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_529e1254da9def07b1f41eb27d8cde9965821e7685cd064756a6a914dd2df1ea.jpg'),('Emad El Raheb',1003814,'Egypt','Egypt','Emad El Raheb is an Egyptian actor who was born in 1970. he graduated from the college of Ain Shams. El Rahed participated in many drama and cinematic works. His TV drama works include “Awan El Ward,” and “El Malek farouq.” He also starred in important movies like Youssef Shahine\'s “Eskendereya- New York”and Waheed Hamed\'s “Maaly Al Wazeer.”','30 June 1970','https://media.elcinema.com/uploads/_315x420_cb6b6924919d595adb2f2f2e0680407934b56c0fdb7b1fccb83d5dff2a815086.jpg'),('Sherif Arafa',1004016,'Egypt','Egypt','Sherif is an Egyptian director, screenwriter and producer. He graduated from the Higher Institute for Cinema in 1982 and he is the son of director Sa’ad ‘Arafa in addition to being an elder brother to director ‘Amr ‘Arafa. Sherif began his cinema career in 1987 when he directed the film “al-Aqzam Qadimoon” (“The Dwarfs are Coming”), the screenplay for that title was authored by Maher ‘Awwad. Thereafter Sherif presented the film “al-Daragah al-Thanniyah” (“The Second Degree”) with performers Soa’ad Hosny and Ahmed Zakky but the work was not a success among audiences. The director was the first to notice the talents of many performers who include ( Mohamed Sa’ad – Ahmed Helmy – Mohamed Heneidy – Kareem ‘Abd Al ‘Azeez – Ahmed Makky – Mahmoud ‘Abd Al Ghany – Haitham Ahmed Zakky – ‘Alaa Waly al-Deen – Mona Zakky – Nour – Sullaf Fawakhragy – Gamal Suleiman). The large number of talent discoveries attributed to Sherif ‘Arafa have indicated that he has a special eye for fledgling performers. The director has worked with major performers from the outset of his career, performers of the likes of Soa’ad Hosny, Ahmed Zakky and ‘Adel Imam. He also discovered and presented several of the well known youthful faces in cinema, names such as ‘Alaa Waly al-Deen, Mohamed Heneidy, Mona Zakky, Nour, Mohamed Sa’ad, Ahmed Helmy, Haitham Helmy, Ahmed Zakky and many others. Sherif has also produced several cinema and television productions such as the film “Halim” and the television series  “Tamer wa Shawqqiyah”, “Lahazat Harija” (“Critical Moments”) and the program “al-Nas wa Ana” (“The People and Myself”) through his private production company Partner Pro. Moreover Sherif has also directed several television commercials for well known products such as Pepsi and Chipsy. Sherif made a forceful entry into the world of television production in 2006 when he produced three works, the two television series “Tamer wa Shawqqiyah” and “Lahazat Hariga” (“Critical Moments”) and the program “al-Nas wa Ana” (“The People and Myself”). That last production saw him collaborate with other producers from Egypt and the United States. Sherif ‘Arafa has directed several cinema titles that were milestones in the history of Egyptian cinema, titles such as “Teyoor al-Zalam” (“The Birds of Darkness” ), “al-Nazir” (“The Manager”), “Mafia” and “Halim”.','25 December 1960','https://media.elcinema.com/uploads/_315x420_b9f69ae91738a4ffddd0bc5bf32b21724c47469dc8a5913314bab29639ac46fe.jpg'),('Salma Al Nagar',1004198,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_46b1be7a2db14f84915f735b903f35eb9d11bf0bb2df151d0cb96605c6ec2b47.jpg'),('Ragaa Al-Geddawy',1004494,'Egypt','Egypt','Nagaat Aly Hassan al-Geddaawy went to Franciscaines school in Cairo. She worked in the translation department of an advertizing agency where she was chosen “Miss Cotton 1958” giving her the chance to become a mannequin. She started acting in cinema and theatre with her aunt Taheyya Carioca. She got married to the football player Hassan Mokhtaar, gave him their only daughter. Al-Geddaawy stopped acting for some time to travel with him. Upon her return, she resumed fashion shows and acted with Aadel Emaam in several plays like “Al-waad Sayyed al-shagh-ghaal\" (Sayyed, the servant). In many TV series, she personalized aristocratic ladies to the point that no one could tell that she is acting.','6 September 1934','https://media.elcinema.com/uploads/_315x420_2615158c7680e89a6e12b1e919778b22f5c9773b53b93a2cc020614b067fcb7e.jpg'),('Olfat Emam',1004554,'Egypt','Egypt','NONE','23 March 1964','https://media.elcinema.com/uploads/_315x420_f618318726c74f7def42290c4165f90f4b39cc3026b0b58a148ec8617b0b920c.jpg'),('Madiha Qassem',1004658,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8df47922a6d557e196b14717fdc70bb2fa915a5e2adcf91fd3b135a407ef6be8.jpg'),('Mohamed Nabawi',1004865,'Egypt','محمد نبوي ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f2f37b6fbd661147b304a57d9ecf647a3d75b6c47ebb1fb85f6f31a2ccb9fe95.jpg'),('Amira Mukhtar',1004907,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e511d86037e3a9f6a91a53230eb0bd7bd0bffedff93058578226cdefc03b65ba.jpg'),('Mohammed Diaa',1004929,'Egypt','محمد ضياء الدين ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a6ff4b03baff04bf7fe7c768e3288156a6b2b31678b7f3646769861a74b2cbe2.jpg'),('Azza Al-Husseiny',1005302,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0d970ea532837bd804cc862fd20fa420087c231f5827785b2ae1ec458de0c3b8.jpg'),('Ahmed Ezzat',1005341,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_750f0f3d65b8a04cf6e7413ac7ece36bb0ea1f2cf7d603dedeac02e1d80d780c.jpg'),('Ahmad Ismael',1005407,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Huda Al Saify',1005423,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d589a4977f7332488e6a57ad8affa9a6d03e08951e727015e883c48b31f235cd.jpg'),('Khaled ElBakry',1005549,'Egypt','Egypt','NONE','15 June 2018','https://media.elcinema.com/uploads/_315x420_408ed59f2277763d74a7658691367e48c9b4e5dde6b4590fd38eea9300a5057a.jpg'),('Ezzat Al-Alaily',1005677,'Egypt','Egypt','E’zzat Hassan al-A’laly Hassan was born in the “Bab al-Sha’riyah” district of Cairo. He received his bachelor’s degree from the Higher Institute of Theater Studies in 1960. \nE’zzat is married and has a son named Mahmoud who works as a dentist. He also has a daughter named Ragaa. Ragaa has a degree in law and is married. \nIn his early stages, art was something of a dream for E’zzat as he had four sisters for whom he was responsible seeing as his father had passed away. He thereafter made his way into art and performed in several TV series an example of which is “A’bd Allah al-Nadeem”.\nAmongst the stage productions in which E’zzat has assumed leading roles are “Dimaa a’la Malabis al-Sahra” (“Blood on the Evening Gown”) and “Ahlan ya Bakwat”. \nE’zzat has also written several plays amongst which are “Thawrat al-Madina” (“The City’s Revolt”) and “Al-Touffan” (“The Flood”). E’zzat al-A’laly has received numerous awards and has also performed in Algerian and Lebanese cinema. He is considered a unique acting talent who can give lively depictions of any character he is asked to portray, no matter how diverse. His natural talents and build have helped him in his career.\nE’zzat can be observed in excellent form in “al-Ard” (“The Earth”), “al-Ikhtiyar” (“The Choice”), “al-Muwattin al-Masry” (“The Egyptian Citizen”) and “el-Sekka Matt” (“El-Sekka is Dead”).\n','15 September 1934','https://media.elcinema.com/uploads/_315x420_e700869fbbaf2e3fc5f40cea5821410a6e94feeb207807772f475ad3924ee43e.jpg'),('Amir Shaker',1005687,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b8c8a2477c3221ac22addaf9d03d395a918c3d2da180ec9cc02cccb0f4fe7825.jpg'),('Ruby',1005695,'Egypt','Egypt','Ruby is an Egyptian actress and singer. Her real name is Rania Hussein Mohamed Tawfiq. Her career began with appearances in commercial advertisements. Director Youssef Chahine discovered her and chose the name “Ruby” for her. She then transitioned into singing and her music created much clamor in 2003. She has worked as a presenter for several satellite networks including “Dream” and “al-Mehwar.\" She\'s starred in a number of hit movies, including \"Film Theqafy\" (Cultural Movie) in 2000, \"Silence... On Tourne\" directed by Youssef Chahine in 2001, \"El Waed\" (The Promise) in 2008, \"El Shawq\" (The Passion) in 2008, and \"El Hafla\" (The Party) in 2013. ','8 October 1981','https://media.elcinema.com/uploads/_315x420_cc1a249a0e5a165dacd2c0f5ffb1366a15a68c3e012201866e2a14fb73799b04.jpg'),('Khaled Essawy',1006091,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_af4d15c54c3dd599ca9b53fbd0969f25e2b9d207852e2c57410529eda9c36d99.jpg'),('Mohamed Maghraby',1006221,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_aa9a1744d445ba27b241b966f02efd86bb2d0109efa0ffca11b245c7bed5b0ba.jpg'),('Samar Ali',1006586,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cdc704c446ff4820a39295f61df5e15de61d519ff5d792e80dac49f637ad716a.jpg'),('Mohamed Azmy',1006624,'Egypt','Egypt','NONE','17 July 1993','https://media.elcinema.com/uploads/_315x420_3db42e1f3ecd5742d31ce21061d67634d4d6edf5814760cc1bfaa850a5e0d9cd.jpg'),('Nedal Al-Shafeay',1006630,'Egypt','Egypt','Nedal El Shafey is an Egyptian actor. He was born in Cairo in 1978, and graduated from the acting and directing department of the high Institute of Theatrical Arts in 1999. He participated in a workshop organized by theater director and writer Khaled Galal, which gave him the opportunity to land roles in small plays produced through state funds like “Al Moganad 311” (Soldier 311) and “Mosafer Leil” (Night Traveller). His first film role was in the crime thriller “Malaky Eskendereya” (Alexandria Private). He then went on to star in the 2007 sitcom “Tamer we Shawqeya” as Shawqeya\'s brother, developing a character that was extremely successful among audience. His other work includes so-starring in the television series “Lahazat harega” (Critical Moments), “Hekayat Bena\'esh-ha” (Stories we Live), “Vertigo” and the films “Al Gezira” (The Island), “Badal Faqed” (Replacement), “El Dealer” and “Garsoneira”. ','12 June 1978','https://media.elcinema.com/uploads/_315x420_ac47ba2a42932a23be6de0a8bf4fa7e92c2bbdcbdd3f44fc2090561e8b0726da.jpg'),('Ashraf Tulba',1006642,'Egypt','Egypt','NONE','12 February 1958','https://media.elcinema.com/uploads/_315x420_e208b45d6d75c323fc53420cd5aab0c8e215fd41689db88444f510d24d6b38df.jpg'),('Aaidah Riyadh',1006699,'Egypt','Egypt','Her full name is ‘Aaidah Riyadh Ragheb Shahata and she was born in the district of Bulaq. ‘Aaidah was married to artist Muharram Fouad and their marriage continued for about four years. She started out as a dancer in the National Folk Art Troupe at the age of fourteen and excelled in that role. It was in that context that she was observed by director Ahmed Yaseen who recruited her for the film “Ma’a Tahhiyaty li al-Ustaz al-‘Azeez” (“With My Regards to the dear Professor”). Thereafter her career took off and she presented several plays including “Wahid Laymoun wa al-Thanee Magnoun” (“One is a Lemon and the Other is Mad”), “Gouz wa Louz” (“Nuts and Almonds”) and “Taksab ya Khashiya”. She also took part in the television series “Bareeq al-Sahab” (“Sparkle of the Clouds”), “Harra al-Mahrousa”, “al-Mal wa al-Banoun” (“Children and Property”), “Marid al-Gabal”, “Le’b al-Hobb wa al-Intiqam” (“The Game of Love and Revenge”), “Layaly al-Helmiyah”, “Hawanim Garden City” (“The Women of Garden City”) and “’Aailat al-Hajj Metwally” (“The Family of Hajj Metwally”). She received awards for her performances with the national troupe and for the films “Ahl al-Qimma” (“The People of the Summit”) and “Ahlam Hend wa Camelia” (“The Dreams of Hend and Camelia”).','23 January 1954','https://media.elcinema.com/uploads/_315x420_4fce6ba3cad4ac557f5a013b5c8000e4d61c16e77468273d5e18dc6853db2c04.jpg'),('Samira Mohsen',1006933,'Egypt','Egypt','NONE','14 July 1945','https://media.elcinema.com/uploads/_315x420_235ffe0d8c0936e19a259ce34fdf27b1082e524c782dc2ccef1fb3bf32ca50c9.jpg'),('Mohamed Nagaty',1007105,'Egypt','Egypt','NONE','15 April 1978','https://media.elcinema.com/uploads/_315x420_5cc0ed2a4e67fde477a223f2183a89031bf5d44c683c137a3e15ed295c74f858.jpg'),('Enaam Al-Gritly',1007212,'Egypt','Egypt','NONE','6 November 1944','https://media.elcinema.com/uploads/_315x420_bb08d154ef9ba67d2eb0ef86f735ae6c96f079275a93891326738ba25f7bc2c2.jpg'),('Wafaa Sadeq',1007214,'Egypt','Egypt','NONE','3 June 1970','https://media.elcinema.com/uploads/_315x420_1cf4658f6353cec93d8144b2cd89194d50ce1f82b7808b59179fd8827766db32.jpg'),('Alaa Morsy',1007377,'Egypt','Egypt','NONE','3 July 1965','https://media.elcinema.com/uploads/_315x420_851a99960852c200cd18b5ad01fa2ea09e69152f59f5be586a5314f3db112ae9.jpg'),('Abdel Salaam El Dahshan',1007399,'Egypt','Egypt','NONE','9 October 1946','https://media.elcinema.com/uploads/_315x420_52f2bf99adfe7df9118c25f4f7c60b646a5a4c1887485158c6d4d1554b17007b.jpg'),('Mohamed Ashoub',1007433,'Egypt','محمد عبدالعزيز عشوب ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_00f464ee3f606f5b15db9f0580f5d9ae8a4fd5a8bc18934a95ee33bac1f89ee7.jpg'),('Sherif Mohsen',1007439,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_918755fba4e6757f5e85a580a0b4a82a3d3185b23cbcfb13f83032a9119d6f3c.jpg'),('Hala Sedqy',1007446,'Egypt','Egypt','Hala Sedky George Younan earned her degree in literature in 1981. She excelled at sports and was a champion swimmer. As a child, Hala spent some time in the United States and began her artistic career upon her return to Egypt. Her role in the TV series “Rihlat Million” drew attention to her and she has since diversified her roles from comedies to tragedies. Among the plays that she has starred in are: “Al Wada’a ya Bakawat” (“Farewell Tears”), “727”, “Al Sa’aydah Wasaloo” (“The Sa’aydah are Here”), “Matloub Tagneed” (“Conscription Notice”), “Izay Al Sihha” (“How are you Doing?”) and “Bashweesh”. Among the television productions that she has taken part in are “Arabesque”, “Al Ragol wa Al Lail” (“The Man and the Night”), “Ragol fee Zaman Al A’awlamah” (“A Man in the Age of Globalization”) and “Dolly Dolly”.','15 June 1961','https://media.elcinema.com/uploads/_315x420_6bff2e903c18c86d9fe554b0efaf1b211a93261fb6e6b62714df469602e05b7f.jpg'),('Magdy Fekry',1007480,'Egypt','Egypt','NONE','19 September 1963','https://media.elcinema.com/uploads/_315x420_c6d5cd4e754a03a10ccfeec28943b1f2723c00c418e443daad18bee7dc8e0247.jpg'),('Louay Abdulla',1008042,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b54052e5584d5d3ab8081ecedbe3e8dcfed009f8075f36717630c0395a496adc.jpg'),('Ahmed Habashy',1008057,'Egypt','Egypt','NONE','15 August 1980','https://media.elcinema.com/uploads/_315x420_c0d0c4344d04b94b0330ff72a5eed12662237b9348ce6716abcdb27728d25760.jpg'),('Mazhar Abol Naga',1008131,'Egypt',' 1 May 2017','Mazhar Abol Naga is an Egyptian actor who was born in Egypt in 1940. At first he worked in the textile industry in Alexandria. In 1969, he appeared in the play “Sayedaty el Gamila”, which was the launch of his acting career. In the 1970s, he worked on numerous cinematic movies including “El Sokareya”, “El Bahth aan el Mataeb” and ”Ehna betoo el Otobis”. Throughout the following years, he appeared in many movies, TV series and plays. In 2017, at the age of 77 he sadly passed away. ','12 July 1940','https://media.elcinema.com/uploads/_315x420_d373bf76e74bf887094750fd4dc92affc7ae9d63411b26a5624c37da1123f7b6.jpg'),('Mahmoud Amer',1008272,'Egypt','Egypt','NONE','28 October 1955','https://media.elcinema.com/uploads/_315x420_f85edf8a92eb4d84f979d7fcc9df91e7cfa7c6e2f435784bae07bc20392694d8.jpg'),('Sayed Seif',1008612,'Egypt','Egypt','NONE','13 October 1945','https://media.elcinema.com/uploads/_315x420_66e8a86829bc87f650f18cde3c0628e5c1793248084d214afa17e0e9f58f4eb5.jpg'),('Hassan El Adl',1008759,'Egypt','Egypt','NONE','21 March 1951','https://media.elcinema.com/uploads/_315x420_858187addd46510153eaf43468746773e91f36fe4648a87c8caf12ef89ad47f1.jpg'),('Mohamed  Salem',1008827,'Egypt','Egypt','NONE','13 November 1930','https://media.elcinema.com/uploads/_315x420_ccd060897795c0886dbd70db4b9a8a9f67bc0beca71bd7cecfe475428ef6cb63.jpg'),('Mahmoud Qabeil',1008920,'Egypt','Egypt','Mahmoud Kabeel is an Egyptian actor born in Alexandria in 1946. Kabeel joined the military in 1964 and served as an officer until 1973. He fought in both the Six Day Way in 1967 and the War of Attrition in 1970. After leaving the military, he made his first acting appearance in Youssef Chahine\'s 1972 film \"El Asfour\" (The Sparrow) and continued to act in films in the next few years. In 1980, he moved to the United States where he started a citrus farming business with his brother. He returned to Egypt after fourteen years in the U.S., after which he began working as a counselor for young people. He returned to acting with \"Darb Gaza\" and \"Lahm Rakhis\" (Cheap Meat) about young girls traded off to rich Gulf suitors. His performance in the latter was well received. In 2003, Kabeel launched a TV series on girls\' education and inheritance in Upper Egypt. That same year he was named a UNICEF Goodwill Ambassador, and has continued with UNICEF on various fundraising and awareness campaigns. Kabeel is well known for his television roles on \"Ayna Qalbi\" (Where is My Heart) and \"Hawanem Garden City\" (Ladies of Garden City). Like many Alexandrians, Kabeel speaks a number of languages, including English, Arabic, French, Hebrew and Italian fluently. ','19 May 1946','https://media.elcinema.com/uploads/_315x420_f2c3dc8d63e39ce084818b6b3b98a1e0bbf2f5fcc6e5ba0467657a01e3153797.jpg'),('Saffwa',1008945,'Egypt','Egypt','NONE','31 March 1968','https://media.elcinema.com/uploads/_315x420_63fad8fac5f0f3baf72dcbde8dd5d2973cec161001e43ddf0db165fedb7f1e04.jpg'),('Mahmoud Yousuf',1009009,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ddd2f54532769ef3b9febe152b627be6048f42d954684e0fdcc2d6adbc2639bf.jpg'),('Sayed El Sawy',1009261,'Egypt','Egypt','NONE','27 August 1947','https://media.elcinema.com/uploads/_315x420_afef16a974cc84350fb3fcb1ea1c3d57eeb028c8bfe8b599f3919637e3a1278e.jpg'),('Correct for Cinema',1009276,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_881ef166c129fa01bc3698bf56e231b1396e679e4d3e1bf2e405a298f4859421.jpg'),('Abla Kamel',1009322,'Egypt','Egypt','Abla Kaamel Muhammad Afeefy graduated from the faculty of Arts library and information department 1986. She began acting on stage at Al-Taleeaa Theatre with her monodrama “Nawbet Sahayaan i.e. Wakeup horn” then joined Muhammad Sobhy Troupe in “Weg-het Nazar i.e. Point of view”. With Lineen al-Ramly, Abla played lead roles in “Waga’ demaagh i.e. Headache”, “Al Hadetha i.e. The accident”. She excelled in her numerous TV roles such as: “Layaaly al-Helmeyya i.e. Helmeyya nights”, “Lan aeesh fee gelbaab aby i.e. I will not live in my father’s robe”, Al-shahd wal-domou’ i.e. Honey and Tears”, “Hawaanem Garden City i.e. Garden City ladies” Abla is married to Mahmoud al-Gendy, the actor, and has two daughters of a prior marriage.','17 September 1960','https://media.elcinema.com/uploads/_315x420_3350a1010fd92db93cf6b5d63f9950fec18aa1341213b89ebefca4fcb0071679.jpg'),('Ashraf Farouk',1009400,'Egypt','Egypt','NONE','24 December 1964','https://media.elcinema.com/uploads/_315x420_6bf3aacc5970256fa8d6f230d510e2ed0d06e82242cccacba527ba19caa6ec33.jpg'),('Mohamed Abdel Moaty',1009567,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7d272523c83582a179c4bc0b7ebc25677fadf5dc59d78e7ca781f85e5e7b859e.jpg'),('Sherif Salama',1009591,'Egypt','Egypt','Sherif is an Egyptian actor who is married to artist Dalia Mostafa. Sherif is also the younger brother of artist Manal Salama. He has several works including the cinema productions “Dars Khosousy” (“Private Lesson”), “Damm al-Ghazal” (“Deer’s Blood”) and “Murgan Ahmed Murgan”. His performances were outstanding in television series which included “Hadrat al-Muttaham Abbi”. Sherif also enjoys a temperament which appeals to acting and this has made critics hopeful about his future.','12 July 1979','https://media.elcinema.com/uploads/_315x420_35153fadf2d88b8c9102cea10f8a631655880f3d13400963d27b592f97a29aa4.jpg'),('Youssef Chahine',1009693,'Egypt','27 July 2008','Youssef Chahine (born in Alexandria, 1926) started studying in a friars\' school, and then turned to Victoria College until the baccalaureate. After one year in the University of Alexandria, he moved to the U.S. and spent two years at the Pasadena Play House, taking courses on film and dramatic arts. After returning to Egypt, cinematographer Alevise Orfanelli helped him into the film business. His film debut was Baba Ameen i.e. Father Ameen (1950)”. One year later, with “Ebn Aal-Neel Son of the Nile” he was first invited to the Cannes Film festival. In 1958, he directed “Baab al-hadeed i.e. Cairo Station” and”Djamila Bouhired”. In 1970, his film “Al-ard i.e. The land” wone a Golden Tanit at the Carthage Film Festival and was nominated for Palme d’Or. With “Al-osfour i.e. The sparrow (1973)”, he directed the first Egypt-Algeria co-production. He won a Silver Bear in Berlin for “Eskendereyya..leih? Alexandria..Why? (1979)”, the first of what proved to be an autobiographic set of films, completed by “Haddouta Masreyya i.e. Egyptian tale (1982)”, “Eskendereyya kamaan we kamaan i.e. Alexandria again and forever (1990)” and “Eskendereyya..New York i.e. Alexandria..New York (2004)”. \n\nIn 1992, French director Jacques Lassalle proposed him to stage a piece of his choice for the Comédie Française; Chahine chose to adapt Albert Camus\' \"Caligula,\" which proved hugely successful. The same year he started “Al-mohaager i.e. The immigrant (1994)”, a story inspired by the character of Prophet Joseph, son of Jacob. This had long been a dream-project. In 1997, 46 years and 5 invitations later, he was again selected Hors Competition in Cannes with “Al-masseer i.e. Destiny” and was awarded the Fiftieth Anniversary Prize (Lifetime Achievement Award for his whole works).\nBetween 1970 and 2002, Chahine won 7 awards from many International Film Festivals and was nominated 9 other times.\nWorth mention, Chahine always had his own way in acting which seems contagious to all his cast with a few exceptions. He established “Aflaam Misr al-Alameyya i.e. Misr International Films” along with Gabriel and Marianne Khoury.','25 January 1926','https://media.elcinema.com/uploads/_315x420_cac5f01ab720d89ff9467c94001f88df1f46983ed9ed61cc8c7d237cd7691b6e.jpg'),('Mohamed Al-Tagy',1009963,'Egypt','Egypt','NONE','28 April 1954','https://media.elcinema.com/uploads/_315x420_29fa4978175e80c60380356f188583510b5c0dc27a51f87bfabf0a1bb04e7fcd.jpg'),('Kamal El Malakh',1010520,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_81be931cbceba7a5b5d10433f3ea5de4083d0815d04e8b59661854970539b699.jpg'),('Gamal Abdel Nasser',1010679,'Egypt','Egypt','Gamal Abdel Nasser is an Egyptian actor. He was born in 1959. He studied at the Faculty of Commerce in Cairo and the High Institute of Theatrical Arts. Since the beginning of his career, he worked mainly in television series, including “Hasad Elhob” (Love Harvest), “Layaly Elhelmeya” (Elhelmeya Nights), “Ahl Eltariq” (People of The Way), “Al Aa\'ila” (The Family), “Al Forsan” (The Knights) and “Al Sabbar” (The Cactus). Abdel Nasser also appeared in a few films, most of which were led by Nadia Elgendy, including: “Al Embratora” (The Empress) “Imra\'a Fawq Elqimma” (Woman Over the Summit) and “Imra\'a Hazzat Arsh Misr” (The Woman who Shook Egypt\'s Throne). ','7 April 1959','https://media.elcinema.com/uploads/_315x420_1b92957bad94b8016a5104901eef98c32a6ddd5f9ca7f08c38c388f8b604ea54.jpg'),('Mohamed Henidy',1010983,'Egypt','Egypt','Mohamed Heneidy Ahmed was born in the district of Giza and earned his bachelor’s degree from the Cinema Institute in 1991. Heneidy began his career acting in the play “Doctor Za’attar” and in the television series “A’la Asl Dawar,” “Al A’rdahalgy” and “Al Bakheel wa Ana”. Around the time that Heneidy made his cinema debut he also performed in some of his best known plays such as “ALabanda,” “Hazimny Ya” and “Al Mahzala Al Ardiyah.” Moreover Heneidy succeeded in demonstrating his comedic talent through a minor role in “Bakheet wa A’deela.” He achieved a high degree of success in the film titles “Isma’iliyah Rayeh Gayy” and “Sa’eedy fee Al Gam’a Al Amrikiyah.” Thus Heneidy was able to redefine the landscape of Egyptian cinema towards the end of the ‘90s. Soon afterwards Heneidy was recognized as a major star with high grossing movies. However Heneidy has lacked a lifelong relationship with artistically achieved directors or screenwriters. Following the success of his song “Kamannana,” Heneidy has integrated singing into many of his films.','1 February 1965','https://media.elcinema.com/uploads/_315x420_8fd3a58d58717ca408a28500d444af59f49779bb7a2046bebb369859051c73e2.jpg'),('Omar Khairat',1010986,'Egypt','Egypt','Maestro ‘Omar Khairat is famous Egyptian composer, pianist, founder and conductor of \"‘Omar Khairat Band\". He was born in Cairo, raised in a family of musicians. His uncle is Abou-Bakr Khairat, the great Egyptian composer and architect, established the “Cairo Conservatoire” and enriched the Arab music with great symphonic pieces. Influenced by this legacy, ‘Omar Khairat discovered new musical dimensions in the emotions and memories of the Egyptian and Arab personality. He joined the Cairo Conservatoire in 1959, studied piano with Italian Maestro Vincenzo Carro and followed correspondence courses in music theory and composition with the Trinity College in England. ‘Omar Khairat shaped his musical identity as a professional independent composer achieving new musical visions characterized with deepness and richness. His debut performing in film music was “Leilet el-abd ‘ala Fatma i.e. The night of Fatma was arrested (1983)”. According to music experts and critics, ‘Omar Khairat\'s music bridges contemporary Arab music and Western music reflecting genuine maturity. Moreover, he is considered to be one of the most outstanding composers presenting successful works like “Al-‘arraafa wal-‘otour al-saahera i.e. The fortune-teller and the Magic Perfumes (1989)”, and the “Arab Rhapsody (1992)”. He also composed music for international events like the “National Feast of Oman (1993)”, the Inauguration Ceremony of “Bibliotheca Alexandrina (1996)”, “Carthage Festival”- Tunisia, “Operetta al-Sheikh Zaayed - Emirates (2000)”, “Panorama al-Abour” - Symphonic Poem - Cairo (1991), “Fine Arts Cycle - Spain (2004)”, “October Celebrations (2000)”, “Celebration of the Royal Jordan River Institution (2005)” , “Jarash Festival (2003), “Three Civilizations Celebration – Spain”, “Celebration of the Centennial Anniversary of the Egyptian Cinema” and many other. He regularly performed at the Cairo Opera House and all the Egyptian and Arab ceremonies during the last fifteen years. His repertoire includes more than fifty works for cinema and more than 20 in TV. \n‘Omar Khairat received more than Arab and international awards such as; “Oman Award (1993)”, a Certificate of Merit and the Shield from the “7th Cairo International Song Festival (2001)”, the “Emirate Ministry of Media Award (2004)”, the “Royal Jordan River Institution Award (2005)”, Certificate of Merit and the Shield from the “Alexandria International Song Festival (2006)”, Certificate of Merit and the Shield from the “30th Cairo International Film Festival (2006)”. In 2008, he received the Middle East Music Award (MEMA).\n‘Omar Khairat married actor Jala Fahmy nad they got divorced. He is now married to Mrs. Naglaa al-Ghannaam, he is the father of ‘Omar (junior) and Sherine and he is the grandfather of Adam.','11 November 1948','https://media.elcinema.com/uploads/_315x420_2829164edfc4e476a77271528ba256b765714d391a8650d32d140c1161f9a6ef.jpg'),('أسامة حسين',1011057,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Dalia Mostafa',1011093,'Egypt','Egypt','Dalia started acting through her aunt actress Nahed Roushdy. She acted in a children\'s play called \"Sinbad\" as well as the mini series \"give back my heart\". She graduated from the high institute of theater. She shone in her parts in the mini series \" mini series \" The shade\'s shadow\" , \"defiance\" ,\"Ibn Barkook Alley\", \"The Secret Word\" and \"The Girls\" ','12 April 1980','https://media.elcinema.com/uploads/_315x420_6e80461ac9afbeeccd86eba248fc117dc079212fe55abc35a462e89265de2dbd.jpg'),('Ines El Masri',1011096,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_43ffe0c37effd8675a6ebed7fa83c50ff5dd988090627f66396a3be48d147365.jpg'),('Hassan Al Araby',1011120,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2c98cfbf37819e9b5e78cf9fb404a3743a600759a780517c05cc6364109e7c3a.jpg'),('Khdugha Sabri',1011247,'Libya','Libya','NONE','12 March 1954','https://media.elcinema.com/uploads/_315x420_6f73b28a47220be7bf17b88ce759673711c586faf84fa683ef49610c62ef5f3f.jpg'),('Ahmad Mounir',1011265,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_de9bcb749b24b60950addf67a386bff3d92c7c09ce80893266621798e7eb3d3c.jpg'),('Studio B\'ela',1011480,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_63bbd9414d2047c03b810255bb7fc6817aca30aaf0524e2fb4b0f969f1ac8710.jpg'),('محمد شحات',1011497,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Khaled Telmissany',1011798,'Egypt','Egypt','NONE','1 December 1966','https://media.elcinema.com/uploads/_315x420_ecf11ed96cfefb6b2551fb6bfa282d82bd8a1c77044d04fec92be4d95623a389.jpg'),('Bassem Samra',1011858,'Egypt','Egypt','Bassem Samra was born in the village of (Al Saff) in Giza. He has earned an (industrial diploma). His (cinematic career) began with his participation in the documentary film (“Al Qahira Munawara bi Ahlaha”). \nHe has worked as a teacher and (an autobiographical film has been made about his life titled (“Sibyyan wa Banat”). The film is a lengthy documentary directed by Yosra Nasr Allah.\nHe has also worked on several documentaries including. (“Amir min Misr”). He received the (Carthage film festival award) for (his work on the film) (“Al Madina”).\n','24 May 1971','https://media.elcinema.com/uploads/_315x420_675d40fdbf0f6efd2257f738be713f12fce719d61d2148248a97d4453f71e61a.jpg'),('Hayatem',1011913,'Egypt','27 July 2018','The famous dancer\" Hayatem-Sohair Hassan\" was born on the 22nd of July 1950 in Alexandria. She was married to actor Mohamed Khairy then they got divorced.\nShe started her career as a supporting actress in cinema and on stage. In 1997 she produced one of her playsplays \"Ya ana Ya enta\"-\"Either me or you\". She also starred in \"Haat Farkha\", \"Bedaya we Nehaya\", \"Mahragan El Haramya\", \"Al Sayeda Wasalo\", \"Ana We Heya We Meraty\". Moreover from her series \"Zaman Emad El Din\".\n','22 July 1949','https://media.elcinema.com/uploads/_315x420_fd9f3df6887c5195831bf90e7b47e136f0bbacbfd7b6297b236eea737c139128.jpg'),('Wafaa Salem',1011944,'Syria','Syria','Wafaa Salem is a Syrian actress. She was born in Aleppo in 1964, and studied philosophy at college, then travelled to Cairo to join the High Cinema Institute. There she met dierctor Atef Salem, who cast her as the female lead in his film “Al Nemr Al Aswad” (The Black Tiger) alongside Ahmed Zaki. She then starred in numerous films, including “Ibtisama fi Oyoun Hazina” (A Smile on Sad Eyes) and “Alzawaf wal Sayf” (Marriage and Summer). She then switched her career to television series, among which were “Haroun Alrashid”, “Maleka fil Manfa” (A Queen in Exile), “Al Daly” and “Al Amaleya Messi” (Operation Messi).  ','23 July 1964','https://media.elcinema.com/uploads/_315x420_75faa9a18b7224d8cc4830a711ba0961505b818f3124e9d74bf51ded2858893f.jpg'),('Abd El.Hakem Al.Remawy',1012220,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Doaa Fadel',1012266,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Agamy El-Sayed',1012454,'Egypt','28 January 2019','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1d0e2855edd2ad42b2f471659e80fbef51d2b83f8f4679f455e7e07f246fdbeb.jpg'),('Doaa Nagy',1012542,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7f53880eac932b8125e5710aaf0b5c310da988dc00f888b20538bac2d218f4e1.jpg'),('Yehia Abbas',1012626,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Rajaa Hussain',1012745,'Egypt','Egypt','Ragaa Hussein, whose full name is Regaa Hussein Ismail, is an Egyptian actress who was born in the Qalyubiya Governorate in Egypt in 1937. In the beginning of her career, she worked in the Naguib El Rehaany acting troupe, and then film and television starting at the beginning of the 1960s. The films she has acted in include: “Afwaa We Aranib” (Mouths and Rabbits), “Hadouta Masriyya” (Egyptian Story), “Almutawahsha” (The Wild), “Abnaa’ Wa Qutla” (Sons and Killers). The television serials she has appeared in include: “El Shahid We El Domou’” (Honey and Tears), “Rihlat El Sayyid Abu El ‘Eila El Bashary” (The Journey of Sayyed Abu El ‘Eila El Bashary), “El Mal Wa El Banoon” (Progeny and Money), and “Zezenia.”','7 November 1937','https://media.elcinema.com/uploads/_315x420_038ab80f09ba1046486f50905a9824ed5613f2f876cee19822d6a9d4eb9d4f5c.jpg'),('Nashwa Moustafa',1012784,'Egypt','Egypt','Nashwa graduated from the Institute for Theatrical Arts. She has worked on the television series “Khalty Saffiyah wa al-Deer” (“My Aunt Saffiyah and the Monastery”), “al-Ameer al-Maghoul” (“The Mysterious Prince”), “Nahnnu la Nazra’ fee al-Shawk” (“We Do not Sow Thorns”), “Raddya Raddya wa Arda mosh Raddy” (“Satisfied”) and “Zaman ‘Emad al-Deen” (“The Age of ‘Emad al-Deen”). Moreover she has also taken part in the theatrical productions “Iz’areena”, “Lan Tasqut al-Quds” (“Jerusalem Will not Fall”) and “al-Nass al-ly fee al-Talit”. Nashwa made an outstanding comedy actress when representing the character of the spinster looking for a husband. Thus she has portrayed such roles in “Film Thaqqafy” (“Educational Film”) and “al-Raggul al-Abbyad al-Muttawasit” (“The Average White Male”). However it should be noted that she has sometimes exaggerated her performances of such roles.','15 October 1968','https://media.elcinema.com/uploads/_315x420_d63373e1852ee0e76ec0175677bb44d0448f98cb1f76b5c04f075955dff9d75f.jpg'),('Magdy Edris',1013266,'Egypt','Egypt','NONE','10 August 1969','https://media.elcinema.com/uploads/_315x420_08149f14f244a52db9558f436a6a72ce5d1db43c116ce9c63c2c019ec6b4aacd.jpg'),('ستوديو نحاس (النيل)',1013295,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Medhat Al-Adl',1013356,'Egypt','Egypt','Medhat Tawfeek al-Adl was born Mansoura (Delta of Egypt) in 1951. He graduated from the Faculty of Medicine in 1981 and worked for two years as a doctor. He started his career in art in the mid 1980’s when he wrote the lyrics of a number of songs of Amr Diab’s film “Ice cream fi Gleem” for which he wrote the dialogue. He also wrote the dialogue of a big number of films; “Amrika shikabika”, “Harb al-farawla”, “Qeshr al-bondok”, “Saeedy fel-game’a al-Amrikeyya”, “Short we fanella we cap”, “Walad we bent” and “Al-dealer”.\nMedhat also prepared the script of a number of TV series; “Mahmoud al-Masry, “Al-andaleeb”, and “Kessat hobb”.','13 January 1951','https://media.elcinema.com/uploads/_315x420_df4e551f1c56fde5608b9695f1bb6e1393c8fdc513acbbcc8e99eb13b4903bb2.jpg'),('Abeer Mikkawi',1013465,'Egypt','Egypt','NONE','24 September 1978','https://media.elcinema.com/uploads/_315x420_56d75147dfcef7aad16ebce83b08043703341d0a432aa1ca7842f0d403549353.jpg'),('Mohammed Abdulhasib',1013507,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Abdel Wareth',1013546,'Egypt','Egypt','NONE','18 October 1947','https://media.elcinema.com/uploads/_315x420_b0d10e57d401554b0b1aa3454a3b1ae0bc931cfb125b3093be0a1a0a152b2b1f.jpg'),('Nelly Karim',1013725,'Egypt','Egypt','Nelly Mohamed was born in Alexandria to an Egyptian father and a Russian mother. She graduated from the Ballet institute at the Art’s Academy and thereafter pursued higher studies. Nelly Karim began dancing ballet at the Opera in 1991. In 1999, Nelly starred in the Ramadan trivia show. She has performed in the television series “Wajh al-Qammar” (“Face of the Moon”), “Hadeeth al-Sabah wa al-Masaa” (“Morning and Evening Talk”), “al-Houb al-Kabir” (“Major Love”) and “al-Bannat” (“The Girls”).\nNelly is married and has two sons.\n','18 December 1974','https://media.elcinema.com/uploads/_315x420_a153552fa6c01d54013bd50664154ecaf041eba821eaf20659f1d2126f2933f6.jpg'),('Ibrahim Nasr',1013907,'Egypt','12 May 2020','Born in Shobra neighborhood in Cairo. He achieved a literature degree in 1972. He also won many awards in the acting team within the university. He started off by imitating the stars and singing especially stars like Ameen El Henaidy. He also did children’s programs and wasas involved in many television series, as well as plays. His most famous appearance was through the Egyptian program “Candid Camera” impersonating a female called “Zakeya Zakaria” which was imprinted in the minds of many Egyptians. He played various roles between the villain and the hero who saved the day.\n','18 August 1946','https://media.elcinema.com/uploads/_315x420_84bb5e0987d0e7c95bd74d077f29f262257bb6117a37b56458e62dbed9fda84d.jpg'),('Hanady Muhanna',1014035,'Egypt','Egypt','NONE','28 July 1998','https://media.elcinema.com/uploads/_315x420_99c38d3ada6e83c73df3c8cadf490109b37453b7ac6e2797277bb9d256f1405a.jpg'),('Ahmed El Sobky',1014087,'Egypt','Egypt','Ahmed Al Sabbky is an Egyptian producer, most of his films have been quite successful at the box office despite being subject to attacks from critics. Al Sabbky states that his works seek to engage the working classes from which he originates, thus he adds that he knows how to connect with normal moviegoers. Nonetheless Al Sabbky is constantly attacked by critics who describe his works as base and unsubstantial. Despite the views of critics Al Sabbky’s works are nonetheless very successful at the box office.\nAl Sabbky’s career in cinema began when he opened a video club in the 1980s atop a family owned butcher shop in the district of Al Dokki. Al Sabbky’s video club specialized in distributing and promoting foreign films in Egypt. The video club met with a high level of success and led to him and his brother owning one of the most successful film distribution houses in the Middle East.\nThereafter Al Sabbky began his run as a producer and collaborated with his brother Mohamed Al Sabbky to found a producing label in the early ‘90s – “Al Sabbky for Artistic Production”. Al Sabbky’s first work was “E’youn Al Saqr” (“Eagle’s Eye”) which featured the performance of Nour El Shereef. Subsequently Al Sabbky produced “Master Karateh” (“Karate Master”), “Sawwaq Al Hannim” (“Lady’s Driver”) and “Al Ragol al Thalith” (“The Third Man”) which starred Ahmed Zaky. The Al Sabbky brothers also produced other works, their most successful endeavors being “Al Lemby” and “El Bally Ballak” which featured the performance of Mohamed Sa’ad. Those two titles achieved a particularly high level of success at the box office.\nAhmed Al Sabbky has recently separated his activities from those of his brother so that both brothers now run independent production labels. His first production works following the split were “Cabaret” and “Al Farah” (“The Wedding”) which achieved  commercial success in addition to being well received by audiences.\n','14 September 1957','https://media.elcinema.com/uploads/_315x420_3b5d64df4107b6329983ea3837213758e5aee7e03459f3194133f697bcddd008.jpg'),('Hesham Maged',1014111,'Egypt','Egypt','An actor and a script writer, graduated from School of Engineering Cairo University. During university, he created a production company with his friends called “Tamr Hendi” that produced movies that ridiculed famous Egyptian movies. Most famous was “Men who do not know the impossible” \nThis work attracted the attention of Mohamed Hefzy who at the time was attempting production and he produced their first series “Afeesh wa Tashbeeh” which portrayed one of the Egyptian classics in a cynical way in each episode. \nHefzy then produced for them the movie “Coded Paper” which was a big hit in the box office. Hesham acted and wrote the script for this movie which familiarized his face to the audience. He won the award of the “Best New Faces” for the year 2008, in participation with his mates Ahmed Sabry and Chico.\n','26 April 1980','https://media.elcinema.com/uploads/_315x420_2178c1be51569dfdfeb35b143ba6fd2c492d1aa242b89f8df0900aff17046707.jpg'),('Khaled Saleh',1014252,'Egypt','25 September 2014','Khaled Saleh is an Egyptian actor born on January 23, 1964 in Giza. He began acting in college where he took part in stage productions. He then performed in amateur theaters like the Hanijjar then later on the Egyptian Opera House, where he stayed for a long time. Throughout this period, Saleh also did some business on the side. He completely devoted himself to acting in 2000, and at age 36 rose to prominence for his talented performances as complex, tyrannical villains. His most important films are \"Tito\" and \"The Yacoubian Building\" (2006) based on the best-selling Alaa Al Aswany novel. He\'s also known for his television work on \"Sultan El Gharram,\" which aired during Ramadan 2007, and \"Baad el Farraq\" (Post-Split) which aired during Ramadan 2008. In 2007, he appeared in films \"Ahlam Haqiqia\" (Real Dreams) and the Youssef Chahine and Khaled Youssef co-directed film \"Heya Fawda\" (Chaos, This Is). His recent film credits include \"Al Maslaha\" (The Benefit) and \"Black February\" in 2012. ','23 January 1964','https://media.elcinema.com/uploads/_315x420_7a2d72944feca16407d1fbe516bb7389060c17b0a59b970a077231a42207b136.jpg'),('Menha Zaytoon',1014286,'Egypt','Egypt','NONE','15 September 1960','https://media.elcinema.com/uploads/_315x420_b6bf5a02b719e34b98b5f96904662488b71e9b2c65a4d3c8d70791cfae4aaffe.jpg'),('Mahmoud Abdelmoghni',1014315,'Egypt','Egypt','Mahmoud Abd Al Moghny’s love for acting was evident from high school. After his graduation he enrolled in (the Institute of Theatrical Arts). He did this despite warnings from (those around him) that the entrance examinations are difficult and that (agency) is usually required for admission. Nonetheless, he placed his faith in God and in his talents. Among 12,000 applicants, only himself and eleven other individuals were granted admission.\nThrought Mahmoud’s period at the institute (he was known for his hard work ) and was regarded positively by the overlooking directors. Nonetheless, he rejected the idea that he should (act for free in the hope of making contacts here and there). Indeed he felt that his talents made him deserve something better and (chose to begin his acting career on the theatrical stage). \nMahmoud’s (keen spirit, together with his outstanding talents) had driven him to act while at college. He also participated in several (festivals) including the (Experimental Theater Festival) and a few festivals held in Jordan and Italy. Mahmoud received several awards at those festivals.\nMahmoud graduated from the (acting and directing division of the Institute of Theatrical arts in 2000). Thereafter, he acted in Sherif Arafeh’s film “Aboud Ala Al Hudoud”. This role made Mahmoud more familiar to cinema audiences. His debut in drama was in the television series “Al Raqs Ala Salalim Mutaharika” which was directed by Moustafa Al Shal. (?) (A fortunate coincidence of circumstances meant that he succeeded brilliantly in that role.\nFollowing that performance, Mahmoud took part in the television series “Zizinia” (where he acted alongside Jamal Abd Al Hamid. That role was followed by one in the film “Sayea Bahr”.\nThereafter, he would act in the television series “Al Rimmal”. In order to film the series, Mahmoud had to stay at Al Gouna for a period of nine months. While there he did some deep thinking about his career thus far and concluded that he would revise (his methods and approach) so that he has a (deeper effect on his audiences).\n','10 June 1979','https://media.elcinema.com/uploads/_315x420_b0a661c56c42efb99537a8075acc5b8ff524b387ce5b1ae7cf98af2b42fc16c9.jpg'),('Enas Mekky',1014397,'Egypt','Algeria','Enas Mekky is an Egyptian actress born in Ouargla, Algeria to an Egyptian mother and Algerian father. She was raised in Egypt by her Egyptian family after her father leaving them at young age. Enas holds a B.A. of Arts from the Cairo University. Mekky started her acting career in mid 1990s in the Egyptian Cinema. She is well known for playing the American in the TV series “Lan a’eesh fee gelbaab aby i.e. I will not live in my father’s robe”. “Awaan El-ward i.e. A time for flowers”, “El-helm wal-alam i.e. The dream and the pain” and “Ya ‘aalam yahoo i.e. O people!” are among her famous TV series. On stage, she played a lead role in “Gonoun El-bashar i.e. Human Craze”.','14 January 1973','https://media.elcinema.com/uploads/_315x420_164bd691aa0fca2e0b3465f8fcdc18e309680a26b6aa36487ef5a151b4f930d8.jpg'),('Yasmin  Alnagar',1014426,'Egypt','Egypt','NONE','2 January 1972','https://media.elcinema.com/uploads/_315x420_7684fb038041c5cd4e98016a7a2ea963c2a9a7cd6369657fe2fad5dbc398a23c.jpg'),('Medhat El Sebaie',1014466,'Egypt','22 May 2014','Medhat El Sebaie is an Egyptian director and writer. He was born in 1949. El Sebaie\'s career includes a prolific list of films and television series, and spans three decades. He started his directorial career in the early 1980s, with films like \"Wa Quyidat didat did Maghool\" (Filed Against Anonymous), \"Al Garih\" (The Injured) and \"Haret El Gohary\" (El Gohary Alley). Throughout his career, El Sebaie\'s films varied in themes and genres, like crime drama in \"Thalatha Ala Ma\'odat Eldam\" (Three Around the Blood Table) and social drama in \"Imra\'a Ayela Lel Suqoot\" (A Falling Woman). In 2013 he directed the television series \"Nazareyet El Gawafa\" (The Guava Theory), which he also wrote. He died in May 2014, at the age of 65. ','25 August 1949','https://media.elcinema.com/uploads/_315x420_fb618a52879effb61c8a5b9b9720cfbb4d89eeaf91915364f8fa57b1bf50f617.jpg'),('Enayat Saleh',1014526,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6eeb314021b60fd15de7ee917b6d24fd7c3147fe2c8cfa0331114782d2f61a07.jpg'),('Ali Hemeida',1014539,'Egypt','Egypt','NONE','20 May 1965','https://media.elcinema.com/uploads/_315x420_f1eea428337e0124d5c1a8592ad23e0f1ebf4d0e1a311197c565f147fc9fbb76.jpg'),('Fayeq Azab',1014560,'Egypt','Egypt','Fayek Azaab is an Egyptian actor who was born on the 6th of September 1943. He is famous for his supporting roles. He participated in many movies that varied between being the evil and the kind character.','6 September 1943','https://media.elcinema.com/uploads/_315x420_dcf037e14ac085ed825687d25d7680f6b2e71bba8b3cc923d9797c95aae7a76b.jpg'),('Nabil Issa',1014656,'Egypt','Egypt','Nabil is a young Egyptian performer. (Mohamed Heneidy assigned him his debut role in the production “Ya Ana ya Khalti”).\nThereafter his career in cinema progressed.','24 October 1978','https://media.elcinema.com/uploads/_315x420_83a22eeae04519ccc1571c55ee92aa03c82c205ea91288f5e057f8089cf9d288.jpg'),('Madlyn Tabar',1014950,'Lebanon','Lebanon','Madeline Taber, born Madeline Taber el Khouri, is a Lebanese actress originally from Beirut. In 1982, she graduated from college with a degree in media and worked as radio and television news correspondent in Lebanon. She began to act in Lebanon--her film work from this period includes \"Kafroon\" (1992) in which she co-starred with Syrian actor Duraid Lahham. She then moved to Cairo where she established herself in television with roles in the shows \"Farewell, Cordoba,\" \"Hearts of Gold and Copper,\" and \"Confused Hearts.\" She also acted in a few TV movies like \"The Road to Eilat.\" \n\n\nMadeline Tabar is a Lebanese actress who was born in Beirut and graduated from media school in 1982. She worked as a journalist and TV presenter for some time in Lebanon, and later on took up acting where she presented many movies, such as the movie “Kafroon” opposite the legendary Syrian actor Doraid Lahaam. \nShe then decided to come to Cairo in 1992. In Cairo she proved herself in series such as “Goodbye Cordoba” , “Souls of Gold and Brass”, “Wandering Hearts”, “Monira Days” and finally “The Knights”\n','26 February 1958','https://media.elcinema.com/uploads/_315x420_426332c58b47c4a1616fdb503926f2a53ae11330ab40a15beb2353f82d2c08cb.jpg'),('May Kassab',1015057,'Egypt','Egypt','Mai Kassab got her start in music as part of a musical duet with the Syrian musician Magd Al Kassem. Their band was called “Ghamid Eneyk” and released its first album “Hagga Tiksif” in 2005. In 2007, the band released another album called “Ahla al Kalam.” Mai’s first television role came in 2006 when she acted alongside the Ahmed Al Fishawi in a comedy television series titles “Tamir wa Shawqiyah.” Thereafter, Mai appeared in a number of film roles, the best known of which are “Cabareih,” “Al Farah,” and “Bobos.”','8 December 1981','https://media.elcinema.com/uploads/_315x420_3f21372812a4c45378e8c97af80d6ced7edaf8b5a5f46ce78203a786469795a8.jpg'),('Ayman Shahin',1015062,'Egypt','Egypt','NONE','26 February 1969','https://media.elcinema.com/uploads/_315x420_4c12ea8b6cc2b1131c1da299d18ec690c154eb6bcb39a72d450133b7c6bcfb03.jpg'),('Wafaa El Hakiem',1015189,'Egypt','Egypt','NONE','17 November 1963','https://media.elcinema.com/uploads/_315x420_2f23ed41c40f97ab553f14255c6d56e1716e3128112a96e256c31d29ba1fcb69.jpg'),('Hassan Abdulfattah',1015376,'Egypt','Egypt','NONE','1 January 1965','https://media.elcinema.com/uploads/_315x420_d75f3cf094b0af8c22c5cf2e145b7bc9c78bf3448a3d6b6bbc5aec9c59e18136.jpg'),('Mohamed Hammam',1015623,'Egypt','محمد ابراهيم عبد القادر همام ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f18076259e8dc06a5847d7f21b18a1b8e0a5010748361a211ae135991e9ce13f.jpg'),('Lekaa Elkhamissi',1015677,'Egypt','Egypt','Lekaa Abdul Malek al-Khameessy graduated from the High Institute of Dramatic Arts after finishing her commerce studies. She worked a as teacher at the University of 6 October. Lekaa participated in the play “Tehebb teshouf ma’ssaah i.e. Do you want to see a tragedy”. For TV, she played in many TV series such; “Al-‘attaar wal-saba’ banaat i.e. The perfumer and the seven girls”, “Haarat al-Tablaawy i.e. The Tabalaawy alley” and “Shabaab online i.e. Online youngsters”, she also played the radio series “Gaarat al-kamar i.e. The moon neighbor”.','15 March 1978','https://media.elcinema.com/uploads/_315x420_e972730ff109e8f26754f8f20db0df14eb1de90806629dea4e29cbabbaf948bd.jpg'),('Abdel Moneim Riyadh',1015887,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_eb34c4df3a69824e46905e71b50b87216c56c3019cc013f89ad7bbaaf502494d.jpg'),('Hassan Shabaan',1015899,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Fardous Abdel Hamid',1015958,'Egypt','Egypt','Ferdos Abdel Hamid Mahmoud was born in Alexandria. She achieved a B.Sc. from the High Institute for theatrical arts in 1969. She started her acting career in the theater where she offered “Daeret Al Tabasheer Al kookazeya”, “Al Naar wal zaytoon”, “Al Gnes Al Thaleth”, “Afareet Masr El Gedeeda” and many more. She was also involved in some block buster series such as “Meezo”, “Lailat Al Kabd ala Fatma”, “Al Mashrabeya”, “Al Borkan”, “Mohamed Rasool Allah”, “Ana wenta we baba fee el meshmesh”. However, she was strikingly most famous for her television roles.','25 February 1947','https://media.elcinema.com/uploads/_315x420_01acc587360d1e3416f3e90a2d2e56dcaf0125f53c02b430c67806cabe4b2721.jpg'),('Khaled El Sawy',1015994,'Egypt','Egypt','Khaled El Sawy is an Egyptian actor. He was born in Alexandria in 1963. He studied law at Cairo University, and started acting while at college on the university\'s theater, and after graduating in 1985, he studied directing at the Academy of Arts till 1993. El Sawy then started working as an assistant director on the film “Samaka we Arbaa\' Oroush” (A Fish and Four Sharks), then as a director for several of the Nile International network\'s satellite channels. El Sawy co-founded the Egyptian Foundation for Theater Enthusiasts. He wrote the plays “Haflet Maganin” (Crazy Party) and “Operette El Darfil” (The Dolphin Operette), for which he won the Taymour Award for Theatrical Ingenuity in 1991 and 1992 respectively. El Sawy\'s career includes a variety of distinct roles on film, including “Emaret Yacoubian” (Yacoubian Building), “Keda Reda”, “Cabaret”, “El Farah” (The Wedding) and “El Feel El Azraq” (The Blue Elephant). He also starred as a lead in television series like “Tofahet Adam” (Adam\'s Apple) and “Khatem Suleiman” (Suleiman\'s Ring). ','25 November 1963','https://media.elcinema.com/uploads/_315x420_dbbdfaf90370c0181d7afaab1b8053695b01ced6019dd3985325a6d51120ee14.jpg'),('Hala Fakher',1016014,'Egypt','Egypt','Hala Fakher Mohamed Fakher began her career in entertainment as a child when she partook in the cinematic production “Lann Abky Abadan”. \nHala studied at (Saint Claire) school. (Following her graduation, she participated in theatrical and television performances where she stood out as a talented comedy actor). Among (the works and theatrical performances in which she has participated are “Wagaa Demagh”, “Shahid ma shafsh Hagga”, “Al Belyatsho”, (“Paulo”), “Malak Al Qarabin”, “Al Zeer Salim” and “Al Layla al Al Beyda”.\nAmong her television performances is the children’s show “Bougy wa Tam-tam”. Hala has been particularly successful in her comedy roles where she has displayed a (great ability to innovate).\n','8 June 1946','https://media.elcinema.com/uploads/_315x420_d1176a5aeab23dd6d9e48afc8cfb8bca033bd313928563aa07a693615332201e.jpg'),('Alaa Zinhom',1016035,'Egypt','Egypt','Egyptian actor Alaa Zinhom is best known for his comedy roles, with performances on television and in other works alongside major celebrities. He is known for his distinctive laugh and innocent smile that captivate his audience. ','30 July 1950','https://media.elcinema.com/uploads/_315x420_2b844c2e723229465a84bc7faac27b1db50b4d4c792ed7124646053b4d99b626.jpg'),('Hany Salama',1016144,'Egypt','Egypt','Hany’s father previously worked as a media consultant in Kuwait. Prior to his discovery by Youssif Chahine Hany had earned a degree from a computer science institute. ','4 July 1977','https://media.elcinema.com/uploads/_315x420_39c292cd6ee7e57fe2657d5ed964aa75c131f5ae7df30ca48a72419ccc482404.jpg'),('Ahmad Haroun',1016153,'Egypt','Egypt','Ahmad Haroun is a young Egyptian actor who began his career acting in television commercials. He played a small role in the film “Sahar al-Layaaly\" (Sleepless Nights). He got his first leading role in \"Farah\" (2004) opposite Egyptian actress Mai Ezz Eldin, which launched his career.','9 May 1978','https://media.elcinema.com/uploads/_315x420_0e4c7be218eae13279a8c622fbb2e651b55c43764dc49bebe1973baf3eb576c7.jpg'),('Halim',1016385,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Abdulla Meshref',1016462,'Egypt','Egypt','Egyptian actor Abdullah Meshref was born in 1942 and graduated from the High Institute of Dramatic Arts in 1968. He joined the Vanguard Theatre immediately following graduation, working with Mohammed Sabhy in his theatre troupe and appearing with him in several plays including: ”Waghat Nazer” (Point of View), “Takhareef” and “Le’bet El Set” (The Lady’s Game). He also worked in television drama and is most well known for his public character (Abdullah) in the series, “Yawmiyat Wanees” (Wanees’ Diary). With respect to cinema, Abdullah played a number of prominent roles, appearing in films such as, “Katibat El Aadam” (Execution Squad), “El Bayda wal Hagar” (The Egg and the Stone), “El Haroub” (The Escape), and “El Hasat El Saba’a (The Seventh Sense).\n','15 February 1942','https://media.elcinema.com/uploads/_315x420_3845357e3dc9a2e0cd82ec3f245838b54793680b006550d626a2d455cd1fcdeb.jpg'),('Mahmoud Talaat',1016754,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_88fc78da22c0304b3bffbe3e4aa81f995a796cc47bb0652538ff753824aebf77.jpg'),('سامي المغربي',1016790,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Awatef Helmy',1016949,'Egypt','Egypt','NONE','4 April 1942','https://media.elcinema.com/uploads/_315x420_41a858f4e7a4fecc09848ad398a2835e12bcac124cbb2f458180deabbb22864e.jpg'),('Azza Bahaa',1016985,'Egypt','Egypt','NONE','22 November 1968','https://media.elcinema.com/uploads/_315x420_eef2263b999e6849e61ca0146e3dd23af056a514c91cd0bf2f1f6392cd9596e2.jpg'),('Tarek Kamel',1017285,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5fecca70280b700b24eb86f0159e12cc57e3443d29f392fd4ed72a223c9feaac.jpg'),('Magdy Abd Al-Ghanie',1017488,'Egypt','Egypt','NONE','27 September 1959','https://media.elcinema.com/uploads/_315x420_e9ee58f6b180ac8c3bf8f7c6521ec30c376a27f689b3eff7653d859d4dd39b2b.jpg'),('Yasser Galal',1017783,'Egypt','Egypt','An Egyptian actor, is the brother of actor Raamez Galaal, belongs to cinema and TV rising generation that shined at the end of 1990s. Yasser studied in the High Institute of Dramatic Arts in 1990. After graduation, he played a role in “Rahma wa ameer al-ghaaba i.e. Rahma and Prince of the forest”. Upon finishing his military service, Galaal worked in TV and Theatre. He excelled in TV series like “Lan a’eesh fe gelbaab aby i.e. I will not put myself in my father’s robe”, “Al-waa’d al-hakk i.e. The right promise”, “Nahnu la nazraa’al-shawk i.e. We do not sow thorns”, “Awlaad hadret al-naazer i.e. Principal’s children” and “Al-batal i.e. The hero”.','16 April 1969','https://media.elcinema.com/uploads/_315x420_6b6cf405584b3b099046bf852846c004167941c5da5843a69b8845c1953753da.jpg'),('Lucy',1017811,'Egypt','Egypt','Lucy’s real name is En’am Sa’ad Mohamed ‘Abd Al Wahab. She was raised on Mohamed ‘Aly street and spent a while working as an oriental dancer at weddings and nightclubs, she also performed minor acting roles before being scouted. Thereafter she acquired television and cinema roles and adopted the name Lucy Sa’ad for her acting career. Her television performances in “Layaly al-Helmiyah”, “Arabesque” and “Zezina” made her standout, the actress also performed on Ramadan trivia shows on an Arab network. Lucy received an acting award at the Alexandria Festival in 1996 and she married businessman Sultan al-Kashef from whom she had a son named Fathy. The actress played a leading role in the “Qima wa Cima” trivia show. Lucy’s career shows that she was adamant to succeed as following several minor roles she proved that she had talents aside from dancing through her performance in “Sareq al-Farrah” (“Wedding Thief”). However she did not establish the role in her subsequent films.','11 December 1960','https://media.elcinema.com/uploads/_315x420_b1797538b463e992612d640ff47c1e8752a99847fd41226f8201fd6218d871fb.jpg'),('Ashraf Meslehi',1017923,'Egypt','Egypt','Ashraf Meslehi began his involvement in cinema by running cinema venues belonging to Misr International Films company that falls under the control of Youssef Chahine and producer Gaby Khoury. Ashraf presently manages more than one cinema chain which include Galaxy, City Stars, Sheraton and Odeon. \nAshraf recently had the opportunity to act in a film titled “Rendezvous” and he performed with success. Subsequently Ashraf has been offered several other cinema and TV roles. \n','23 April 1974','https://media.elcinema.com/uploads/_315x420_43da77e203d51adf075f3b5fc5c71358ba24b79810d74427ba91e96176dbebdf.jpg'),('Amir Karara',1017946,'Egypt','Egypt','Amir Karara is an Egyptian actor and broadcaster. He rose to fame through hosting television contest shows like Star Maker and The Deal. He played in the national volley ball team, in a lot of national and international games. He has a degree in tourism from Cairo University. His most famous television roles include\"Shabab Al Hawa\" (Guys on line), and \"Lahazat Hariga\" (The Egyptian version of ER),\"Taraf Talit\" (Third Party) and \"Taht El Ard\" (Underground).','10 October 1977','https://media.elcinema.com/uploads/_315x420_66c5a948c651211ceb9945a44b8c4d74708fc9401589d34d09d4e5a6d0f58023.jpg'),('Ahmed Qorany',1018071,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed El Sawy',1018134,'Egypt','Egypt','Mohamed El Saway is a comedian Egyptian actor who participated in many plays, movies and Riddles show with the late actor Abdel Moniem Madbouly including \"Gedo Abdo\" and \"Al Omda Elaly\".','12 June 1956','https://media.elcinema.com/uploads/_315x420_84643cfc7b0da5f4feb9512dbaa6ca0e68bb8a7350a31881796184e4ff2a93ce.jpg'),('Farid Shawqy',1018181,'Egypt','27 July 1998','Fareed Shawky is one of the most famous Egyptian and Arab world actors. Born Fareed Shawky Muhammad Abdou in 1922 in the popular quarter of al-Sayyeda Zainab –  Cairo. After receiving the Applied Arts diploma, Fareed joined the High Institute of Dramatic Arts. Meanwhile he started acting small roles with Anwar Wagdy. He later wrote his own films and became a super star. Of his famous titles are; “Malek al-Terso i.e. The King of the Third Class”, “Wahsh alShaashah i.e.  Beast of the Silver Screen” and “Al-malek i.e. The king”. \nFor the first decade he played the villain, yet ended up playing more human touching roles. His action films attracted great audience of simple people.\nHe won the State award in 1955 “Gaalouny Mogremann i.e. They made me criminal”, in 1956, his film “Al fotowwa i.e. The bully” was nominated for Berlin Film Festival\'s Golden Bear  . In 1962, he received the state Production Award and in 1994 he was honored by the Cairo International Film festival. His films “Hakatha al-ayyaam i.e. So are the days” and “La tabky ya habeeb al-omr i.e. Don’t cry sweet heart”, won several prizes. \nOn stage, with Naguib el Reehany Troup he played the lead role in “Al-dallouaa  i.e The spoilt”, “Hekaayet koll yowm i.e. The everyday story” and many other plays.  Fareed also starred in a number of Lebanese, Syrian and Turkish films.\nShawky married Hoda Sultan his acting partner who gave him two daughters. After their divorce, he got married to Soheir Tork who also gave him two daughters.','30 July 1920','https://media.elcinema.com/uploads/_315x420_5382c20f421458d9d88413fa29a3b76bd55bfd9ba733ff898e39c98e49656755.jpg'),('Abbas Saber',1018416,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_621e60e45c5eff942a8c6c9a624b94f7ed5843455fa2a4f4e88e620cc22bff88.jpg'),('Kamal Mansour',1018516,'Egypt','Egypt','NONE','4 June 1971','https://media.elcinema.com/uploads/_315x420_e986d112f27ce95dade4b4a3345d4b1d8d6d7410d5779acb483b249b0b106671.jpg'),('Elshahat Mabrouk',1018671,'Egypt','Egypt','NONE','11 August 1959','https://media.elcinema.com/uploads/_315x420_d5500d298e6ecb2283bd374d4755a6aa3fe71f247dcb78b3ee2e657bc5fc5fe4.jpg'),('Khaled Abol Naga',1018692,'Egypt','Egypt','Khaled Abol Naga is a versatile Egyptian actor, model, TV host, producer and director. He was born in Cairo in YEAR, and began his career in films at the tender age of 12. He has degrees from both Ain Shams University and the American University in Cairo in communications. He continued his education in the United States where he studied film and theater. In the late 1990s, he became a popular TV show host, working on \"Good Morning Egypt.\" In the 2000s, Naga worked on a diverse array of projects, proving his dexterity and ability to deliver in bigger budget as well as smaller, indie flicks. His film credits include the hit \"Sahar El Layali\" (2003), \"Hob El Banat\" (2004), \"Banat Wust El Balad\" (2005), \"Civic Duty\" (2006), and \"Kashf Hesab\" (2008) which earned Naga critical attention. In 2008, he began what would be a continuing collaboration with independent director Ahmad Abdalla. Naga co-produced and starred in \"Heliopolis\" for then first-time director Ahmad Abdalla. They later worked together again on \"Microphone\" (2010), which was a huge success around the international festival circus. The drama revolves around Khaled returning to Egypt and discovering the underground music and arts scene in Alexandria. The film conveyed the political angst and disillusionment that helped bring about the January 25 Uprising, making the film, which was shot in the months leading up to the revolution, a freeze frame of Egyptian youth before the history-altering outburst in 2011. Naga has won over eight best actor awards from Egyptian and international festivals. In 2006, he won Best Actor at the Alexandria International Film Festival for \"Leabet el Hob.\" Naga is a Human and Child rights activist and has been a UNICEF Goodwill Ambassador since 2007. He has talked recently about his new project, \"Tahrir Tahrir,\" a docu-drama telling the inside story of the Egyptian Revolution. ','2 November 1966','https://media.elcinema.com/uploads/_315x420_7a1c032714edc574dc20a193f800ae584e08402f237d327ea2701af6e7ecf1f7.jpg'),('Mohamed El Sisi',1018798,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Farah Youssef',1018885,'Egypt','Egypt','Farah Youssef is an Egyptian actress who was born on November 11, 1982. She started acting at the age of 7 in plays and independent films. She made her real professional debut in the film \"El Magic\" with a group of fresh, new faces in the industry, and followed it withd it with \"War\'a Shafra\" with the same group of actors. Both films were the product of the great Hussein El Qla. Her other film credits include \"Balad El Banat,\" \"Mafish Gher Keda,\" and lastly \"Qobolat Masrou\'a\" (Stolen Kisses), \"Ibrahim Al Abyad\" (White Abraham) with Ahmed El Sakka, and with Amr Waked in Ibrahim El Batout\'s political drama \"Winter of Discontent\" (2012) about the turmoil that foreshadowed Egypt\'s 2011 uprising against Hosni Mubarak and his security state. ','11 November 1982','https://media.elcinema.com/uploads/_315x420_4bfd528aacdef7c9d777ef916f376c56776502273acfa444fcbebbc699d03487.jpg'),('Moshira Ismaeil',1018914,'Egypt','Egypt','NONE','26 September 1950','https://media.elcinema.com/uploads/_315x420_b280b71725988742acc9aba96bf5bd5c25335a972170d302c6f06b0f2cf57344.jpg'),('Fouad Sharaf El Den',1018956,'Lebanon','Lebanon','NONE','12 April 1941','https://media.elcinema.com/uploads/_315x420_7053396db1ff98c74d5e926bad1008487c383102f13c40d5ca489a011815848d.jpg'),('Amal Ibrahim',1018985,'Egypt','Egypt','Aml Ibrahim is an Egyptian actress who started acting when she was young. During this time, she had a number of small roles in evening television shows, plays, and TV serials. Her big break came in 1973 with her role in the comedy “Madrasat Al Mushaghebeen” (School of the Mischievous), as well as later in the film “Bidour.” \n\nAml had successive roles in cinema and television and theater. Of her most important performances include: her performance in the early 1990s film “El Kit Kat” which started actor Mahmoud Abdel Aziz, as well as her role in El Hariban (The Fugitives), and her distinguished performance in the TV series “Sir El Ardh” (Secret of the Earth). She also had an important role in the second part of the TV series “Zezenia” which starred actor Yehia El Fekharany, actress Fardous Abdel Hamid, actress Hala Sedki, and other stars. One the last films she acted in was “El Prinseesa” (The Princess) with Ola Ghanem in 2013. ','12 January 1941','https://media.elcinema.com/uploads/_315x420_fcacaec0afe8fd48282ae0ae3f0ae2b33e7cb23247740bfc2153c27a44a544e0.jpg'),('Fathy Abdul Wahab',1019067,'Egypt','Egypt','Fathi is a bit of a rebel and a dreamer. He has succeeded in securing celebrity status for himself within the short span of a few years despite the fact that he does not place great value on being famous nor on assuming leading roles in performances. \nHis journey as an artist began in his college where he was enrolled in the faculty of commerce. At that point, Fathi used to perform on an amateur level. (This was until a friend of his applied on his behalf for a television production.) Thereafter, Fathi took part in three back-to-back seasons of the television show “Bilarabi Al Faseeh”. Following that stint, Fathi’s career in cinema took off.\n','21 August 1971','https://media.elcinema.com/uploads/_315x420_4f0c1d38d889e24443b7a54f8e28757bd5e46c093500a2572b64bbb19869e835.jpg'),('Nabil Al Helfawi',1019103,'Egypt','Egypt','Nabil Mohamed El Halafawi was born in Giza and raised in Sayeda Zeinab. He achieved his B.Sc. in theatrical arts in 1970. He was known for his poetry and his serious roles in front of the camera. Some of the plays he was involved in were : “Afreet li kol mowaten”, “Daeret al tabasheer al kookazeya” and some of his series were “Domoo Sahebat Al Galaalaa”, “Hekayet Madina”, “Al Hob wa Ashyaa Okhra” , “Rafaat Al Hagaan” and “Al Afyal”. As for his movies there was: “Al Tareek ila Ilaat”, “Ghawayesh”, “Al Zeiny Barakaat” and “Hekaya bila bedaya we nehaya” and many more.\n\n','22 April 1947','https://media.elcinema.com/uploads/_315x420_37aac9d4583a12e62333cca55b1e4a118d03876c59e3f0686b5f37e85ca22d47.jpg'),('Sabri Abdulmonem',1019247,'Egypt','Egypt','Sabry Abdel Moneim Hussein achieved a bachelors degree in Theatrical arts. Worked in many plays and mini series for national television amongst the most famous is \"Gohaa in Town\"','23 July 1947','https://media.elcinema.com/uploads/_315x420_caa7c5febdca20f407da0ea73a163081f2222711ee63aab280acdcf18be2c8e6.jpg'),('Lobna Wanas',1019254,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8a305d61f150916a7caaeb875a9f95e91c1fc98e7245eaf78759d61e837bebe8.jpg'),('Ehab Mohamed Ali',1019263,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_099cfdcceb403c2ca2172ecf1eb9da8294b2492808dd909366ef9994ff039263.jpg'),('Wafaa Amer',1019335,'Egypt','Egypt','Wafaa A’bd Al Ghaffar was born in Alexandria. She graduated from the literature faculty at Beirut Arab University. She also enrolled at the Higher Institute for Theatrical studies. Whilst at college, Wafaa took part in collegiate theater productions. \nWafaa’s acting career began when she assumed a part in the television production “al-Zawg Awal man Ya’raf” (“The Husband is the First to Know”). Her performances in “Layaly al-Helmya”, “Zaman al-Houb al-Da’e” (“The Age of Squandered Love”), “Ameera min A’bdeen” (“A Princess from A’bdeen”), “Imsik Hokouma”, “Zi-ab al-Gabal” (“Mountain Wolves”) and “Faris bela Gawad” (“Horseless Knight”) were particularly successful. “Feema yabdo Saraqo A’bah” (“It Appears that They have Stolen A’bdah”) is one of her plays.\nWafaa is married to Eng. Mohamed Mustafa Shamy.\n','25 May 1968','https://media.elcinema.com/uploads/_315x420_bd079015c3a9f53942890f8a45a9211d402f700e769b1493bd2a133483500596.jpg'),('Adel El Maghraby',1019407,'Egypt','Egypt','NONE','29 November 1962','https://media.elcinema.com/uploads/_315x420_c8e6d5e57dd7935770225b41a90fb02802c63e5e0962aa4782495dd657a9794b.jpg'),('Tamer Abdelmonem',1019493,'Egypt','Egypt','Tamer Abdelmoneaim is an Egyptian actor and screenwriter. He was born in Cairo in 1973. He graduated at the High Cinema Institute of Cairo from the screen writing department. He started working as an actor through minor roles in films like “Edhak Elsoora Tetlaa Helwa” (Smile For A Good Picture) in 1998 and “Etfarrag Ya Salam” in 2001. He co-starred in “Amir Elzalam” (The Prince of Darkness) alongside Adel Imam in 2002, for which he also wrote the screenplay. He also appared as the lead actor in “Al Meshakhasaty” (The Master of Disguise) in 2003, which flopped at the box office.','12 July 1973','https://media.elcinema.com/uploads/_315x420_ee5431046bad76e3bd42e711aa6401663c52003ccd5b49dd838f1e9e2d8c981f.jpg'),('Khairy Beshara',1019700,'Egypt','Egypt','Khairy Beshara is an Egyptian film and television director. He was born and lived his first five years in Tanta, then moved to Cairo with his mother who worked there. He studied film directing at the High Institute of Cinema and graduated in 1967. He then worked as an assistant director, and moved to Poland for a year for his post-graduate studies, where he met his wife. Upon his return to Egypt, he continued working as an assistant director, in addition to teaching acting and screenwriting at the institute. In the period between 1974 and 1986, he directed 12 documentary and short fiction films. His first feature length film was an Egyptian-Algerian co-production, and took 4 years to produce. It finally premiered in 1982. He then went on to direct 11 other feature films, most of which were critically acclaimed and gained cult followings, and several television series.','30 June 1947','https://media.elcinema.com/uploads/_315x420_eb8cac6661d15dc789d32c2caeddcfdb62d903a214ad161203bcdd3d9b0d6898.jpg'),('Mostafa Hassan',1019715,'Egypt',' 9 December 1968','NONE','15 April 1908','https://media.elcinema.com/uploads/_315x420_22d327963190294b26cb73adac08cb138dca1f403cdf319b4d995656b2f6241e.jpg'),('Sameh El Soreity',1019746,'Egypt','Egypt','Sameh El Sereity is an Egyptian actor. He was born in 1951 in Cairo, and studied at the faculty of commerce. He then embarked on a prolific acting career, appearing in numerous plays including \"Tazkara Lel Ganna\" (Ticket to Paradise) and \"Kora Kora\" (Ball Ball), and television series like \"Layaly Elhelmeyya\" (Elhelmeyya Nights) and \"Ahlam Elforsan\" (The Knights\' Dreams) and films like \"Kheyana Mashroua\" (Righteous Betrayal) and \"Elrahina\" (The Hostage).','19 March 1951','https://media.elcinema.com/uploads/_315x420_4f7c0f204de1ae5406307261c45a4ca0e17f7c488fbce3eb9b0e9ac8bf489760.jpg'),('Tamer Ismail',1019976,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_208f2558681f0b52737219420ea4901f8569c90aed1752ed3700872d0404b19b.jpg'),('Wesam Soliman',1020067,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_de4de8d8bab3677c5cefa1b21a2b518e0d145e63a1f7bb56fd93fa58ce75b07a.jpg'),('Salwa Mohamed Ali',1020216,'Egypt','Egypt','Salwa Mohamed Ali is an Egyptian actress who initially gained recognition playing the \"aunt\" role on television. She\'s had a number of supporting roles on television soaps, and has participated in many stage productions. ','29 October 1964','https://media.elcinema.com/uploads/_315x420_7d3b8a3324bcdae6ff837dceadb90f38d92d45f1688a1232e34e555b739775fb.jpg'),('Saeed Tarabeek',1020249,'Egypt','Egypt','Said Tarabik is an Egyptian actor. He was born in Cairo in 1941. He began his artistic career at the end of the 1960s, working in theatre, television and cinema. Tarabik connected with actor Adel Imam when the two worked on  several films and plays together, the most notable of which was the play “Shahid Mashufsh Haga” (Blind Witness; 1976). Tarabik has also played a variety of secondary roles in works such as the series, “El Kabir Awy” and the film, “Gezira El Shaytan” (Island of Devils) in 1990, as well as the film “Wesh Egram” (Born to be a Criminal; 2006).','17 April 1941','https://media.elcinema.com/uploads/_315x420_63741a0beb2b3f23e9b71a9e82e812110ff9c45d36a4515495cf0d1def9377ff.jpg'),('Amr Saad',1020509,'Egypt','Egypt','Amr Saad grew up in al Sayeda Zeinab and graduated from the design division of the faculty of Applied Arts.\nAmr began his acting career nice years ago when upon a visit to Youssif Chahine’s office he met Khaled Youssif who asked him for a photograph of himself. Thus his acting debut was in Yosry Nasr Allah’s “Al Madinah” where he presented the character of Doreen. He also acted in Youssif Chahine’s “Al Akhir”, additionally he also assumed a role in Magdi Ahmed Ali’s television series “Al Houb Mawttan”.\nThereafter he became well known to the general public when he took on the role of the wealthy businessman “Salah Al Beheiry” in “Khiyana Mashroua”. His role as “Adel Hashisha” in “Heyna Maysarah” marked a big transition from the previous archetype due to the fact that his new role depicted a much poorer character. It is for this reason that portraying the role effectively must have been a difficult task for Amr – the character he was asked to depict is one that the public would never have associated him with.\nNonetheless, he succeeded admirably in fulfilling the role those proving his ability to evade being restricted by character models that are often applied to actors. Amr is in fact from a (lower class) neighborhood as he was born in the neighborhood of Ain Shams and his family settled in the neighborhood of Al Sayyida Zeinab.\nAmr has strong roots in the proletariat segments of society. Moreover, he has succeeded in depicting that segment’s woes on the silver screen. \n','26 November 1977','https://media.elcinema.com/uploads/_315x420_9d3e020cb577712bdcaf7780cacde8a164e8aadecb16d2e09cf7bbacb163356e.jpg'),('Dalal Abdelaziz',1020534,'Egypt','Egypt','Dalal Abdelaziz Mohamed is an Egyptian performer. She earned her bachelor’s degree in agriculture from Zaqaziq University. Thereafter, she decided to move to the capital.\nShe was first noticed by Nour Al Damerdash and she worked with the “Adwa Al Masrah” trio in the theatrical production “Ahlan ya Diktour”. She also took part in several other theatrical productions which include “Faris bany Khaiban” “Akhouya Hayiss wa Ana Layiss”, “Houb fee Al Takhshibah”.\nMoreover, her performance was exceptional in the television series “La”, “Demou Sahibat al Galalah” and “Abadan Lam Yakon Laha”.\nShe won the best actor category at the 1998 Television Awards Festival. It should also be noted that she participated in “Al Sayyid Kaf”.\nShe married the performer Sameer Ghanem and the couple had two daughters.\nHer performance in recent films is quite different from the performance style that characterized her at the start of her career. Her best performances include those in “Bulbul Mam Yahya Fakhrany” and “Asrar al Banat”.\n','17 January 1960','https://media.elcinema.com/uploads/_315x420_192a624e40b87192732ed88009c9758e5fc96e35d952a00230ce11ae2cb11186.jpg'),('Bushra',1020553,'Egypt','Egypt','Bushra is a young Egyptian actress characterized by a variety of talents which range from singing to acting to presenting.\nShe is the daughter of the well-known Egyptian writer Ahmed Reza.','5 October 1976','https://media.elcinema.com/uploads/_315x420_6fa0949d5d19a8d64a2b8941d13beccd58932d0a38ec5e08359280d4c711fa03.jpg'),('Lobna Abdelaziz',1020620,'Egypt','Egypt','\"Lobna Abdel Aziz\" graduated from The American University and acted on its stage. she was known as \"University Girl\". She presented a radio European program for children r children called: \"Mama Lulu\". Salah Abou Seif assigned her to present the radio series \" Al Wesada Al Khalya\". She got the scholarship of \"Fulbright \"and studied drama at the University of Washington. More over she married Ramsis Naguib and after divorce she married Dr.osama Barada whom she traveled with to the United States. There she used to write to El Ahram newspaper and she got her PhD. In 1988 she returned to Egypt and presented her old program that won the Radio Festival Award in episodes of \"St. in front of Roger Moore.\"','1 August 1935','https://media.elcinema.com/uploads/_315x420_f54bdfb5e0a2916fb643243b2e00ce48a855b139c67d592070cd08c14b61b68b.jpg'),('Inas Nour',1020677,'Egypt','Egypt','NONE','20 November 1975','https://media.elcinema.com/uploads/_315x420_3932e3ff7538e04865462c85cdd0a43c02fbdb30c73610bb194e8743631b8ebe.jpg'),('Mohamed Dardeery',1020688,'Egypt','Egypt','NONE','24 February 2015','https://media.elcinema.com/uploads/_315x420_a965f5937d3945d8cbf5d47b6f674ed29b36ad7fd6e6fb2195837cfe8432601c.jpg'),('Riko',1020698,'Egypt','Egypt','NONE','1 January 1967','https://media.elcinema.com/uploads/_315x420_9278d0725a5c21f229d22f059229d225487963b7cdddc5e5f374355857599e76.jpg'),('Muneer Makram',1020706,'Egypt','Egypt','Monir Makram is an Egyptian actor who presented very small roles in the early nineties. After attracting attention by presenting Ramadan\'s program \"Edini Aklak\" he participated with Adel Imam starring the film \"The Danish Experience\". Afterwards he filmed many other movies.','1 January 1962','https://media.elcinema.com/uploads/_315x420_1a96f45f4ba2662c3adbf47f2956d87cdafd94da7c2d9711250fd31b45ecade3.jpg'),('Mohamed Shafiq',1020769,'Egypt','Egypt','NONE','26 December 1966','https://media.elcinema.com/uploads/_315x420_b79cd4ac09b8344ade957f1abb411e0c3e13f0cc35ce1fdc6a500d757d350997.jpg'),('Khairy Farag',1020884,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Moataza Abdel Sabour',1021151,'Egypt','معتزة صلاح عبدالصبور ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ff1826694622d06bb211ae2c8aa98fab29d5c9f206011f448639f5b952fa2e08.jpg'),('Jihan Salama',1021395,'Egypt','Egypt','NONE','19 August 1970','https://media.elcinema.com/uploads/_315x420_ef5294f0bf9a91c2c6894dff16f68fd22c2b9e27371d16ea2ee732e46292e549.jpg'),('Khaled Hammad',1021410,'Egypt','Egypt','NONE','24 April 1971','https://media.elcinema.com/uploads/_315x420_306663c393999d4cedf9fcce9f794e6c0bf212541e188d7f06ec5354bd5a171c.jpg'),('Rania Mahmoud Yassin',1021636,'Egypt','Egypt','Rania Mahmoud Yassin is an Egyptian actress who was born in Cairo on 1972. She graduated from the Department of English in the Faculty of Arts at Cairo University and then started acting in 1995 with the film “Qashr El Bondaq” (Hazelnut Shells) directed by Khairy Beshara. Afterwards, she started working more intensely in TV drama in series including “We Yebka El Amal” (And Hope Remains), “Reyah El Sharq” (Eastern Wind), “El Aseyan” (Disobedience), and “Hikayet Binayeesha” (Stories We Live). ','10 March 1972','https://media.elcinema.com/uploads/_315x420_1c9d4d3f9335058517168b7e2debd89fdee22b5befc216c017ca84322500f9eb.jpg'),('Ahmed Salama',1021807,'Egypt','Egypt','Ahmad ‘Ali Hassan Salaama is an Egyptian actor who graduated from the High Institute of Dramatic Arts. He has started as a child to play small roles in TV and radio series. He is known for playing the roles of the rebellion teen, junior brother and later the role of the academic professor. “Lan a’eesh fe gelbaab aby i.e. I will not live in my father’s robe” and “Al-‘aar i.e. Disgrace” are among his most famous TV series. Ahmad played supporting roles in Chahine’s “Eskendereyyaa..leih? i.e. Alexandria..Why?”and “Al-muhaager i.e. The emigrant”.','10 May 1960','https://media.elcinema.com/uploads/_315x420_98cfccc186055db436edc20f9743ccdf3bb455bb74bcb2d27f8695cb93d973cb.jpg'),('Hisham Gabr',1021880,'Egypt','Egypt','NONE','17 January 1972','https://media.elcinema.com/uploads/_315x420_c677f797286f8a74bef58d24130a16c93ea894821aea59c990724967cb17237d.jpg'),('Abdulraheem Hassan',1021981,'Egypt','Egypt','NONE','10 June 1954','https://media.elcinema.com/uploads/_315x420_5bf28e0577893d0eb349034073a339f2dd5447fcbe9d3e37ef45d4a9c3fcb85f.jpg'),('Hassan Mostafa',1022124,'Egypt','Egypt','Egyptian actor Hassan Mostafa was born in 1933 and graduated from the High Institute for Theatrical Arts in 1957. He has worked for a variety of theatre troupes throughout his career including the Ismail Yassin Theatre troupe, the Egyptian United Artists and  Egyptian Television Theater. He is best known for his numerous theatrical performances that were broadcast on television including: \"Hawa\' Elsa\'a 12\", (Eve at Midnight), \"Madraset Almoshaghbein\" (School of Bullies), \"El Eyal Kebret\" (The Children Grew Up) and \"Sayidaty Elgamila\" (My Fair Lady). Mostafa has also played supporting roles in numerous films including: “Adwa’a Elmedina” (City Lights) \"Nus Sa\'a Gawaz\" (Half Hour Marriage), \"Yawmiat Na\'ib fil Aryaf\" (Deputy’s Diary in the Countryside) \"Gharib fi Bayti\" (Stranger in my House) and \"Morgan Ahmed Morgan.\"','26 June 1931','https://media.elcinema.com/uploads/_315x420_805ad39c47f41f87d4692602af4bdf012cb50f4c89fa320e38a884d68a541bad.jpg'),('Hend Taher',1022278,'Lebanon',' 6 April 2020','NONE','22 June 1944','https://media.elcinema.com/uploads/_315x420_ec67ad4a26a671565508b9bf5cf21533e87c6da02573440fe8e9a463a50620a6.jpg'),('Jihad Saad',1022397,'Syria','Syria','NONE','20 November 1953','https://media.elcinema.com/uploads/_315x420_faea818ddd94962a764438560ae6617fef3e0b3f027ef9d172b2a42bc818d06f.jpg'),('جمال إمام',1022633,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Hefzy',1022759,'Egypt','Egypt','He is a producer and script writer who studied engineering in London. He returned to Egypt to work as a script writer. In 2 years’ time he built his own producing company, Film Clinic and became a partner in another television producing company called Media Clinic','13 March 1975','https://media.elcinema.com/uploads/_315x420_7a9bef538bf171504f431f5c498890118321a1546012a2a2bac280a2481b4027.jpg'),('Iman Khalil',1022762,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e39d62b2905317d7d57766def495154b48a0a45bb3af9b954ce8d82e90fe8b32.jpg'),('Mohamed Marzaban',1023044,'Egypt','Egypt','NONE','24 February 1959','https://media.elcinema.com/uploads/_315x420_ff10e2f42d9bb1b752fc197fd223774f22501d7457c08b30b63a3a727f1831d4.jpg'),('Samir Sabri',1023162,'Egypt','Egypt','Muhammad Sameer Galaal Sabry is an Egyptian singer, actor and entertainer, born in Alexandria where he went to Victoria College. After his graduation from the faculty of Arts-English Department, he started to present “At your request” an Egyptian radio program presented in English language. He is a multi-lingual and cultured person. This helped him later when he presented his famous Egyptian TV program “Al-naady al-Dawly i.e. The International club” and with all his other accomplishments. His first appearance on the silver screen was among the masses with the famous Radio Star Amaal Fahmy in Abdul Haleem Haafez’s “Hekaayet hobb i.e. Love story”. When he started to really work in cinema he was not happy with what was offered to him so he formed his own production company.  Sabry played comic, musical as well as villain roles. Among his best roles are; “Al-mahfaza ma’aaya i.e. I’ve got the wallet”, “Al-Toot wal-nabboot i.e.  Bering and Clubs”, and “ Noshaaterokom al-afraah i.e. Our congratulations”.','27 December 1936','https://media.elcinema.com/uploads/_315x420_7cfe4c913e00a1dc3680adecde144273c88c9cafae77ee0553a0e50929ca5fef.jpg'),('Ahmed Farahat',1023249,'Egypt','Egypt','NONE','23 July 1950','https://media.elcinema.com/uploads/_315x420_7fd184033edf4c6bccbba4aac10f7e313e7bc78230fb97af042537469926e1cf.jpg'),('Ghada Adel',1023481,'Egypt','Libya','Ghada is an actress who was born in Cairo. Her began her professional career with television commercials. Ghada graduated from the Faculty of Commerce. She took part in a play titled “Al Abanda” and in the “Abyad wa Iswid” (Black and White) trivia show. Ghada has also performed on television in a production titled “Wajh Al Qammar” (The Face of the Moon).','25 December 1974','https://media.elcinema.com/uploads/_315x420_c880e1890ffcd8bf7a24071c4c71be21a80a06af2a5059134580fc94f7d96519.jpg'),('Nabil Nour Eddin',1023536,'Egypt','Egypt','Nabil Nour Eddin (whose full name is Nabil Shafik Nour Eddin) is the son of the famous film actor Shafik Nour Eddin. From the start of his career, Nabil appeared in starring roles in films including “Oreed Hoban wa Hananan” (I Want Love and Affection) and “El Soud Ela El Hawiya” (The Climb to the Top). He later worked in both theatre and television, and then he disappeared for a period before re-emerging in a number of works. \n','1 January 1951','https://media.elcinema.com/uploads/_315x420_e8fbe199d022ca633d4c102268bffc342f3502f073afdc10db0c93b5685e6085.jpg'),('Walid Youssef',1023558,'Egypt','Egypt','An Egyptian author and writer, who started his career at the end of the 90’s. He was famous for his movie “Why Did You Make me Love you” , but his real success came after the “Al Daly” trilogy, starring Nour El Sherif in 2007. ','15 January 1970','https://media.elcinema.com/uploads/_315x420_db5633d551d1d5c10fb2252c685a3132a70d78039dc97fa09c9a5b96f92d0999.jpg'),('Ehab Lamei',1023754,'Egypt','Egypt','Eham Lamei is an Egyptian director and screenwriter. He graduated from the faculty of mass-com in 1987, and from the directing department in the High Institute of Cinema in 1995. He then went on to direct a number of short films. He then wrote the script for his first feature length film, which he also directed and designed the sets for: \"Men Nazret Ein\" (At An Eye\'s Glance). He also directed \"Kan Youm Hobbak\" (The Day I Loved You) and \"Ala El Hawa\" (On Air).','25 November 1966','https://media.elcinema.com/uploads/_315x420_ae7eba1265632795de96e83e046f6f8db55cfe144b8519d4f7f5d42d9727ba55.jpg'),('Galal El Zaky',1023968,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_487366ee8b3a1ad44f27c853620a831db8ba28ea70c0b6bf948f49a0acc31651.jpg'),('Hanan Turk',1023973,'Egypt','Egypt','Hanan Hassan Mohamed A’bd Al Kareem was born in Cairo. She studied at the Ballet Institute and while performing in a production of “Macbeth” she was noticed by director Kheiry Bushara who nominated her for a role in the film title “Raghba Muttawahisha” (“Monstrous Desire”). Hanan has performed in several television productions amongst which is “al-Suqoot fee Bir Saba” (“Falling into Bir Saba”), “al-Mal wa al-Banoun” (“Property and Progeny”), “al-Sabr fee al-Mallahat”, “lan A’eesh fee Jalbab Abby” (“I Will not Live in My Father’s Robes”), “Opera A’ydah”, “Ameera fee A’bdin” (“A Princess in A’bdin”), “Nisf Rabee’ al-Aakhar” (“The Middle of Next Spring”). Moreover the actress has also partaken in the cinema production “Fee al-Ou’shq wa al-Saffar” (“Love and Journeying”). Hanan is considered among the most talented performers of her generation and can be seen in her finest form in “al-Mohajjir” (“The Emigrant”), “al-Aakhar” (“The Other”) and “Sahr al-Layaly” (“Staying Up”). ','7 March 1975','https://media.elcinema.com/uploads/_315x420_8d8c4e55111734e616769648e23da676232ba8f44595e0f2d69f0623deeaf9bc.jpg'),('Nasser Seif',1024119,'Egypt','Egypt','NONE','17 November 1960','https://media.elcinema.com/uploads/_315x420_33aa3eaeac28521a416795f4e65c3773eb535225bb3312f74a07def83c63f853.jpg'),('Rehab Al Jamal',1024208,'Egypt','Egypt','Rehab EL Gamal is an Egyptian actress of film and television. She debuted back in 1998 in the television series \"Al Mesdaweya\". She had her breakthrough in the acclaimed 2009 film \"Ehky ya Shahrazad\" (Tell Us, Shahrazad). She is most known for her roles in then the television series \"Ma\'a Sabq Al Esrar\" (Premeditation), KHotut Hamraa\" (Red Lines) and the film \"Abdo Mota\".','20 April 1974','https://media.elcinema.com/uploads/_315x420_f52e261036a9a322943263356d1770234bbdaf51bbb94d04b364e2ab88da8d10.jpg'),('Menha El Batrawy',1024506,'Egypt','منحة أحمد البطراوي ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_594dba19cdbd5b81a7c5501f22f22285e9024ae75b807d8c5e5594aa437d8244.jpg'),('Mohamed El Dafrawi',1024576,'Egypt','Egypt','NONE','29 May 1931','https://media.elcinema.com/uploads/_315x420_8bbc21b091c620bdacae7a5ed513dcb318c53e0795a7346e9c24095a223c89b7.jpg'),('Ahmed El Sakka',1024671,'Egypt','Egypt','Ahmed Mohamed Salah El Din El Sekka graduated from the Institute of Theatrical Arts in the year 1993. He is the son of the director Salah El Sakka.\nAhmed started his acting career in television where he took part in the series: (Al Nawa), (Ali Baba wa Al Arbain Harami), (Nisf Rabie Al Akhir), (Min Al Lazi La Yohib Fatma), (Hilm Al Janoob) and (Al Zawag Ala Waraq Solifan).\nHe also took part in the plays (Afrooto) and (Kidah Okay) and won the award for the “Best Actor” category in the (Cairo  Films Festival) for his role in \"Africano.\"\nSince then, Ahmed has been successful in expanding his role beyond comedy into the action and drama categories, playing roles like the body guard and the local thug in \"Ibrahim El Abyad\", and also adding a touch of comedy to some action/drama roles like in \"Ibn Al Qunsul\" (Son of the Council).\n','1 March 1973','https://media.elcinema.com/uploads/_315x420_f1218b2b1f687c475b431e9494f616b5c4ee5ccdc9098cd3f4f7efe10d19edfc.jpg'),('Hamdy Elramly',1024737,'Egypt','Egypt','NONE','27 March 1960','https://media.elcinema.com/uploads/_315x420_14ec8f936ee2801ba1f39892227cad0a447caec62d2adbf7dfe02e055e0650a7.jpg'),('Ahmed Fouad Selim',1024895,'Egypt','Egypt','Egyptian actor, Ahmed Fouad Selim was born in Al Sharqia governorate in 1957. Selim graduated from the High Institute for Theatrical Arts in 1978 and began his career in theatre. He has appeared in many plays including “El Soa’eda Wasalu” (The Upper Egyptians Arrived; 1989). Regarding cinema, Selim has appeared in a variety of films including:”El Hadaq Befhem” (Hadaq Understands) and “El Mohagir” (The Immigrant) both in 1994. In 1997, he was offered a role by director Youssef Chahine in “El Masir” (Destiny), which was a turning point in his career. He continued to appear in television dramas including, “Zu Al Nun El Masry,” “Qasim Amin,” “El Layl wa Akhro” (At the End of the Night), “Muwatin X” (Citizen X) and “El Khawaga Abdel Kadr” (The Foreigner, Abdel Kadr).\n','6 February 1957','https://media.elcinema.com/uploads/_315x420_0a2cef61f7b727ef2d9b20f6e4ed3dbe1eccd94ecd4f9d2cf24cd5588c87c8f4.jpg'),('Ahmed Abdelaziz',1025118,'Egypt','Egypt','Ahmed Abdel Aziz is an Egyptian actor. He was born in Alexandria in 1956, and received a bachelor\'s degree from the Faculty of Commerce and the high Institute of Theatrical Arts. He started his acting career from the faculty\'s theater, and later joined the “Forefront Theater” in 1976. His rise to stardom came after his extensive work in television series, at which the majority of his career was focused. His most famous roles were in the television series “Meen Elly mayhebbesh Fatma” (Who Doesn\'t love Fatma?), “Al Forsan” (The Knights) and “Zia\'ab Elgabal” (Wolves of the Mountain). Although Abdel Aziz\'s film roles were few, they were mostly acclaimed performances in artistically important productions, like “Awdet Mowaten” (The Citizen\'s Return), “Haret bergwan” (Bergwan\'s Alley), “Wadaa\'an Bonaparte” (Farewell Bonaparte) and “El Touq wel Eswera” (The Collar and the Lace). ','30 December 1955','https://media.elcinema.com/uploads/_315x420_a0d2e39c615f66dae5f9ff9dfbf4abe10d8a04b804e02933e7cfe5dfa6dcb65f.jpg'),('Abdel Moneim Elmarsfy',1025363,'Egypt','Egypt','NONE','31 December 1951','https://media.elcinema.com/uploads/_315x420_05e28f09b68b3125fdfcb81c988871dbbe360e5785718b87390420890a2100e9.jpg'),('Mohsen Mohie Eldein',1025415,'Egypt','Egypt','Born in Cairo. He achieved his degree from the high institute of cinema majoring in directing.He worked in the radio in 1969 then in 1970 he worked in the theater where he was part of the play \" The Minister\'s wife\" He later on produced alot of plays for theater then moved on to TV in  1970 where he directed his first series \"The Killer\". He did many more movies after that and he received an award for his role in the movie \"Why Alexandria\" later on he took a prize for the national cinema contest, for being part of the play \"Lock your girls in\". He married the actress \"Nesreen\" and then decided to step out of the spot lights.','1 November 1959','https://media.elcinema.com/uploads/_315x420_a2b943014119f0ee74d4f902fbc5b74fbd6f73217dbd6d663ce61e7cd2e04fc7.jpg'),('Mohamed Abo Dawood',1025509,'Egypt','Egypt','Mohammed Abo Dawood is an Egyptian television actor and theatre director. Born in 1944, he appeared in a number of television shows including: “Ragil Gheni Fakeer Gidan” (The Very Poor Rich Man), “Malak Farouk” (King Farouk), “Om Kulthum,” \"Nesr Alsharq\" (Eagle of the East), “Ya Rigal El Alam Ithidu” (Men of the World, Unite) and “Bab El Khalk” (The Gate of Creation). He also directed a several plays including: \"Afreet Li Kul Muwatin\" (A Ghost for Every Citizen), “Tazwir fi Awrak Atefeya” (Forgery of Love Letters) and \"Mawlid Sidi El Mora\'eb\" (The Mawlid of the Terrifying Saint).','10 November 1944','https://media.elcinema.com/uploads/_315x420_8ba34ce9afd9234a3c1715f5c7aa442af38239d8a0b0e13c5b9c48daac89c728.jpg'),('Sherif Ramzy',1025622,'Egypt','Egypt','Shereef Ramzy is a young Egyptian actor. His father, producer Muhammad Hassan Ramzy, helped him to debut in cinema with the film “Asraar al-banaat i.e. Girls’secrets” in which he played an adolescent and performed to critical acclaim. After that, Shereef became a prominent actor, appearing in a diversity of roles, including those in films like \"Agamista\", \"Alwan El Sama El Saba\'a\" (The Seven Colors of the Sky), \"Orido Khula\'an\" (I Want a Divorce) and \"El Eyal Herbet\" (The Kids have Escaped).','1 January 1981','https://media.elcinema.com/uploads/_315x420_d1fc6449b65a63f3eb66565d012e9ec47f6d8e6ff47fb5d6f527408acff35af9.jpg'),('Razan Moghrabi',1025702,'Lebanon','Lebanon','Razan Moughrabi is a Lebanese TV presenter, actor and singer. With the support of her mother, Razan started her TV career presenting her famous 3 and half hour-program “Al-leil al-maftouh i.e. Open night” on Future TV, to be the youngest Lebanese TV presenter ever.\nBy mid 1990s, she joined the MBC network in London where she presented the “Top of the pops”Arabic version. She also covered numerous International artistic events. For her overwhelming success, Moughrabi was given another program “Shahrazan” where she showed her talents in dancing and singing. She is known for her ability to manage interviews perfectly in Arabic and English. She also presented the program “Album” and “Deal or no deal” on al-Hayat TV. ','19 August 1973','https://media.elcinema.com/uploads/_315x420_7adfa351e0d3c4d33a076e77a047be0fbe54e59c14d6f046b1dafb045c070e0f.jpg'),('Mohamed Hassan',1025740,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hani Muhammad',1025785,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hossam Ali',1025881,'Egypt','Saudi Arabia','NONE','20 February 1982','https://media.elcinema.com/uploads/_315x420_ab39e3d6b97d19688d55f9eb08876973e9e731c006a1890d91fd1c6e37245eeb.jpg'),('مصطفى سامى',1025914,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Majdy Ahmad Ali',1025998,'Egypt','Egypt','Magdy Ahmed ‘Aly’s creative career began when he worked as an assistant director for several directors who included Mohamed Khan, Khairy Bushara and Youssif Shaheen. Fourteen years later in 1996 Magdy directed his first film title “Ya Donya ya Gharamy” (“Life My Love”). That work was followed by other titles such as 1998’s “al-Battal” (“The Hero”) which starred Ahmed Zakky, “Assrar al-Bannat” (“Girl’s Secrets”) and “Khaltat Fawziyah” (“Fawziyah’s Recipe”). Moreover, Magdy Ahmed wrote and directed “’Assafeer al-Ganna” (“Birds of Paradise”) which starred Fathy ‘Abd Al Wahab in addition to directing the television series “Frisca” and “Mamlakat al-Gabbal” (“Mountain Kingdom”) which aired in Ramadan, 2010.\nMagdy Ahmed ‘Aly studied directing at the Higher Institute for Cinema after completing his education at the Pharmaceutical Faculty.\n','26 August 1952','https://media.elcinema.com/uploads/_315x420_c8022c3866934f7a06d2ccd61d97513960f296ca84fef749ea973ac546b77c21.jpg'),('Nabiha Lotfy',1026031,'Lebanon','17 June 2015','Nabila Lotfy is a Lebanese actor and documentary filmmaker. She has lived most of her life in Egypt. She studied at the American University in Cairo in 1953, where she was sacked due to her political activism, then moved to Cairo to join the Faculty of Arts, then the Hihg Institute of Cinema in 1960.\nShe graduated as a film director in 1964, becoming one of the first institute\'s graduates, and worked as an assistant director in numerous feature films, before focusing almost entirely on directing documentary films. She was one of the founders of the New Cinema Group in 1986, and worked in the Experimental Film Centre with Shady Abdel Salam. She wrote several articles about cinema, and was a member of the Arab Documentary Filmmakers Guild.\nShe also appeared as an actress in Daoud Abdel Sayed\'s \"Rasa\'el Elbahr\" (Messages of the Sea), Ibrahim El Batout\'s \"Ein Shams\", and in the television series \"Elkhawaga Abdel Qader\", and the short film \"Zeyara Yawmeya\" (Daily Visit).','28 January 1937','https://media.elcinema.com/uploads/_315x420_687046712767dddb400003f2a871b018d524cc9e1ebb1e0c36f7a934ddb099e4.jpg'),('Zeinab Wahby',1026152,'Egypt','Egypt','NONE','12 June 1952','https://media.elcinema.com/uploads/_315x420_512eec066e39717328cca775314157a492726cf0df83554f888aef9d485ff018.jpg'),('Ahmed El Gendy',1026173,'Egypt','Egypt','Ahmed El Gendy began his career as an actor where he participated in the film “Wahed min al Nas” (“One of the people”), a title which starred Kareem A’bd Al A’zeez and Muna Shalaby. Ahmed also worked as an assistant director in that same production following his graduation from the Institute of Cinema. This was followed by his participation as an assistant director in the film “Zarf Tareq” (“Urgent Circumstances”) which starred Ahmed Helmy in the leading role. \nAhmed’s participation in those works was followed by his directing a sitcom titled “Ahmed Itgawiz Muna” (“Ahmed Married Muna”) in addition to several movies such as “Hawish ely Wa’aa’ Minak”, “Etsh Dabour”, “Teer Enta” and “La Tarago’ wa la Istislam”.\nAhmed’s son, Mahmoud El Gendy (born in 1980) has also done some directing in addition to contributing to the screenplays of several films such as “Teer Enta”. Mahmoud’s works are unique in that they derive comedy by making sarcastic remarks with regards to popular culture. He has also directed several works which were parodies of other cinema titles.\n','15 January 1980','https://media.elcinema.com/uploads/_315x420_532066bb0f2112bc89fb7edaef58eeb43aa9092d57fb2bddaea98202562bb3e9.jpg'),('Salah Elhanafi',1026190,'Egypt','NONE','Salah Mohammed is an Egyptian actor and producer. He is best known for Ibrahim El Batout\'s \"El Shita Elli Fat\" (Winter of Discontent), in which he starred as the antagonizing State Security officer. He also contributed a lot to the production side of making the film. ','NONE','https://media.elcinema.com/uploads/_315x420_7a4d00a0be5d4bf1887687980a662c97622721ab2bbcbc1f596d693847a93e3b.jpg'),('Khaled Al-Nabawy',1026639,'Egypt','Egypt','Khaled Mohamed El Nabawy is a theater and film performer that was born in the city of Al Mansoura. He graduated from the Institute for  Theatrical Arts in 1989 and has performed in several theatrical productions, including “Al Bahr Beyidhak Leih”, “Al Ginzeer” and “Kefah Teeba”.\nHe has also performed exceptionally in several television series which include “Bawabat Al Halawany”, “Sharea Al Mawaridy”.\nKhaled mainly assumed minor characters before Youssif Chahine assigned him leading roles in the films “Al Mohajer”, “Zaman Al Hilm Al Daea”, “Al Hilm Al Moajal”, “Al Maseer”. This followed his success in the short film “Al Qahira Menawara Be Ahlaha”.\nKhaled worked as an announcer for a Gulf television channel in 2002. His most notable works were those that were directed by Youssif Chahine and it should be noted that he is unique among a generation of performers that were mainly engaged in comedy.\n','12 September 1966','https://media.elcinema.com/uploads/_315x420_ccc14906aaad5b2eb0049f4068f814019b4c9ad42736572460f0ddcd1f9b9657.jpg'),('Sherif Shimi',1026773,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b45163ad873dc2ae7d7db0f6b8a0ff0fcc407433ebadc4ee6bb45eb9670f4190.jpg'),('Amr Mahdi',1026920,'Egypt','Egypt','NONE','10 September 1970','https://media.elcinema.com/uploads/_315x420_e21229dded15d7114a3ac080d4496a4cd541abc5cdad42eaf324d54ffbedd8c7.jpg'),('حسين بكر',1027236,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ola Roshdy',1027524,'Egypt','Egypt','Ola Roshdy is an Egyptian comedy actress born into a diplomatic family that moved all around Europe when she was young. She is fluent in Arabic, English, Italian and French and can get by in Spanish. As a third grader, she won the \"story-tell-a-thon\" at school. She got a degree in Business Administration from the University of Maryland in the United States. She began her professional career with the famous movie \"El Selem wel Teeban,\" which she followed with a role in the first Egyptian sitcom \"Shabab Online.\" She starred in an independent short film \"Al Onf wel Sokhreya\" (Violence and Sarcasm). She then starred in a string of hit movies including \"Dam Ghazal\" (2005), \"Halim\" (2006), as well as the comedy series \"Pisso\'s Family.\" She\'s acted in four seasons of the hit Egyptian sitcom \"Tamer & Shawkeya.\" Roshdy is credited as one of the pioneers of stand-up comedy in Egypt. She resumed her main role of Mounira in the third season of the TV series \"Lahazat Harega\" (2007-2012). In 2013, she stars alongside Ahmed Helmy in the dark comedy \"Ala Gothety\" (Over My Dead Body). ','19 August 1980','https://media.elcinema.com/uploads/_315x420_665a0430be1e7a37492eba06c72df2e362720a5e71eac573f4550586a9f5c6ae.jpg'),('Tarek El Tilmisany',1027647,'Egypt','Egypt','Tarek has worked as (camera manager) in several important Egyptian films such as “Al Muwatin Al Masry”, “Aaraq Al Balah”, “Ayam Al Sadat”, “Baheb El Seema”  and “Qus wa Laziq”.\nHe has also acted in several films which include “Al Silim wa Al Thoaban”, “Qadiyat Amn al Dawlah” and “Istighamiyah”. He has also acted in series that include “Masalat Mabdah”, “Liqaa Aal Hawa”, “Mahmoud Al Masry”, “Lahazat Hareja” and “Awqat Faragh”.\n','25 April 1950','https://media.elcinema.com/uploads/_315x420_0d148dcedb273501189e7bbaba95a4aced7cd550cb55adf4bd034392fc5b95ba.jpg'),('Kamal Al Hummusani',1027772,'Egypt','Egypt','NONE','9 September 2014','https://media.elcinema.com/uploads/_315x420_1ee8cd3d776574b247f2a3f12b3fd572cfb1130f8b1bb58be8786aab36646e4c.jpg'),('Mohye Ismail',1028220,'Egypt','Egypt','NONE','8 November 1946','https://media.elcinema.com/uploads/_315x420_cdffad34e130c6a16b2ab1cf4bc5766d9adeff4ead33bfedfe8b7b2bf7a798c4.jpg'),('Tamer Habib',1028261,'Egypt','Egypt','A special script writer that proved himself in his very first movie “Late nights”. He added a new approach, which is a combination between romance and reality in a magical way.','29 June 1963','https://media.elcinema.com/uploads/_315x420_4fbe96854e0c633a7cf133b12f980b501b9010611f4645404392afee6294827f.jpg'),('Ashraf Zaki',1028300,'Egypt','Egypt','Ashraf Zaky is an Egyptian actor and the current head of the Actors’ Syndicate. He is the brother of actress Magda Zaky. Zaky has recently caused a great deal of controversy following his decision to limit the number of cinema and television projects assumed by foreign actors in Egypt within a given year.','29 December 1960','https://media.elcinema.com/uploads/_315x420_6a572cff8f7fe7f268677c2fe480450cf3dcd3fdaaf54ad08c81d39f1bdfb5d3.jpg'),('Ramsis Marzouq',1028350,'Egypt','Egypt','NONE','1 June 1940','https://media.elcinema.com/uploads/_315x420_f1323913f2f89aceeba58de88ebec44f427591cc6db06f8429092da86f1251d0.jpg'),('Aboul Seoud Al Ibiary',1028476,'Egypt','17 March 1969','Egyptian scriptwriter and songwriter, born in 1910 – Cairo.\nAs a child, Aboul So’oud wrote colloquial poems (zajal) that was published in “Al-Awlaad i.e. Children” magazine. He was fond of the great Badee’ Khairy’s colloquial poetry and plays thus, he followed his steps and Badee’ encouraged him.\nHis first monologue “Borreih men al-settaat i.e. Oh! Women” chanted by “Sayyed Soulaymaan” was of great success. He also prepared comic sketches for Badee’a Massabny troupe and his first play was “Ew’a tetkallem i.e. Don’t talk” in 1933. His abundant effluent vocabulary was acquired from the common language of the people as he sat at Badee’a Massabny’s café smoking hookah and watching the crowds come and go.\nAl- Ebiaary wrote some of the best comic film scripts. His characters were authentic. His fluent dialogue was very clear starting from the very first film “Law kont ghany i.e. If I were rich” and continued through all his films; “Fatma, Marika and Rachel”, “Aakher kedba i.e. Last lie”, “Al-hamawaat al-faatenaat i.e. Charming mothers in law” and “Al-zoga al-13 i.e. Wife number 13”.\nThe majority of Ismaeel Yasseen’s films with his name in title were also written by Aboul-So’oud al-Ebiaary”.','9 November 1910','https://media.elcinema.com/uploads/_315x420_4da75d51e6b32165390d6c67f3471410d75178d7e6de7b6cf396372135cc9b96.jpg'),('Kamal Abdelaziz',1028517,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4378df22c29a8e5a1602868aa45e44bdc2eada02c75916ecc9ffa339c87605b1.jpg'),('سيد أمين',1028809,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('مصطفى ماهر',1029232,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohsen Ahmed',1029243,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_90da968cad25fba2f1350a8b36886b6271304eeb95c56174a90e631637447d6b.jpg'),('Mohamed Emam',1029334,'Egypt','Egypt','Egyptian actor Mohamed Emam was born on December 16, 1984 and graduated from the American University in Cairo. He first began his career in the arts as a child when he starred alongside his father Adel Emam in the film “Hanafi El Abha” (The Magnificent Hanafi) in 1990. In 2003 he appeared in the well-known series “Canaria wa Shariko” (Canaria and Co,) and later in a number of films including: “Amaret Yacoubian” (The Yacoubian Building) (2006) and “Hassan wa Marcos” (2008). His first film as the main protagonist was “Al Beeh Romansy” (The Romantic Bey) in 2009. He has continued to act in various television series including: “Bilshama’a El Ahmar” (Red Tape) (2010), “Firqet Naggy A\'t Allah”  (Naggy A\'t Allah’s Squad), and “Khatut Hamra” (Red Lines) (2012). ','16 September 1984','https://media.elcinema.com/uploads/_315x420_bcb47fd0f3a9e1ed1d711b3d6d07afb712e6ab5332ff2c39dbfc0250ac974b09.jpg'),('Tamer Ezzat',1029340,'Egypt','Egypt','Graduated in 1994 from the American University in Cairo majoring in electronics, but was overcome with passion to art and cinema and studied film directing in New York Film Academy and graduated in 2001.Then studied the visual effects for digital movies at New York University and graduated in 2002','22 February 1971','https://media.elcinema.com/uploads/_315x420_cd4ac6c6f05c44e6b67678444c0a93e2be0a11c6bf10cca0025c595ad4baee4a.jpg'),('Sherif Desouqy',1029470,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1679d13031be9533367ff1adf16bfc866520f37a49ec7238f5f134d458ca904e.jpg'),('Nour Qadri',1029694,'Egypt','Egypt','NONE','13 January 1982','https://media.elcinema.com/uploads/_315x420_b14eebc6fb7b030ad7713ffd293a2aff47b37080df7d6c2cc4dbf901dd941764.jpg'),('Soliman Eid',1029840,'Egypt','Egypt','Soliman Eid is an Egyptian comedic actor and has one of the most recognizable faces on screen for his plentiful comedic roles. He comes from a modest family in southern Egypt. He was born and raised in Kitkat in the Cairo neighborhood of Imbaba. His older brother, Sheikh Khalifa, is a reciter of the Holy Qur\'an, and shares the same lightheartedness and humor as Soliman. ','17 October 1968','https://media.elcinema.com/uploads/_315x420_777bbf66da1f9e17cebef26f3b31b1e736a037993091ae5c21dacc031437f89e.jpg'),('Hidy Karam',1029934,'Egypt','Egypt','Heidi Karam is an Egyptian actress who started off modeling for commercials. This was her gateway to television. Her role in the miniseries \"The Nightingale\" was her ticket to many more roles.','27 August 1980','https://media.elcinema.com/uploads/_315x420_1eb76c14b3c10d1243c82cd7ecc023339a394d096b2c9970e9b5a8d026e8a483.jpg'),('George Anwar',1029939,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b5d9e7acecb8bf45c77c7df4e3026fc99a2774d91d607bb2742bc324f1869d06.jpg'),('Saied Barakat',1030513,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1db58f6f8093925d4c5abacadd2ad6f25023e5acaefdfe48febd84d7324d5824.jpg'),('سامح سليم',1030640,'Egypt','Egypt','NONE','1 August 1958','https://media.elcinema.com/uploads/_315x420_f93693aa25d2c428bcd74c9535f524c4c738798859781f368aae410f267026fe.jpg'),('Hakim',1030740,'Egypt','Egypt','Abdul Hakeem Abdul Samad Kaamel is an Egyptian folk singer who was born on 1962 in Maghaaga – Menya (Upper Egypt).','8 October 1962','https://media.elcinema.com/uploads/_315x420_52f265fda94b6d162a5ab0e9f1ebe1699d01782e181f8430c81b515e74139393.jpg'),('Nehad Fahmy',1030939,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Masstora',1030963,'Sudan','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0998c4779b1176c6e8c68028a4930e3e5cbb1b0fa040d5213ba8a970a3c9a887.jpg'),('Oscar for Disttribution and Theaters',1030967,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4c3b6b4649fcbd13d090b47a42b837bccfd5e8be604ff146689a90f147240425.jpg'),('Mahmoud Al-Bezzawy',1031002,'Egypt','Egypt','Mahmoud El Bezawy is an Egyptian actor and screenwriter. He wrote and collaborated in the writing of several television series, including “Al Adham”, “Lahazat Harega” (Critical Moments), and the highly controversial series “Al Rayyan”. He appeared in supporting roles in numerous films and television series, including “Zaky Shan”, “El Taaweeza”, “Sa\'idy Rayeh Gay”, “Hamam fi Amsterdam” and “El Andalib”.','25 September 1963','https://media.elcinema.com/uploads/_315x420_848aaa23811257b10ebc6c3e1715a269cf739d33cf85196995d17ae97eda69d2.jpg'),('Hala Khalil',1031204,'Egypt','Egypt','NONE','23 July 1967','https://media.elcinema.com/uploads/_315x420_74376550b707146322ee498e272d79e0ab7622a2510c1bd957b87ce0d7cabf17.jpg'),('Omar Shama',1031303,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2e1892f861f1c9c1829277048895c89288a14f1d8a8a333a1e9f5e1b5b647760.jpg'),('Faten Hamama',1031529,'Egypt','Egypt','Faten Hamama is an acclaimed Egyptian actor and producer. She was born in 1931 in Al Mansurah in the Dakahlia Governorate. Hamama graduated from the the High Institute for Acting in 1947. She began her acting career as a child, appearing in a number of small roles including her film debut, “Youm Sa’eed” (A Happy Day; 1938), alongside Mohamed Abdel Wahab. Hamama also took part in a series of short television shows that were titled “Hekaya Wara Kul Bab” (“A Story Behind Each Door”), which was later compiled into a movie by the same name starring Hamama. In 1963, Hamama starred in an American crime film called “Cairo.” Throughout her career, she has appeared in only a few television series including, “Dameer Abla Hekmat” (The Conscience of Mrs. Hekmat;1992) and “Wagh Al Qamar” (Face of the Moon) which premiered in 2000. Faten Hamama has been dubbed the “Lady of the Screen,” having starred in more than two dozen films and received various awards and honors throughout her career. In 1977, she won a prize at the Tehran Festival for her film  “Affwah wa Aranib” (“Mouths and Rabbits”). She was also chosen as the “Star of the Century” at the 2001 Alexandria International Festival, honoring her lifetime of achievement in Egyptian cinema.\n','27 May 1931','https://media.elcinema.com/uploads/_315x420_d25de3b11a76e3139503a1550b0b79772c779c9c0e9d80c09de0195d3f4a0050.jpg'),('Ahmed Ezz',1031573,'Egypt','Egypt','Ahmed Ezz was born on July 3, 1971. He began a career in modeling after graduating from the Faculty of Arts from the English division. Ezz began working as a model in the hopes that it would later give him access to acting jobs. However the venture was not successful. After some time, Ezz met director Enas Al Daghdaghy who gave him a minor role in the film “Kallam Al Layl” (Night Talk) in 1999. The director would later give him the lead role in “Muzikirat Murahiqa” (Memoirs of a Teenager) in 2001. Although the film was not a major success it nonetheless contributed to Ahmed’s fame. Despite the fact that Ahmed’s entry into the world of acting occurred abruptly he has nonetheless committed himself to studying cinema and even joined a few actor training workshops such as “Studio Al Mumathil” which is run by Mohamed A’bd Al Hady and Mahmoud Hemeida. In 2013, Ezz stars in the anticipated \"El Hafla,\" a mystery thriller involving a businessman\'s wife who\'s disappeared and the sinister abduction plot unraveled in the investigation. \n','23 July 1971','https://media.elcinema.com/uploads/_315x420_c78f20d9c20bbcf1b9275fcc91268aaa6649fbc9e78f0c5bc56c173d81f82dd1.jpg'),('Ahmed Samir Farag',1031659,'Egypt','Egypt','Ahmed graduated from the directing division at the Institute of Cinema and worked as an assistant director. Ahmed worked as an assistant director for 12 years during which he worked alongside several renowned directors including Shereef Arafeh, Nader Galal, Amr Arafeh, Sa’eed Hamid, Ahmed A’wad, Samir Seif, Dareed Laham, Tareq Al A’ryan and Mohamed Al Naggar. Ahmed has also directed several music clips.\nFarag’s first feature length work was “Code 36”. Also noteworthy is the fact that Ahmed’s father, Samir Farag is a filming director.\n','27 September 1970','https://media.elcinema.com/uploads/_315x420_ff383455827aa8fc71aaff746b9ac38831dc455e0627dbc81f030f861339f11e.jpg'),('Mahmoud Shoukoko',1031707,'Egypt','21 February 1985','NONE','1 May 1912','https://media.elcinema.com/uploads/_315x420_58e72c8365ed5e94925297eeb4e8a207081e867f976f36bba026601919fd5425.jpg'),('Wael Mandour',1031740,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Azab',1031753,'Egypt','Egypt','NONE','11 November 1978','https://media.elcinema.com/uploads/_315x420_6c877d395abdb6184cc0906b8a6922ce1dc6bfa311915560f31411a98fd8b61b.jpg'),('Magdy Nour',1031839,'Egypt','Egypt','NONE','25 January 1963','https://media.elcinema.com/uploads/_315x420_1e6515d144c43be0411ee132c47983d3193917232c1581d40fe73f14ef3599f4.jpg'),('Maged El Kedwany',1031917,'Egypt','Egypt','Maged El Kedwany is an Egyptian film and television actor. In 1967, he was born in Shubra in Cairo, but lived in Kuwait up until age 18. He began his professional career while studying design at the Faculty of Fine Arts. He began acting in a number of amateur plays, which led to him being cast in various TV shows like \"Qanfad\" (Hedgehog) and \"Nahnu al Nazre el-Shook.\" He\'s worked on dozens of films, among them are some of the most well-known films of the 1990s, like \"Afareet el-Asphalt\" (Asphalt Ghosts) in 1996 and \"Saidi fe Gaea al-Amrikeya\" (Saidi at the American University in Cairo) in 1998. His other films include \"Harameya Ki-Gi-To\" (Ki-Gi-To Thieves), \"Harameya fe Thailand\" (Thieves in Thailand), \"Al-Ragel al-Abyad al-Motawast\" (Average White Guy), and \"Khaly min Kolesterol\" (Cholesterol-Free). In 2012, he appeared in two high-profile movies, \"Hafla Montasif al-Leil\" (Midnight Party) and \"Saaa we Nos\" (Hour and a Half).\n\n\nstudied in the (design) division of the faculty of fine arts. Thereafter he enrolled in the Institute of Theatrical Arts and graduated in 1995.  Amongst the theatrical productions that he has performed  in are “Pallo” and “Diwan Al Baqar”. Maged has also made several television appearances, which include roles in “Nahnu la Nazra Al Shawk”, “Al Farar Men Al Hob”, “Al Shara’a Al Jadeed”, “Zayzenia” and “Arabesque”.','10 December 1967','https://media.elcinema.com/uploads/_315x420_9cae9d5f0d6bff47f775c5fe16775899536627c9c99c5d77c503e07b03dfa3cf.jpg'),('Mohamed magdy',1032009,'Egypt','Egypt','NONE','17 December 1979','https://media.elcinema.com/uploads/_315x420_d7255eb82b271ab0a793b6d07e3c197afc5daa78e6c378ad79e9b5654bd601c4.jpg'),('Essam Al Ashry',1032058,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3327039d290a629283d8fa749b1130ceeaf4998d530025882654a594cf96418e.jpg'),('Ahmed Dawood',1032066,'Egypt','Egypt','Ahmed Dawood earned his bachelor’s degree in engineering and took part in several (theatrical productions) while at college. He also performed at the French Cultural Center where he took part in a production of Sartre’s (“Death without Graves”). \n(He would later) take part in the graduation project of the young director Omar Rushdy who was a (colleague) Karim Al Adl. While taking part in this project, Ahmed Dawood’s (talents were noticed by Karim Al Adl who decided to work with him after a demonstrative performance). \n','31 January 1983','https://media.elcinema.com/uploads/_315x420_cb555494203cf6327780787a65aa569fa8bd88d86d5e7f1d9c27b2e51fedfc3a.jpg'),('Magda Saleh',1032103,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_10077fe677c5bb58caa5fe001a5ded00729bd0ac2da013cab198d5db883cc613.jpg'),('Amr Al Saifi',1032208,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5d98073acb1d18dd97a6e09285f3932eec669bf01c319fe4e9bc91c41657c162.jpg'),('Magdy Al-Hawwary',1032480,'Egypt','Egypt','NONE','30 June 1977','https://media.elcinema.com/uploads/_315x420_756dc46bc74443061e68ad7e1483a5c5c2d06237ffc5e7031ac1ed18b034fc77.jpg'),('Hanan Suliman',1032542,'Egypt','Egypt','Hanan Soliman is an Egyptian actress. She was born in 1960, and studied acting at the High Institute of Theatrical Arts of Cairo, graduating in 1984. She has appeared in several films, including “Etnein Ala Eltariq” (Two on the Road), “Al Goua\'” (Hunger), “Ard El Ahlam” (Dream Land) and “Wahed Sahih” (Complete One). She enjoyed a prolific career in television, appearing in tens of series, including “Mouga Hara” (Heat Wave), “El Ataba El Hamra” (The Red Sill), “Sarah” and “Aldoua\' Alshared” (The Stray Light).  ','22 August 1960','https://media.elcinema.com/uploads/_315x420_6cc40012b79cbbd5d09a128add74fb53a5ae3f3d48f543653a20eb2a96bfc7b0.jpg'),('إيهاب طاهر',1032543,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ali Al-Ghazuly',1033218,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_621588be3df7be88a746d702ccacccb4a3906aded8716a3d0ed0aedaa4711ca6.jpg'),('Essam Imam',1033219,'Egypt','Egypt','NONE','10 September 1956','https://media.elcinema.com/uploads/_315x420_2cd7a1360568a8394ebfb928a28c359f3cd72c2aaab2ff1a67db919153172a70.jpg'),('Omar Taher',1033316,'Egypt','Egypt','Omar Taher is an author of many productions such as “Special Operations” in 2007, “Super Henaidy” in 2008 and “You Go Fly” in 2009. He was born in Suhaag on the 23rd of July 1973.\nAlthough he has a bachelor’s degree in commerce he worked in many newspaper agencies and magazines such as Al Dostoor , Voice of the Nation, Half the World and Ein.\nHe wrote many books and was involved in the making and writing of lyrics for many songs for a couple of artists such as “Asala” and  “Rami Sabry”. He was also involved in the making of many programs for several television stations such as MBC , Mazzika and Channel One.\n','23 July 1975','https://media.elcinema.com/uploads/_315x420_ab83f99f3168d266f86a0b0f8abddc5ba7e244d8962d1400e1947994a7b97d51.jpg'),('أمير فؤاد',1033474,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Yasser Zaied',1033591,'Egypt','Egypt','NONE','24 March 1971','https://media.elcinema.com/uploads/_315x420_aec966a3577bf511c4e4be71589eac16672447917af6a75aa677dd33aed041de.jpg'),('Ahmad Saeed Abdulghani',1033632,'Egypt','Egypt','Ahmed Said Abd Al Ghani is an Egyptian performer. He was born in the town of Nussa Al Gheit in Al Daqhiliyah governorate. Ahmed was brought up in an artistic household as his father was the renowned artist Said Abd Al Ghani while his aunt, Zahra Al O’la was also a well known artist.\nAhmed received a law degree and initially worked as a journalist for Al Ahram. That occupation was to eventually pave the way for his career in art. Ahmed would later act on stage and then in a number of TV productions. Ahmed was particularly successful at assuming the roles of villains.  \n','10 January 1976','https://media.elcinema.com/uploads/_315x420_aaf33d9cbd321db2f8dbd23cffb5f7f790b95b571e545fc8f4da060ffe8b4b49.jpg'),('Georges Kazazian',1033676,'Egypt','Egypt','NONE','25 January 1953','https://media.elcinema.com/uploads/_315x420_3078a16e736503f4d16e29b454321a3b7d29a098e8b5cb78142f78575f99d3fb.jpg'),('Samiha Ayoub',1033792,'Egypt','Egypt','Samiha was born in Shubra and was educated at the Nun’s School. She is a first rate theater performer and her real name is Samiha Ayyoub U’thman.\nSamiha graduated from the Acting Institute in 1952 where she studied under Zakky Taleimat. She had an outstanding performance in the radio series “Sammara” and “Rab’aa al-A’dawiyah”.\nSamiha first married actor Mohsen Sarhan and then Mahmoud Morsy. She would later marry writer Sa’ad Wahba.\nAmong her plays are “al-Bakheel” (“The Miser”), “Sitt al-Batt”, “Kisibna al-Primo” (“We’ve Won the Primo”), “Kobry al-Namoos”, “Sikkat al-Salama” (“The Right Way”), “Daaerat al-Tabasheer” (“Chalk Circle”), “Feeh Raay”, “al-U’mar Lahza” and “al-Khedewy”.\nSamiha later joined the al-Qawmmy theater which she would later manage twice between 1975-1985. Samiha also managed the Modern theater on two occasions. Her cinema appearances were not as outstanding as her stage performances. \n','8 March 1932','https://media.elcinema.com/uploads/_315x420_58a0e4d2ccd209a0dd815c582e7ca84ea54e113a322887b553cc2861072777de.jpg'),('Hamdy Ahmed',1033813,'Egypt',' 8 January 2016','NONE','9 November 1933','https://media.elcinema.com/uploads/_315x420_9309d0a3f3a186fd2acc006224121881015b7821c0acd5dd4a7c18e4d15483c1.jpg'),('Samah Abdel Rahman',1033875,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d106f34786c2a5dc196f480d72c07cda93b424e4147848d865a88806c1e8f49b.jpg'),('إيهاب فؤاد',1034327,'Egypt','إيهاب أحمد فؤاد سليم ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Amani Elbahtiti',1034366,'Egypt','Egypt','NONE','1 April 1972','https://media.elcinema.com/uploads/_315x420_0b8da392a3950421439660c34ac6ad5681c5ea02a2a6118d33e498ce6ce8fe60.jpg'),('Ahmed Atef',1034697,'Egypt','Egypt','NONE','17 April 1971','https://media.elcinema.com/uploads/_315x420_5ba71a81f67f124664ea2dec74f60d36f3473381be4fe6ce63c54be35aa2ea5c.jpg'),('Camilia Hussein',1034966,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Muhammad Salama',1035005,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_554e667ac487a9435853b9d4d8c3aeda86401abfc675b8d1b295cfeb1758faff.jpg'),('مجموعة إعلام المصريين',1035060,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nana',1035119,'Lebanon','Lebanon','NONE','23 April 1980','https://media.elcinema.com/uploads/_315x420_9d8cde7356263da07b6d531f4b7049cedfd43b56c0e973704df7b394294154b4.jpg'),('Maha Ahmed',1035172,'Egypt','Egypt','Maha Ahmed is an Egyptian actress. She was born in 1974. While studying at the High Institute of Dramatic Arts, she appeared on a number of television series including: “Sou’ Magra Al-Oyoun” (Magra Al-Oyoun Market) “Helw al-Kalaam” (Sweet Talk) and “Al-Dababeer” (The Wasps). After graduation, she appeared in several plays such as, “Shorom Borom” (Hardship), and several television series such as: “Al-Watad (The Peg), “Aida,” “Hadeeth al-Sabaah wal-Masaa’” (Day and Night talk), “Tarweedh al-Sharessa” (Taming of the Fierce), “Abyad f-abyad” (White and white) and “Al-Kadaa fel-Islam” (The Judiciary in Islam). Maha Ahmed has also been in many films including: “Abdo Mawasim” (Abdo of the Seasons; 2006), “Lakhma Ras” (2006) and “Al-Basha Talmeez” (2004).','16 November 1974','https://media.elcinema.com/uploads/_315x420_ee034c77683d5d6bcbb3272304e89c0bb029e68ff8570e40c3ee647e5873dedc.jpg'),('Amr Abdul Gelil',1035185,'Egypt','Egypt','Despite his great talent and the fact that his career took-off to a promising start with an involvement with Youssef Chahine, Amr was nonetheless assigned minor roles in his first few years in cinema. \nThereafter, Amr proved his talents as a comedy actor when he performed in Khaled Youssef’s films “Heyna Maysarah” and “Dukkan Shehata”. Amr finally found a leading role in Youssef Chahine’s “Kalimny Shoukran”.\n','10 January 1963','https://media.elcinema.com/uploads/_315x420_649fc9d0318ebfe93170f882d185672e6b3d11eab9f3354090c7c315f5ddf00d.jpg'),('Ayman Makram',1035282,'Egypt','Ayman ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_49ded3859bff17820d3327823d513b9fb1113b950da94ecd4d99c33b8f425cc3.jpg'),('Hassan Hosny',1035569,'Egypt','Egypt','Hassan Housny was born in the Al Qal’aa neighborhood of Cairo, his father was a construction contractor. Housny’s mother passed away when he was only six years old and he was educated at the Radwaniyeh Elementary school. Housny participated in theater productions at his school and received several awards for his efforts. Thereafter he took part in theatrical works whilst in the army and joined the “Al Keim” theater. \nHousny’s performance in “Kalam Faregh” (Idle Talk) was particularly talented. He has taken part in several theatrical productions including “Hazimny Ya”, “Qishta wa A’sal” (“Cream and Honey”), “Jouz we Louz” (“Nuts and Almonds”), “Awlad Rayya wa Sakkina” (“The Children of Rayya and Sakkina”), “A’la al Raseef” (“On the Sidewalk”), “Sukkar Ziyadeh” (“More Sugar”) and “Al Mahaba Al Hamraa”. Among the television productions he has taken part in are “Awlady Al A’izaa Shukran” (“Thank You my Dear Children”), “Al Sanbasah”, “Jawary bella Qioud” (“Unhindered Maidens”), “Nass Modern” (“Modern Folk”), “Bawabat Al Halawany”, “Al Mal wa Al Banoun” (“Property and Children”), “Amira fee A’bdin” (“A Princess in A’bdin”), “Ayn Qalby” (“Where is my Heart?”), “Joha Al Masry” and “Zaman E’mad Al Din”. \nHousny received an award for his role in the film “Dimaa A’la Al Asfalt” (“Blood Stains on the Tarmac”). Moreover Housny can be considered among the most active performers of the last two decades. He has assumed a variety of roles ranging from comedy, to portrayals of peasants and businessmen. Housny\'s most critically acclaimed roles were in “Dimaa A’la Al Asfalt” and “A’fareet Al Asfalt”.\n','19 June 1936','https://media.elcinema.com/uploads/_315x420_7a2db9381048bf7285f33c86d966c267e44ffad4f31da52f33c2062338b2a4fe.jpg'),('Mahmoud El Hefnawy',1035581,'Egypt','Egypt','Mahmoud El Hefnawy is an Egyptian actor. He started his career in the mid 1970\'s, and has since then appeared as a supporting actor in numerous television series, including “Bab El Khalq” (El Khalq Gate), “Al Daly”, “Yawmiyat Wanis” (Wanis Diary) and “Al Suqoot fi Bia\'r Sabaa” (Falling in Sabaa Well). He died in 2014 of heart failure. ','7 March 1954','https://media.elcinema.com/uploads/_315x420_80d85977ea2a77c605b3db071a4cf38fee4abeb9bd5dc3e6a41d678d5d18ab98.jpg'),('Nasser Shahin',1035695,'Egypt','Egypt','NONE','13 July 1960','https://media.elcinema.com/uploads/_315x420_ead7dc2129ea470eb62df5177ec8e4f72915af624ed3b32ba28f51a54f635a2a.jpg'),('Farid Al Noqrashi',1035705,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_87043bf7da764ff149c302564f27dfc5b22dad23555574757a4396a38e585863.jpg'),('Edward',1035984,'Egypt','Egypt','Edward is an Egyptian actor and he started his career singing and playing guitar in a band called Gypsy. He also produced many of their music videos. He was cast by the famous director Osama Fawzy to play a small role in his film \"Beyheb El Cinema,\" which won him a number of other film roles, like \"Mahmoud Hamida\" in 2004. He often plays supporting, sidekick characters in films like \"Leila Alawi,\" \"Bahebak wa Bamoot Fik,\" \"Kalaam fi al Hob,\" \"Gaaletny Mogrem,\" and \"Fi Mohatat Masr.\" He\'s also starred in the TV sitcom \"El Ayada.\" In 2013, he\'s starring in the Ahmed Helmy comedy \"Ala Gothty\" (Over My Dead Body). He\'s enjoyed moderate success and has long been a steady choice for secondary characters. ','7 December 1973','https://media.elcinema.com/uploads/_315x420_8ad39d8be56528ed323acc3ad740be6674e5eff6f5d5a84038e86235f711cfad.jpg'),('Maher Selim',1036066,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b2e7d9590f820c4d05536b536ecd48050fafbf0d7f0bbec047903ffa14515aba.jpg'),('Kamal Suliman',1036278,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_dcbeaefb5979966e1677f64edfe4c1b57a9a6c51c8130472bb61bed19dab5d50.jpg'),('Kamla Abou Zekri',1036619,'Egypt','Egypt','Director Kamilla Abou Zekry began her career as a second director’s assistant in the film “131 Ashghal” (“131 Works”) which was directed by Nader Galal in 1993. Thereafter Kamilla director her first short which was titled “Qittar Al Sa’aa Al Sadisah” (“The Six O’ Clock Train”). Following that experience Kamilla went back to working as a directing assistant in the films “Hello America”, “Itfarrag ya Salam” (“Watch and be Amazed”), “Al Lemby” - which starred Mohamed Sa’ad and “Izzay Tikhaly Al Banat Tihibak” (“How to Make Girls Love You”). \nThereafter Kamilla directed her own feature length movie in 2004. The film was titled “Sanna Oulla Nisb” (“Introduction to Swindling”). That production was followed by “Mallik wa Kitaba” (“A King and Scripture”), “’An Al Ou’shq wa Al Hawa” (“On Love and Passion”) and “Wahid Sifr” (“One Zero”). Kamilla also directed the sitcom “6 Meedan Al Tahrir” (“6th at Tahrir Square”). \nAbou Zekry has taken part in several international film festivals, the most important of which involved her representing Egypt through the title “Wahid Sifr” (“One Zero”) at the 66th round of the International Venice Film Festival.\n','8 January 1974','https://media.elcinema.com/uploads/_315x420_5edb5d386fb956ab01199a9ad36cf498066eba8f4d8b7e12534149be7736f1f0.jpg'),('Afaf Shoaib',1036968,'Egypt','Egypt','‘Afaf Ahmed ‘Aly Shoaib was born in Kafr al-Dawar and moved to the capital to study at the Higher Institute for Theatrical Arts in 1972. Her talents drew attention after she took part in several television series. Thereafter she transitioned to cinema after earning experience on the series “Afwah wa Aranib” (“Mouths and Rabbits”), “Qays wa Lubna”, “al-Yateem wa al-Houbb” (“The Orphaned and Love”), “Du’aa al-Karan” and “al-Hadd wa al-Dimoo’. ‘Afaf married Lebanese producer Riyad al-E’ryan. She later withdrew from acting before starting again but with the veil on.\nDespite her promising start her performances where somewhat devoid of expression. Her best roles were perhaps as those of the dying mother.\n','2 November 1948','https://media.elcinema.com/uploads/_315x420_ea1c58744ff1610807ca8914a037088c708e1551694dba79b379c4fe53d8c8bd.jpg'),('Ahmad Rahhal',1036976,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1215a08b97a46a47a8fd0c6419b9f0c5782a5c01e36a26929973e8ac70d4888e.jpg'),('سامية علي السيد',1037026,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e254a1db14298ca55aad692db695d79bb1e1429bc28a480614b063bd47672fba.jpg'),('Ali Al-Zaidi',1037117,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Saeed Saleh',1037252,'Egypt',' 1 August 2014','Sa’id Saleh Ibrahim was born in Cairo. Saleh earned a degree in arts in 1960 and worked on theatrical productions of the likes of “Hallo Shalaby”, “Madrasat al-Mushaghbeen” (Mischief at School), “al-‘Eyal Kibrit” (The Kids Grew Up), “Ka’baloun” and “Nahhnu Nashkur al-Zuruf” (We’re Indebted to the Circumstances). Saleh contributed singing and musical scores to some plays as well as playing the leading role in video and cinema productions.','31 July 1938','https://media.elcinema.com/uploads/_315x420_d9ea91bda30b1c6f3c5f69850b0fcd28f8c231c52abecb50170c94a40b934054.jpg'),('Lubna Mahmoud',1037464,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e870e164b3149a98d3f8a051dcfcb472e042fe38844e32b90a497ea80548bf2b.jpg'),('وليد الكردي',1037555,'Jordan','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Helmy',1037605,'Egypt','Egypt','Ahmed Helmy was born in Banha. He graduated from the Higher Institute of Theatrical Arts. He moved to Cairo to pursue a diverse career including interior design and media production. He later on settled on the media path, working as a host for multiple TV programs mainly aired on Egyptian satellite networks. Following his successful and popular TV run, he ventured into feature films. His first acting job was in \"Aboud Ala Hodood\" (Aboud on the Borders) (1999), which proved to be his huge breakout performance. Since then, Helmy has become a well-established comedian and a leading man. He\'s starred in \"Omar 2000\" (2000), \"Sahar El Layali\" (Sleepless Nights) (2003), and most recently \"Assal Eswed\" (Black Honey) (2010) and 2013\'s \"Ala Gothety\" (Over My Dead Body). Ahmed Helmy is married to actress Mona Zaky and they have one daughter, Leila.','18 November 1969','https://media.elcinema.com/uploads/_315x420_747ec702764d9d2bc120bca067cfdbd8729c016e34ab888649fc6143012c4040.jpg'),('Ahmed Algbili',1037756,'Egypt','Egypt','NONE','8 August 1964','https://media.elcinema.com/uploads/_315x420_fe3fef3d47a0db5e6d044dd4bf178ef94c991fa8028fddee493ef769aa1923d1.jpg'),('Mohamed Hassib',1038124,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2bf67a1485703430442a375f8c932ec19129c29390f76b4dd4fe990730e38437.jpg'),('Timor Al-Aasar',1038343,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Yasine',1038371,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4c8a8c330222f6b249f152226e52ba3b6ce932126a578f1458b228af50480739.jpg'),('Magda Kamel',1038528,'Egypt','Palestine','NONE','22 September 1957','https://media.elcinema.com/uploads/_315x420_99ec2eccda597c1f707f0a3f7e144dcdffaac484bd254b07b9f8b6f11ecaa4ef.jpg'),('Haitham Al-Khamisy',1038638,'Egypt','Iraq','NONE','11 July 1977','https://media.elcinema.com/uploads/_315x420_42395862f16bec836af7ce2c5d8ab69f8faa7552a4149a5c8a60f047395e27c9.jpg'),('Al-Masa Media Production',1038657,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_77a16eb1709196c386c7424efe2f0310732ee2ff90acf967c8cb70d6df282dcf.jpg'),('Ahmed Seyam',1038960,'Egypt','Egypt','Ahmed Seyam is an Egyptian actor who was born in Mansoura, Dakahleya Governorate in 1953. He graduated from the Faculty of Commerce of Cairo University in 1953. He was drawn to acting by coincidence when he was discovered by director Shakir Khadeer when he was still a university student. Sayem accepted Khadeer’s offer of the starring role of his play “Karnifal El Ashbah” (Carnival of Ghosts). Yet Sayed continued to consider acting as a hobby until he graduated from university. Afterwards, play director Galal El Sharkawy suggested that he enroll in the Higher Institute of Dramatic Arts. He was hired by director Fahmy El Khouli to play a minor role in the play “El Raha’in” (The Hostages), which subsequently paved the way for a number of supporting roles in tens of television dramas, including: “Akho El Binat” (The Sisters’ Brother), “Leylat El Qabdh Ala Fatima” (The Night Fatima Was Arrested), “Rihla El Sayyed Abu El Aila El Bashary” (The Journey of Sayyed Abu El Aila El Bashary), “El Rayaa El Beydha” (The White Flag), “Um Kulthoum,” “Lil Adala Wegouh Keteera” (Justice Has Many Faces), “Neran Sadeeqa” (Friendly Fire). He also appeared in a number of films, including “Isteghatha Min El Alem El Akher” (Appeal From Another World), “El Bahr Beyadhak Leh?” (Why Does the Sea Laugh?), “Malf Fe El Adaab” (Prostitution Police), “Gana El Bian El Taly” (We Received the Following Announcement), and “Bousbous.”','20 November 1954','https://media.elcinema.com/uploads/_315x420_7d5714d2ed216e4a1140feb8fb80e51c39ad7e2e5cfe506870fe3d4ed0f290ff.jpg'),('Mona Zaki',1039127,'Egypt','Egypt','Mona began her career acting in the play “Bila’raby al-Faseeh” (“In Formal Arabic”). She studied in England while young and travelled to Kuwait and the United States with her family before enrolling in a Media Faculty. Mona has appeared in the television productions “al-A’ailah” (“The Family”), “Ahlina” (“Our People”), “Zezina”, “Gohha al-Masry” (“Gohha the Egyptian”).\nMona Zaky married actor Ahmed Helmy in 2002.\n','18 November 1977','https://media.elcinema.com/uploads/_315x420_12cb01551146fb7f1ba84df55ef8cff2639ed55276fb11bf38833511eac07847.jpg'),('Mohamed Farid',1039222,'Egypt','Egypt','NONE','24 December 1940','https://media.elcinema.com/uploads/_315x420_7e6e7102908ece85a9e040b4ef8d6bab221bf618990a3240856fd2d4d70a63c8.jpg'),('Nagwa Fouad',1039400,'Egypt','Egypt','Nagwa Fouad is a famous Egyptian belly dancer. Her real name is ‘Awaatef Muhammad ‘Agamy, she was born in 1939 to an Egyptian father and a Palestinian mother. \nNagwa performed at the Abdeen Casino where she met Ahmad Fouad Hassan (her future husband for 6 years), a producer of stage shows that later became a famous conductor. He convinced her to perform live at the most prestigious music and dance show in the 1960s called “Adwa al-Madeena i.e. City Lights” which had featured such superstars as Shadia, Abdul Haleem Haafez, Fayza Ahmad, and Sabaah.\nIn 1976, the famous composer Mohammed Abdel Wahab wrote an entire musical piece exclusively for her belly dancing show titled “Aamar Arba\'tashar i.e. Full moon” it was her transition from traditional oriental dance to a choreographed stage performances. Her stage performance to this special piece allowed her to change the way belly-dancing was presented on stage, transforming it from traditional oriental dance to more of a choreographed lavish spectacle adding more dramatic elements to it than ever before.\nNagwa featured on many of the covers of the Ahmed Fouad Hassan LP\'s/CD\'s. Nagua took every career step well calculated: \"Hassan was 17 years older than me, but I needed him. He nurtured my amateur\'s talents... He taught me the importance of studying and working on my talent if I wanted to be a big star. He trained me at the Nelly Mazloum Dance School and I joined the National Dance Troupe to study folklore with Russian teachers.\" Nagoua Fouad learned showmanship and eye-catching techniques, which were obvious in her performances of \"Ayyoub al-Masry\" and \"Baheyya we Yasseen\". Ahmad Fouaad Hassan wanted to have a baby from Nagwa, something she did not accept so this eventually led to her first divorce after six years of marriage. Nagwa established her own dance group yet it did not last long and later tried to retire dancing to become actor. She played on the stage and in the cinema and finally became cinema producer.\nShe played a great role in the film “Hadd al-seif i.e. The edge of the sword”.','6 January 1939','https://media.elcinema.com/uploads/_315x420_d47a019be63864a32f693a24a2c374f5139d6e86b492bfade155cd70a30bfbfa.jpg'),('Mahmoud Al-Esiely',1039546,'Egypt','Egypt','n Egyptian singer and actor born in 1982. He started an interest in singing while he was still in school and studied media at the American University in Cairo, it was then when he made his own band. In 2002 he sang in Elisa’s band where he was discovered by producer Ayman Abbas who offered him his first album called “Where are you going” or “Rayeh Ala Fein” in 2004.\nHis song “Crazy” or “Magnoona” was a big hit. The song’s lyrics were written by Mahmoud. Later on, Mahmoud presented many more albums. He started acting in 2007 in the movie “Nema Bay” with actress Ghada Adel and singer Ahmed Fahmy.\n','10 December 1982','https://media.elcinema.com/uploads/_315x420_6c881228fb19ea941e37644533d0cd73c3c1ce0bba4cf1b593f4340adf714ac4.jpg'),('Amal Helmy',1039555,'Egypt','NONE','Amal Helmy is an Egyptian actress. Her debut was in “El Keif” (The High) in 1985. Her other notable roles were in the films “Ahlam Hend Elkhashab” (Hend Elkhashab\'s Dreams), “Dumouaa\' fi Hodn Elgabal” (Tears at the Mountain\'s Bosom) and “E.U.C”. ','NONE','https://media.elcinema.com/uploads/_315x420_638230582d33725afcc10ce3c61910cf3b3470674a52ee12d0d35a53f5df292a.jpg'),('Saeed Abdulnaeem',1039799,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a5ae031195b776797ae94223314771ac8b440971d6db56e611d606aaa76b8943.jpg'),('Basma',1039904,'Egypt','Egypt','Basma was born in Cairo. Her father worked as a journalist while her mother (was a women’s rights advocate).\nBasma’s acting career began in college where she acted in the movie “Al Madina” directed by Yousry Nasr Allah.\nPrior to performing in “Al Madina”, Basma had tried to enter the world of acting through applying for the state radio and television service. She applied for the position and took the required examinations. However, she was selected by Yousry for the leading role in “Al Madina” before she had completed the application process. \nFollowing her graduation from the English division of the Faculty of Literature at Cairo University, Basma worked as an announcer for the Nile Variety channel between 1998 and 2000. \n(Towards the end of that period) she was contacted by the office of the director Sherif Arafah who had seen her in “Al Madina”. Two weeks after meeting with the director, Basma was offered a role in the movie “Al Nazir,” where she would perform alongside Alaa Waly Al Din, an actor who has passed away since then.\nFollowing her performance in “Al Naama wa Al Tawous”, Basma returned to her old job as announcer, only this time she would announce for Dream channel. She held this position from 2001 to 2002. Thereafter, she would assume a leading role in the television series “Rimal” which was broadcast on MBC. \nSubsequently her acting career took off after having left her old occupation as television presenter behind.\n','7 December 1976','https://media.elcinema.com/uploads/_315x420_e63c49017df78f0aae61ab69f097e2fdf30346d40629b9727ea5a8ab941f8b06.jpg'),('Amr Adib',1040182,'Egypt','Egypt','NONE','23 October 1963','https://media.elcinema.com/uploads/_315x420_a16081ecee6c92a25bf911016ab65612b32896881ae264eddc8eb706a5cb9231.jpg'),('Muhammad Nabil',1040337,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('يحيى زكريا',1040341,'Egypt','29 October 2013','NONE','4 March 1938','https://media.elcinema.com/uploads/_315x420_894919d22b49ebdb1569fa7a51f18358cc8df71dec10fa5974896a8f45150c16.jpg'),('Sameh Abdelaziz',1040495,'Egypt','Egypt','Saameh graduated from High Institute of Cinema in 1996, Editing department. Started as a director in the Egyptian television then directed some of Haala Sarhaan’s shows with whom he moved to work at Rotana channel to direct the same show.\nHe also directed many video clips and his first feature film was “Dars Khossoussy i.e. Private Lesson” staring Muhammad Ateyya, then directed “Cabaret” and “Al-farah i.e. The wedding”.\nIn TV, Abdul Azeez directed the series “Al-haara i.e. The alley” using digital cameras.','18 September 1976','https://media.elcinema.com/uploads/_315x420_4d969a56fa2a4aaa2663a785b94b6db28d8d390ce773235067576bb85374e99a.jpg'),('Hamza Khater',1040695,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a1b5c9d404124e3cf02a2f5922671944c59abc6b03c68983e36cf2d7f4243cf9.jpg'),('Safwat Ghattas',1040706,'Egypt','NONE','Descending from Lebanese origins he was married to Egyptian actress \"Samira Ahmed\" for some time then they got separated. \nHe was one of the first people to work in video distribution. He is a cinematographer along side being  a producer.','NONE','https://media.elcinema.com/uploads/_315x420_7fae7f28ff6c8627fb65e2b464b374273388cf272aa1e9786567257ff1882e33.jpg'),('Mohamed Khan',1040732,'Egypt','Egypt','In his early life, Muhammad Khaan travelled to England to study architecture but returned with a cinema diploma. He became one of realistic cinema pioneers, which flourished at the end of the 1970s and through 1980s. Most of Khaan’s films visualize the life of ordinary Egyptian people and he is known for his interest in characters more than the story, which reserved for him a place in Arab cinema hall of fame.','26 October 1942','https://media.elcinema.com/uploads/_315x420_232a6c118677f0f8682c019532f1eb6a8721941454a9ddaf6b2514aa6cef9ac7.jpg'),('A United Bros. Cinema Distribution',1040924,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c2cad157e035cb5a87e9600eb7bf650f95c29e8ebd609417a9b19547a1c6f8ee.jpg'),('Maha Rushdy',1041063,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b2ca32236c0d26033c3c928b8139d9e844fe8cf84feeb19bb9ac3887e05002ad.jpg'),('Tamer El Demerdash',1041139,'Egypt','Egypt','NONE','13 October 1975','https://media.elcinema.com/uploads/_315x420_cc4e8926ac368267b513cc13524ad1b8977e3acdd3c24d76bebef29fbb2c145d.jpg'),('Hanan Motawee',1041140,'Egypt','Egypt','Hanan Karam Motawie is an Egyptian television and film actress. She is the daughter of Soheir Al Morshedy and the late actor Karam Motawie. She graduated from Cairo University from the faculty of commerce. She began her career on \"Hadeeth El Sabah we el Masaa.\"aa.\" She\'s played a number of memorable characters in both television and film, including \"Qas we Lazq\" by Hala Khalil, \"Al Ghaba\" (The Forest) and \"Heliopolis\" by Ahmad Abdalla. She won Best Supporting Actress for her performance in the film \"Qas we Lazq.\" Her television credits include \"Sara,\" \"Awlad El Shawarea,\" \"Aghla men Hyati,\" \"Azmet Sokkar\" and \"Wekalet Ateyya.\" \n','23 February 1979','https://media.elcinema.com/uploads/_315x420_5940c19a85b5c6acadc26227ab72d2fc9b314e667b7a6994cb169e0cef802285.jpg'),('Menna Shalaby',1041233,'Egypt','Egypt','Menna Shalaby is one of the brightest stars in the younger generation of Egyptian actors. She was born on July 24, 1981 in Cairo. She is the daughter of the famous dancer and performer Zizi Mustafa. Shalaby displayed a passion for performing from a very early age, no doubt due to the exposure to the industry her mother\'s fame provided. She would often sit in front of the mirror and pretend to be her famous mother, and also fake being sick to get out of going to school, which her mother declared was also acting. Menna made her film debut in \"Al Saher\" (The Magician) as Nour in 2001. She next scored a leading role beside Layla Elwy in \"Baheb El Seema\" (2004). Since then she\'s gone on to work with some of the most talented actors and directors, like Youssef Chahine with \"Heya Fawda\" (2007), Ahmed Abdallah with \"Microphone\" (2010) and Yousry Nasrallah with \"After the Battle\" (2012) about the infamous Battle of the Camel during the January 25 uprising. Her other film credits include \"Banat Wust el Balad\" (2005), \"Ouija\" (2006) and \"Ezaet Hob\" (2011). ','24 July 1982','https://media.elcinema.com/uploads/_315x420_f0d78cecb5e50cb3e5196ccc217bf364696a8d7070daaa0dd83ecab43768725a.jpg'),('Mona Abd El Ghani',1041408,'Egypt','Egypt','NONE','14 November 1964','https://media.elcinema.com/uploads/_315x420_b90a30a59fc6eb0bef1345280c3575f56bbc953b2a3d15a4e4ffa480aac9737c.jpg'),('Neveu Orvalenelli',1041478,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Majdi Kamel',1041486,'Egypt','Egypt','Magdy is an actor who has performed in theatrical and cinematic productions. He graduated from the (Institute of Theatrical Arts).','18 September 1970','https://media.elcinema.com/uploads/_315x420_d71b8e0bb30bfec3b66aff6fe767a81ca11b12c36475f285031b20e448806cc7.jpg'),('Nabil Ali Maher',1041517,'Egypt','Egypt','NONE','8 August 1954','https://media.elcinema.com/uploads/_315x420_9523582acb308410ac5e4291ca3c6dc6dd0721cbfe096d620472d6dc9b4d54ac.jpg'),('Hesham Abdelkhalek',1041695,'Egypt','هشام أحمد عبد الخالق معتوق ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1a7bc1c601eac676a590888e83c5a3636d8122824fbfb56080974a9c9ef02e27.jpg'),('Ahmed El Halwany',1041746,'Egypt','Egypt','The actor Ahmed Mohamed Ahmed \"Mohamed El Halawany \" has participated in lots of Cinema and television work. Although he presented few honorary roles, he succeeded to impress us in the series \"Who\'s with a charming smile\", \"The band of mom andm and dad\". He also joined the syndicate of dramatic arts and presented commercials\n','20 June 1965','https://media.elcinema.com/uploads/_315x420_66819b4407370188ddf229de5e8d11647c889b18d63eb15bfee48f9c69555387.jpg'),('Ahmad Kamel',1041817,'Egypt','Egypt','NONE','1 January 1959','https://media.elcinema.com/uploads/_315x420_22a54d58aefc08837bf1797e2cfe2248e60364a3d01cb1dbc39c788032ea5e16.jpg'),('Nasser Abdulrahman',1041889,'Egypt','Egypt','Anyone who has been following developments in Egyptian cinema over the previous years would certainly have noticed that the industry has suffered from declining standards with regards to screenplays. Screenplays represent the backbone and the fundamental element for all films.\nAmong the many personalities active in the field of cinematic screenwriting, one name stands out – the youthful writer Nasser ‘Abd Al Rahman. Nasser first drew attention to himself when he took part in the writing of “al-Madina” (“The City”) alongside director Yousry Nasr Allah. Thereafter Nasser withdrew from the profession for a few years before making a comeback and writing two titles, namely “Geneinat al-Asmak” – which also saw him collaborate with Yousry Nasr Allah, and “Heyya Fawdah” (“Chaos”) which saw him work with renowned director, the late Youssif Chahine. That last effort was particularly significant as it marked the first time in more than 30 years that Youssif Chahine had delegated (or even shared) the task of screenwriting. Nasser is a first rate writer with unique talent.\n','7 December 1970','https://media.elcinema.com/uploads/_315x420_a1d056f198d837432ea13a00f0e131cce9bb78988417928ad86fcc482b509a96.jpg'),('Ahmad Wafiq',1041982,'Egypt','Egypt','Born in Mansoura in the Egyptian Delta, Ahmad studied Commerce at Mansoura University where he joined the theatre group with which he directed stage plays, did set design, and won the university level award. In cinema, Ahmad has starred in Chahine’s “Sokout Hansawwar\" (Silence, We\'re Rolling) and on the stage in “Bel ‘araby al Faseeh\" (Eloquent Arabic) and “Dostour Ya Syadna\" (Constitution Oh Masters).','15 January 1970','https://media.elcinema.com/uploads/_315x420_32537186258ba5865d569d5de24741875b0334fa5ea71d23b6eb96fd1f7bd113.jpg'),('Mohamed El Sobky',1042058,'Egypt','Egypt','Mohamed Al Sobky is an Egyptian producer whose films have fared consistently well at the box office despite attracting negative reviews from critics. Al Sobky states that his works seek to engage the populist classes from which he himself originates, adding that he knows how to connect with that cohort of society. Critics, however, attack his work and label it as base. \nAl Sobky\'s career began in 1985 when his brother opened a video club atop the butcher shop owned by his father, Hassan Al Sobky, in the Dokki district of Al Giza. The video club focused on promoting foreign movies in  Egypt. Mohamed Al Sobky teamed up with his brother and in a few years the two became joint owners of one of the largest film distributors in the Middle East.\nInitially Mohamed worked as a producer in concert with his brother but they recently decided to separate their activities so that now each brother owns his own producing label.','14 November 1953','https://media.elcinema.com/uploads/_315x420_fa67d11cd52b224fdf5fc143004070ace55d11fcfae6df1c8946e8ac4df11845.jpg'),('Nadia Ben Rachid',1042059,'France','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Medhat Morsi',1042231,'Egypt','Egypt','NONE','16 December 1949','https://media.elcinema.com/uploads/_315x420_28fd14064e6d234b0591125196697c033a69a409653348db63ef2b2cffefdf25.jpg'),('Abdelaziz Makhyoun',1042542,'Egypt','Egypt','NONE','3 June 1943','https://media.elcinema.com/uploads/_315x420_77ea7a94767d641b63576dfb4f120fa645113278493fbcc2ef454784869f6d5a.jpg'),('Hanan Youssef',1043012,'Egypt','Egypt','NONE','28 June 1966','https://media.elcinema.com/uploads/_315x420_53d67dd45d5285357cf7e2bf46e2dfc092acfbbc8b11b73a5b4c0d4279f88271.jpg'),('Bassant El Bakri',1043027,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Talaat Zakareia',1043049,'Egypt','Egypt','Tal’at is an Egyptian comedy actor who was born in Alexandria. Among his most important works was “Haha wa Tuffaha” (“Haha and the Apple”) which  saw him work with Yasmine ‘Abd Al ‘Azeez and Hassan Housni. The actor also took part in the film “Sayyid al-‘Attafee” with Tamer Housni and the film “Ew’a Wishak” with Ahmed ‘Eid and Ahmed Rezk. Thereafter he worked on one of his most important projects, “Tabakh al-Raees” (The President’s Chef), in his first independent lead. \nIn September 2007, Tal’at Zakkariyah suffered an inflammation in a blood vessel in his brain and fell into a coma. However he later recovered and “Tabakh al-Raees” achieved good returns. Among his most important leads which saw him being awarded prizes was the film “al-Sayyid Abou al-‘Araby Wissil” (“Mr. Abou al-‘Araby has Arrived”). Tal’at collaborated with Hani Ramzi and Wahid Youssif on that work. Another film of his was “Abou ‘Ali”, a work which saw him collaborate with Kareem ‘Abd Al ‘Azeez and Mona Zaki. \nThe actor also presented a film titled “Qissat al-Hayy al-Sha’bee” (“The Tale of the Lower Income Neighborhood”) but it was not up to the high standards which audiences were used to.\n','18 December 1960','https://media.elcinema.com/uploads/_315x420_2ba5a008ea8577410384abebcd496e628212049537d6b6f5b24a79179058d553.jpg'),('Muhja Abdulrahman',1043067,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e22cb4ca14446c9025d2e1a4a8f55de46687470e1ba6edb63872445be06db83f.jpg'),('Adel Abu Al Gheet',1043175,'Egypt','Egypt','NONE','12 June 1951','https://media.elcinema.com/uploads/_315x420_b3f0afb6c0732cc09988dbb0e45efb573403f2e1b86539b926cf28f9e9cdb929.jpg'),('Ismail Farghaly',1043352,'Egypt','Egypt','NONE','3 January 1961','https://media.elcinema.com/uploads/_315x420_073c7f93dc7fac72c24ebd3b0beb1d0afd9036fc99d541446f412502b2ed3e97.jpg'),('عبدالعزيز عمار',1043462,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Khaled Selim',1043597,'Egypt','Kuwait','Khaled Selim is an Egyptian musician and is among the most successful of the country’s youthful musical performers. His songs appeal to youths and moreover he is adept at singing in several different dialects which include the Lebanese, Gulf and Egyptian dialects. The artist received the title “Premier Musician of Cairo University” in the years ’97, ’98 and 99 in addition to the title “Premier Musician of Egyptian Univerisities” in ’99.\nKhaled has frequently held concerts at opera theaters in Cairo and Alexandria.\n','6 November 1975','https://media.elcinema.com/uploads/_315x420_7659aa1d1bdbdb9835776c55140ec09d517d7f3e69e991b3c98e267667101540.jpg'),('Essam Karika',1043930,'Egypt','Egypt','An Egyptian singer from a Sudanese father and Egyptian mother. He graduated from the  faculty of Hotel Tourism in 1994. He started composing music in 1993 and his first song was for the singer Mohamed Mohi. He achieved best music composer for this year . In the year 2000 he moved on to the cinema where he composed music for films and opening titles and so on. He the year 2003 he took a shot at singing and produced his first single.','13 May 1969','https://media.elcinema.com/uploads/_315x420_24eefaa8a35a018d2e04bbd96b3445cd4ab2b7b4ab5effca7fa94945a62078e1.jpg'),('بسنت الهواري',1044025,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Amr Mostafa',1044038,'Egypt','Egypt','‘Amr Mustafa was born in Cairo to a middle-class family composed of two parents, a brother and a sister. His talents were apparent during his childhood as he composed some of the Arabic poems presented in his Arabic textbook. He received a guitar as a gift when he was three years old – one of the earliest gifts that he received. \n‘Amr enrolled at the Military Aviation Secondary School and studied there for a year. Thereafter he elected to leave the school thereby choosing a life of freedom in exchange for his ambitions to become a career aviator. ‘Amr then joined the law faculty at the University of Cairo and studied there until he graduated in 2001.\n','31 December 1979','https://media.elcinema.com/uploads/_315x420_047c9eddaf071225842db0473eea380946780fd20323c6f4170b690f330b2413.jpg'),('Shaaban Abdel Rahim',1044170,'Egypt','Egypt','Sha’ban was born in al-‘Assal, an area in al-Shurabiyah. He worked with his father on laundry by day while singing at weddings by night. He realized fame by singing to Ahmed Helmy’s “Atgawiz ‘Aydah”. He also became well known for singing songs that had a political air, songs such as “Bakrah Israel” (“I Hate Israel”) which caused significant clamor. Sha’ban also worked on several musical plays and on series such as “Samhooni Makansh Asdee” (“Forgive Me, I Did not Mean to”). He also sang on the film “’Afareet al-Asfalt” (“Spirits of the Asphalt”).','15 March 1957','https://media.elcinema.com/uploads/_315x420_de0df133f4f5257d65ff924f96c39f8affb1193d8f2df74f8376e265fdf9a0e6.jpg'),('Tarek El Nahry',1044316,'Egypt','Egypt','Taarek al-Nahry Haazem Hassan is an Egyptian cinema and TV actor and director who was born in Cairo. He studied graduated from the faculty of commerce before studying, director section, at the High Institute of Cinema 1987. Taarek started his career in Nour al-Demerdaash’s TV series “Sarkhat baree’ i.e. The screm of an innocent”, followed by “Akhou al-banaat i.e. The girls’ brother”, “Zokaak al-Madakk i.e. Madakk’s alley”, “Man al-gaany? i.e. How is the offender?” and “Nawaa’em”. He participated in the TV film “Al-tareek  ila Eilat i.e. The road to Eilat” and he also directed a number of songs for tevelvision and the film “Law kaan da helm i.e. If it was a dream”.\nAl-Nahry won “Al-Momath-thel al-Mesry i.e. The Egyptian actor” award for newcomer actors in Alexandria 1973.','8 October 1952','https://media.elcinema.com/uploads/_315x420_0fe8d6c81bb0180fcc073a2a9d9f7f32324ac28784c1d3f03126f5df9c5d7b20.jpg'),('Ahlam Al-Gritly',1044427,'Egypt','Egypt','NONE','20 February 1948','https://media.elcinema.com/uploads/_315x420_46227214c7ceced7cdd1932fd9f070b30819743e8d7191ba82492fc764ad35f4.jpg'),('Khaled Marei',1044513,'Egypt','Egypt','Khaled Mar’ie began his cinema career after graduating from the montage division at the Institute of Cinema. He has taken part in numerous film productions such as “Korsy fee Al Klub’, “Ayam el Sadat”, “Africano”, “Janat Al Shaytan”, “Muhamy Khal’”, “A’skar fee Al Mu’askar” and “Tito”. Khaled Mar’ie has also contributed to the production of several titles including “A’marat Yacoubian”, “Zarf Tarea” and “Ja’alatny Mugriman”. Khaled’s debut as a director came in 2007 when he directed “Taymour wa Shaqiqa” starring Ahmed El Sekka and Mona Zaky. The film was a commercial and critical success. Following that work, Khaled directed “Asif A’la Al Iz’aj” which starred Ahmed Helmy and Mahmoud Hemeida.\nKhaled’s most recent work was “A’asal Aswad” which brought in a revenue that was in excess of 17 million Egyptian pounds. Khaled Mari’e spent a long time working with the ART network and he has also worked as a director on several programs. However, Khaled has come to work exclusively in cinema since then.\nIn 2013, Maraie began a series of successful collaborations with writer Mohamed Amien Rady with the television series \"Neiran Sadiqa\" (Friendly Fire), which featured a big ensemble cast of stars. After receiving acclaim for his immaculate direction and the series\' daring content, Maraie teamed up again with Mohamed Amien Rady in 2014 to make the more successful and controversial series \"El Sabaa Wasaya\" (The Seven Commandments), which also featured an ensemble cast and received widespread acclaim. The collaboration was also repeated in 2015 with the series \"Al Aahd\" (The Pledge).','22 November 1970','https://media.elcinema.com/uploads/_315x420_60393f8ddaf12c0b187168a986ecd0c51d84d5bef96ae3d88b6d04374338e523.jpg'),('Mohamed Fadl',1044602,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nour El Sherif',1044776,'Egypt','11 August 2015','His full name is Mohamed Gaber Mohamed A’bd Allah and he was born in the al-Khalifa neighborhood of Cairo. Nour earned a diploma from the Higher Institute for Theatrical Studies in 1967. Upon his graduation he was classified as first tier. Nour married fellow actress Poussy in 1972 and the couple have two daughters named Sara and May.\nNour’s father passed away at the age of 26 when Nour el-Shereef was only one. El-Shereef began acting while at school where he joined an acting troupe. Nour also played soccer in al-Zamalek’s junior team and had it not been for his passion for acting he would have probably have sought a career in football. Following his graduation from highschool Nour enrolled at the faculty of commerce but later transferred to the Higher Institute for Theatrical Arts. He got to know Sa’ad Ardash who nominated him for a minor role in a play titled “Shaware’ al-Khalifa” (“The Streets of al-Khalifa”). Thereafter director Kamal E’id chose him to perform in a theatrical production titled “Romeo wa Juliet”. Whilst rehearsing for the play Nour met A’del Imam who was to nominate him to director Hassan Imam. The director had him participate in the film “Qasr al-Shawq” (“Fort of Passion”). Nour el-Shereef received a special honor for his part in the production – his first such award. \nAmong the television series that he has participated in are: “Al-Qahira wa al-Nas” (“Cairo and its People”), “Adeeb” (“The Scholar”), “Lan A’eesh fee Galbab Abby” (“I Will not Live in My Father’s Robes”), “Al Tha’lab” (“The Fox”), “U’mar bin A’bd Al A’zeez”, “Haroun al-Rasheed”, “Ibn Rushd”, “A’ailat al-Hajj Metwally” (“The Household of al-Hajj Metwally”) which aired in 2001, “Al A’ttar wa al-Bannat al-Sab’”(“The Perfumer and The Seven Girls”) which aired in 2002 and “Ragol al-Aqdar” (“Man of Destiny”) which aired in 2003. Nour also hosted the television program “Shouf Bakhtak”. \nAmong his plays are “Kont feen ya A’ly” (“Where Were You A’ly”), “Al-Muttafael” (“The Optimist”). His directorial debut took place at the Al-Hanajir theater where he directed “Al-Kahin” (“The Priest”). Nour has received numerous awards as he received honors for the film “Qitt’a A’la al-Nar” and four prizes for “Ya Rab Tawba”, “Da’ Al U’mr ya Walady” (“We’ve Squandered the Years, My Son”), “Habeeby Daeiman” (“My Lover, Always”), “Al Karnak”, “Hadouta Massriyah” (“An Egyptian Tale”), “Al Taouss” (“The Peacock”), “Al A’ar” (“The Shame”) and “Ahl al-Qimma” (“Those of the Summit”). \nNour was also awarded the prize of the New Delhi film festival for the film “Sawwaq al-Autobis” (“Bus Driver”), in addition to the 1996 Cairo Cinema Festival award for best actor for his role in “Leyla Sakhina”. In 2001 Nour directed the movie “Al-A’ashiqan” (“The Two Lovers”).\n','28 April 1946','https://media.elcinema.com/uploads/_315x420_e3e122343374b53c7453ccf6c4959f29b0ca517598f66821973f4f451a6e3ead.jpg'),('Muhammad Mohie',1044971,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6efd1e63677048d1a269408447c9739933e7ff5fadab74c27b15828c58ebef8a.jpg'),('محمود كامل',1045010,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Naguib Mahfouz',1045036,'Egypt','30 August 2006','Born on December 11th 1911, he was an Egyptian writer who won the 1988 Nobel Prize for Literature.  He is regarded as one of the first contemporary writers of Arabic literature, along with Tawfiq el-Hakim, to explore themes of existentialism He published over 50 novels, over 35050 short stories, dozens of movie scripts, and five plays over a 70-year career. Many of his works have been made into Egyptian and foreign films.\nMahfouz\'s central work in the 1950s was the Cairo Trilogy, an immense monumental work of 1,500 pages, which the author completed before the July Revolution. The novels were titled with the street names Palace Walk, Palace of Desire, and Sugar Street.  Mahfouz set the story in the parts of Cairo where he grew up. They depict the life of the patriarch el-Sayyed Ahmed Abdel Gawad and his family over three generations, from World War I to the 1950s, when King Farouk I was overthrown. With its rich variety of characters and psychological understanding, the work connected Mahfouz to such authors as Balzac, Dickens, Tolstoy, and Galsworthy. Mahfouz ceased to write for some years after finishing the trilogy.\n','11 December 1911','https://media.elcinema.com/uploads/_315x420_1f1374cd20cbdf4d9353b946d04ccaabeac26d4db37ba1a32e30f25fdf1d4745.jpg'),('Tarek Lotfy',1045187,'Egypt','Egypt','Taarek Lotfy is a talented Egyptian actor, he studied at the High Institute of Dramatic Arts and got the director diploma from the High Institute of Cinema at the 1980s. Lotfy participated in various works that helped him to him to book a place in audience’s hearts, among his most famous TV series are; Esma’eel Abdul Haafez’s “Al-‘aaela i.e. The family” and “Al’hakeeka wal saraab i.e. The truth and the mirage”. Taarek played an excellent role in the successful film “Se’eedy fel gam’a al-Amerikeyya i.e. An upper Egyptian at the American University”.','20 November 1965','https://media.elcinema.com/uploads/_315x420_6c4df0be90d74c1b3e1ad3865f4dffc4f58caab9165ff5c998588d4188eef1a8.jpg'),('Afaf Rashad',1045241,'Egypt','Egypt','NONE','30 December 1957','https://media.elcinema.com/uploads/_315x420_0bf4abfef8e47d6902ba64141c9c8559538383b39be6217805d986229127bd88.jpg'),('Belal Fadl',1045300,'Egypt','Egypt','Belal Fadl was born in 1974 in the Cairo district of Manshiyet al-Bakry. He spent his childhood in Alexandria where his family resides in the district of Mahram Beyk. Fadl studied at the Journalism department at Cairo University’s Media faculty from which he graduated in 1995. Fadl was ranked first in his class and graduated with distinction and honors. Thereafter Fadl worked as a trainee for the “Rose al-Youssif” newspaper, that position was followed by a stint as a secretary editor at the al-Dastoor newspaper until the government temporarily closed that publication towards the start of 1998. \nBelal Fadl then spent  a while writing for newspapers and magazines of the likes of “al-Kawakib”, “Sabah al-Kheir”, “al-Mussawar”, “al-Hilal”, “Wighat Nazar”, the Emirati publication “al-Ittihad”, London’s “al-Wasat” and the Egyptian publication “al-Isboo’”. Belal also worked for the ART television network before working as the deputy director of MBC’s Cairo office. Moreover, Belal also worked as an editor at the “al-Geel” Egyptian newspaper before taking part in the founding of the “al-Qahira” newspaper which was published by the Ministry of Culture. Belal was the chief editor for the paper for several month before leaving journalism behind altogether and beginning a career as a screenwriter. His first screenplay was released in 2001 after six years of attempts. Belal then returned to journalism and wrote for the al-Dastoor weekly paper after a court ordered its opening in 2005. He edited a weekly publication titled Qalamein and then contributed a weekly column for the “al-Masry al-Youm” newspaper. In 2007 Belal began writing a daily column in the al-Dastoor newspaper, he continued the effort for eight months before stopping. Thereafter Belal wrote his first television work, a series titled “Heyma”. After the work was screened Belal went back in November 2008 to writing daily articles but this time he wrote for the “al-Masry al-Youm” where he contributed a column on the last page titled “Istibaha”. The column discussed contemporary events. Belal also spent a while presenting a segment on the “al-Qahira al-Youm” (“Cairo Today”) television program alongside television presenter ‘Amr Adeeb. Today Belal presents a weekly program on the Dream 2 channel titled “’Aseer al-Kutub”, the program discusses books and airs every Sunday at seven in the evening. The same program is also repeated every Monday at four in the evening and Wednesday at 2 am.\n','5 September 1974','https://media.elcinema.com/uploads/_315x420_849b5d7302bec42dc3707b5639016543c3265bda684d4c6fe910d48607039444.jpg'),('Mohamed Diab',1045331,'Egypt','محمد عبدالحميد عبدالحميد دياب ','Mohamed Diab is a screenplay writer and director from Ismalia. Originally an economics major, he worked in a major international bank while writing scripts on the side as a hobby. His love for writing outweighed his decision to work as a steady employee, so he quit his job and moved to New York where he studied screenplay writing at the New York Film Academy.','NONE','https://media.elcinema.com/uploads/_315x420_c7aa5cc5314f9566c3789325a91469f8a8c1d064928f7e9ea6cf5f1f4ff36219.jpg'),('Youssef Eid',1045389,'Egypt','Egypt','Youssef Mohamed Eid was born in the (town) of Al Gamaliyah. (He received a high school degree from Al Azhar in 1987). (?) His (theater debut took place in 1975 when he participated in) “Nahnu la Nohib Al Kowsa”, “Intaha Al Dars ya Ghaby”, “Aashan Khater Eiounak”, “Sharaa Mohamed Ali”, “Raqs Al Deyouk” and “Zqaq al Madaq”.\nAmong the television (series) in which he has assumed roles are “Al Sira Al Hilaliyah”, “Al Bashair”, “Safar Al Ahlam” and “Alo Rabie Mara”.\n','14 November 1948','https://media.elcinema.com/uploads/_315x420_4dbed892acc88f3d61e41ca0d59511898f1d3312941fc1c233387f722390a795.jpg'),('Yousra',1045552,'Egypt','Egypt','Born Civene Muhammad Haafez Nasseem (1955 Cairo), is an Egyptian actress who was first discovered by photographer Abdul Haleem Nasr who gave her a role in his debut as filmmaker. She played several TV roles like “Arees we aroussa i.e. Groom and bride”, “Al-shaahed al-waheed i.e. The only witness”, “ Hayaat al-Gohary”, “Raafat al-Haggaan”, “Sayyedat al-fondok i.e. The Lady of the hotel”,  “Awaan al-ward i.e. A time for flowers”, “Ayna Kalby? i.e. Where is my heart?” and “ Malak rowhy i.e. King of my soul”.\n“Entadher la taktolny i.e. Wait, don’t kill me” is among her radio series. She played stage roles like “Ka’b aaly i.e. High heels” and “Lamma baba yenaam i.e. When daddy sleeps”. Superstar Youssra is married to Khaaled Seleem, the son of football Legend Saaleh Seleem and the actor Heshaam Seleem’s brother.\nYoussra represents a special blend of acting and stardom mixed survival and freshness, she formed a very successful duet with Aadel Emaam and played several roles with Ahmad Zaky. Youssra has a unique artistic talent which flourished in Chahine’s “Eskendereyya kamaan we kamaan i.e. Alexandria again and forever”, “Al-mohaager i.e. The immigrant” and “Eskendereyya New York i.e. Alexandria New York”.\nAmong her most famous cinema roles; “Al-‘assefa i.e. The tempest”, “Al-gou’ i.e. Hunger”, “Al-mansy i.e. The forgotten” and “Toyour al-zalaam i.e. The birds of darkness”.','10 March 1955','https://media.elcinema.com/uploads/_315x420_a48418ee3227255ed594c8a7280922a48813ee09abae7256bf102930c6a389af.jpg'),('دانا للإنتاج والتوزيع الفنى',1045672,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_997d9566c30619d95da5287c23f760b874bbaa3516ec7f3ab1542f643a8dbbbe.jpg'),('Haitham Zaki',1045936,'Egypt',' 7 November 2019','Haitham Zakky is a rising Egyptian actor. His family was active artistically as his father was the late Ahmed Zakky and his mother is artist Hala Fouad. Haitham began his career in 2006 when he filled in for his deceased father in the remaining scenes of the film “Haleem”. Haitham’s father, Ahmed Zakky, was the title’s lead prior to his death. Thereafter Haitham presented his first independent lead in the film title “al-Plagio” and the endeavor was a great success.','4 April 1984','https://media.elcinema.com/uploads/_315x420_f62abff282dacdff5537b08465dd2595bf08180ecf62eabc99ee33137d9dece4.jpg'),('Hamdy Hikal',1045963,'Egypt','Egypt','NONE','25 July 1959','https://media.elcinema.com/uploads/_315x420_47e108621c81ebd843410c8808b8bb6231a5e157afdff370b452a7aaa682f0c4.jpg'),('Shams',1046134,'Egypt','Egypt','NONE','9 April 1976','https://media.elcinema.com/uploads/_315x420_dc124f677b7f0375d450ce17244cb16f7554ab248b3730c0c2b7df8521d4570d.jpg'),('Rashwan Tawfek',1046195,'Egypt','Egypt','Rashwan Tawfek is an Egyptian actor who was born in Sayyeda Zeinab, Cairo in 1933. He got his Bachelor’s degree in acting and directing from the Higher Institute for Dramatic Arts and after graduating worked in Egyptian TV. After this, he joined a TV theater troupe that was getting started, and during this period of time was the star of a number of plays, including: “Sheia’ Fi Sadri” (Something in my Chest), “El Showaria El Khalfia” (The Backstreets), “Thawra Qareya” (Revolution of a Village), “Bayt El Fananeen” (House of Artists). Tawfek also performed with the Tafik El Hakim Theater Troupe, The Modern Theatre Troupe, and the National Theatre Troupe. After long years of acting in the theater, Tawfek moved to acting in TV drama at the end of the 1970s. The most famous serials that he acted in include: “Abna’i El-A’za’ Shukran” (Thank You, My Dears), “El Ayam” (The Days), “Mohamed Rusul Allah,” El Shahid We El Domou’” (Honey and Tears), “El Zayni Barakat,” “Len Ayesh Fe Galabab Abi” (I Won’t Live My Father’s Life). ','24 November 1933','https://media.elcinema.com/uploads/_315x420_36cd79854357069142dc5d26a2eac4d1be91347698d8073c67c6befeb53485d0.jpg'),('Hosam Al-Gohary',1046295,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a0130323037dd39fa573bd40857f507323ab90b3bb99c0df853625a0eda27a8c.jpg'),('Hamdy El Sakhawy',1046306,'Egypt','Egypt','Egyptian actor Hamdy El Sakhawy was born in 1955. Directors have often cast him in roles as a foreigner, taking advantage of his European appearance. He is best known for his television acting, including such works as: “La Ahad Binam Fi Iskandria” (No One Sleeps in Alexandria), “Meen Atlak El Risas ‘Ala Hind Alaam” (Who Shot Hind Alaam), “El Malak Farouk” (King Farouk), “Ragil wa Sit Sitat” (One Man, Six Ladies) and “El Sa’irun Nayiman” (The Sleep Walkers).\n','1 July 1955','https://media.elcinema.com/uploads/_315x420_a1e1fb33be2cacd1c7a77f30a56de52c92923c9a6028c10dce1d0f511d017953.jpg'),('Ahmad Bedir',1046457,'Egypt','Egypt','After finishing his high school studies in 1966, he graduated from the faculty of Arts in 1970. Ahmad was an actor, play writer and director in the Youth centers theatre. As actor, he also worked in a number of radio series, it was his appearance in TV series that started his fame.  One can never forget his roles in “Taaer al-leil al-hazeen i.e. The sad night bird”, “Al-Zeiny Baraakat”, “Holm al-layl wal-nahaar i.e. Night and day dream”, “Abwaab al-madeena i.e. City gates”, “Nahr al-malh i.e. Salt River”, “Al-madeena i.e. The city”, “Al-hessaar i.e. Embargo”, “Soraakh al-samt i.e. Silence scream” and “Zizinia”. On stage Bedeir excelled in a number of plays; “Rayya we Sekeena”, “Bacalorios fee hokm al-sho’oob i.e. B.A. ruling people”, “Al-sa’ayda wassalo i.e. Upper Egyptians arrived”, “’Al-rasseef i.e. On the sidewalk”, “Koromb zabaady i.e. Cabbage Yogurt”, “Dostour ya syadna i.e. Constitution oh masters” and “Al-Comandan i.e. The Commander”.\nThe silver screen shows how Ahmad was patient enough to play small roles that bit by bit proved his talent. Though he played lead roles in different films, yet he was in his best with Youssef Chahine. His vitality in “Sokoot hansawwar i.e. Silence ..We’re rolling” was a value added to Chahine’s film. His roles in “Abnaa wa qatala i.e. Sons and killers” and “Batal men warak i.e. Paper Hero” show his real talent. Ahmad Bedeir is married and has two daughters; Sara and Do’aa.','1 May 1945','https://media.elcinema.com/uploads/_315x420_2cdda64d60a9b3c3b37db8655c94daf686687ce10fd3ff04726246cf6ce32b49.jpg'),('Albatrous film production',1046532,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b336f132f4877576ee0d57bf61a993207e1635d923c32c6cf9c5cd389a1c2a8f.jpg'),('Adel Adeeb',1046535,'Egypt','عادل عبدالحي أديب ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4110a075465f86b4f3bddd891e9ac2a38242cd86039b02a53aa1a204c1bb643f.jpg'),('Ahmed Abdelhamid',1046834,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_66539c56b3da54690a8590fc420c09293e50718afb711be95d1ce8851637e623.jpg'),('Tamer Shaltout',1046835,'Egypt','Egypt','Tamer Shaltout has worked for the channel (Mazzika) as a presenter in the (music news segment). He has also presented many of the channel’s concerts in addition to conducting interviews with several (performers). \nFollowing his (stint) at (Mazzika), Tamer Shaltout worked for several other channels where he met with a great deal of success in presenting a range of (distinctive) programs. \nFollowing his success in television, Tamer was attracted to the world of cinema and he (assumed) his first acting role in the film (“Al Shaytan”). Subsequently, he has acted in several other movies, the latest of which was (“Qataa Shahn”). \n','15 January 1986','https://media.elcinema.com/uploads/_315x420_7e76f6c3ec93e527690388e62eb5e13d14db9baf894ded3cb9048153a515c9e2.jpg'),('Ahmed Maher',1047138,'Egypt','Egypt','Ahmed Maher is an Egyptian actor, who was born in the town of Boulaq in 1946. He received a Bachelor\'s degree from the Institute of Theatrical Arts in 1973. Maher worked mostly in theater and television. He started on theaters of youth centers and public culture foundations. Among his most popular theatrical works are “Al Motazawegoon” (The Married) and “Agaza Momtea\' Giddan” (A Very Entertaining Vacation). In television, Ahmed Maher was best known for his depiction of historical characters, in major hits like “Al Forsan” (The Knights), “Al Abtal” (The Heroes) and the famous eponymous espionage series “Raa\'fat El Hagan.”','13 August 1946','https://media.elcinema.com/uploads/_315x420_768020961e0cff104fe2166f95de93b0d936ca27e587405c9ff7f8c2f6056390.jpg'),('Wafaa Soliman',1047212,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Motawea Oweis',1047283,'Egypt',' 1 December 2015','Metaweaa\' Eweiss is an Egyptian actor, born in 1929. He worked as a silent extra in a lot of films at the start of his career. He then started taking small roles, the majority of which being as a doorman, fruit/vegetable seller, broker and gangster. He died in 2010. ','6 August 1929','https://media.elcinema.com/uploads/_315x420_520322ca621d8577a7a275e391e4367b4967e4235c52f41308dd1a2b4d1c7d7e.jpg'),('Mohamed Zedan',1047359,'Egypt','Egypt','NONE','29 May 1983','https://media.elcinema.com/uploads/_315x420_876f1465f6e700e48123efa35508ec98585fb12e38d14ca0dc98427a9373256f.jpg'),('Nader NourAlddin',1048267,'Egypt','Egypt','NONE','7 July 1961','https://media.elcinema.com/uploads/_315x420_57ad0cf15572725a80c0a4696f775bebe5cd3f6048603bb7f9c95f454fdf90fa.jpg'),('Emad Hamdy',1048339,'Egypt','Egypt','Egyptian artist ‘Emad Hamdi is among the most capable and most outstanding artists throughout the history of Arabic cinema. His full name is Mohamed ‘Emad al-Deen ‘Abd Al Hameed Hamdi and he was born in the governorate of Sohag. ‘Emad received a diploma from a commerce school and was married four times. His first marriage was to an oriental dancer named Houriyeh Mohamed while his second marriage was to Fathhiyah Shereef who worked as a monologist for a group named Badee’a Musabny. The couple had a boy which they named Nadir and their marriage lasted between 1945 and 1953. ‘Emad later married an artist named Shadya and the pair presented a few movies together. They later separated in 1956. In 1961 ‘Emad married an artist named Nadia al-Guindy. The pair had a son named Hashim and their marriage lasted 13 years. At the outset of his career ‘Emad worked at Studio Misr, thereafter he worked at the Abou el-Reesh Hospital. He progressed in his job, starting out as a head accountant then becoming production manager and later becoming a distribution manager. He was fond of acting and that led him to take part in Ministry of Health promotional films which were produced at Studio Misr. His real beginnings in cinema came about in 1945 when he took part in a film titled “al-Souq al-Sawdaa” (“The Black Market”) and acted alongside artist ‘Aqilah Ratib. ‘Emad also took part in the production of several films as he founded a production company. Some would consider him among the most important of Egyptian actors as he had a cool demeanor with soft features which made him resemble Marlon Brando. He also has a very distinct voice. The distinction in his voice grew with his age as can be observed in “Umm al-‘Arousah” (“Mother of the Bride”), “al-Muzniboon” (“The Guilty”) and “Tharthara Fawq al-Neel” (“Chatting on the Nile”). Despite the fact that he was a hard worker he would reserve his talents for particular films and for directors that could bring out those talents. ','25 November 1909','https://media.elcinema.com/uploads/_315x420_346363ea07439026aae032f8c91acd0e47e36bcc6816c73d446e11893f0e47df.jpg'),('Enaam Salosa',1048346,'Egypt','Egypt','Egyptian actor Enaam Salosa (born: Enaam Ibrahim Hassan Ahmad) was born in the city of Dumyatt in 1939. While studying at Ayn Shams University, she participated in a number of theatrical performances in the College of Literature. After graduation, she enrolled at the Higher Institute of Dramatic Arts. Some of her most important works are television dramas including: “Layaly Al Helmya” (Al Helmya Nights), “El Liqa’ El Tani” (The Second Meeting), “Imraa min Zamn El Hub” (A Woman from the Time of Love), “Ya Rigal El Aalam Ithadu” (Oh Men of the World, Unite), and “Ailet El Hag Mitwali” (The Family Hag Mitwali). Salosa has also appeared in many films, including: “Mawad ala Asha’” (A Dinner Date; 1998), “El Irhab wal Kebab” (Terrorism and Kebab; 1992), “El Noom fil Aasel” (Sleeping in Honey; 1996), “Hammam fi Amsterdam” (Hammam in Amsterdam; 1999), and “Aasel Eswed” (Molasses; 2010). ','15 December 1939','https://media.elcinema.com/uploads/_315x420_f75cf0c77fdcb06ef2a9c84824dcaf634112fade771c424a6716ba53088097cb.jpg'),('Mohammed Al-Shura',1048366,'Egypt','محمد محسن الشورى ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8adc1a65b4997e500860263b646edc7e3ed23fea00bcdedeb9bc4c1fbcf3831a.jpg'),('Youssef El Sherif',1048373,'Egypt','Egypt','Muhammed Esmaeel, known as Youssef al-Shereef was born in Cairo on the 14th of December 1978. He is a mechanical engineer, graduate of Ain Shams University, and a clever Karate player who played in international championships in Tunisia and Hungary. He also played football at al-Ahly as well as volleyball. He participated in six films and three TV series. Youssef played the role of director Aly Badrakhaan, Soaad Hosny’s husband in TV series “Al-Cindrella\" (The Cinderella). In TV series “Ala naar hadya\" (On low fire) he played the role of Hishaam, Rasha Mahdy’s fiancé. He was also Essaam in “Al-‘ameel 1001\" (Agent 1001). On the big screen, Shereef played the role of Shereef, the D.A. in “Heya Fawda\" (Is this Chaos..?) with Khaaled Saaleh and Menna Shalaby, Hossaam, the army officer in “Fattah Eineik\" (Open your eyes) and Ahmad Abdul Hayy in “Saba’ war’aat kotsheena\" (Seven play cards). He also participated in “Haleem” and “Al-gazeera\" (The Island). The year 2012 saw the rise of his fame on TV when he starred in \"Rakam Maghol\" (Unknown Number), then he went on to play another very successful role in \"Ism Mo\'aqat\" (Temporary Name). ','14 September 1978','https://media.elcinema.com/uploads/_315x420_7f556ea15ef77f179612163abc98479deac8f8f9d1cc3117a141444dff1bedcd.jpg'),('Tamer Hosny',1048491,'Egypt','Egypt','Born in Cairo on August the 16th – a determined Leo-,Tamer Abbas Hosy earned his degree in Mass Communication from 6 of October University then started to purse his singing career. His early beginnings started by his introduction to renowned TV presenter ‘Salma Al Shamaa’, who gave him a lifetime opportunity to perform at the Opera House alongside  other emerging talents such as, ‘Shereen Abd El Wahab’, where famous producer ‘Nasr Mahrous’ attended.Ever since, Hosny worked closely with Mahrous- whom he regards as his elder brother- releasing his first successful album, which marked the beginning of his career, opening gates of stardom and fame, not only in singing, but also in the movie industry.                                                      \nHis famous songs include (Kol Mara), (Bent El Eh), (Aktar Haga) and his famous works in Cinema include (Omar and Salma)-which was a big success in the Egyptian box office-,(Captin Hema), while his first movie debut was in(Halet Hob), starring ‘Sherif Ramzy’ and ‘Hind Sabry’\n','16 August 1977','https://media.elcinema.com/uploads/_315x420_ad65343b6f25d2708d846ecd1b066386b90be9584353797035dd47c6957c5a94.jpg'),('Emad Al Bahhat',1048561,'Egypt','Egypt','NONE','20 May 1970','https://media.elcinema.com/uploads/_315x420_4133a302f5e45e6cab6c10c3584ea127d2221c91b08c495f21d30d54de2020c7.jpg'),('Adel Imam',1048597,'Egypt','Egypt','Adel Imam is an Egyptian comedic actor, and one of the most iconic figures in Arab cinema. He\'s starred in over 100 movies and 10 plays, earning the adoration of audiences and critics alike. He was born in Mansoura on May 17, 1940, but at an early aged moved with his family to Sayyed Zeinab where he grew up. The actor got his bachelor\'s degree in agriculture from the University of Cairo, where he became passionately involved in college theatre productions. He joined a television troupe in 1962 while still a student, and began starring in TV plays like \"Ana wa Howa wa Heya\" (He, She and I) and \"Al Nassabin\" (The Swindlers) which was performed at the Al Hakim Theater. In the following years he acted in several well received plays like \"Al Bijamma Al Hamra\" (The Red Pajamas), \"Fardet Shamal\" (Left Shoe) and \"Gharammiyat A\'feefy\" (A\'feefy\'s Love Affairs). In the 1970s, he starred in the hit play \"Madrassat Al Mashaghbeen\" (Mischief at School), which screened from 1971 to 1975. He then did \"Shahid Mashafsh Hagga\" (The Witness Didn\'t See Anything) which was screened over a period of seven years. Afterwards, he did \"Al Wadd Sayyid Al Shaghal,\" which screened from 1985 to 1993. Imam has had one of the longest acting careers. More recently, he starred in \"The Yacoubian Building,\" adapted from Alaa Al-Aswany\'s celebrated novel. The film, a poignant piece of social commentary, is known to be the highest-budgeted film in Egyptian cinema history. In 2012, an Egyptian court convicted Imam for defamation of Islam (not the first time this has happened). The films targeted in this particular case were \"Al Irhabi\" (The Terrorist) and \"Al Zaeem\" (The Leader) in which he satirizes Arab autocratic rulers. Imam, however, won his appeal against the conviction. In 2000, the United Nations named him a Goodwill Ambassador for UNHCR.','17 May 1940','https://media.elcinema.com/uploads/_315x420_b0b8ebf23698a5fcad33edfcdcb8ac9c527847260dc8ebce65d32c3510da3d2c.jpg'),('Mohamed Ragab',1048632,'Egypt','Egypt','Mohamed Ragab began his career as an actor on children’s programs. He also worked as an assistant director and studied at the Cinema Institute. Mohamed worked on the television series “al-Zainy Barakat” in addition to working as an assistant director for Tareq al-‘Eryan on \"El Silim we Al Thu\'ban\" (Snakes and Ladders). He also appeared on the television series “al-Banat” (Girls). In 2013, he stars in the mystery thriller \"El Hafla\" (The Party). ','27 May 1975','https://media.elcinema.com/uploads/_315x420_35fddc8f76c5c2005d60d7643df118ac68b5979edb34bb8f9f9eb097c69406d3.jpg'),('Ayman El Shewy',1048981,'Egypt','Egypt','NONE','23 June 1965','https://media.elcinema.com/uploads/_315x420_033206518603239be55fd3fa8d35a9de333e64d7d158f563a0397de6e311a19b.jpg'),('Daoud Abdel Sayed',1049024,'Egypt','Egypt','Daoud was awarded a bachelor’s degree in directing from the (Cinema institute) in 1967. As a child, he had not aspired for a career in directing but rather wanted to become a journalist. His cousin, who was a big fan of cartoons, had a strong influence on him in this respect.t. \nDaoud eventually bought a camera and experimented with it at home. Gradually, he got to know several people that worked in the film industry. When he was 16 years old his cousin took him to visit “Galal” studio where the director Ahmed Diaa Al Deen was shooting a movie. Daoud’s cousin knew the director (as they were both colleagues). While on the visit, Daoud was greatly impressed by the world of cinema and decided thereafter to enroll in the (Cinema institute).\nDaoud started working as an assistant director, at this early stage he contribute to several films, the most important of which were Youssef Chahine’s “Al Ard”, Kamal Al Sheikh’s “Al Rajul al lazy Faqad Zolah” and Mamdouh Shokry’s “Awham Al Hob”. At this point, Daoud discontinued this type of work.\nDaoud took his camera to the streets of Cairo and went looking for real life sociological accounts to make documentary films.\nThus, he presented several documentary films, the most important of which are “Wassiyat Rajul Hakim fee Shoun Al Qaryah wa Al Taalim” (1976), “Al Aamal fee Al Haql” (1979) and “Aan Al Nas wa Al Anbya wa Al Fananeen” (1980). Work on these films provided Daoud with the opportunity to interact directly with common folk, this gave him a deeper insight into Egyptian society with all its divisions. Moreover, the experience allowed Daoud to appreciate the sensations of dynamic day-to-day lives.\n','23 November 1946','https://media.elcinema.com/uploads/_315x420_58c7fe489476a1d0a2d5b91ce10d9ec1df251dc016721dbebe6020e601bc6267.jpg'),('Natasha',1049062,'Lebanon','Lebanon','NONE','14 January 1994','https://media.elcinema.com/uploads/_315x420_230e3dae762b51670415c372b5494046f147513b3e7ff6f6776ded5c699c81b7.jpg'),('Nayef Bassiouni',1049096,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e857e88bf5ced668df769183c4871789411ac0e4d3a6da74fb0479466ed17578.jpg'),('Ahmed Eid',1049208,'Egypt','Egypt','E’id was born in the district of Dahlia. He enrolled at the faculty of agriculture but did not complete his degree. Rather he transferred to the Institute of Theatrical Arts and thereafter performed in several plays including “Souq Al Halawa” (“Candy Market”), “Al A’yn Al Hamraa” (“Red Eye”) and “Al Abanda”.','6 January 1968','https://media.elcinema.com/uploads/_315x420_aa98c43117f9b7a3e2e3537e566d994569e55d42d2972fa891235ac6443be302.jpg'),('Mohamed Saad',1049209,'Egypt','Egypt','Mohamed Saad was born in Sayeda Zeinab, Cairo. He studied in the High Institute of Theatrical Arts of Cairo. He started his career by appearing in small roles in TV series like “Mazal Alnahr Yagry” (The River is Still running), and films like “Al Tariq Ila Eilat” (The Road to Eilat) and “El Gentle” (The Gentle) in 1997. His big break was in the blockbuster “El Nazer” where he portrayed the character of “El Lemby”, which earned him a great popularity that was increased enormously in the film “El Lemby,” in 2002, where he portrayed the same character and was the lead actor this time. He then went on to portray single farcical characters with flashy names in a series of films that followed the success of “El Lemby” like “Okal”, “Booha”, “Tattah”, and “Bushkash.”','14 December 1968','https://media.elcinema.com/uploads/_315x420_2c493aba02be3769b01df2e8b82a83acb80dac30fca1019d219f5a03b182455a.jpg'),('Mahmoud Abdelghaffar',1049223,'Egypt','Egypt','Mahmoud Abdel Ghaffar has worked on a number of feature films and television shows. Of his most memorable roles are Gowany in \"Rasha Gari\'a\" (A Brave Act), Lulu El Nahes in \"Belia we Demagha Aliya,\" and Salah Jaheen in the show \"El Andleeb\" (The Nightingale). ','20 January 1961','https://media.elcinema.com/uploads/_315x420_c7f9e847e3efc9f1459694b7c92a1343c985e4513f7a84719617cf52dc4ca2a2.jpg'),('Amr Arafa',1049257,'Egypt','Egypt','An Egyptian cinema director, he is also the younger brother of famous director Sherif Arafa, and the son of director Saad Arafa. In a short period of time Amr Arafa was able to set foot in the cinema field and succeed throughout the competition. He worked with big names in the cinema and acting field such as actors Adel Imam and Ahmed Ezz.\n\n','9 December 1962','https://media.elcinema.com/uploads/_315x420_100ef5fdfdc94c44b1ac4f094cf3e035dbb17a10814637b61bce08bb67849539.jpg'),('رأفت حمدي',1049310,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Zaki Fateen Abdel Wahab',1049333,'Egypt','Egypt','Zaky is the son of singer Laila Mouraad and director Fateen Abdul Wahhaab. In 1983, he graduated from the High Institute of Cinema. Zaki worked as second unit and assistant director with ‘Aly Badrakhaan and with Youssef Chahine in “Adieu Bonaparte i.e. Farwell Bonaparte” and “Al-yowm al-saades i.e. The sixth day”. Zaki also was the location manager of American films and miniseries shot in Egypt like “Fortunes of war”, “Mysteries of Egypt” and “The mummy returns”. His only film as director is “Romantica (1996)”.','15 December 1955','https://media.elcinema.com/uploads/_315x420_27416f4eb01955daddebbf8fc455e71b5ed5fffe71fcc4ac8795c0023067285b.jpg'),('Falak Nour',1049412,'Egypt','Egypt','NONE','7 September 1963','https://media.elcinema.com/uploads/_315x420_c3ee6a2bf02337d08c874f871d5848d1be8f14ed824d0734f5ae7449f016915b.jpg'),('Sherifa Maher',1049455,'Egypt','Egypt','Egyptian actress Sherifa Mahear was born in 1932 in the Cairo neighborhood, Helwan. She graduated from a French high school and was discovered by the prominent Egyptian singer and musician Mohamed Abdel Wahab, who signed her on for a three year contract. She went on to work in cinema, appearing as both a singer and an actress. Mahear is best known for playing an an aristocratic woman and for her roles in the films: “Irham Dmoo’y” (Pity my Tears), “Karamet Zawgaty” (My Wife’s Dignity), Aaz El Habayeb\" (Dearest Beloveds), and “El Masir” (Destiny).','30 September 1932','https://media.elcinema.com/uploads/_315x420_7ef59c541138074a160d71325012feaeb6dcdfe8838a9dddac962c78e8603271.jpg'),('Mahmoud El Gendy',1049617,'Egypt','Egypt','Mahmoud Hussein El Guindi was born in (the town of Abou Al Mattamir), Al Beheira governorate. (He has nine siblings).\n(Mahmoud was enrolled in a vocational school where he trained as a (tailor)). After graduating, he worked at a factory. \nThereafter, Mahmoud was admitted to the (Institute of Cinema) and graduated in 1967. Following his graduation he worked in cinematic, television and theatrical productions. Among the plays in which he has performed are “Antarah”, “Mawloud Al Malik Maarouf”, “Shakespeare fee Al Ataba”, “Alashan Khatir Eyounik”, “Al Maleem bi Arbaa”, “Bahebak ya Mojrim”, “Al Brenseesa”, “Innaha Haqan Aaila Mohtarama”, “Al Rouaab Al Laziz”.\nFollowing an accident that took the life of his lover, Mahmoud directed the film “Al Morshid” in 2003. Abla Kamel starred in that picture.\nMahmoud has succeeded in bringing together music and comedy in his film.\n(His performance was not particularly outstanding in the movies (that were financed by the real-estate boom)), however, his talents are obvious in his performances in “Qalb Al Layl” and “Shahateen Nobala”.\n','24 February 1945','https://media.elcinema.com/uploads/_315x420_382e5aed8b515d01bc8d2f764e50b0657f788382e9006d572ea5be6231f2d1d1.jpg'),('Salah Abdullah',1049773,'Egypt','Egypt','Salah was born in Cairo and he has studied at the (Institute for Theatrical Arts). \nHis acting career began with his performance in the series “Sunbol Baad Million” and thereafter he has performed exceptionally in several series which include “Ziab Al Jabal” and “Abou Al Alla 90”.\nHe has also performed in several theatrical works which include “Howda Karama”, “Feema yabdoo Saraqoo Abdah”, “Imsik Hakooma”, “Al Askary Al Akhdar”, “Al Barachot” and “Abou Zeid”.\nHe has received several awards for his (performance) in the film “Muwattin wa Mukhbir wa Haramy”.\n','25 January 1955','https://media.elcinema.com/uploads/_315x420_1d339ca037c270b473e2dd7a4a963a824fb921190e13b5b65912df21e196b75c.jpg'),('Khaled Youssef',1050215,'Egypt','Egypt','Khaled Youssef is an Egyptian director. His father was a mayor. \nKhaled studied in the electrical engineering division of the faculty of engineering at Banha University. He graduated in 1990.\nWhile a student at university he held the post of Student Union president, he also directed a play titled (Al Moharej). The screenplay for that production was authored by the deceased Syrian writer Mohamed Al Maouz and was performed at the Taliaa theater as part of a university students production.\nKhaled Youssef had the opportunity to get to know the departed director Youssef Chahine while a student through his film screenings and also through the seminars he held at the university. Khaled Youssef also performed in Chahine’s 1991 documentary film “Al Qahira Menawara bi Ahlaha”. Moreover, Khaled contributed to the screenplays of “Al Mohajer”, “Al Maseer” and “Al Akhir” and also worked as an assistant director on the set of “Eskandiria New York”. Thus, Khaled Youssef had a long history of partnership with Youssif Chahine.\nIn 2001, Khaled Youssef began directing his first cinematic production which was titled “Al Asifa” and starred Yousra, Hanan Tourk, Hani Salama and Mohamed Nagaty. The film was a big success. Later in 2003 he directed the film “Gawaz bi Qarar Jamhoury” that starred Hanan Tourk and Hani Ramzy, this was followed by “Anta Oumry” which featured Nelly Kareem and Hany Salama.\nIn 2005, Khaled Youssif presented his fourth film titled “Ouija”. This film starred Shereef Mounir, Hani Salama, Mouna Shalby and Hend Sabry. In the following year he presented “Khiyana Mashroua” which starred Hani Salama, Sumayah Al Khashab and May Ezz Al Deen. In 2007 he presented “Heena Maysara” that starred Sumaya Al Khashab and Amr Saad. Later that same year, in a collaborative effort with his mentor Youssif Chahine, Khaled directed “Heya Fawda”. In 2008 Khaled directed “Al Rayyis Omar Harb”, this was followed in 2009 by “Dukkan Shahata” that starred Hayfa Wehbe and Amr Saad.\n','28 September 1964','https://media.elcinema.com/uploads/_315x420_59c65522d3ea332c0d7ddb9ac66ae5286bfb58a560b4f0e1bca845ae4dc4fabe.jpg'),('Mohamed Abdel Razek',1050524,'Egypt','Egypt','NONE','4 March 2015','https://media.elcinema.com/uploads/_315x420_c0943072340c8a186c698864661ce26b5c23b72eb8cc26b63615fdc2d8034714.jpg'),('Maged Magdy',1050673,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2088af15e1827b9273c1a47f17c916eef71c24e019ad62beb550e49ecdd2d846.jpg'),('Reda Idrees',1050844,'Egypt','Egypt','Reda Idryes is an Egyptian actor famous for his comic supporting roles. He participates with many actors where he always proves himself.','26 January 1960','https://media.elcinema.com/uploads/_315x420_02af0b6c60ae8b27abf33da64de6aac4c718b633285da3b3dd3e5d16157b95ab.jpg'),('Samir Ghanem',1051054,'Egypt','Egypt','Samir Youssif Ghanem graduated from the faculty of agriculture in 1967. He became friends with George Seydhom and al-Deyf Ahmed and the three formed “Adwaa al-Masrah” (Theater Lights), which was a singing and acting troupe. Ghanem had outstanding stage performances in the productions “Tabeekh al-Malayka” (Angelic Cuisine), “Romeo wa Juliet,” among others. Ghanem also had an outstanding performance in “Fawazir Ramadan” – Ramadan Trivia Shows – where he assumed the character Fatouta. Among his most successful television performances was his role in “Hekayat Captain Mizo” (The Tales of Captain Mizo). Although having a career containing several flops and mediocre efforts, Ghanem is considered among the most talented, spontaneous and resourceful comedic actors in the middle east. \n','15 January 1937','https://media.elcinema.com/uploads/_315x420_f78af94fc4212c2fd0b24ed5f35bcdf104709fdf734de0717ca5e06d8abffb39.jpg'),('Safie Eddeen Mahmoud',1051086,'Egypt','Egypt','NONE','1 June 1969','https://media.elcinema.com/uploads/_315x420_e14bc382eb81c8334b3f69923435f1f56e1ee349933add94d29ca91efed10bfb.jpg'),('Zainab Aziz',1051106,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_830e9410c0d93d74800b2d15f804f3b4e4eff0c98f7b5fb3ee0c245a659b7192.jpg'),('Mai Ezz El-Din',1051294,'Egypt','Egypt','Mai Ezz Eldin was born in Abu Dhabi, Emirates. She studied sociology in the Faculty of Arts in Alexandria. She was granted her first role as an actress when director Monir Rady referred her to director Mohamed El Naggar to star in his hit film “Rehlet Hob” (Love Trip) opposite famous singer Mohamed Fouad. She then rose to fame and starred in TVG series like “Ayna Qalby” (Where\'s my Heart). Her biggest success was in the romance “Omar & Salma” where she starred opposite pop star Tamer Hosny, and they formed a duo that continued in two other sequels to the first film. She was engaged for a short period to footballer Mohamed Zidan in 2009.','19 January 1980','https://media.elcinema.com/uploads/_315x420_8b8433f4bd219ff35e5b035e7f8f0d6b517d5ad00c3e8bd5af519d86d92423c3.jpg'),('Adel Al Far',1051379,'Egypt','Egypt','NONE','20 December 1961','https://media.elcinema.com/uploads/_315x420_1474137376dd1cdc02faee758dc85407bec60316428f536c0a6311ab5cefa494.jpg'),('عبدالعزيز عمارة',1051556,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c7bf121dbeb822d55085799f65260b47404ce293ecf705490cdbed28851a3882.jpg'),('Ghassan Massoud',1051908,'Syria','Syria','NONE','20 September 1958','https://media.elcinema.com/uploads/_315x420_5f75c4189f0f389c7058c9913631af11a181ac1285c152a429ade979819a9cc5.jpg'),('Farida Saif Al-Nasr',1051973,'Egypt','Egypt','Farida Said Al-Nasr is an Egyptian actress who was born in the Agouza area of Cairo. She began her acting career when she was discovered by director Hossam Al-Din Mostafa and artist George Sidhom, who included her in the “Tholathy Adwa’a El Masrah” (The Theatre Lights Trio). Her most famous cinematic performances include “Min Fina Al-Haramy” (Who Among Us Is The Thief), “Badia Masabni,\" “Abnaa’ Al-Samt” (Children of Silence), and “Deil al-Samaka” (Fish Tail). Some of her most famous television performances include “Bedoun Zikr Asma’” (Anonymously), “Hamam Shaykh al-Arab,\" “Afareet Al-Seyalla” (The Demons of Al-Seyalla), and “Al-Rehaya.\"','10 September 1959','https://media.elcinema.com/uploads/_315x420_98f4848eeacce0f3f070c414eb0e42ff6256ed704bd277b1c19e4be683c4c8c6.jpg'),('Nermin El Feky',1051991,'Egypt','Egypt','Nermeen Abdul Raazek al-Fiky, born in Alexandria, graduated from Victoria College and studied Commerce. In early nineties, Talaat Youhanna helped her to enter the TV advertisement field. Few months later, Nermeen started acting and played stage roles like “Dastour ya asyadna” and “Ana we meraaty we Monica i.e. Me, my wife and Monica”. Excelled in TV series like “Rodd Kalby i.e. My heart is back”, “Al-leil wa akhro i.e. Till the end of night”, “Lan tasrek omry i.e. You won’t steal my life” and “Al-ketaar al-akheer i.e. The last train”.','21 June 1972','https://media.elcinema.com/uploads/_315x420_49de9cb43d924be0118a1ddc3cc6cc268d0ee9f8fecf31e058a99ad46b717a1d.jpg'),('Mohamed Nasr',1052273,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nadia Fahmy',1052289,'Egypt','Egypt','NONE','6 January 1950','https://media.elcinema.com/uploads/_315x420_51a0244ebe60c58ff90876e62378c0aa8c6b54ca29279f46011719b851f9f33e.jpg'),('Mohamed Younis',1052449,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2565197472acdfd85dd98320f68e75ca4ed06d01eb709b384983c0b40a7a63dc.jpg'),('Ahmed Essa',1052458,'Egypt','Egypt','NONE','20 January 1979','https://media.elcinema.com/uploads/_315x420_dfe1b9a77551eb60879f1b32caf41d092bb6d659f8e4b9095490338d77ca8639.jpg'),('Ahmed Falawkas',1052483,'Egypt','Egypt','Ahmed Farouq Falawkas is a rising actor, his father is renowned actor Farouq Falawkas. Ahmed’s mother is a Turkish citizen and his wife, Rabia, is Moroccan but holds Spanish citizenship who works as a fashion model. The couple have one son, Seif Al Deen, who is between 2 to 3 years old. Ahmed graduated from the broadcasting faculty at Cairo University and his distinguished acting career is ongoing.\n','22 June 1981','https://media.elcinema.com/uploads/_315x420_40e55d5ae196d081f419a77c2619c5ead60c3e1315ccc8f2b7708dfa215ff12f.jpg'),('Abir Sabri',1052496,'Egypt','Egypt','Abir Sabri is an Egyptian actress. She was born in 1971 in Cairo, and studied law at Ain Shams University. She started her artistic career as a show host, until she was picked up by director Ali Abdel Khaliq for a role in “Al Nagun min Alnar” (Those Who Were Saved from The Fire) with Amr Abdel Gelil and Tareq Lotfy in 1994. Her second collaboration with the same director came in the film “Atabet El Settat” (Women\'s Doorstep) alongside Nabila Ebeid and Farouq Al Fishawy. She worked afterwards in numerous films, before taking a temporary hiatus after wearing the Islamic veil. While wearing the veil she worked as a host on religious shows, but then returned to acting in 2010 to appear in films like “Ahasis” (Feelings), “Nour Einy” (Light of My Eyes) and “Asafir El Nil” (Birds of the Nile). ','14 March 1971','https://media.elcinema.com/uploads/_315x420_d692763979c170472d5b0f77d6fffc40a594b9c9aa754118f102350a19532e88.jpg'),('أحمد سليمان',1052521,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_17aa06c45eb230137b148446486b070b6bf8d5e1780968b360418ed8a5504b78.jpg'),('Mohammed Al-Essawi',1052554,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Studio Masr',1052809,'Egypt','Egypt','NONE','7 March 1935','https://media.elcinema.com/uploads/_315x420_e2460464bd8ea6804fb07f6212ab8bd49debdb2f8a26c38c8cd3a08898a74aac.jpg'),('Nabil Shoeib',1053043,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Khaled Talaat',1053072,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_152d093b1ccdeeb326adc759763ec4b4997cf7ba0eef3cec1a83f5315966aac9.jpg'),('Zizi El Badrawi',1053422,'Egypt','31 January 2014','Zizi El Badrawi was born in 1944. Born as Fadwa Gamil Al Bitar, she was renamed by director Hassan Al Imam. She started her acting career with director Ezz El Din Zolfakar in a small role in “Port Said” before Hassan Al Imam chose her for “Aawatef,” changed her anem and cated her in multiple roles afterwards. El Badrawi got married twice, the first time was from director Adel Sadeq in 1966 whom she\'s met during the making of “Hobi Fel Kahera” (my Love in Cairo). She got a divorce  soon after and by the beginning of the seventies she got married to Tawfiq Abdel Guelil, a lawyer that she loved very much as she said to the press. El Badrawi kept a distance with drama and acting during her second marriage. Divorced in 1988, she participaed in many drama series and plays. She died on the 31st of January, 2014.','9 June 1944','https://media.elcinema.com/uploads/_315x420_9ffdd3271b3eed62832aa80cfc947fedddc5344750d6c9aedbe492f44bf021ab.jpg'),('Hesen Abo Hagag',1053428,'Egypt','Egypt','NONE','2 December 1954','https://media.elcinema.com/uploads/_315x420_bedabcec7eb6ac17628d3ed64898fbcdde1fd8a3c94386b8971cda41c584e65d.jpg'),('Marwa Al-Khatib',1053450,'Egypt','Egypt','NONE','8 April 1959','https://media.elcinema.com/uploads/_315x420_1e5109e339bb4dea0074a853be67aaff8ba954a26df9fc34205e2107bc699f3a.jpg'),('Dalia Al-Nasser',1053564,'Egypt','Egypt','NONE','19 March 1965','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ehsan El Qalaawy',1053721,'Egypt','Egypt','NONE','26 April 1932','https://media.elcinema.com/uploads/_315x420_6983769d8e1e5b00de4d069b063817b7a907faca3a2bb66bd5ce1e9281ff33f0.jpg'),('Sharif Eddris',1053966,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5c5048e8db3fed573ba62ffa5518b5199699fa1b34f344692863aab335ca036a.jpg'),('Muhammad Al Saqqa',1054096,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fda8682730114b982801abca78f20d4fe621ef54594429e9d50c7c153497717d.jpg'),('Ahmed Mokhtar',1054429,'Egypt','Egypt','NONE','18 April 1958','https://media.elcinema.com/uploads/_315x420_8fb9b6eed100e601b92fd0e4f010372981b6eab7bd463678e0fd90daed91aebb.jpg'),('Laila Fawzy',1054530,'Egypt','Turkey','Laila Fawzy was an Egyptian actress. She was born in 1918 to a Syrian father and a Turkish mother. Her debut role was in the 1941 film “Masnaa Alzawgat” (Wife Factory). She then went on to star in numerous roles between film and television, until the beginning of the 21st century, the  she retired a few years before her death. Among her most notable roles were those in “Alnaser Salah Eldin” (The Victorious Salah Eldin), “Safir Gohanam” (Hell\'s Ambassador), and “Hawanem Garden City” (The Ladies of Garden City).  ','20 October 1918','https://media.elcinema.com/uploads/_315x420_f330b829d8d84ba8753268adf693657f900d5311e3c3d65800dd510ba084e5ce.jpg'),('Tarek Abd El-Galil',1054832,'Egypt','Egypt','NONE','16 March 2018','https://media.elcinema.com/uploads/_315x420_6eb610c43bfd70352af56f8b5ecb7ac917607c1e9a8695f3fcfacff029e06588.jpg'),('Ahmad Refaat',1054917,'Egypt','Egypt','NONE','19 March 1979','https://media.elcinema.com/uploads/_315x420_de59f31ea5b2bbae13e8be484bd493360efdec57086b851a17427025ed957b22.jpg'),('Amr Ismail',1054961,'Egypt','Egypt','NONE','11 April 1971','https://media.elcinema.com/uploads/_315x420_5ca6da799263889ab8781cb36c2e2bd00cdd2f5669d1eea5475340e2a5c86425.jpg'),('Hassan Abu Jabal',1055349,'Egypt','Egypt','NONE','10 October 1976','https://media.elcinema.com/uploads/_315x420_c504dc8768e226bc49ba86a7d06f0e7670fb20517aeea61e096dc17583f002b3.jpg'),('Atef El Mahdy',1055396,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c92e1505cc7c04a9f95db536b2a445011bc01b8b5fac77f7e0b7f9f2b7720aae.jpg'),('Tarek Abdelaziz',1055941,'Egypt','Egypt','Tarek Abdelaziz is an Egyptian actor. He was born on August 4, 1968. He\'s appeared in many films made by graduates of the High Cinema Institute. He began acting in university stage productions in 1986. He acted in a few theater troupes, including one called Haraka and another called Al Wersha with Hassan Al Gareetly. Abdelaziz graduated from law school in 1991. ','4 August 1968','https://media.elcinema.com/uploads/_315x420_263df1e89978a6f7ae924ff056c08c4fa525d2d16e1c9810016f4ad238493dff.jpg'),('Mais Hamdan',1055957,'Jordan','Jordan','Mais is an actress and a singer. Her father is Lebanese while her mother is a Palestinian-Jordanian. She is the sister of musician May Selim.\nMais was born in Dubai. She has performed in several films such as “’Umar wa Salma”, “Keif al-Hal” (“How’s it Going?”) and “Zarf Tareq” (“Urgent Circumstances”). Mais began her career in the satirical show CBM which saw her acting alongside several well known performers.\nMais is skilled at imitation and she has imitated many famous Arab figures. Her talents were discovered by Ahmed Sobhy who at the time was the Director of Public Affairs at the MBC Group. Thereafter, her career took off.\n\n','31 October 1982','https://media.elcinema.com/uploads/_315x420_eed1ccdc32f10801b85a9c8a9d6f54a30b1aefa6a408820447aa90b963c7c51e.jpg'),('Tamim Abdou',1055985,'Tunisia','Tunisia','Tamim Abdou is a Tunisian film, stage and television actor. His relationship to acting began with stage productions in his hometown of Siliana, Tunisia, and despite beginning law school in Tunisia, he decided to travel to Iraq to work as a translator, after which he went to Egypt, where he joined the Institute of Theater Actors to train in acting and directing. He also joined Youssef Chahine\'s production company, where he\'s worked for 22 years. Over time he rose to production manager there, overseeing foreign films shot in Egypt. Abdou also worked in advertising. His close friendship with Yousry Nasrallah also ended up having great professional benefits, as Nasrallah cast him in several of his most famous films. Abdou has also appeared in shows like \"Ahl Cairo\" from director Mohamed Ali, in which he co-starred with Khaled El Sawy. ','1 April 1958','https://media.elcinema.com/uploads/_315x420_3d3b9419aa1b4f143078168e748f994cbd0bcd1fca02f910589cdf9ecd78ba55.jpg'),('Nicole Saba',1056153,'Lebanon','Lebanon','Nicole Saba is a Lebanese actress and musician. She began her artistic career through a music band called “Four Cats.” Adel Imam realized her talents and assigned her a leading role in one of his films.','26 June 1974','https://media.elcinema.com/uploads/_315x420_7cfaf0784641d3c87290a65674fd4d3455e537d096f6a3e524d7ff8c8c2b3769.jpg'),('Menna Arafa',1056194,'Egypt','Egypt','Mennat-Allah A’rafeh had her debut in the television series “Cinderella” where she acted alongside Mona Zaky and the rising star Mohamed Ramadan. Menna portrayed a juvenile So’aad Housny in that title. Menna’s second work was a film titled “Mattab Sina’ee” (“Industrial-Age Speed Bump”) where she acted alongside comedy star Ahmed Helmy. Menna has also performed alongside Hamadeh Hilal in “Al Houb Kidda” (“Such is Love”) and  beside Hassan Housny and Madeleine Mattar in “Akhir Kalam” (“Final Word”) . Besides her cinema works Menna has also taken part in a few TV commercials. Moroever, Menna is also partaking in the well known TV sitcom “Raggil wa Sitt Sittat” (“A Man and Six Women”), a work which sees her performing alongside Ashraf A’bd Al Baqee, Liqaa Al Khamissy, Sameh Hussein, Intissab and In’aam Al Garitly.','1 May 1999','https://media.elcinema.com/uploads/_315x420_f7efca7e59a442e6e574364e6c7054efaca6e3dca7e307298e4d3d47ce65df63.jpg'),('Ghada Ibrahim',1056283,'Egypt','Egypt','NONE','1 November 1972','https://media.elcinema.com/uploads/_315x420_2645b85c2e6b07e2324b89328cb52ed70cd054b69215b7a0abb14a53b13ecb18.jpg'),('Dolly Shahin',1056389,'Lebanon','Lebanon','Dolly Chahine was born in Lebanon to a Lebanese father and a Brazilian mother. The young musician was the source of much clamor from her very beginnings and had her cinema debut in Cairo where she assumed a variety of roles in the company of a host of distinguished actors.','2 July 1980','https://media.elcinema.com/uploads/_315x420_1b1edac0eb34d271998ed3c9c0b0e136f92c8166cc02becf035375f35428c0ec.jpg'),('Wael Ehsan',1056421,'Egypt','Egypt','Wael Ihsan is an Egyptian director. He graduated at the faculty of commerce in 1986, then studied film production at the High Cinema Institute of Cairo until 1991. His breakthrough came at the early 2000s, with his debut “El Lemby”, which was one of the most successful films in Egyptian cinema history. He followed El Lemby with “Elly Baly Balak”, a sequel that was as successful as the first film. Ihsan then went on to make A-list star-led blockbuster comedies, like “Zaki Chan”, “Amir El Behar” (Prince of the Seas), “Bobbos” and “Nour Einy” (Light of My Eyes).','13 May 1963','https://media.elcinema.com/uploads/_315x420_d4b2240869fabcc983d3d641f97cffbf0d50a16a69e4eb17e7b54f2f2d40b7cd.jpg'),('Ahmed Hatem',1056488,'Egypt','Egypt','Ahmed Hatem is an Egyptian actor who was born in Dokki, Egypt. He studied Media and Sciences before joining the acting workshop of Mohamed Abdel Hadi, who recommended him for his debut role in Awqat Faragh that won wide audience and critical acclaim. Hatem\'s repertoire includes several blockbuster films such as: the two installments of El Kenz (The Treasure), El Haram El Rabe\'a (The Fourth Pyramid), Qeset Hob (Love Story), and El Ghassala (The Washing Machine). In addition, he starred in a plethora of TV hits, including: Vertigo, Ibn Halal (A Good Guy), Fo\'k Mostawa Elshobohat (Above Suspicion), Hekayty (My Story), and Haret El Yahoud (The Jewish Quarter).','25 December 1987','https://media.elcinema.com/uploads/_315x420_15a60dd07332a0733f5aea7fef5ac1ce7c2e6eb9dfb99ce24a859597f4cc091a.jpg'),('Ahmed Nader Galal',1056530,'Egypt','أحمد نادر أحمد جلال ','Ahmed Nader Galal is the son of renowned director Nader Galal and grandson of one of Egyptian cinema’s pioneers, Ahmed Galal. ','NONE','https://media.elcinema.com/uploads/_315x420_1f1a9c28348ded79b64ce1bac9b1d1594adbc58a5afdfa7c202b108593dab5f9.jpg'),('Ahmed Rizk',1056531,'Egypt','Egypt','Ahmed Rizk is an Egyptian actor who was born in Alexandria. He is characterized by a heavy stature and a good sense of humor. Rizk moved to Cairo and began his performing career with a film titled “Sitt al-Sittat” in 1998. Thereafter he worked on several films, “Film Thaqafy” (“Educational Film”) was particularly helpful for his career. Rizk also starred in “Sharm Baram”, “Shabab ‘ala al-Hawa” (“Youths on the Air”) and “Mafia” where he acted alongside Ahmed al-Sekka. Following those efforts he acted in “Ew’aa Weshak” (“Watch Out”). His most recent title was the film “Hawishy elly Waqa’ Mennik”(“Pocket what You Lose”) where he starred with ‘Ola Ghanem. Rizk has also taken part in several television productions including “Gohha al-Masry” (“The Egyptian Gohha”), “Awraq Massriyah” (“Egyptian Papers”), “Sara” and the sitcom “Foush”.','23 March 1976','https://media.elcinema.com/uploads/_315x420_8697aaebb014eab1529641288fa767daf6932915ddb14f513d158e414a6c2743.jpg'),('Lotfy Labib',1056613,'Egypt','Egypt','Lotfy Labib, born on August 18, 1947, is an Egyptian stage, television and film actor. He also worked as announcer at one point. Despite having graduated from the Institute of Theatrical Arts in 1970, Labib\'s career was delayed for a whole decade. First he was drafted in the army for six years, and then traveled outside Egypt for four years. His career truly started in 1981, when he acted in the play \"The Bald Singer,\" which he followed with another stage production \"The Hostages.\" Labib has since then worked profusely, in many supporting but memorable roles, with over 200 film and television credits. Though many of his screen appearances have been brief, Labib has performed admirably and has shown himself to be one of the strongest performers of his generation. ','18 August 1947','https://media.elcinema.com/uploads/_315x420_394fc562f16aa9f1a6b98676ed5af08ae1aeb18d6dcb3d2b65ec2dc04c2cf295.jpg'),('Sayed Ragab',1056639,'Egypt','Egypt','Sayed is an Egyptian actor. His debut came in the cinematic production “Ahlam Saghira” (“Minor Dreams”). Thereafter Sayed appeared in a variety of minor roles.','16 November 1950','https://media.elcinema.com/uploads/_315x420_cad527a38515d2fc96c4d39d22158bf7e1070210763baa3e26afce62a5192c98.jpg'),('منى جمال',1056647,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Naeim Issa',1057161,'Egypt','Egypt','NONE','6 January 1937','https://media.elcinema.com/uploads/_315x420_510724ebaa01acf9a47059a1b33360e771e8c178bc1d9361ced493ef5770ad45.jpg'),('Entsar',1057293,'Egypt','Egypt','Originally an economics major, Entesar began her career as an actress completely by chance.  She starred in a few college plays and her friends encouraged her to try out for the movie \"Apple\" which she later landed a role in.  She was discovered by Ra\'fat Elmeehy, and would star in many TV shows including \"The Stake\" \"The Earthquake and its After Shocks\" and \"Adventures of a Modern Husband.\"','8 January 1971','https://media.elcinema.com/uploads/_315x420_f7b8c7de548ea0749db3b9240d976d854896460bd1421a69b534a8cc85dec785.jpg'),('Mona Youssef',1057345,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d8465f9b0aa237662d2eb1cea3587226453984c4bb5351710790483e81f8352f.jpg'),('El-Sobky Film Productions',1057658,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e87dc2fda366bc3993b06584afc3575f21e7bf1c88e9c9a35e78b7cfec9480cf.jpg'),('Ali Idris',1057698,'Egypt','Egypt','Aly Idris started his career upon his graduation from the High Institute of Cinema in 1988, and working as an assistant director starting with the movie  “Youth On The Edge”  in 1990. Following this movie were many more hits. He worked as an assistant director for 23 movies as well as some very famous television series such as  “The Miser and I”. \nAfter that he moved on to work with big directors such as Sherif Arafa and Aly Abdel Khalek and more. His first exclusive direction was “Friends or Business” starring Mostafa Kamar and Hani Salama then following that were many more including the “Danish Experience” that received an award for direction. \nAly Idris is married to author and script writer Zeinab Aziz working together in more than one movie. \n','14 November 1963','https://media.elcinema.com/uploads/_315x420_494ec1b6cfea0485886b1807f3dd77d1eb5ffb5e80f53b82315df07aaf0c46b1.jpg'),('Nader Hassan',1057836,'Egypt','Egypt','NONE','23 March 1978','https://media.elcinema.com/uploads/_315x420_0f3b86ce905103793be631ee3fe5753c1280f8f8cb6ab335f40b35ed8f64a923.jpg'),('Ali Abdulmonem',1057910,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_39e39158afcf193b7db51b43c31a6eb0bed2863fe39b71dc22c0d22d95f8fe16.jpg'),('Ali Hassanein',1058209,'Egypt','12 August 2015','NONE','13 January 1939','https://media.elcinema.com/uploads/_315x420_ce319136da707cc27adcd38e478bfdf417685f5ba33d25fe768aad3314b1974c.jpg'),('New Century Art Production',1058236,'Egypt','NONE','In 2004 Dollar Film Company opened its new production branch “New Century” to produce high quality Egyptian movies. Where it started with the movie “The 7th Sense” written by actor Ahmed Mekky for the first time, before achieving his current success as an actor, it was also the first movie for actor Ahmed El Fishawy.\nThe company also introduced script writer Mohamed Diab, and director Mohamed Gomaa for the first time in the movie “Real Dreams” in 2007. \n','NONE','https://media.elcinema.com/uploads/_315x420_d9015b5845c2cd32f413317669fc4b3e4475e05e9f2fb5c47910c1b7c7fa981e.jpg'),('Bondok',1058442,'Egypt','محمد شحاته ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Muhammad Sabri',1058484,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_be56952c43f3b0b3822369550bc500cc50418143e9583e9fb7c4bcbd90203ed8.jpg'),('Nohir Amin',1058666,'Egypt','Egypt','NONE','5 March 1945','https://media.elcinema.com/uploads/_315x420_9ac87f7abc789abc5c3648008d5056c0d98433590e08c2b346b2dbe13a7fd343.jpg'),('Raouf Moustafa',1058849,'Egypt',' 1 October 2017','NONE','1 October 1940','https://media.elcinema.com/uploads/_315x420_09f529d8e9cbbdc2b837dbbb7651d2ce27fd2ea44bb0e326c9c1e1f7a62d5601.jpg'),('Ashraf Saleh',1058870,'Egypt','Egypt','NONE','29 January 2021','https://media.elcinema.com/uploads/_315x420_9d327fcf9c826f9d271db8560e90aba1d2d73fa5e26d6e283370587ca5ed1ca2.jpg'),('Moustafa Haridy',1059122,'Egypt','Egypt','NONE','8 December 1975','https://media.elcinema.com/uploads/_315x420_986ea5e51d191aaf3f19a78a61ed97915c127746e57726abe7c29e3c89acdc8e.jpg'),('Ehsan Abd El Kodos',1059208,'Egypt','12 January 1990','Ihsan Abdel Quddous was an Egyptian writer. He studied at the faulty of Al-Azhar, and also studied law. His literary career spans nearly 50 years and 600 novels, and is known to have written 49 novels that have been adapted to films, including \"La Anam\" (I Don\'tDon\'t Sleep), \"La Tasa\'alny Man Ana\" (Don\'t Ask Me Who Am I) and \"Ana Horra\" (I\'m Free). As a journalist, he was involved in political activism, and was sentenced to prison several times as a result of criticizing the regime. He died in 1990.','1 January 1919','https://media.elcinema.com/uploads/_315x420_8f9533a77a7196f9a770a6fdebf46d409149ce87f4d63d1638ff75fcaf82d844.jpg'),('Mohamed El Hadidi',1059331,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_82c6a55caf163f32c9b2cf596d1b1f30f1667f628f7004c442ed2e6f01e4a430.jpg'),('Ahmed Samir',1059338,'Egypt','Egypt','NONE','28 September 1974','https://media.elcinema.com/uploads/_315x420_564f1bbbb778ce519e96e93a43bddc3910e306efebb509b38b783a61fbb6d91b.jpg'),('Mahmoud Masoud',1059342,'Egypt','Egypt','Mahmoud Masoud, born in 1952, is an Egyptian actor who received his Bachelor’s degree from the Higher Institute of Dramatic Arts in 1975. After graduating, Masoud worked at the Vanguard Theater, then starred in a number of films, among them “Maganeeno,\" “Al-Motamarid” (The Rebel), “Al-Sharisa” (The Fierce), and “Hikaya To” (The Story of To). Afterwards, he had roles in several television serials, including “Al-Liqa’ Al-Thani” (The Second Meeting), “Mughamarat Zakia Hanem” (The Adventures of Zakia Hanem), “Gomhorreya Zefta” (The Republic of Zefta), and “October Al-Akher” (The Other October). ','3 September 1952','https://media.elcinema.com/uploads/_315x420_b2dc9bb2d1d324fb245d3d46d974b2f6a6b1274905dd1c5e66ea8149f322cb60.jpg'),('Nabil El-Hegrassy',1059476,'Egypt','19 January 2013','The famous actor Nabil Ahmed El Hagrasy was born in Alexandria. He was married to actress Isaad Younis when she was still an anchor after a while they got divorced.\nNabil Ahmed has presented many plays including \"Asl Wa Soura- Origin and Copy\", \"Ana We Meraty We Gozha- Me, My wife and her husband\" in addition to \"Alsalouka\", \"Al Tartour\" and \"Makaleb Makhrous- Mahrous Tricks\".\nHe also starred in \"Alaab Al Masry- The Egyptian dad\". He was always known for his comic humor and playing the role of the hero\'s friend. He proved himself on stage more than cinema.\n','31 January 1937','https://media.elcinema.com/uploads/_315x420_c6d9bdfa63449180c626068fc36eaae38e11bf1c65ecd6ef5a2ea9dd4b95269a.jpg'),('Mirna Al Mohandes',1059493,'Egypt',' 5 August 2015','An actor who personalized the sweet naughty girl in TV series “Banaat Afkaary i.e. My brainchildren”, “Ta’aala nehlam be bokra i.e. Let’s dream for tomorrow” and “Nagmat al-gamaheer i.e. The superstar”.\nCharacterized by simplicity, Mirna returned after being retired for health reasons.','3 May 1976','https://media.elcinema.com/uploads/_315x420_8ab1f8b850072aad4b2021c2568d9233c39fac39968abdc9952bc8d3f41c10b2.jpg'),('Essam Al Shammaa',1059705,'Egypt','Egypt','NONE','29 November 1955','https://media.elcinema.com/uploads/_315x420_3e0cccc490706d7307d9382f638781602ef740962add15509a85d10cb7bfb93f.jpg'),('Ayman Abu Makarem',1059728,'Egypt','Egypt','NONE','18 December 1964','https://media.elcinema.com/uploads/_315x420_6926d7dadd7bec7453cfaaccc7b659551d83ca903f202b96972ba9d3f98d1801.jpg'),('Reda Hamed',1059843,'Egypt','Egypt','NONE','29 August 1954','https://media.elcinema.com/uploads/_315x420_2eddee11e01cc22848ab4f963daeecfbc4278510931d485993db0ae0f1ca3579.jpg'),('Hamid El Shaeri',1059892,'Egypt','Libya','Famour singer, composer, mixer, producer since 1982. His father is Libyan and his mother is Egyptian. He has made the musical arrangements for many other singers of his generation including Simone, Ali Hemayda, Hisham Abbas, Faris, Hanan, Mona Abdel Ghany, Amr Diab, etc.  He also tried his hand in acting such as in the film “Hazelnut Shells.”','29 November 1960','https://media.elcinema.com/uploads/_315x420_87ab46b166f0a127c055ace20649dff4b67d69c35bdb2d74d2c979f1cc85735c.jpg'),('Youssef Fawzy',1059896,'Egypt','Egypt','Youssef usually protrays powerful and villainous characters in his performances. He has assumed several minor roles in productions but (the filmmaker) Nadia Al Guindy has assigned him greater roles in her pictures. \nYoussef also participated in several television series.','16 July 1945','https://media.elcinema.com/uploads/_315x420_c871c4c4e7ac4b9a4f6dbdb693ef9e2f8da7641d4c6e0f0efda2cb8c16d9ab42.jpg'),('Hady Al Bagouri',1059990,'Egypt','هادي جميل الباجوري ','Haady al-Baagoury in an Egyptian director born to an artistic family; his father Gameel is a producer and journalist, his brother Saameh is a scriptwriter and his maternal aunt is superstar Zizi al-Badraawy. Haady started his career as an executive producer, later on; he directed more than 300 hundred video clips and TV commercials.\nAl-Baagoury entered the field of TV drama, but a in different way, he has decided to use cinema techniques in terms of directing, filming, editing and casting. His series “Ard khaas i.e. Special offer”, is the first series in the Arab World to sustain cinema technicalities.','NONE','https://media.elcinema.com/uploads/_315x420_974c5ef29d29c0b2f0f26f1f63db50847869d8897029ca73c25ce8c98a884ea9.jpg'),('Majdi Abdulhaleem',1060134,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7b01afb077bba3328428028bf64ac056b33559e68d66baed25b05b325b02b8d2.jpg'),('Mayar Al-Beblawy',1060239,'Egypt','Egypt','NONE','24 December 1972','https://media.elcinema.com/uploads/_315x420_8bb893ef8cda98aa93007b783ee6a26c88e2413cd8c6b36775d5d3b5c6c2cc05.jpg'),('Nesreen Youssef',1060487,'Egypt','Egypt','NONE','26 October 1979','https://media.elcinema.com/uploads/_315x420_50471d73a20abe9b0904005eadd6530c99125e27af5fd4d46ab081204cd9e297.jpg'),('Hany Gerges Fawzy',1060742,'Egypt','Egypt','Hany is among the(most significant producers in Egypt). His father is the well-known producer Girgis Fawzy. His first experience as a producer was on the film “Bedoun Reqaba” which met with great success at the box office.\nHany’s films are bold with regards to their methods and content. When working on his first film, “Bedoun Reqaba”, Hany took the bold step of forbidding the promotion of the film on satellite television due to the fact that it included (controversial) scenes. Moreover, (regulating bodies) deleted several scenes from the film and classified it as suitable for adults only. Hany continued his career with the film “Ahasees”.\nOn art, Hany has said “Art has no relationship to mores, however, there are those who abuse this notion in order to present films that are void of meaning and purpose and are intended simply to generate revenue.”\n','NONE','https://media.elcinema.com/uploads/_315x420_943eae1f6194611d04446b004c4e2de04a388f9b5ae2c4484a95b5aeea50ff22.jpg'),('Ryad El Kholy',1060808,'Egypt','Egypt','Reyaad Ebraheem Metwally al-Kholy, graduated from the High Institute of Dramatic Arts in 1976. In 2001, Reyaad was appointed director of the Comedy Theatre. Among his notable TV series are; “Shaare’al-Mawardy i.e. Mawardy street”, “Nour al-kamar i.e. Moonlight”, “Al-‘aaela i.e. The family”, “Gesr al-khatar i.e. Bridge of danger”, “Al-faraar men al-hobb i.e. Escape from love”, “Ams la yamout i.e. Yesterday never dies”, “Al-Zeiny Barakaat”and “Om Kolthoum”. “Mama America” and “Al-naas elly fel-taalet i.e. People in third floor” are among his famous stage roles.','29 January 1953','https://media.elcinema.com/uploads/_315x420_efbe5ed0016532b0b846b9b7cf0c53576580d9aaed46680585f9ac144ed98899.jpg'),('Hanaa El Shorbagy',1060952,'Egypt','Egypt','NONE','22 December 1946','https://media.elcinema.com/uploads/_315x420_b56d23fe7b89093e621f47c6de599ac426589692a6a80559e64f518ce4946657.jpg'),('Nashaat Abdel Latif',1061102,'Egypt','نشأت عبد اللطيف عباس علي ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3a718b69caff42aea8d7a638955f07f3e9eaff8ee628a82fa9e4b571005c22bf.jpg'),('Hussien El Emam',1061156,'Egypt','Egypt','Hussein is an actor, a musician and a producer. He is the son of director Hassan el-Emam and has sung at several events. Hussein is married to the female artist Sahar Ramy. He holds a bachelor’s degree in fine arts and he has had a brilliant performance on the 2002 comedy show “Hussein ‘ala al-Hawaa” (“Hussein On the Air”) which was followed by “Hussein fee al-Studio” (“Hussein in the Studio”) in 2003.','8 February 1951','https://media.elcinema.com/uploads/_315x420_5fe03ff6631ad22b23b5c8f3335b3e52f6c0c5172828453af8d196747d82ea9b.jpg'),('Talaat Zein',1061167,'Egypt','14 August 2011','Although Tal’aat was born in Alexandria he was raised in Cairo. His grandfather was an officer in the Egyptian army during the reign of King Fouad and was the governor-general of the town of Port Sudan. Whilst there his grandfather married a Sudanese woman.\nZein began his career as a musician in a group called “Qittat Sagheera” (“Miniature Cats”) but later transferred to singing. He first rose to fame when he performed a song titled “Ta’aaly” (“Come Here”) with A’mr Diab. Zein has performed alongside Yahya Al A’alamy in the television series “Al Hawwy”.\n','14 February 1955','https://media.elcinema.com/uploads/_315x420_6dbf7d401b86ae2a54c054146b3b3c97c61b2f47d5c06624838917b3a5d8790e.jpg'),('Sherein Reda',1061285,'Egypt','Egypt','She is the daughter of artist and star Mahmoud Reda. She started off her career working in advertisments and doing Ramadan riddles. Shereen then married pop star and singer Amr Diab, only to get a divorce from him after having her first born daughter \"Nour\".','12 July 1968','https://media.elcinema.com/uploads/_315x420_44d97f88a158961d828e202c2fb9f8e78aca62c4d1a52ba79e7c7066225606b5.jpg'),('Rami Wahid',1061518,'Egypt','Egypt','Ramy Wahed’s love for art began at a young age. This was due to the attachment he had to his departed father Samir Wahid, who worked on theatrical productions in which Ramy participated. While at university, Ramy formed an inter-university acting troupe. His cinema debut was in the film “Al Garaj” where he acted alongside Nagla Fathi and Farouk Al Fihawy. Ramy had strong relations with the director Mohamed Al Naggar who was his father’s friend. Ramy acted in “Qalb Garea,” after which he was cast in many television series. Director Ahmed Yahya took note of his talent, and later gave him a major role in the series \"Al Banat.\" Wahed continued to prove himself as a versatile actor in a number of television and film roles. His best known work, however, is his performance in the film \"Omar wa Salma\" (2007). ','17 April 1975','https://media.elcinema.com/uploads/_315x420_06ffda05805362ccabdb275fd6d05527c82f13a8e36bf8401e6ae4ecdabfe496.jpg'),('Sameh Ser Al-Khetum',1061893,'Egypt','Egypt','Author and script writer Sameh Ser El Khetm created success when he wrote the script for movies such as “Howa Fee Eih” or “What’s Going On” in 2002 which was considered a hit comedy. The comedy starred Ahmed Adam and singer Mohamed Fouad.\nFollowing this success was the movie “Eli Bali Balak” in 2003 for actor Mohamed Saad. Sameh also participated with writer Walid Seif  and Mohamed Nabawi in writing other scripts such as “Without Censorship” \n','NONE','https://media.elcinema.com/uploads/_315x420_3263bd4e6bc63f52e591847ded58f7d3ae160e3804739ae215a5b417e1853f6c.jpg'),('Mohamed Sharaf',1061901,'Egypt','Egypt','Mohamed Saharf is an Egyptian actor born on the 19th of February 1963. He graduated from the Commercial Technical Institute in 1984. Afterwards he head to Cairo to begin his artistic career with \"Arabisc\" series and \"Houda Karama\" theatrical play.','19 February 1963','https://media.elcinema.com/uploads/_315x420_e19127bfe83a34fe32a96925dce59eacbecb1d38bc5ef6c2ee7be987282cd3ec.jpg'),('Ali Jamalelddin',1062733,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9369506380011b66a67a5881c8fb7632088ac80eb21e40186ab6c3e3b465cec8.jpg'),('Jalal Rajab',1062773,'Egypt','Egypt','NONE','16 July 1961','https://media.elcinema.com/uploads/_315x420_85e085a5699e0bc3ff5031f25589a2eb39720d5c98f1188bee489d95d51e81f4.jpg'),('Bashir El Deek',1062814,'Egypt','Egypt','Bashir El Deek is an Egyptian cinema figure. El Deek earned his Bachelor’s Degree in commerce from Cairo University in June 1966. Prior to the start of his career as a screenwriter he authored several short stories, publishing them in magazines in Egypt and across the Arab World.d. \nHis debut as a screenwriter came in the film “Ma’aa Sabaq Al Assrar” which was directed by Ashraf Fahmy. The film starred Mahmoud Yassin, Nour El Shereef and Mervat Amin and began screening on February 1978.\nBashir has directed “Al Toufan” (“The Deluge”), a movie which starred Mahmoud A’bd Al A’ziz, Farouq Al Fishawy, Mahmoud Al Guindy and Amina Rezk. He has also directed “Sikkat Saffar” (“Traveller’s Way”) which starred Nour El Shereef, Noura, Hassan Moustafa, A’bd Al Salam Mohamed, Ahmad Badeer and others.\nBeginning in 1984 and continuing till today, Basheer has provided screenplays for several television series. Basheer has also worked on animations whereby he wrote the screenplay for “Al Faris wa Al Amira” (“The Knight and The Princess”) and directed the work following the death of the original director Mohamed Hassib. \n','27 July 1944','https://media.elcinema.com/uploads/_315x420_58b70542939f776df6918daf27008fece872427d816e1194721ef04e1327e0a7.jpg'),('Fathy Al-Gendy',1062884,'Egypt','NONE','Fathi El Guindi is a young script writer who shone amongst the many script writers with his unique work, and in a very small amount of time was able to prove himself against all odds. He did the series “Kareoka” which is the biography of the late legendary Taheya Kareoka. He also wrote the series “Nouna the Matrimonial Lady” which played during Ramadan 20111, staring Hanan Turk. ','NONE','https://media.elcinema.com/uploads/_315x420_fea073892e44b138b2aa18b9cbabda40c2b73282ddd46491796a7a1277294fca.jpg'),('Gamal Ismail',1063170,'Egypt','18 December 2013','Gamal El Din Ismail Hussein was born in Cairo. He earned a degree in history from the Faculty of Arts of Ain Shams University in 1957, and a bachelor\'s degree from the Institute of Theatrical Arts of Cairo in 1956. He started working as a theater supervisor in the city of Alexandria in 1958. He then directed plays made by university and public companies acting troupes. He was first recognized when he played a role in the play “Sheia\' Fi Sadry” (Something Inside Me), after which he appeared frequently in many successful plays, like “Sayedaty el Gameela” (My Fair Lady). In television, Gamal Ismail worked in many shows that were considered landmarks of their periods, like “Ze\'ab El Gabal” (Wolves of the Mountain) and “Layaly El Helmeya” (Nights of Helmeya). His last appearances were in the TV series “Al Qasirat” (The Minors) and “Khalaf Allah”. He died in his house in 2013 after suffering a heart attack.','20 February 1933','https://media.elcinema.com/uploads/_315x420_7c896aa563b763d0902b40a62fdd4c1c6e1983e9525042239aa0a9c89554f613.jpg'),('Dina',1063300,'Egypt','Egypt','Dina Talaat Sayed Mohamed, born in Sayeda Zainab, studied folkloric art and has a Masters in Theater. She was married to director Sameh Elbagawry and they had a son together before he passed away. She is one of the most famous belly dancers in the world, and often portrays a belly dancer in her TV and silver screen roles, including the lead in \"Ibn Ezz\" opposite Alaa Wali Eldin.','27 March 1965','https://media.elcinema.com/uploads/_315x420_2bee9e18d5269721834bf4c80a6d6abc28b86a82144691740537f832bd3196e1.jpg'),('Youssef Maaty',1063500,'Egypt','Egypt','Youssef is an Egyptian (screenwriter) who began his career as an (announcer) on television. He (became well-known) after he presented a television program titled “Al Sitt di Umee” after which he (has issued some publications).\nThat was until he got to know “Adel Imam”. Thereafter the two collaborated closely in what many have characterized as a (?) association due to the fact that he is the scriptwriter for all of Adel Imam’s cinematic, theatrical (and television) performances. \nYoussef has also worked with Ahmed Adam and Mohamed Heneidy and can be considered one of the best (satirical) writers in Egypt and the Arab World.\n','25 August 1963','https://media.elcinema.com/uploads/_315x420_d108ae3d5cac79636a61bf9fb65b2c67aa4f7117e97911dd75f96edde4b95859.jpg'),('Khaled Sarhan',1063608,'Egypt','Egypt','NONE','25 September 1979','https://media.elcinema.com/uploads/_315x420_fe7bf1df766109f46d3ee18a1305e58a81398591c4c942254db1dc8c7953dc15.jpg'),('Nagy Saad',1063681,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a61c3dc7125c11eb84eb68334a1dffa64cb2e97a30c2498b38c3e55c717e5704.jpg'),('صفوت عبدالخالق',1063978,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sanaa Shafea',1064111,'Egypt','Egypt','Sanaa Shafea is an Actor, theater director and Egyptian academic professor. He was born in the village of Mocha in Assiut Governorate in Upper Egypt. He stayed in the village for about 8 years before moving to Cairo with his father, who was a scholar of Al-Azhar Al-Sharif. He studied primary school at Al-Gamaliya Primary School. He discovered his passion toward art and joined the amateur teams on Emad Eddin Street until he went through the academic studies to graduate from the Higher Institute of Dramatic Arts.. Sanaa worked as a teacher and became the dean of the Institute, and worked on television, cinema and theater. Where he directed the play Don Quixote in 1975, and one of his most important film works was Raouf\'s (Not to Smoke) and Ibrahim\'s role in the famous TV movie Fawzia the Bourguine. He played a pivotal role in most of the film\'s events. , Has participated in several series of the most important (Zinni Barakat) and (Hazrat accused father) and (Hanan and Hanin) and (Bab al-Khalq) and (slap) and (after the beginning).','25 January 1943','https://media.elcinema.com/uploads/_315x420_7d431add3c2ad122b3bdc298aca2ceef988c795a062913073fc79852a30a4266.jpg'),('Ehab Ayoub',1064356,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bd863e291380d4ba4452d9069ff48f43e94030401f26a1f084725a7f969ce160.jpg'),('Mohamed al Moatasem',1064418,'Egypt','Egypt','NONE','2 July 1972','https://media.elcinema.com/uploads/_315x420_8414119c9df86797c2ed91d29211460937e98a894f0a2d848560c702637b3aed.jpg'),('Tamer Hagras',1064421,'Egypt','Egypt','Born on November 6, 1972, Taamer Hagras is an Egyptian actor who started his career as a model in fashion house owned by the Palestinian producer Muhammad ‘Aayesh. \'Aayesh instantly spotted Taamer’s talent and pushed him to his first cinema role in “Borkaan al Ghadab\" (Volcano of Anger). His second leap forward was his role with the legendary Adel Imam in the film “Al-tagreba al-Danimarkeyya\" (The Danish experience).  Taamer has worked on a number of TV shows: “Amaaken fel-kalb\" (Places in the Heart), “Kalb al-Donya\" (The Center of the World) and “Kalby Yonaadeek\" (My Heart is Calling You). In 2006, Taamer played a leading role with Yousra in the film “Ma teegy Nor’os\" (Let’s Dance) and appeared that same year as a guest of honor in the first four episodes of the series “Lahazaat Harega\" (Critical moments). Hagras\'s other film credits include  \"Amalaeyaat Khaassa\" (Special Operations) and Abdul ‘Azeez Hashshaad’s “Al-balad Di Fiha Hokouma!\" (There\'s a Government in this Country!).','6 November 1972','https://media.elcinema.com/uploads/_315x420_f7582e298ddc509a2329ceb47e6f1b61a34d195175cafca87829acdb2481fb45.jpg'),('Hala Shiha',1064474,'Egypt','Egypt','A retired actor, is the daughter of the plastic artist Ahmad Zulficar Sheeha and sister of actors Hana, Inaas and Maya. As a young actor playing the role of super star Hussein Fahmy’s daughter in the TV series “Kalemaat i.e. Words” has caught the audience eye. However playing the role of Manaar with great talent in series “Al-ragol al-aakhar i.e. The other man” with super stars Nour al-Shereef and Mervat Ameen launched her career. Hence, filmmakers gave her lead roles in “Al-sellem wal-tho’baan i.e. Snakes and ladders”, “Al-Lemby” and “Arees men Geha Amneya i.e. A Security Service Groom”. Young as she is, Hala decided to retire gradually after becoming more religious. She appeared veiled in her last film “Kaamel al-awsaaf i.e. The perfect man” with Aamer Mouneeb then she retired acting. She joined Nesreen, Hanaa Tharwat, and Hayaat Kandeel in retiring at such a young age. Hala lives away from the lights of fame in Alexandria where she leads a quiet life with her husband Youssef Harrison, an Italian/Canadian who converted to Islam.','23 February 1979','https://media.elcinema.com/uploads/_315x420_4061d0ce8231048f7b8dccfe1e16bf9e7e1cfc66dba24b213bd5bcc1c0a88991.jpg'),('Adel Ammar',1064489,'Egypt','Egypt','NONE','17 June 1965','https://media.elcinema.com/uploads/_315x420_c227f9e1f4f68023dc2fc4e61f73343598088504c3bdefb2e0c76fff8e504dd1.jpg'),('Ahmed Rashwan',1064635,'Egypt','Egypt','Ahmed Rashwan is an Egyptian director, screenwriter and producer. Rashwan also manages a production company called “Dream Production”.\nRashwan earned a degree in law from the University of Alexandria in 1990. In 1994 he earned a Bachelor’s degree from the Higher Institute for Cinema at Cairo. He has directed several documentary and short titles which were screened at several international film festivals where some won awards. Rashwan has also produced several documentaries and shorts and has worked on several foreign titles which were filmed in Egypt. Moreover, Rashwan has also served on the judging committees which looked at documentaries and shorts in all of Egypt, Lebanon, Tunis and Italy. \nAhmed Rashwan has authored a book about the documentary director Samir ‘Ouf and has also prepared a book on independent cinema in collaboration with Hussam ‘Elwan. Furthermore Rashwan has taken part in the organization of several film festivals and other similar programs which include the organization of awards ceremonies for Egyptian and Tunisian film festivals. \nRashwan has written film reviews for several Arab and local magazines and newspapers which include the “al-Hayaa” international newspaper. Ahmed Rashwan has also been involved in cultural programs and workshops set up in Cairo, Lebanon, Spain and the United States. The filmmaker has also taught documentary filmmaking in Cairo between 2005 and 2006. \nRashwan is a member of the executive committee for directing young filmmakers at the “Rusul al-Hourriyah” workshop. His first experience writing and directing a narrative film came in 2008 when he wrote and directed “Basra”. The work was screened at several local and international film festivals and received several awards. Rashwan is currently working on his second narrative title “Ta’mm al-Hayaa” (“Taste of Life”).\n','23 October 1969','https://media.elcinema.com/uploads/_315x420_852b86a50a8253c07f3142d9fc2798875e4195b396afc3e45fa1e4da5e17a9da.jpg'),('أفلام مصر العالمية للانتاج والتوزيع',1064706,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('عبده أمين',1064718,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Abdel Megid Khedir',1064853,'Egypt','Egypt','NONE','10 January 1953','https://media.elcinema.com/uploads/_315x420_64eafce1f1831a475b8f2bc94e8eb1fbc7c4720cd1b5dba7a9068e32f9fedc30.jpg'),('Sahar Rami',1064927,'Egypt','Egypt','Sahar Rami is an Egyptian actress who joined the Higher Institute for Dramatic Arts with her sister Ola Rami to study ballet. She started her career as commercials actress where she attracted the casting agents\' to her. She worked in Ramadan\'s famous riddles with comedian Samir Ghanem and from there she participated in many movies and plays with stars like Adel Imam and others. ','20 June 1961','https://media.elcinema.com/uploads/_315x420_e24b291b589cd7804eda9311bdffc9e9f0e3ebbe7bf54aec536202fe2f718b91.jpg'),('Tarek Al Amir',1065282,'Egypt','طارق الآمير ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b802d47073c617e3d7c91c34e34905a6f98e2eb09df415982b97f76720a4f337.jpg'),('Ashraf Amin',1065295,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8bff092fb4916d0a6c3d6ed91c953771cdb3c8648719089e3be5df6bdaa115c0.jpg'),('Nahed Nasrallah',1065379,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9449efaeec99e1ee3d2807b9ff39cd362998606524776bf6c4eb28dd67725e5f.jpg'),('Huda',1065389,'Egypt','Egypt','NONE','29 July 1976','https://media.elcinema.com/uploads/_315x420_265068c8877d8c682140d877ef2ac11e8741ea1b489c44825b7968bb0ac1d074.jpg'),('Wael Abdallah',1065477,'Egypt','Egypt','Wael is an Egyptian producer, director and distributor. He was born on the 18th of May, 1965 and began his film career when he directed “Hayyat Al Gawhary” (“Al Gawhary’s Life”), a television production which starred Yosra and went on to become one of the ‘90s most successful series. Wael then proceeded to provide a unique adaptation of a Naguib Mahfouz novel through a series titled “Al Seyra Al A’shouriya”. That work featured the talents of Nour El Shereef. Thereafter Wael set up his own production company in 2003. The first film produced by that company was “Mallaky Al Iskandiriyah” (“Licensed Alexandria”). Wael provided the screenplay for that production which went on to achieve great success, thus supplying him with momentum to continue his career. Some of the titles which followed were “Badal Faqed”, “Masjoon Transit” and “Samir wa Shahir wa Baheer”. The producer now seeks to bring together the talents of performers Ahmed El Sekka and Ahmed E’zz in a production titled “Al Maslaha”. That latest title is directed by Sandra Nashaat and is set for release in 2011.','18 May 1965','https://media.elcinema.com/uploads/_315x420_1ca06288098c6dc6c35da337e8d4a83a48da61efeb1c7bc6913bf73c0c851d6e.jpg'),('Maher Maher',1065713,'Egypt','NONE','Mokhtar El Sayed is an Egyptian actor who started acting at the beginning of the 1950s with the film “El Zohour El Fatina” (The Tempting Flowers) in 1952. He had a number of small roles in films, such as a doctor, officer, or employee. He continued to play distinguished smaller roles, but he never had a starring role in his 40 year acting career. His last film was “El Sageena 67” (Prisoner 67), and his most famous work was “El Ra’aasa We El Tubal” (The Dancer and the Drummer). ','NONE','https://media.elcinema.com/uploads/_315x420_db60fd7d28743d7bc5b10c20c2dbbfac4b0fe2ecc1b1f09cef0a6dea4ac2d414.jpg'),('Mostafa Amar',1065773,'Egypt','Egypt','Mustafa Ahmed Mohamed Ahmed Amar was born to a father who worked as an engineer. Mustafa birthplace is Alexandria, he studied at the faculty of agriculture and was married at a young age. Mustafa is a musician and a composer, he rose to fame by virtue of the success of his albums of the likes of “Quloo li fein Habibti” (“Tell Me Where My Loved One Is”), “Ya Wad Ya Iskandarani” (“Oh, Alexandrian”), “Taal Al Leil” (“It’s been a Long Night”) and “Ya Ghazali” (“My Precious”).','22 September 1966','https://media.elcinema.com/uploads/_315x420_e4cc9a017b38854a4e6e30082ef6342d6877416a90fd923f78837f1fb08bc707.jpg'),('Ashraf Abdulaziz',1065831,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d219b4ebfeaf686c36b10d175f78bb25277ff33aeadfd01c9743e40d969e50ba.jpg'),('Mohamed Lotfy',1066039,'Egypt','Egypt','Mohamed Lotfy is an Egyptian actor who was born in Alexandria in 1968. He graduated from the acting division of the Institute of Cinema in Cairo. Lofty began his acting career in cinema with the film “Caberia” (1990) starring alongside Ahmed Zaki. He has since appeared in many films in supporting roles including: “Amreeka Sheeka Beeka” (1993), “El Bahar Byadhak Leh?” (Why Does the Sea Laugh?), “Isharet Marour” (Traffic Signal), “Hysteria,” “Cabaret” (2008), and “Halwet Ruh” (Rouh’s Beauty; 2014). Lofty has also appeared in numerous television series such as “El Sira El Hilaleya” (The Hilaleya Biography), “Milh El Ard” (Salt of the Earth), “Sharaf Fetah El Bab,” and “El Adham.”\n','17 October 1968','https://media.elcinema.com/uploads/_315x420_a068c082fc666bcf1debf116a39c965427b8d88dfd2b1c6d396b4106c7087f5f.jpg'),('Ahmed El Morsy',1066059,'Egypt','Egypt','NONE','10 March 1977','https://media.elcinema.com/uploads/_315x420_c7fcccb716f2a366ba345f057ae452ef61ee44e8d7d59911d935724a9cc94644.jpg'),('Nader Salah Al-Din',1066119,'Egypt','Egypt','Nader began his career in cinema by writing the script for “Howa fee Eih?” which starred Mohamed Fouad and Ahmed Adam. Thereafter Ahmed moved on to write films which starred most of Egypt’s comedy actors, performers of the like of Ahmed Helmy and Mohamed Sa’ad. \nNader has also directed a theatrical production in 2009 titled “Braksa”.\n','NONE','https://media.elcinema.com/uploads/_315x420_3e1df8914441c483be8064edb3f038e466139f21111b1ece727d903e193c88e0.jpg'),('Hamdi Abdel Rahman',1066196,'Egypt','NONE','The famous Egyptian decoration designer, Hamdi Abdel Rahman was born on the 10th of November 1977. He designed the decoration of many movies and received many awards. ','NONE','https://media.elcinema.com/uploads/_315x420_47112beaaec9424a4fcc2ed5968b2d60d56c9e3dd0912f2459d633643dad04d8.jpg'),('Dina Farouk',1066321,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_600314b082f378978e7481a5a16134430e82c70fb93d87efac6cf377107b4206.jpg'),('Salma gharib',1066339,'Egypt','Egypt','NONE','5 October 1970','https://media.elcinema.com/uploads/_315x420_60869a165c7510953927b75409cd67b9d4965b85cf207bd449bdeaf0b7221450.jpg'),('Mohanad Hosny',1066415,'Egypt','Egypt','NONE','21 October 1992','https://media.elcinema.com/uploads/_315x420_b77e441f65a04aa5e4e538520745be1ee91fa353877eeeaa4dd35c0370fbe978.jpg'),('Serag Mounir',1066435,'Egypt','13 September 1957','Seraag and directors ‘Abbaas Kaamel and Fateen Abdul Wahhaab were born of the same family. He was sent, by his family, to Europe to study medicine, but instead he studied German language. It was Muhammad Kareem, the director whom he met in Germany, who gave his first role in “Zeinab” the silent film. Mouneer joined the Acting Supporters Society and started acting on stage, in films as well as in the radio. He married actor Mimi Shekeeb who remained his wife till the end of his life though at the beginning they suffered a lot from her family’s refusal.','15 July 1904','https://media.elcinema.com/uploads/_315x420_34398d7695a7fe61bf52c0279eab7e656187c76b8d84419edc6c1ec312f950fe.jpg'),('Muhammad Al Swasy',1066468,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a93de5bb31a2936eab2a6a8ca1154e327aca8c67d2b134775204d4bcc92ee48f.jpg'),('Karim El Houssiny',1066588,'Egypt','Egypt','NONE','9 February 1984','https://media.elcinema.com/uploads/_315x420_5b07b9ae421538cf787aa8276c7d86da29a755f3fa584d88e12909dcbb618209.jpg'),('Safaa Al Toukhy',1066612,'Egypt','Egypt','Actress Safaa El Tokhi (full name Safaa Abdallah Mohammed El Tokhi) was born in Cairo on February 8, 1964. El Tokhi comes from an artistic family; her father Abdallah El Tokhi and mother Fatheya El Assal are famous writers. Safaa El Tokhi studied at Higher Institute of Dramatic Arts from which she graduated with a Bachelor’s Degree in 1985. At the beginning of her career, Safaa El Tokhi worked as a writer, and in 1995 worked at the Institute of National Culture. \n\nSafaa El Tokhi began her acting career in 1979 with the television serial El Bahitha (The Researcher); even though she was trained as a stage actress, she only acted in one play “El Ayyam El Makhmoura” (The Drunken Days) in 1999. She acted in several films, among them “El Zaman El Saa’b” (The Difficult Time), “El Mohagir” (The Emigrant), and “Bekhit we Adila” (Bekhit and Adila). Of Safaa El Tokhi’s most famous television performances, which distinguished her in the realm of TV Drama, are “Leyali El Hulmiyya” (Dream Nights), “Lan Ayesh Fi Galbab Abi” (I Won’t Live In My Father’s Galabiyya), “Mahmoud El Masry,” as well as her striking performance in “Qadhiya Rai’ ‘Am” (The Case of Public Opinion) with the star, Yousra. ','22 August 1964','https://media.elcinema.com/uploads/_315x420_07745c03adfd3028673d8ab88fa90dbe3f82fafbbd71ffb7cb84d309f5b81eab.jpg'),('Mohamed Ezz Elarab',1066785,'Egypt','Egypt','NONE','1 January 1981','https://media.elcinema.com/uploads/_315x420_c169741beca737efa6d66b1532582b24b6e804d084b3bce8b766c9460f7413ac.jpg'),('Simone',1066810,'Egypt','Egypt','Her full name is Simone Philip Kamel, she was born in Shobra Cairo. She used to sing in school, her real talent came to the surface when she sang a Greek song at the Egyptian Greek friendship festival. She acted opposite singer Amr Diab in the movie “Ice cream in Gleem”. She also acted in the movie “Good Day Hard Day” opposite infamous actress Fatin Hamama. \nShe was also involved in several television series such as “Black and white”, “Time of the knights”, “Abu El Ela El Beshri”, “A Husband’s Diary”, “The Southerner’s Dream” and “Strangers in Town”. Some of the plays Simon was involved in opposite Mohamed Sobhi were “Seket el salama”, “siam Siam”, “Carmen”, Lebet El Set”.\nAs for some of her most famous songs they were, A look and a smile, Taxi, be afraid of me, happy, again and again, Merci and Casanova \n','14 June 1966','https://media.elcinema.com/uploads/_315x420_9c7eb06ed8cd72236f06662c95ab81a666947f98ac92c6ac5a61b53096c1be2b.jpg'),('كمال مجدي',1066890,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ola Ramy',1067127,'Egypt','Egypt','‘Ola Nehaad Raamy is an Egyptian actor since young age; she is the sister of actor Sahar Raamy. ‘Ola studied Ballet. “Al-la’eeba i.e. The players”, “Al-bahlawaan i.e. The clown” and “’Afreet le koll mowaaten i.e. A genie for every citizen” are among her stage roles. She excelled in many TV series such as; “Raafat al-Haggaan” and “Hadath fee beit al-kaady i.e. Happened in al-Kaady’s house”.','12 December 1959','https://media.elcinema.com/uploads/_315x420_97dd1fe2193350542c765ec89043614bf023265bd42e360545e1579453f97623.jpg'),('Diaa El Merghany',1067219,'Egypt','Egypt','Mohamed Diaa Mohamed Al Merghany received his bachelors degree in theater. He writes and acts in films and has worked on several plays and TV shows. The characters he portrays vary, from goofballs to villains. He has written and directed many plays, including \"Al Wamanji\" and \"Abou Khatwa.\" \n','21 June 1952','https://media.elcinema.com/uploads/_315x420_ab1ea927f7fd641bbf159675318e280b2a23122e204a457479bece1db1a841fb.jpg'),('Galal Issa',1067549,'Egypt','17 March 2019','NONE','17 July 1937','https://media.elcinema.com/uploads/_315x420_bda01b91bc103ef2f58c8d4c41559de9c691964379e65af5e054a3786e6ee5ed.jpg'),('Tamer Samir',1067697,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_54f31829303b2ffaced455ef3d7cd97344917275e0bd4856f7e25358085976f3.jpg'),('Ghada Abdelrazek',1067776,'Egypt','Egypt','Ghada Abdel Razek is an Egyptian actress who studied computer science at Cairo University. Her career in television began with several appearances in television commercials. Ghada started getting film roles in the early 1990s, and scored her first sizable film role in Mohamed Abd Al Aziz\'s “Lamadah” (Chatterbox) in 1999. Among the television series which she has performed in are “Amanah Ya Leil,” (Oh Please, Night), “Aailat Al Hajj Metwaly,” (The Hajj Metwally Family) “Nijoom Kol Youm,” “Wadi Al Feran,” (Valley of the rats), “Dahab Qishra,” (Fake Gold), “Seraa Al Aqwiyaa,” (Clash of the Strong) and “Al Ala wa Al Nas.” Ghada has also performed in the theatrical productions like “Al Ikhwa Al Andal” (The Wicked Brothers) and “Houda Karama.” In 2003, Ghada took part in the Ramadan trivia show “Farah Farah,\" (Joy Joy) and in 2012 starred in the popular Ramadan drama \"Ma\'a Sabq Al Israr\" (Premeditiation). She repeated the successful experiment with director Mohamed Samy in the following year in \"Hekayet Kayat\" (The Story of Hayat).','6 July 1965','https://media.elcinema.com/uploads/_315x420_95d8add0975210efe5b8e945e29c61ae39f9e2161e31fecff63fed39185ac509.jpg'),('Amina Rizq',1067876,'Egypt','Egypt','1910, Ameena Muhammad Rezk was born in Tanta (Delta of Egypt) where she joined the elementary school and would watch the circus during “Mouled al-Sayyed al-Badawy”, which gave her a taste for performing. Following the death of her father, Rezk moved to Cairo with her mother, grandmother and Aunt Ameena Muhammad, an aspiring actress with whom Rezk would sneak out to visit the nightly carnival at “Rod al-Farag” on the banks of the Nile. Muhammad acted with the Ramses troupe, established by Youssef Wahby. Inspired by her aunt, Rezk also began acting and, at the age of 13, won a supporting role in a stage production of ‘Rasputin’ next to Youssef Wahby. Her performance was impressive enough to ensure she became a valued member of the company, acting in approximately 500 plays until the troupe’s dissolution in 1944, and her friendship with Wahby endured until his death in 1982. Wahby tried unsuccessfully attempt to revive the company five times over the next twenty-six years, and Rezk always made herself available for his productions at these times.\nIn 1928, Rezk embarked on a film career that would span eight decades when she appeared in the title role of Stelio Chiarini’s “Souaad al-ghagareyyaa i.e. Souaad the gypsy). Four years later, she appeared in “Awlaad al-thawaat i.e. Sons of Aristocrats”, Egypt’s first talkie.\nAlthough she never married - apart from, as she would regularly claim, the theatre - Rezk carved a niche for herself in motherly roles, including the part of a young Omar Sharif’s mother in Salaah Abu-Seif’s “Bedaaya wa nehaaya i.e. Dead among the living (1960)”. In addition to films and plays, Rezk regularly appeared on Egyptian TV and radio.\nIn 1997, Rezk became the first female artist to be appointed to the “Shoura Council”, the lower legislative body of the Egyptian government.\nRezk, a much-loved figure in Egyptian cinema, died of heart failure in a Cairo hospital on 24th August 2003, just two months after giving her final performance.','15 April 1910','https://media.elcinema.com/uploads/_315x420_b3cf61cc5fca35f6cc5ad0ff5552b3dcc215c9cb87b180dd80d39050f0b3fd2d.jpg'),('عماد مراد',1068127,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nadia Rafeek',1068180,'Egypt','17 January 2020','NONE','8 February 1935','https://media.elcinema.com/uploads/_315x420_42e9587b9f28899e53cbc0264daa73a90ac07304b568360160cc4a3f3cc654de.jpg'),('Camba',1068301,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_be19157b319338328d51bd4ef078f73a78085b4cf7450b64303ac0911ff1a288.jpg'),('Saad Hendawy',1068535,'Egypt','NONE','Sa’ad Hendawy began his career directing short films which included 1993’s “al-Bukaa” (“Sobbing”), 1994’s “Zeyara fee al-Khareef” (“A Visit in Autumn”) and “Fuqa’at” (“Bubbles”) which was released that same year. Thereafter Hendawy worked as an assistant director on the 1995 television drama “al-Wahm wa al-Silah” (“The Illusion and the Arms”) before returning to directing shorts. In 1996 Hendawy directed the short narrative film “Yawm al-Ahad al-‘Aady” (“A Normal Sunday”) which was followed by “al-Mashhad al-Akhir” (“The Final Scene”) and “Ayyam al-‘Araby fee Paris” (“An Arab’s Days in Paris”). \nHendawy’s first cinematic work was “Hallat Houb” (“Amorous Circumstances”). That title was followed by “Alwan al-Samaa al-Sab’a” (“Seven Colours of Heaven”) which starred Leyla ‘Elwy and 2007’s “al-Saffah” (“The Murderer”) which starred Hany Salama.\nHendawy graduate from the directing department at the Higher Institute for Cinema in 1994 and received the institute’s directing diploma in 1996.\n','NONE','https://media.elcinema.com/uploads/_315x420_39501b6c145aaa4200125179dabda88a7f964c6b2634766ec67f069040f0b22d.jpg'),('Ahmed Diab',1068587,'Egypt','Egypt','Ahmed Diab is an Egyptian actor. He was born in 1945, and has worked as a supporting actor throughout his whole career in numerous television series, including “Opera Aida”, “Alragol Al A\'khar” (The Other Man), “Lel Adala Wugooh Kathira” (The Many Faces of Justice) and “Al Osyan” (Disobedience).  ','9 August 1945','https://media.elcinema.com/uploads/_315x420_8f196f32183ba2d9a7b79dc25c7737606deb22406d19cbe34612973ae82af6e0.jpg'),('Marwan Hamed',1068590,'Egypt','مروان وحيد حامد ','Marwan Hamed is an Egyptian director. He graduated from the High Cinema Institute in 1999, and worked as an assistant director in films by Samir Seif and Sherif Arafa. He directed several short films, including the award-winning “Lili”, which was screened at many film festivals worldwide and on Arab world television channels. His feature film debut was the 2006 best-seller novel adaptation “Emaret Yacoubian” (Yacoubian Building), which was then the most expensive film to be ever produced in Egyptian cinema history. He followed Yacoubian\'s success with the moderately successful action film “Ibrahim El Abyad”, and another best-seller adaptation “El Feel El Azraq” (The Blue Elephant), which was his most successful film critically and financially. ','NONE','https://media.elcinema.com/uploads/_315x420_0066860b906bfd86e9653d224d57f74c0f1cf095aaf2dd0d793c88f6b4fb4c32.jpg'),('Kamal El Shennawy',1068696,'Egypt','22 August 2011','Started his career on the silver screen as a star, After graduating from the Teacher’s College Muhammad Kamaal al-Shennaawy taught art education  at secondary schools. Meanwhile, as a plastic artist he held a number of art exhibitions. After two years, he left teaching to acting.g.  During his first stage, he was very popular playing light comic lead roles. He formed a successful duet with super star Shadia where he joined her in some of the songs; “Al-hawa maloush dawa i.e. Love All the Way”, “Hamaamet al-salaam i.e. The dove of peace” and “Lessaanak Houssaanak i.e. Guard Your Tongue”. Kamaal produced a big number of films through his production company; “Wadaa’ fel-fagr i.e. Farewell at dawn”, “Nessaa al-leil i.e. Women of the night” and directed “Tanablet al-Sultaan i.e. The Sultan\'s idle followers”. His films “Al-mar’a al-maghoula i.e. Mrs. X”, “Akwa men al-hayaah i.e. Stronger than life” and “Tareek al-Domou’ i.e. Tears Road” mark the beginning of maturity as an actor playing more complicated roles. “Al-Karnak” declared the beginning of a new stage for the grand Al-Shennaawy. Of his popular TV series are: “Zeinab wal–‘arsh i.e. Zeinab and the throne” , “Hend wal-doctor No’maan i.e. Hend and Dr. No’maan”, “’Oyoun al-hobb i.e. Eyes of love”, “Le dawaa’y amneyya  i.e. Security measures” and “Aakher al-meshwaar i.e. The end of the road”.  Kamaal married several times. Among his ex wives was belly dancer Haaguer Hamdy, actors ‘Afaaf Shaaker and Naahed Shereef.','26 December 1921','https://media.elcinema.com/uploads/_315x420_f48a4a03ee0c7a3df82cf09c6d5cd3d1ec14ede1735940b1ff4dba83d38e9fd6.jpg'),('Mona Fouad',1068873,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Samir Bahzan',1069339,'Egypt','Egypt','NONE','22 September 2020','https://media.elcinema.com/uploads/_315x420_8a5db97f18bb5f2102029d21dd50e712e382401c21ca94488222d9249be09bdb.jpg'),('Mervat Amin',1069429,'Egypt','Egypt','Mervat Amin is an Egyptian actress who received her degree from the English department at A’yn Shams University’s literature faculty. Her full name is Mervat Mostafa Amin. Amin has been married four times. Her first marriage was to Syrian musician Mowafaq Bahgat whilst her second was to guitarist O’mar Khourshid. Amin’s third marriage was to Hussein Fahmy with whom she had a daughter named Mennat Allah. Finally, Amin’s fourth marriage was to businessman Mostafa Al Beleidy. \nMervat Amin’s acting career began in college where she joined an acting troupe and subsequently performed in Tawfiq Hakim’s play “Ya Tale’ Al Shagara” (He Who’s Climbing the Tree). Following her graduation Amin became a professional performer and took part in the theatrical production “Mattar Al Houb” (Love at the Airport) which saw her act alongside performer A’bd Al Mone’im Madbouly.\nAmin’s talents were noticed by fellow performer Ahmed Mezhar who nominated her for cinema roles beginning in 1968. Thus Amin performed opposite Mezhar in the 1968 film “Houb Al Mourahiqat” (Adolescent Love). Thereafter her acting career took off and she took part in several television and nighttime productions such as “Al Zawgah Awal Man Ta’lam” (The Wife is the First to Know) and “Sahibat Al Galala Al Houb” (“Majestic Love”).\nMervat Amin is unique in her talents. She is cool minded and acts out her roles with passion. Some of her best known roles were in “Zawgat Ragol Mohim” (A VIP’s Wife) and “Oula Thanawwy” (Freshman Year). Most of her early roles portrayed her with a seductive air.\n','24 November 1948','https://media.elcinema.com/uploads/_315x420_462aa8574174239e8aa38e07ee81723f4e8cfe0714fd8a50a1c23c34949f34e4.jpg'),('Mohammed Farag',1069439,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4e1faa6798846d7aa97afe640dc53b4574c593da1892d062c8ffa2cf6a6af5cc.jpg'),('أفلام حسن الإمام الجديدة',1069552,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Youssriya Al Sayed',1069588,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5c0e349715eed17fcc506927b865fe35fad97287524334dd549a93fb015598ea.jpg'),('Mahmoud El Meleigy',1069659,'Egypt',' 6 June 1983','Mahmoud ElMeligi started his career as an actor in the Fatma Roushdy theatrical Troupe and moved between different troupes. Al-Meleegy participated in a big number of radio and TV works. Not only was a talented actor especially when it came to the role of the villain, but alsoso wrote the scenario and/or dialogue of a number of films; “Al-malaak al-abyad\" (The white angel) in 1946, “Al-omm al-qaatela\" (Mother murderer) in 1952, “Segn Abou-Zaabal\" (Abou-Zaabal prison) and “Al-mabrouk\" (The blessed). In 1964 al-Meleegy received the Science and Art Medal for his lifetime achievement and the Lebanese Cedar Medal.   Although he was known for his evil roles, yet towards the end of his career he excelled playing the role of Mohamed Abu-Sweilam in Chahine’s “Al-ard\" (The Land) which uncovered his great talent.','22 December 1910','https://media.elcinema.com/uploads/_315x420_92c066323656d72da3e345349c2ca0fd38bb090813c1ee0c3bc2d63eb17d5ca0.jpg'),('Farouk Naguib',1069813,'Egypt','Egypt','Farouk Naguib Mikhail was an Egyptian actor who was born in Cairo. He graduated from the faculty of arts, Ain Shams University. His talent was discovered by the legendary playwright Naguib Surur, and he presented him for the first time in his play “Waboor El Tahin” (The Wheat Mill). He was best known for his comedic roles, in which he developed his own unique method and jokes. His most successful roles were in television series, the field his career was mostly focused on. His latest famous roles were in the Yehia el-Fakharany-led-series “El Khawaga Abdel Qader” (The Foreigner Abdel Qader) and the comedy series “Hamiha Haramiha” (The Protector and the Thief).','7 March 1940','https://media.elcinema.com/uploads/_315x420_c033d6278ceffbb8b207f6d35565d92f0820a7d30c2d4f269cf39f5010409569.jpg'),('Fatma Roshdi',1069829,'Egypt','23 January 1996','Fatma Roshdi is an Egyptian actress who was born in Alexandria in 1908. She began her acting career at a young age, when (director) Ameen Attallah cast her in one of his acting troupe’s plays. Afterwards, she acted with a number of theater troupes, working alongside Abdel Rahman Rushdi, Sayyed Darwish, Aziz Eid, and Youseff Wehbe. Starting in the mid-1920s, Fatima starred in a significant number of plays, including: “El Sahraa’” (The Desert), “El Qan’aa El Azraq” (The Blue Mask), “El Nasr El Sagheer” (L’Aiglon), and “El Horreya” (Freedom). After separating from Aziz Eid, Fatima created her own private theater troupe, which became one of the most illustrious theater troupes. At the end of the 1920s, Fatima began her cinematic career. Her first film was “Fag’aa Foq El Haram” (Tragedy on the Pyramids) in 1928. She starred in a number of films until the 1950s, including “Thamin El Saa’da” (The Price of Happiness), “El A’mil” (The Worker), “El Tareeq El Mostaqeem” (The Virtuous Path), “Medina El Ghajer,” “El ‘Azeema” (Determination), “El Jassid” (The Body). She stopped acting at the end of the 1960s, and died in 1996 at the age of 87.','15 February 1908','https://media.elcinema.com/uploads/_315x420_60a7f2c6bf00db07df2e5201f1d9fd0ec3e7e6007a71754c89c0a4e6fd533d6e.jpg'),('Hesham Nazih',1069877,'Egypt','Egypt','Hesham Nazih is an Egyptian music and film/television series score composer. He started his career in 1992, composing the scores of very famous and successful films, including Hysteria, Tito, and Elfeel El Azraq (The Blue Elephant). He also composed scores for the television series Sharbat Louz (Almond Nectar), Niran Sadiqa (Friendly Fire) and Al-Aahd (The Covenant).','23 October 1972','https://media.elcinema.com/uploads/_315x420_73d917a1acb5d9cbe27611c5b78d6bf8d25cd368c733bf93f9eef62a238dba40.jpg'),('Mohamed Mostafa',1070073,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8472a5fa0d7fa3f3bcd217235fc55b58a4a68815791afd9c1fd017e2505dc265.jpg'),('Mona Saad',1070112,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Thuraya Ibrahim',1070175,'Egypt','18 January 2015','Thuraya Ibrahim was an Egyptian actress. She started her career on the people\'s cultural theater in Tanta, before moving to Cairo to start landing roles in television series, then on film. She appeared in numerous productions since the late 1970s, including “Al Eshq wal Dam” (Passion and Blood), “Katkoot” and “Elhaqiqa wal Sarab” (The Truth and the Mirage).','10 May 1939','https://media.elcinema.com/uploads/_315x420_5e0059827fb47bd0dd30cbd5438172dc5182336505d47df3738aac27facb0808.jpg'),('Nehal Anbar',1070468,'Egypt','Egypt','Nehal Amber was born in Cairo but she would later study (high school) in the United States. She married the musician Magdy Al Husseiny but the couple later (divorced).\nAt the (university level), Nehal studied tourism.\nAmong the theatrical performances in which she has assumed roles are “Al Laaib bil Nar”, “Al Nisaa wa Al Gharib”, “Ayam Al Ghariba”.\nMoreover, she has assumed roles in the following television productions: “Al Aaila wa Al Nas”, “Souq Al Asr”, “Al Maraa Aslaha Nimr”, “Dimouaa Al Ghadab”, “Hawanim Garden City”, “Souq Al Hareem” and “Akhir Meshwar”.\n','9 October 1961','https://media.elcinema.com/uploads/_315x420_5e496c4d56827ebadda400dee728b8688229fcc2a81829e7c55abcca9759c673.jpg'),('Fadel El Garhy',1070488,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_de2c47ae8429928e921a320b46405a6bd3ea023d2e2d96c17b621042da1fb5cb.jpg'),('Mahmoud Yassine',1070571,'Egypt','Egypt','Mahmoud Fouaad Yasseen was born in Portsaid. \nHe graduated from the faculty of law in 1964. One year before graduating he joined the National Theatre where he was the narrator in a number of plays: “Solaimaan al-Halaby”, “Al-Zeer Saalem”, “Daaerat al-tabasheer al Kokaazeya i.e. The Caucasian chalk circle”. He played lead roles in “Laylat masra’ Guevara i.e. The night Guevara was killed”, “Watany Akka i.e. Akka..my Nation”, “Laila wal-magnoun i.e Laila and her fool”, “Al-zeyaara entahet i.e. Visit is over”, “Ahlan ya Bakawaat i.e. Hello Sires” and “Al-Khedeiwy i.e. The Kedive”.\nDuring the seventies, Yassin became one of the most popular romantic film stars, starring in films like “Al Khayt El Rafia\'” (The Think Line), “Hob wa Kibriya\'” (Love and Pride) and “Al Rosasa La Tazal Fi Gayby” (The Bullet is Still in my Pocket). He formed a starring duo with actress Naglaa\' Fathi, making a lot of highly successful romantic dramas. \nIn the nineties, Yassin shifted his career to television, starring in series like “Abu hanifa Al Noa\'man,” “Did el Tayyar” (Against the Current), and “Souq El A\'sr” (Afternoon Market).','2 June 1941','https://media.elcinema.com/uploads/_315x420_cdb452fad1eefb0ee119047c08c9b30f7f2c51163649106f23f07a8899df325e.jpg'),('Helmi Bakr',1070603,'Egypt','Egypt','NONE','6 December 1937','https://media.elcinema.com/uploads/_315x420_790adc1720ce19b2cb6be0d93e3fc2323fb57bff58dc6662c5352196afacae69.jpg'),('mamdouuh Qotb',1070617,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8559ee0ac049de572e13122af12efbeefb243e6c38d8584666caacbf79ba314b.jpg'),('Salloum Haddad',1070656,'Syria','Syria','NONE','29 March 1953','https://media.elcinema.com/uploads/_315x420_9a508a7e60503216b6cef47488738f2986648c585af38ad7f6dc03f852854df9.jpg'),('Magda El-Khatib',1070745,'Egypt','Egypt','Magda El Khatib is an Egyptian actor who was born in Cairo in 1943. She began her acting career with a small role in the film “Hob wa Delaa” (Love and Endearment; 1959). El Khatib then went on to play starring roles in a numerous films including “El Bayt El Mela’un” (The Cursed House; 1987) alongside Kamal El Shenawi. Throughout her career, she has appeared in more than 130 works and won several acting awards, including the “Golden Pyramid” for her role in “Dalal Masriya” (Dalal, The Egyptian; 1966), which was her first starring role. El Khatib also won Best Actress for her role in the film “El Tufaha” (The Apple).\n','2 October 1943','https://media.elcinema.com/uploads/_315x420_de5edb74819bb67a17a4d39ad385a697ef5a67ce298c85ceb311d422ab1babe9.jpg'),('Assad Fouladkar',1070975,'Lebanon','NONE','Assad Fouladkar is a Lebanese television director of Iranian descent. He studied in Lebanon, and majored in film direction in Boston University, where he also made several documentaries. He then moved to Australia to work as an assistant director in a number of sit-coms. Assad then returned to Lebanon, now working as a film critic and university teacher. After he made his award-winning debut feature “Lama Hekiet Mariam” (When Mariam Told her Story) in 2002, he went on to focus his career on sit-coms, the most famous of which being “Ragel we Set Settat” (A Man and Six Women). ','NONE','https://media.elcinema.com/uploads/_315x420_8156a8ab068c8a8b9dd1f1455867db61e6ccc146ee3694c71e201d5cfcc8422d.jpg'),('Tamer Ibrahim',1070999,'Egypt','Egypt','NONE','23 October 1980','https://media.elcinema.com/uploads/_315x420_527661ece6ff7b2c4193062df980cc433a3b30c73b3ff71e9cf410d83e8c59b4.jpg'),('Esaad Younes',1071459,'Egypt','Egypt','Isaad Hamed Gamal El Din is her real name and she was born in Cairo. She achieved a bachelor of tourism in 1972. Her dad who was a journalist at “Rozal Youssef” magazine was a big inspiration to her. She worked as a radio host at the Middle East radio station. Then she worked inin the theater and became very well known after her role in the play “Al Dokhool Bel Malabes Al Rasmeya” .\nShe acted in many movies and television series some of the most famous were “Bakeeza and Zaghlool”. She married actor Nabil El Hagrasy then later on remarried a business man and created her own production company. \nSome of the most television series she worked in were Mizo’s story, A Lie, The bet, The way to Beir Sabei. She was a very successful comedian after her fantastic role in the famous play “Al Dokhool Bel Malabes Al Rasmeya” where she was involved in more comedy such as “ya Rab Walad”\n','12 April 1950','https://media.elcinema.com/uploads/_315x420_d2826f1c0877cdf32a1cdfdacbf04abbe387e1fb3ce1e56b08fc19221bbcdb80.jpg'),('Ahmed Halawa',1071554,'Egypt','Egypt','Ahmed  Salah Ragab Ramadan Halawa graduated from the High Institute of theatrical Arts. He is the nephew of late Fayez Halawa. He has achieved his PHD and is currently teaching theatrical arts at the university. He was involved in many plays such as “The High Door”, “They are Laughing” , “Isis”, “Long Live the Wafd” and “Alley of Lovers” and many more.\nHe was also involved in many television series such as “We Won the Case”, “Fasting and God only knows”, “The Way to Jerusalem”, “ Tears in bald Eyes” and his infamous role in the series “Raafat El Hagaan” part 2 where he played as an Israeli officer called “Bekhoor Shatreet” \n','7 January 1949','https://media.elcinema.com/uploads/_315x420_c54ffa8bf913d071b3eca61d6986031396ca744c1d836a96c4e9916de07f675a.jpg'),('Mohamed Refaat',1072084,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_525c52a67573787581df7a14c2db0441c72515c25264c569621bd7d161633b95.jpg'),('Abdelrahman Abo Zahra',1072130,'Egypt','Egypt','Abdul Rahmaan Abdul Rahmaan Mahmoud Abu-Zahra is an Egyptian actor and director who was born in Damietta (Delta of Egypt). He is married (1962) with three children; May, Sahar and Ahmad. His first stage role was “’Awdat al-shabaab i.e. The rejeunesse” than he participated in may plays like; “Telmeeth al-shaytaan i.e. The devil’s student”, “Masra’ Cleopatra i.e. The death of Cleopatra”, “Bedaaya wa nehaaya i.e. Dead among livings”, “Sanf al-hareem i.e. Women”, “Afraah al-anthaal i.e. Joys of bastards”, “Al-lahza al-harega i.e. The critical moment”,”Al-mawt ya’khoth agaaza i.e. Death takes a holiday”, “Fee baytena ragol i.e. A man in our house”, “Shakka lel-‘eegaar i.e. A apartment for rent”, “Al-mahroussa”, “Don Juan”, “Al-kadeyya i.e. The case”, “Hallaak fee Baghdaad i.e. A barber in Baghdad”, “Yasseen and Baheyya”, “Al-dafaade’ i.e. The frogs”, “Beer al-sellem i.e. The stairwell”, “Al-farafeer”, “Halaawet zamaan i.e. That sweet time”, “Mas-houk al-thakaa i.e. The intelligence powder”, “Zahrat al-sabbaar i.e. The catus flower” and “Masra’ Guevara i.e. The death of Guevara”. Abu-Zahra also directed the play “Faylassouf i.e. Philosopher” and staged it on the National Theatre.\nAbdul Rahmaan played a number of TV series and drama, among them are; “Sanawaat al-dehk wal-domou’ i.e. Years of laughter and tears”, “Al-sokout fee Be’r Sab’ i.e. Falling in Beersheba”, “Nehaayat al-‘alam layssat ghadan i.e. The end of the world is not tomorrow”, “Lan a’eesh fee gelbaab aby i.e. I will not live in my father’s robe” and “Lamma al-ta’lab faat i.e. When the fox passed”.  Abdul Rahmaan Abu-Zahra presented the children radio show “Sondouk al-donya i.e. Pandora’s box” for more more than twenty years.','8 March 1934','https://media.elcinema.com/uploads/_315x420_a7802f68df7524de1d0e176092a4a330fce00657b0706597cd782f9671ea7242.jpg'),('Amir Ramses',1072283,'Egypt','Egypt','Amir Ramses is an Egyptian director. He was born in 1979, and graduated in 2000 from the High Institute of Cinema. He directed numerous short films and documentaries. He also worked as an assistant director and producer in several independent films. He is best known for directing the two-part documentary \"Jews of Egypt\" and the feature film \"Betawqit Elqahera\" (Cairo Time).','12 October 1979','https://media.elcinema.com/uploads/_315x420_3ee51e2d0d9c614e36bb8d40beefba05ec1aedc76b644a087a532aef2a86f8a0.jpg'),('Amal Abu Shadi',1072328,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0c14ced1a56b52b2a48339c1d78ecc6bd26c9587c1392239343d1157999c4996.jpg'),('Samia Gamal',1072547,'Egypt','Egypt','Samia Gamaal was an Egyptian belly dancer and actor. She was born in the village of “Youn al-kass”- Beni Sweif . In 1940, Samia joined Badee’a Massabny troupe where she participated in group dancing. After that, she played small roles in many films and succeeded to play lead roles next to Muhammad Abdul Mottaleb and Nagueeb al-Rihaany.\nSamia performed in “Entessaar al-shabaab i.e. Triumph of the youth (1941)” where she danced in the finale sketch and appeared in a scene with Fareed al-Atrash. Samia together with Fareed formed a successful duet starting with the film “Habeeb al-‘omr i.e. The love of my life (1946)”. Through five famous films; “Ahebbak enta i.e. I love you only (1949)”, ”’Afreeta Haanem i.e. Little Miss Devil (1949)”, “Aakher kedba i.e. The last lie (1950)”, “Ta’aala sallem i.e. Come and say hello (1951)” and “Ma t’olsh le had i.e. Don’t tell anyone (1952)”, where Fareed sang his own melodies and Samia danced her great dances. They fell in love, yet not married and left each other. Samia costarred in a dozen of films with many of the well known actors of that period such; Muhammad Abdul Muttaleb, Nagueeb al-Reehaany, Muhammad Fawzy, Abdul Azeez Mahmoud..etc\nLater on, Samia played lead roles next to famous vedettes as Kamaal al-Shennaawy, ‘Omar Sharif, Mahmoud al-Meleegy, Anwar Wagdy, ‘Emaad Hamdy, Yehia Shaheen, Youssef Wahby, Ahmad Maz-har and Shoukry Sarhaan.\nIn late 1950s, Samia married superstar Roushdy Abaaza and they featured together a number of films, including; “Al-ragol al-thaany i.e. The second man (1959)”, “Tareek al-shaytaan i.e. Devil’s path (1963), “Saa’at al-sefr i.e. Zero hour (1972)” and “Al-shaytaan wal-khareef i.e. The devil and the fall (1972)“, in which Samia was dedicated to acting more than dancing.\nSamia\'s charismatic performances in Egyptian and international films gave Oriental Dance recognition and admiration in Egypt and worldwide.','5 March 1924','https://media.elcinema.com/uploads/_315x420_e27dae4ed7911beb27d63d4c0703a3e3c766eb3affeafd8b3fb49e746d6df11a.jpg'),('Mohamed Eltohamy',1072719,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d7605c38ee64e88f34a1b0f7f81be89171d0dd7acd421866919f3bf010f065ce.jpg'),('Menna Galal',1073101,'Egypt','Egypt','NONE','7 June 1982','https://media.elcinema.com/uploads/_315x420_44c82955b4b611bf9c810200dd631434f490ad150968f52185a8351a0666eeec.jpg'),('Laila Gamal',1073302,'Egypt','14 April 2014','Laila Gamal is an Egyptian actress. She was born in Alexandria in 1944. She worked mostly in television dramas, picking up supporting roles in series like “Hawanem Garden City” (The Ladies of Garden City), “Mirath Alreeh” (Inherit the Wind), and Ragel we set Setat” (A Man and Six Women). She dies in 2014 at the age of 70 due to complications of lung cancer. ','1 August 1944','https://media.elcinema.com/uploads/_315x420_20ed06cbd89ea202a0ed8582381af760b2459a559e159fda3cae99a8fbcc43ac.jpg'),('Ahmed Allam',1073339,'Egypt',' 2 September 1962','NONE','20 July 1899','https://media.elcinema.com/uploads/_315x420_cc2d47f6141c35de17884a9217b720995ac88d8f3f92f99e287c4e84977e02b6.jpg'),('Youssef Al-Assal',1073426,'Egypt','Egypt','Youssef El Assal worked at an airline company and can speak more than one language fluently. His wife is a relative of the actress Nelly. At the beginning of his career, directors usually chose him to play the role of the “foreigner” due to his knowledge of English and French and the fact that he looks foreign. He has also been cast as police and airforce officers. ','14 May 1947','https://media.elcinema.com/uploads/_315x420_cc65058f9e069c49a83abdd40e011e8fc9e697978b1aeac7cf3a2846ebe753d8.jpg'),('Sayed Sadek',1073456,'Egypt','Egypt','NONE','18 June 1945','https://media.elcinema.com/uploads/_315x420_655292661a75fe0d0a7b695e6b66ec250b2564995d2a6416a684617d38306432.jpg'),('Mona Rabie',1073515,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cff13731d650afece44639dce4eca7db1d17158e4c5ae96c4ac80d6182c293ba.jpg'),('Nadia Seddiq',1073580,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Yasmin Abdulaziz',1073676,'Egypt','Egypt','Yasmin Mohamed Abd Al Aziz was born in Cairo (where her father worked as a hotelier). She enrolled in (the Modern Academy) in Maadi and began her television career at the age of five with appearances in commercials. Yasmin was (recruited into the industry through a friend of her mother’s who managed an advertising production firm). \nThereafter, Yasmin was (nominated for roles in cinematic and television productions). Thus, she performed on the television series “Imraa min Zaman Al Houb”. That production achieved a great measure of success and brought Yasmin’s talents to the attention of the public. Whilst a student at the Modern Academy in Maadi, Yasmin also (partook) in the trivia show “Al Aiyal Itganinit”. (Most of her roles have had her assume the character of a mischievous girl).\n','16 January 1980','https://media.elcinema.com/uploads/_315x420_2bbc4a7e125883ab6536151d51c66062c9248a4930be3d2fdc2a9f8e10dcb1e6.jpg'),('Mohamed Mourad',1073679,'Egypt','Egypt','NONE','4 June 1972','https://media.elcinema.com/uploads/_315x420_48b2a7227739fe1b2c96a909ef7858e994633bc117fc267980629cdff46ac757.jpg'),('Safia El Emary',1073717,'Egypt','Egypt','Safiyah Mustafa Mohamed El Imary is a performer that has taken part in television and cinema productions. She was born in the city of Al Mahala Al Kubrah and earned a bachelor’s degree in commerce.\nShe has studied Russian and worked as a translator in international conferences.s. \nShe was discovered by the (performer) Galal Issa, they got married and had two children.\nAmong her theatrical works are “Fananah Mutazilah”, “Al Malak Al Azraq”, “Rajil Mafeesh Minho”, “Al Bahr Beyadhak Leih”, “Tisbah Ala Kheir ya Habat Einy” and “Muzakirat Mumathila”.\nShe worked (alongside) Al Sayed Bedeir in the television series “Al Qalb la yamtalik Zahaban” and her performance was outstanding in the “Layali Al Helmiya” television series which included “Al Shatee Al Mahjoor”, “Hawanim Garden City”, (“Abyad fee Abyad”), the opera “Aida”, “Baad Al Toufan”, and “Khan Al Qanadeel”.\nShe was selected as the United Nations ambassador in the Middle East (in 1997).\nShe has assumed several secondary roles in several cinematic roles. The director Youssif Chahine was perhaps the one who profited most from her ability to perform in “Al Mohajir” and “Al Maseer”. Her performance was also noteworthy in “Al Muwattin Al Masry”.\n','20 October 1949','https://media.elcinema.com/uploads/_315x420_63af271c0bda2ed1fb8921468720d0bdb91c16b5f1e37bd4ce72b9914aef3419.jpg'),('Layla Olwi',1074022,'Egypt','Egypt','Layla Alwi is an Egyptian actress, born to an Egyptian father and a Greek mother. Her full name is Leyla Ahmed E’lwy and her career began when she was still quite young with Abla Fadeela at the Radio broadcast and Mama Samiha on children programming on television. Leyla studied at French schools and graduated in 1991 from the faculty of commerce. She took small parts in films as a child and performed in several titles. Nour el-Shereef noticed her talents on stage. Leyla took part in the television series “Dimoo’ Fawq al-Haqiqa” (“Tears Over the Truth”) in her first television role as a mature actress. Among the stage productions which she has taken part in are “al-Brenseesa” (“The Princess”), “Gamilla wa Wahshayn” (“Two Beasts and a Beauty”), “Baklarious fee Hokm al-Sha’b” (“A Degree in Governing the People”), “8 Sittat” (“8 Women”) and “Sahlab”. Her television performances have included “al-‘Aaila” (“The Family”), “al-Tawaam” (“The Twins”), “’Atfet Khoukha”, “Teyoor al-Sayf” (“Birds of Summer”), “Akho al-Bannat” (“Brother to the Girls”), “Ta’aaly Nahlam bi Bokra” (“Let’s Dream of Tomorrow”) and “Alf Leyla wa Leyla” (“One Thousand and One Nights”). \nLeyla has received numerous film awards and has worked as a producer on the film “Ya Mihalabiya ya”. The actress was also honored at several festivals including the Love Festival of 2002. She could be considered among the most intelligent actresses in her generation and her performances were particularly memorable in “al-Muzniboon” (“The Guilty”) and “Kharag wa lam Ya’od” (“He Left but did not Return”).\n','4 January 1962','https://media.elcinema.com/uploads/_315x420_dadc4a3f16470de208b6dfc07e879bd8afa75d0b927d6b16e6ffdd0e0c3c1e91.jpg'),('Khairy Hassan',1074059,'Egypt','Egypt','NONE','24 February 1952','https://media.elcinema.com/uploads/_315x420_69618e58606e0e82c22b2d7486a99bfda6b8e8860cc81f23e59f07abbe39a0c8.jpg'),('Ahmad Rateb',1074068,'Egypt','Egypt','Ahmed Kamal Eldin Rateb was born in the Sayeda Zaynab neighborhood of Cairo. His interest in acting began at an early age, where he performed in most of his school plays. He continued to act in college, where he was enrolled in Cairo University, College of Engineering, but quit after 2 years to pursue his passion for acting, and joined the High Academy of Arts, graduating with a degree in performing arts in 1974.\n\nHis first work was in the TV series \"Fagr (Dawn)\" after which he had many roles in plays, the most notable of which was \"sok ala banatak (Beware of Your Daughters)\"\n\nHis TV series work includes Bilad elGhorba, Elmal wal Banoon, Elabtal, and Om Kalthoum, in which he won many awards for his realistic portrayal of the legendary violinist Mohamed el Asabgy.\n\nHe married his cousin in 1978 and has 3 girls, Lamia, Lobna and Lameece. \n\nAlthough he is famous for his comedic roles, especially alongside fellow actor/comedian Adel Imam, Rateb has many distinguished roles in more dramatic works such as his role as a political patriot in \"Toyoor elZalam (Birds of Darkness)\" and other works such as \"Ya rab walad\" and \"Akhir elregal elmohtarameen\"','23 January 1949','https://media.elcinema.com/uploads/_315x420_c6dd54f6551180d214c55fb8a168beaf7c77f57e71e5538c67e84cf0322333ac.jpg'),('Maya Nasry',1074168,'Lebanon','Lebanon','NONE','14 August 1976','https://media.elcinema.com/uploads/_315x420_dd9a3e1050332ffc0c660b2c87a019d843df40dcbb7087de613ad3085d07ea9e.jpg'),('Sabrin',1074180,'Egypt','Egypt','Sabreen was born into the household of ‘Akef which excelled at circus stunts. She is the niece of actress Na’eema ‘Akef. Sabreen took part in acting, acrobats and oriental dance whilst a child. Thereafter she acquired a degree in philosophy before taking part in several television series such as “Halla wa Derwish”, “Rihlat Abou al-‘Ella al-Bushry” (“The Journey of Abou al-‘Ella al-Bushry”), “Leilat al-qabd ‘ala Fatma” (“The Night of Fatma’s Arrest”), “al-Donnia Warda Baydaa”, “Dameer Abla Hekmat” (“The Conscience of Mrs. Hekmat”), “Omm Kalthoum” and “Al-liqaa al-Thanee” (“The Second Rendezvous”). Her stage performances include “Hammra Gamrra” and “Atfal al-Shaware’” (“Street Children”).\nSabreen married a businessman and bore him a son.\n','4 October 1967','https://media.elcinema.com/uploads/_315x420_8a08f55923d4636f02affc967aebcf29582f3b6a1d951028ec8f4a7f23868c42.jpg'),('Alvise Orfanelli',1074207,'Egypt','Egypt','NONE','1 January 1901','https://media.elcinema.com/uploads/_315x420_0fc8a40a72ad83bfbfcc7aa452aabcdd7f8102d9ddc3ad7754156c1824b53ae9.jpg'),('Moataz El Kateb',1074237,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fab059ef76ebcf67aeb215a7c624c8eba97941853fea514703b16dd2700a7cf6.jpg'),('Ola Ghanem',1074816,'Egypt','Egypt','Ola Ghanem was born in Cairo. Her father worked as an architect while her mother was an interior designer. Ola graduated from the Photography division at the Faculty of Fine Arts in 1994 but elected not to continue her studies at the Institute of Theatrical Arts. She came to the public’s attention through her involvement in Mohamed Fouad’s song “Hansaak” (“I will Forget You”). Ola has also appeared on TV commercials. The television productions in which Ola has assumed roles include “Al Qalb Yakhtea Ahyanan” (“The Heart is Sometimes Wrong”), “Zizinia”, “Ahlam Wardieh” (“Rosy Dreams”), “Jissr al Khatar” (“A Bridge to Danger”), “E’qal ya Majnoun” (“Wise Up”). Ola realized fame after taking part in an exceptional television production that was titled “Amakin fee Al Qalb” (“Places in the Heart”). Aside from her television appearances Ola has also acted in a play titled “Al Tayyib wa Al Shereer” (“Good and Evil”). She recently starred in \"El Brinseesa\" (The Princess).','26 November 1971','https://media.elcinema.com/uploads/_315x420_ca8f7eb401cdc7428af66b7e35cd797055e1100a3b8ec72bdee21aedd0ce6eff.jpg'),('Afaf Mustafa',1074856,'Egypt','Egypt','NONE','17 November 1960','https://media.elcinema.com/uploads/_315x420_06c600e1b1e11561a91c4e65ef3f8b7bec0b694e57c95d3e38e6981a2ba329d5.jpg'),('Ahmed El Fishawy',1074887,'Egypt','Egypt','Ahmed El Fishawy is an Egyptian actor, and the son of actor Farouq El Fishawy. He started acting at the age of nine, debuting alongside his father in “Al Morshed” (The , appearing in small roles in several films, among which was “El Batal” (The Champion) with Ahmed Zaki in 1998. His breakthrough came with his role in the television series “Wagh Elqamar” (The Moon\'s Face) alongside Faten Hamama in 2000. He then appeared in the epic television drama “Hadith Elsabah wal Masaa\'” (Morning and Night Dialogue) in 2001, and “El Amma Nour” (Aunt Nour) in 2003 alongside Nabila Ebeid. His first lead role on television was in the series “Afarit El Sayala” (The Ghosts of Sayala), after which he landed his first lead role on film in Ahmed Mekky\'s action comedy “El Hasa Elsabaa” (The Seventh Sense). His most successful roles include the multi-season sit-com “Tamer we Shawqyea” (Tamer and Shawqeya) and the thriller/drama film “45 Youm” (45 Days).','16 February 1980','https://media.elcinema.com/uploads/_315x420_7155c3642f3180b25a6a457c76668fe474ac62cf793487c09e8d8b6a67d045c5.jpg'),('Gihan Fadel',1075183,'Egypt','Egypt','Jehan Fadel is an Egyptian actress who was born in Cairo to a father who worked as an architect and a mother who worked as a college professor. Jehan graduated from the American University in Cairo. Her talents were first noticed by director Kheiry Bushara while she was still a student at college. Kheiry presented Jehan in his 1992 cinema title “Ice Cream fee Gleim” where she acted alongside the Egyptian musician and actor ‘Amr Diab. Thereafter Jehan transitioned to television roles.','11 March 1973','https://media.elcinema.com/uploads/_315x420_8eae8429aef4c447c61581f4a1c8a96bad8a55b5d836cbbf838dd4759cfd1416.jpg'),('Fifi Abdou',1075293,'Egypt','Egypt','Feefy A’bdu is an actress and dancer that was born in the governorate of al-Manoufiyah. She began her career as a dancer as part of the folklore group “A’akef” and thereafter appeared as a dancer on cinema productions before being assigned a leading role in the Enaas al-Daghdaghy’s title “Imraa Wahida la Takffy” (One Women Is not Enough). Amongst her theatrical productions are “Shabbab Imraa” (1979), “Hazimny Yaa” (1992), “Ishta wa A’asal” (Honey and Cream) and “Edla’y ya Dousah”. The performer has also taken part in several television productions which include “al-Aanissah Kaf” (Lady K), “Ma zal al-Neel Yagry” (The Nile Still Runs) and “Wazeer fee al Jibss”. Feefy is married to Jordanian businessman Mohamed al-Deedarry.','26 April 1953','https://media.elcinema.com/uploads/_315x420_d43ee3089d4a3f37ac8159978fe46b5f5cdd0351723c2108a7e5199944a2e907.jpg'),('Saeed Hamed',1075398,'Sudan','Sudan','Sudanese, born in February 5 1958 – Khartoum, studied cinematography editing at the Higher Institute of Cinema. Started his career as assistant director with many notable Egyptian directors like Saad Arafa, Muhammad Khaan, Sherif Arafa and Raafat al-Meehy in films “Waad Maktoub i.e. Destined”, “Al-mouled”, “Samaa Hoss i.e. Shhhht”, “Al-le’b maa al-kobaar i.e. Playing with the big guys” and “Ya mahalabeyya ya”. 1989 witnessed his first film as a director “Al-hobb fel-tallaaga i.e. Refrigerated love”. Nine years later, directed the box office record breaker “Saeedy fel-gamaa al-Amrikeyya i.e. Upper-Egyptian in the AUC” starring Muhammad Heneidy. Heneidy starred other films by Saeed Hamed like “Hammaam fee Amsterdam i.e. Hammaam in Amsterdam” and “Ga’ana al-bayaan al-taaly i.e. Breaking news”, other films “Short we fanella we cap i.e. Shorts, T-shirt and cap” and “Tabbaakh al-rayyes i.e. President’s cook”.\nHe also directed two TV series Hanaan Turk’s “Haanem bent pasha i.e. Her highness” and Heshaam Seleem’s“Ekhtefaa Saeed Mahraan i.e. Disappearance of Saeed Mahraan”.','5 February 1958','https://media.elcinema.com/uploads/_315x420_211d3162d92065de288434ea9c5ed9ffdf9896903a96277d83352e38f10cf1b3.jpg'),('Shorouq',1075529,'Egypt','Egypt','NONE','20 March 1952','https://media.elcinema.com/uploads/_315x420_8785416928e87b0dbbd1f5b94e430ae0210e9c51eb8da572dd80f392067ef24d.jpg'),('Atef Shokry',1075555,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5133a26fd0c4050c1ff37b849cfd1551dbaea63baace581b7dc072930b793f13.jpg'),('Onsi Abo Sief',1075657,'Egypt','NONE','Onsi Abo Seif is an Egyptian set designer and art director. He graduated from the High Cinema Institute in 1967, and worked at the start of his career as an assistant designer in Shady Abdel Salam\'s \"Al Mumya\" (The Mummy). The next year, he worked as a set designerigner on the film \"Yawmiyat Naa\'ib fil Aryaf\" (Diary of a Delegate in the Countryside). Abo Seif\'s filmography includes numerous landmarks of Egyptian cinema, like \"Eskendereya Kaman we Kaman\" (Alexadnria Again and Again), \"El Kit Kat\", \"Araq El Balah\" (Date Wine), \"Ayam El Sadat\" (Sadat\'s Days) and \"Rasa\'el Elbahr\" (Messages of the Sea). ','NONE','https://media.elcinema.com/uploads/_315x420_5aa2c14a8a7a32c0a69690ec8b7310bd758de99857594cc35be67570cf337426.jpg'),('محمد طاهر',1075716,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Wahid Farid',1075813,'Egypt','22 April 1998','NONE','2 August 1919','https://media.elcinema.com/uploads/_315x420_02277baa00f16ff2dfcecfbd2b3a90e784a87c95e76671a0e365cbc3077ed480.jpg'),('Wael Nour',1075828,'Egypt',' 2 May 2016','Born Waael Muhammad Salaaheddeen Morsy, Waael Nour is an Egyptian actor who completed his studies at the High Institute of Dramatic Arts after graduating from the Institute of the Secretariat. He pursued an acting career playing mostly the roles of the naughty and the corrupt young man. Waael starred with actress Sherihan in the film “Kafas al-Hareem i.e. Harem cage” and has played a memorable role in the film “Al-hobb fee Taba i.e. Love in Taba”.\n“Al-bakheel wa ana i.e. The miser and me”, “Saaber ya ‘amm Saaber i.e. How patient is Saaber!” and “Khayaal ‘aashek i.e. A lover’s silhouette” are among his famous TV series.\nWaael played a number of stage roles, the most prominent is “Al-ganzeer i.e. The chain”, written by Muhammad Salmaawy and directed by Khaaled Saeed. Although absent from the film and television scene for years, Wael has managed to maintain a stable career in theater and is still leading plays in private and public theaters.\nHe was married to actor Ameera al-‘Aidy.','24 April 1961','https://media.elcinema.com/uploads/_315x420_eb6681d06b3103305fada5b170ffbb3668c1d20ccf580a6e5ff70d4e4c7a3ed0.jpg'),('Mostafa Shaaban',1075832,'Egypt','Egypt','Mostafa Shaban was born in Cairo. He received his bachelors degree from the Media Faculty at Cairo University in 1975. Whilst a student, Mostafa had directed some college productions. In his stage acting debut Shaban appeared alongside Mohamed Sobhy in the production “Bil’arabi al-Faseeh” (“In Standard Arabic”). He received the award for best actor from the Film Association for his role in “Fatta men Israel” (“A Girl from Israel”). He also received an award for “al-Sharq” (“The Orient”) from the Alexandria Film Festival.\nShaban has taken part in the television productions “Ahlam Moajjala” (“Deferred Ambitions”) and “’Aailat al-Hajj Metwally” (“The Household of al-Hajj Metwally”) and in the play “Tihib Tishoof Massa”.\n','19 May 1970','https://media.elcinema.com/uploads/_315x420_a4da326bd76601449b061904466670d5a41c03a6db3e9d23729c1de053b474e1.jpg'),('Magdy Abd-Elmessih',1075923,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_587bea68ef2eedc2e62749de023547edb3fd679876305766999448804ee15bc8.jpg'),('Abdallah Saleh',1075939,'United Arab Emirates','عبدالله محمد صالح الرميثي ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b33bf66fa8686ae8f45d3d3abf63e9ec2bdbbe648acfce121b262ae654348d9b.jpg'),('Mostafa Al-Shamey',1076031,'Egypt','Egypt','Moustafa al-Shaamy is an Egyptian actor who started his career through small roles in a number of films; “Mak’ad begewaar al-Shaytaan i.e. A chair beside Satan”, “Azwaag taaeshoon i.e. Stray couples” and “Ommahaat fee al-manfa i.e. Mothers in exile”. He also participated in a number of TV series; “Mata tabtassem al-Domoue’ i.e. When will tears smile” and “Dedd al-tayyaar i.e. Against the stream”. During his 30 year of acting, Moustafa participated in important works and earned a big number of awards. His last role was in the TV series “Abu dehka genaan i.e. The man with the fascinating laugh” which tells the story of the late comedian Esma’eel Yasseen who was a phenomenon among Arab comedians.','2 August 1944','https://media.elcinema.com/uploads/_315x420_04e6ff0efbbe5161f5d15df31379f209a4635336a7f0d7b4eeca7902a4ce65e4.jpg'),('باسل حسام',1076150,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Lamiaa El-Amir',1076374,'Egypt','Egypt','NONE','27 August 1957','https://media.elcinema.com/uploads/_315x420_26996f2726c79dbc474249d25d1eec1bed68574c11209825d2c55824af6f06f6.jpg'),('Khaled El Hagar',1076376,'Egypt','Egypt','Director Khaled El Hagar graduated from Law School 1987 from Cairo University. He worked as an assistant to the legendary director Youssef Shaheen.\nLater on he went to study cinema at Beaconsfield in the UK and graduated from that in 1994.\nKhaled El Hagar was one of the lecturers in the Berlin workshop for young talents as the only Egyptian to do so.\nHis films were playing in almost 150 international film festivals such as Caan, Montreal, Rotterdam and New York. He won 27 awards both internationally and nationally.','3 January 1963','https://media.elcinema.com/uploads/_315x420_451e264e131c9150a4a42616a715ca41643471141dfcb3c00c8ccf9d6d2b72d6.jpg'),('Omar Hassan Yousuf',1076383,'Egypt','Egypt','Amr’s parents are the (performers) Hassan Youssef and Shams Al Baroudy.\nHis first acting role was in the film “Shareaa 18” where he achieved moderate success which paved the way for future roles.','19 August 1980','https://media.elcinema.com/uploads/_315x420_9abbc7c920f87d1892d07b87dafc81435e0b6f027050e45f610267a65c77ef9c.jpg'),('Ehab Rady',1076411,'Egypt','Egypt','NONE','12 February 1969','https://media.elcinema.com/uploads/_315x420_b707f5601eda484898a9588736e6001e0309b1867c34526098dfb2631c762124.jpg'),('Olfat Sukkar',1076604,'Egypt','Egypt','NONE','27 December 1942','https://media.elcinema.com/uploads/_315x420_3c24ee9c347146adf7e144dc5072859827acbb8412113b89794c72af40966122.jpg'),('Salah Marei',1076659,'Egypt','Egypt','NONE','3 March 2011','https://media.elcinema.com/uploads/_315x420_d868de836ed41c3883fafebd0e7724240c44c4b09ead90976536a6bd048b65c1.jpg'),('رباب عبداللطيف',1077196,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Juma Abdullatif',1077324,'Egypt','Egypt','NONE','21 June 1968','https://media.elcinema.com/uploads/_315x420_14c5cca3219713b43633c13d84671f15e077dd7cb677011820d06588413b66ca.jpg'),('Safaa Jalal',1077335,'Egypt','Egypt','Elle est diplômée de la Faculté des Arts, Université d\'Alexandrie. Elle  a commencé sa carrière artistique depuis son entrée dans l\'université, où elle a été découverte par le réalisateur de publicité Georges Dawes et il l’a recommandée  pour la représentation d’un rôle dans une pièce mise en scène par Galal El Charkawy, qui a attribué son nom à Safaa pour que son nom artistique devienne Safaa Galal, et de là était le début d\'un d’un chemin fructueux de rôles distincts, en effet elle a travaillé avec un grand nombre de d’acteurs géants en Egypte, y compris Kamal El Chénawi, Fouad El Mohandess, Maali Zayed. Ses rôles ont varié de la jeune fille saidienne, la jeune fille, ou la bien aimée et elle a ajouté encore à ses rôles du drame à la comédie. ','20 February 1974','https://media.elcinema.com/uploads/_315x420_089ceb3f86d215447a30a13d743f1c9f01cdc52ae2508ec90b966e592295887b.jpg'),('Amr Diab',1077607,'Egypt','Egypt','Diab is the best-selling Arab recording artist of all time, according to Let\'s Go Egypt. He was awarded the World Music Award for Best Selling Middle Eastern Artist four times: 1998, 2002 , 2007 and 2009. He has also sold over 50 million albums worldwide.\n\nAmr Abdel Basset Abdel Azeez Diab was born October 11, 1961 in Port Said. His father was an accountant and his mother a French teacher. Both his parents encouraged their children to sing from a young age. Amr sang for the first time in public radio on a national holiday (Galaa’ Day) where he sang the national anthem in 1968.  The mayor of Port Said awarded him with a guitar for his efforts. Amr was only 6 years old at the time.\n\nDiab studied music at the art academy in Cairo, performing with his band “Mo Music.” He moved to Cairo in 1982 to study at the High Institute of Arabic Music. He taped his first song “Time” in 1983, but it was never officially released. In 1983, Diab released his first studio album, “The Road.” He graduated from the institute in 1986. Diab released three more albums between 1984 and 1987. 1988\'s \"Mayaal\" garnered huge success all around the Middle East. It was produced, arranged and remixed by German musicians, Frank Von Dem Bottlenberg and Jörg Evers, with various releases. More success followed in the following years including the albums Shawakkna, Matkhafesh, and We Yloumouni. By 1992, he became the first Arabic artist to start making high-tech music videos.\n\n\"Habibi Ya Nour el Ain\" from Diab\'s 1996 album, Nour El Ain became a worldwide hit, and was remixed by many of the world\'s top DJs. Diab\'s album El Leila De was released in the summer of 2007 and topped the Arabic music charts for 22 weeks. Diab received a World Music Award for Best Selling Middle Eastern Artist for the album. In 2008, Diab renewed his contract with Rotana for five more years. In 2009, Diab released a new album Wayah.\n','11 October 1961','https://media.elcinema.com/uploads/_315x420_c717138e33e64c60ff2ca40bc1ffb30fa74d3ed2d1e7f8d473fd1834fb2bfd39.jpg'),('Medhat Nassar',1077679,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Riham Abdulghafour',1077680,'Egypt','Egypt','Born in Al-Mahalla al-Kubra (Delta of Egypt) in September 6, she is the daughter of the Egyptian actor “Ashraf Abdul Ghafour”. Rihaam played the leading female role with Muhammad Heneidy and Ashraf Abdul Baky in the film “Saaheb Sahbo – Best friends”. She studied Commerce – English section. Delicate and distinctive, she became very popular for her roles in TV and cinema.\nParticipated in many TV series like “Al-aaela wal-naas i.e. Family and people”, “Hadeeth al-sabaah wal-massaa i.e. Day and night talk” and “Zizinia i.e. Zizinia (neighborhood in Alexandria)”. In cinema, participated in “Mallaaky Eskendereyya i.e. Privé Alexandria”, Kaan yowm hobbak i.e. The day of your love”, “Gaay fel-sareea i.e. I’m coming!” and “Bel-Araby Cinderella i.e. Cinderella in Arabic”. Performed in the play “Hamlet” and co-worked with Yahia al-Fakharaany in “Al-malek Lear i.e. King Lear”.','6 September 1978','https://media.elcinema.com/uploads/_315x420_c716b005036afcb96c775dc8fa44215afad328de7597d8855109f6ecdab7add0.jpg'),('Amina',1077842,'Egypt','Egypt','Born in Alexandria, on the 6th of December. Graduated from Egyptian Arts Academy (Acting and Directing Department) . Her real name is \" Wafaa Mohamed Naeeam\" but she chose the name of \"Aminaa Alfakharani\" in 1999, when she joined \"High Quality\"\" production company to be one of its Stars with Producer Tarek Abdallah… she chose the name Aminaa because of the resemblance her voice carries to an Algerian Singer called Amina . When she was at the Academy, she participated in many plays. As she wanted to be an actress originally, She started singing by chance, when she was somewhere with her friends and they asked her to sing and one of them was the Poet \"Ahmed Sheta\" who took her next day to the producer Tarek Abdallah, who was already impressed by her voice and signed a contract. She then Participated with a group of singers in the album \"High Quality 7\". Her song was \"Uday al-Ghazal\" written by Ahmed Shata and composed by \"Hussein Mahmoud\" . After that she filmed the song \"Maine\" which had great success. Her Supreme ideals are Ahmed Adaweya , Mohamed Alezaby and Mohamed Roshdy . Won Best Arabic song “Baladna\" in 2011 with Lebanese Singer Hisham Alhag at Mourex D’or . Won Best Single at Oscar Art in 2008.\" ','6 December 1971','https://media.elcinema.com/uploads/_315x420_99256be9e83f7a2e91d27fa03c1c28be6ebec29837cdf57288c8021c8b68e476.jpg'),('Mahmoud Hemeida',1077845,'Egypt','Egypt','Mahmoud Hussein Hemeida earned his bachelor’s degree in commerce in 1981. He is married and has four daughters.\nMahmoud’s acting career began with performances on television. He participated in the series “Harat Al Shurafa” and “Al Wassiyah”. His performance in that last series drew a lot of praise and acclaim for his talents and marked the beginning of his rise as a star.\nThe start of Mahmoud’s cinematic career began with (his performing a leading role alongside Ahmad Zaky) in the film “Al Embrator” (1990). Mahmoud has also founded a production company that has released several films including “Janat Al Shayytan”.\nMoreover, Mahmoud has also founded an (entertainment) magazine titled “Al Fann Al Sabeaa”. \nMahmoud has proved his uniqueness in his ability to embody the characters he is assigned and can be seen in his best form in “Faris Al Madinah” and “Aafarit Al Asfalt”. \nInas Al Deghidy (has offered him a role representing a very masculine character) in “Dantella”.\n','7 December 1953','https://media.elcinema.com/uploads/_315x420_ab61824ba47e686104299c7a0aaf4c22fe9d9071dd47f713a027a84a9571e76b.jpg'),('Mostafa El Tokhy',1077955,'Egypt','مصطفى الطوخي توفيق ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bc62c8bb829f2bb29f27066b0fff4fb849928692cdccebb99e61ea62c319f44c.jpg'),('Samer El Masrei',1077981,'Syria','Syria','Samer El Masry is a Syrian actor who was born on the 3rd of August in 1969. He received a bachelor\'s degree in science in 1991, and then graduated from the High Institute of Theatrical Arts in 1996. He started his career in the mid 1990s with roles in “Faris fil Madina” (A Knight in the City) (1995), “Hawa Bahary” (Seaside Love) (1997), “Tag min Shouk” (Thorn Crown) (1998). His most famous roles are in: “Alzir Salem” (2000), “Saqr Quraysh” (Quraysh Falcon) (2002), “Suqoot Gharnata” (The Fall of Granada) (2008), and the three seasons of “Bab El Hara” (The Alley\'s gate) (2006, 2007, 2008). ','3 August 1969','https://media.elcinema.com/uploads/_315x420_117afe0dcafffa08c4c8950f2fb0991c883effae8a353788bac8af23247e0dcd.jpg'),('Hind Rostom',1078019,'Egypt','Egypt','Rostom’s first appearance on cinema was in a role as an extra in 1954 whereby she appeared in only two scenes as an odd-acting girl in a film titled “al-Sittat ma Biya’rafoosh Yakdiboo” (“Women don’t know how to Lie”), the title was directed by Mohamed ‘Abd al-Gawwad. The film starred Shadya, Isma’il Yasseen and Shokry Sarhan. Prior to having roles as a voiced extra Rostom was assigned roles as a silent extra who sang songs on the film “Ghazal al-Bannat” with artist Leila Murad. She ended up at the United Films office in 1964 after which she had a minor role with artist Yahya Shaheen in “Azhar wa Ashwak” (“Roses and Thorns”) in 1947. The role was followed by other minor parts until she met director Hassan Reda whom she married. The couple had a daughter named Basant and Hend began her cinema career. Director Hassan al-Imam assigned her major roles. She never acted on stage and she presented several works with Isma’il Yasseen, the most important of which was “Ibn Hamido” in 1957 which was directed by Fattein ‘Abd Al Wahab. That was followed by a glowing performance alongside Salah Abou Youssif in “La Annam” (“I Do not Sleep”) in 1957. Her skills as an artist had matured by the time she presented “Sira’ fee al-Neel” (“Conflict on the Nile”) with ‘Aatef Salem in 1959. Hend Rostom was adept at expressing the volatility of women and their strong emotions in a respectable manner. She did this in “Ragol bella Qalb” (“Heartless Man”) opposite Yahya Shaheen in 1960 and once again on a few scenes in the film “Isha’at Houb” (“Rumor of Love”) that same year, that production was directed by Fatteen ‘Abd Al Wahab. Hend Rostom was successful at standing out and at becoming the actress whom people adored thus becoming the model of the talented actress on Egyptian cinema. Her performances represented a unique stream as her characters’ profiles had changed by the time she acted on “Bab al-Hadeed” and “Imraa ‘ala al-Hamish” (“A Woman on the Margin”). She presented a distinguished comedy role in “Houbb wa Houbb” (“Love and Love”). Hassan al-Imam was successful at employing her skills and presented her in some of her best roles. Her performance was also outstanding in a short role in “Kalimat al-Sharaf” (“Word of Honor”). Her acting talents were displayed in the film “al-Khoroug men al-Ganna” (“Exit from Heaven”) where she performed alongside artist Fareed al-Atrash. Hend Rostom received several awards for her films, especially “al-Gabban wa al-Houb” (“Love and the Coward”) in 1975. She also married the famous doctor Mohamed Fayyad. By the end of the ‘70s Rostom decided to retire from acting and her last work was “Hayyaty ‘Azab” (“My Life is Torture”) in 1979.','12 November 1931','https://media.elcinema.com/uploads/_315x420_b2ecdc5332ecba8846be09fb723da4def11c3aef1b376e070ba7ae9f1b156fb6.jpg'),('Fakher Fakher',1078316,'Egypt','Egypt','NONE','3 March 1912','https://media.elcinema.com/uploads/_315x420_272f3932e8524343acdd86efab89e997a2e51c2249c6571f6ab6297306ad4c6d.jpg'),('salah hassan',1078369,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1a03fa6571ab9940aa793b3e9b4943ecc3b8b75ea7f5df795d176be26bab4d3d.jpg'),('Firas Saayed',1078384,'Argentina','Argentina','Firas Sa\'id is a Syrian/Argentinian actor. He studied architecture in the university of Belgrano, Argentina, and worked as an interior designer. He now resides in Egypt and has picked up a career in acting by appearing in TV shows, starting with Al Jamia\'a (The University), “Serr A\'lany” (Public Secret) and “Hekayat Hayat” (The Story of Hayat). He had his big break in the Ramadan season of 2013 when he played “Adham” alongside Laila Alwi in “Farah Laila” (Laila\'s Wedding). He is married to an Egyptian and he has two kids who hold Egyptian citizenship, unlike him who hasn\'t received it yet.','15 April 1966','https://media.elcinema.com/uploads/_315x420_633306bb08ad50c276384824915c08cc29e036271e88425cbd884d8da6c1bef3.jpg'),('Hagag Abdel Azim',1078649,'Egypt','Egypt','NONE','16 August 1960','https://media.elcinema.com/uploads/_315x420_dceb3cddba2b7a60df78fd04238c42d412803e8fbcdd9ca864ca88cf1377e215.jpg'),('Samy El Adl',1078715,'Egypt','10 July 2015','Samy was born in the city of Mansoura in Dakahlia governorate. In addition to being an actor, he is also a  producer.\nHis career in entertainment started with work in theater and television. He graduated from the Institute of theatrical arts. His full name is Samy Tawfiq Aladl.\nAmong the television series he has participated in are “Al Samman wa Al Khareef”, “Al Burkan”, “Gawary bila Qyood”, “Al Harmalak”, “Balagh ila Al Naib Al Aam”. Among the most important of his theatrical performances are “Loly”, “Ahl Al Hawa”, and “Kalam Faregh”.\nHe is currently married to the actress Nadia Nour Al Deen and he was previously married to another actress by the name of Nadia Shoukry.\nHis career in cinema began towards the end of the 1970s when he assumed a minor role in “Ragab Fawq Safeeh Sakhen” which was a production that starred Adel Imam. In that performance, Samy assumed the role of a charlatan that worked with “Bolbol” (Saeed Saleh). His career in cinema continued into the 1980s where he usually assumed roles depicting evil characters such as drug dealers, gangsters, corrupt businessman and other roles of that nature. Samy continued performing roles of that type for a long while. His participation in movies increased with the (increase in the number of movies produced between 1987 and 1994). \nBy the end of this period, Samy developed a greater interest in film production and founded a company with his brothers Mohamed and Medhat Adl.  The company they founded was named “Al Adl Group”.\nThus, Samy achieved a great measure of success in film production and thereafter developed his acting skills. Samy was assigned roles that were positive than those he had assumed previously and among the best known of these roles was a role in the 2007 television series “Qadiyat Raey Aam” where he presented the role of an investigator leading a case that involved the rape of two doctors and a nurse.\n','2 November 1946','https://media.elcinema.com/uploads/_315x420_a3915b912bb2f9bf0decf34ba0259d06c8effbc1baea6e974f32b755ff5fa2e2.jpg'),('Aida Abd El Aziz',1078743,'Egypt','Egypt','Aida Abd El Aziz, whose full name is “Aida Abd El Aziz Abdel Rahman is an Egyptian actress who was born on October 27, 1936. She graduated from the Higher Institute for Dramatic Arts in 1959. After she completed her studies, she worked in the Ministry of Education as a supervisor to train school theater troupes. In 1962, she traveled to London with her husband, actor Ahmed Abdelhalim to complete her graduate studies in acting and directing and took a course in theater movement and voice. Of her most important works in stage theater include: “Shei Fi Sadri” (Something in My Chest), “El Ardh” (The Land), “Shagara El Dhulm” (Tree of Injustice), “Don Juan,” “Thamn El Horeya” (The Price of Freedom). She also worked in cinema, with the films: “Yomeyyat Na’ib Fil Areyaf” (Diary of a Country Prosecutor) in 1969, “Shahid El Malika” (The Queen’s Honey) in 1985, “El Namr Wa El Untha” (The Panther and the Female) in 1987, “Bawabet Eblis” (The Gate of the Devil) in 1993, “El Wad Mahroos Betou’ El Wazir” (Mahrous the Minister’s Boy)  in 1999, and “Heliopolis” in 2000. She also appeared in a number of TV serials, including: “Zeynab Wel ‘Arsh” (Zeynab and the Throne) in 1979, “Hala We El Darwish” in 1990, “Dhameer Ibla Hikmat” in 1991, “Yomeyat Wanis” (Wanis’s Diary) in 1994, “El Firar Min El Hob” (Escape from Love) in 2000, “Kanariya We Shoraka” (Canaria & Co.) in 2003, “Mowga Hara” (Heatwave) in 2013, and others. ','27 October 1936','https://media.elcinema.com/uploads/_315x420_5b15d78902558667f5dc14d1654e59533878eb3623cffc3f88a449855e846524.jpg'),('أيمن فتحي',1078805,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b864b67ce9a3a170c3aabf9c94c4eb026afd50eb484ea1530e413b3ab69e8e33.jpg'),('Said Naciri',1078855,'Morocco','Morocco','NONE','25 September 1960','https://media.elcinema.com/uploads/_315x420_85fba8b9aa1f58059ded4d8b05bc1ce7538c6533773940dcb94acf250600c631.jpg'),('Ayman Ismail',1078897,'Egypt','NONE','An Egyptian actor famous for his leading roles. He participated in many movies including:\"Wahed Sefr\", \"El Hekaia Feha Menna\", \"Kabaret\", \"Wahid Capochino\" and \"Shewayat Horya\" in addition to many series like \"Nos Ana We Nos Howa\" and \"El Zanaty Megahed\". He also presented many sitcoms like \"Asaad Allah Masaakom\" and \"Hadotat Ma Kabl El noum\". ','NONE','https://media.elcinema.com/uploads/_315x420_605bacb04c73b7f3b6f600bdbb53ab7772d833a61310436445dfb3290e45be95.jpg'),('Lebleba',1078978,'Egypt','Egypt','Ninochka Manoug Kupelian better known by her stage name Lebleba is an Egyptian film actor and entertainer of Armenian origins. Started her life mocking actors and the entrepreneur “Ma’allem Seddeek” discovered her and presented her to “Al-masrah al-kawmy i.e. The National Theater” where she became famous for stand-up comedies. Anwar Wagdy and Hassan al-Seify gave her some small roles in cinema. Abul-So’oud al-Ebiaary gave her the name Lebleba (The eloquent) after seeing the multi-talented child actor, comedian and dancer. She married actor Hassan Youssef, but they were divorced later on. She never remarried. Lebleba played a number of different roles with renowned Egyptian comedian Adel Emaam. The director Aatef al-Tayyeb gave her two noteworthy roles in “Dedd al-hokouma i.e. Anti-Government” and “Layla saakhena i.e. Hot night”, winning many awards. As she grew up, she took on more serious roles like a mother in Chahine’s “Al-aakhar i.e. The other” and a prostitute in “Gannat al-shayaateen i.e. Fallen angels paradise”.','14 November 1946','https://media.elcinema.com/uploads/_315x420_fa359d49e149ff891951ad7c7f0adc2ee30c65bd4672ce37a23b7d76d28f14b8.jpg'),('Shaaban Hussein',1079175,'Egypt','22 May 2013','Shaaban Hussein has earned a bachelor’s degree in Agriculture. He is an actor who has appeared on stage, television and film productions. In the mid 1960s, Hussein performed at the al-Dawla theater. Thereafter he transferred to the Mohamed Sobhy theater.\nAmong the best known television series which Shaaban has appeared in are “Ahlan Be al-Sokkan” (“Greetings to the Inhabitants”), “Yawmeeyat Wannis” (“Wannis’ Diary”), “al-Abla” (“The Teacher”), “Sunbul ba’d al-Million”, “Qaqees Waraq” and “al-Qarar al-Akhir” (“Final Decision”). His theatrical performances have included roles in “Nargis” (“Narcissus”), “Gawaz ‘ala Waraqat Talaq”, “al-Jokkar” (“The Joker”), “Anta Horr” (“You’re Free”), “al-Hamagy” (“The Barbarian”), “Takharif”, “Le’bat al-Sitt” and “Waghat Nazar” (“Point of View”). \nSha’ban has also assumed minor cinema roles.\n','24 November 1940','https://media.elcinema.com/uploads/_315x420_cedcc3e4498a370b47a0a284b2dc36e6667cf977f45baa013276ccfb38b47bbf.jpg'),('Khalil Morsy',1079283,'Egypt','Egypt','Egyptian actor Khalil Morsy was born in 1946. He received a bachelor’s degree in agriculture and later received a second degree in theatre, as well as a doctorate. He then became the head of the theatre department at October 6th University, where he worked until his death. Morsy played diverse roles - from the hero to the villain - working in theatre, cinema and television. Some of his most important works included the film, “El Embratour” (The Emperor) with Ahmed Zaki, and the play, “Laibet El Sit” (Lady’s Game) directed by Mohamed Sobhy. \n','21 September 1946','https://media.elcinema.com/uploads/_315x420_717f7dac069b2b7cde24ac9147f4ab3a5364cdc1ad0a18d49f7371f5d6768f45.jpg'),('Salah El Sayeh',1079289,'Egypt','Egypt','NONE','21 October 2013','https://media.elcinema.com/blank_photos/315x420.jpg'),('Randa',1079547,'Egypt','Lebanon','Randa is an Egyptian/Lebanese actress. She was born in Saida, Lebanon in 1964, and moved to Egypt with her family due to the start of the Lebanese civil war. She graduated from the High Institute of Theatrical Arts in 1990, and since then has worked between film and television, in works including \"Alhob Fawq Hadabet Elharam\" (Love Over The Pyramids Plateau), \"Al-Gouaa\" (Hunger) and \"Crystal\".','25 September 1964','https://media.elcinema.com/uploads/_315x420_76c4505dd35e9410f595fd6a7038a511c96ee1db65f938d90f23b1bfa491951d.jpg'),('Hassan Kamy',1079555,'Egypt','Egypt','NONE','2 November 1936','https://media.elcinema.com/uploads/_315x420_b42200886967b193c6fa8dfa93777daeccbf5813e4d65d4d42a4c4b27210817c.jpg'),('Zayed Fouad',1079972,'Egypt','11 October 2008','NONE','10 September 1949','https://media.elcinema.com/uploads/_315x420_ed0bac78a874f001cf8e00a36df5728db572206f8eba894ef6493c470af19950.jpg'),('mohmed genina',1080154,'Egypt','Egypt','NONE','1 January 1978','https://media.elcinema.com/blank_photos/315x420.jpg'),('Rasha Samy Eladl',1080206,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_51b38c689b6571aa6adfacc0b1ca6705882f2b8c600ed1baa806f24e383568ef.jpg'),('Magdy Badr',1080352,'Egypt','Egypt','NONE','14 October 1970','https://media.elcinema.com/uploads/_315x420_dbe796b81a19c8ef93f60653825417a7802ae3d6d4c2d3c1ac67eaae6f4cec25.jpg'),('Kamal Abu Raya',1080361,'Egypt','Egypt','Kamal Abu Raya is an Egyptian actor. He graduated from the Hihg Institute of Theatrical Art in 1985. In the mid 1980s, Anu Raya\'s career started taking shape, as he appeared in numerous television series, including “Al Saraya” (The Palace), “Bein El Qasrein” (Between the Two Palaces), and “Ma\'a Martabet Alsharaf” With Honors). He also appeared in several films, including “Abaa\' wa Abnaa\'” (Fathers and Sons) and “Wadaa\'an ya Walady” (Farewell my Son). He is most known for playing Qassem Amin, in the televisions series with the same name about the life of the early 20th century feminist activist. He also played critically acclaimed roles in the televisionse ries “Om Kulthum” and “Suq Al Aasr” (Afternoon Market).  ','23 October 1962','https://media.elcinema.com/uploads/_315x420_ef25dc7a7f0084c2c10e38a8b148a2f7b66d59445b065c2a4ded072d7ac35e3a.jpg'),('Ahmed Hamza',1080395,'Tunisia','15 March 2011','NONE','14 December 1930','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hamada Helal',1080533,'Egypt','Egypt','Hamaada Helaal is an Egyptian singer with a unique style, his success in singing lead him to become a cinema actor in a number of light comedies.','20 March 1980','https://media.elcinema.com/uploads/_315x420_47b5a4b719f48bfe5d539076817199929d11aca91c42a349c4ea754307b47de4.jpg'),('Yousry Nasrallah',1080752,'Egypt','Egypt','Yousry was born in Cairo in 1952 to a Coptic family. He studied economics at Cairo University before studying cinema at the Higher Institute for Cinema in Cairo in 1973. Initially Yousry worked as a cinema critic for a Lebanese paper named al-Safeer and as a director’s assistant in Beirut. He also worked as a director’s assistant with Youssif Chahine on the film projects “Wada’an Bonaparte” (Farewell Bonaparte) and “Hadoutta Masriyah” (An Egyptian Tale) (1981). Furthermore Yousry also worked with Folker Shlondorf on “al-Muzayyaf” (Counterfit) and with ‘Umar Amiraly on the documentary title “Massaib Qoum” (The Woes of a People). Next he participated in writing the screenplay for “Iskandiriyah Kaman wa Kaman” (Alexandria Again and Again) (1989) with Youssif Chahine and worked with him again in directing “al-Qahira Menawara bi Ahlaha” (Cairo is Alive with its People).\nYousry directed his first feature length film in 1990, the work was titled “Sariqat Sayfiah” (Summer Thefts), his second feature length direction work was “Mercedes” (1993). Thereafter he directed “Sibbyan wa Banat” (Boys and Girls) in 1995 and “al-Madeena” (The City) in 1999. One of his best recognized works “Bab al-Shams” (Gateway of the Sun) came about in 2004 and his last work was 2008’s “Geneinat al-Asmak” .\nYousry has offered audiences a unique view through his works and has tried to use his films to portray clearly the mindset of Egyptian society and its psychological constituents. His first feature length work “Sariqat Sayfiah” (Summer Thefts) was perhaps influenced by his own life story as it relates the life of his wealthy Coptic feudal family and the farmers.\n','26 July 1952','https://media.elcinema.com/uploads/_315x420_387314ae7a6b1cf29de3d73932eb0cbc23f59443a26f030c9da0ef2e66b40a72.jpg'),('Miral',1080849,'Egypt','ميرال كمال عيد ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9685f8f9aca240757e80b15561452d5a8e7d674a0903bac888816b405cd44fb3.jpg'),('Ahmed Azmy',1080872,'Egypt','Saudi Arabia','Ahmed Azmy started his career at a very early age. His career path began at the age of 11, when he used to write poems and send them to a children\'s radio show. His poems and letters were so moving, that they grabbed the attention of Mohamed Hamdy, the president of radio broadcasting at the time. Hamdy introduced him to Abla Fadila, who personally invited him to be a regular on her famous children\'s radio show. From children\'s radio, he was introduced to the actress Inaam elKretili, who helped launch his career in television. He first appeared as a child actor in the TV show \"Elforsan (The Knights)\" starring Ahmed Abdel Aziz.\n\nAfter finishing high school, he enrolled in the High Academy of Performing Arts to cement his talent and work experience with a formal education in acting. He also enrolled in the director Youssef Shahin\'s talent agency, which gave him his first job as an adult in the movie \"Elabwab elmoghlaqa\" after passing rigorous auditions and casting calls.  In 2001, he won numerous \"Best Actor\" awards in 3 different movie festivals for his role in this film.  He later went on to act in Yousry Nasrallah\'s film \"Elmadina\"\n\nAzmy gained notoriety through his role in the popular TV show \"Abbas elAbyad\" starring Yehia elfakharany, whom Azmy considers his godfather in this industry. \n\nHe lives with his wife Dina and son Adam.\n\n','23 April 1972','https://media.elcinema.com/uploads/_315x420_ecf0ab183ddbc56dd1b39b3501b08cc56c0e275c3049ea8b9022f5ba3f75a772.jpg'),('Omar Ezz Eldein',1081145,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_45772cbb895303d0a9f9b7d7231de4177f9165d371c8b0a8c7efb3e12e605ac8.jpg'),('Muhammad Ali',1081364,'Egypt','NONE','He started off as an assistant director in 1995 with the movie “Joy Thief” then in 2005 he did “Booha” which was a great success. Finally, he did his first solo directing for the movie “The Game of Love” followed by many more movies.','NONE','https://media.elcinema.com/uploads/_315x420_75a9630037b2b84a2f5bcc69e7e738176968cb423a933e4dd3b7f4d201852305.jpg'),('Amira Salem',1081733,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Shady Youssry',1081749,'Egypt','Egypt','NONE','20 December 1975','https://media.elcinema.com/uploads/_315x420_64c1ac1e05946c7c02d9fd0ad0bcf1cf93efd042b8aee1c456f229b9b884498e.jpg'),('Othman Abu Laban',1081944,'Egypt','Egypt','Lebanese director was born in Beirut 1973. Started his career directing video clips for stars like Moustafa Amar then directed a group of “action” films.','15 January 1973','https://media.elcinema.com/uploads/_315x420_4470fc597b225d56e8d4001aecf6a381957bf59af7411a65350d4bdf4b427b11.jpg'),('محمد عباس',1082085,'Egypt','محمد عباس أمين ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sayed Fadl',1082104,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Karim Qassem',1082123,'Egypt','Egypt','Karim Qassem is an Egyptian actor. He was born in 1986 in Cairo, and graduated from the American University in Cairo. Karim studied acting in several workshops in London and Paris, and joined Ahmed Kamal\'s acting studio. He was chosen by producer Hassan Elqalla to be one of the three leads in the critically and commercially successful drama film “Awqat Faragh” (Void Times). He then went on to appear in several films, including “El Magic” (The Magic Hour), “Bel Alwan El Tabia\'eya” (In Natural Colors), and “AUC”.','8 October 1986','https://media.elcinema.com/uploads/_315x420_c5603ad77bfbc89f14c889e6164b65df9f01632de3699cf79665ccb756e1046a.jpg'),('Amr Waked',1082130,'Egypt','Egypt','Amr Waked is an Egyptian film, television and stage actor. Western audiences best know him for his roles as the terrorist leader in \"Syriana\" (2005) opposite George Clooney, Rafik in Soderbergh\'s \"Contagion\" (2011), and as Yemeni Sheikh Muhammad inad in \"Salmon Fishing in the Yemen\" (2011) alongside Emily Blunt and Ewan McGregor. Waked graduated from the American University in Cairo with a degree in political science. He worked full-time as a stock trader and moonlit as an actor before fully committing to his acting career. He got his break in 2001 with \"Ashab Wala Business\" (Friends Or Business). His performance was so convincing, audiences left the theater believing he was a Palestinian actor. He got his first lead role in \"Deil el Samaka\" (The Fish\'s Tail) in 2003, for which he won a Best Actor award at the Alexandria International Film Festival. He was one of the first high-profile celebrities to openly join the 2011 anti-Mubarak protests. The next year, he honored the revolution in his critically acclaimed film \"Winter of Discontent\" directed by documentary-maker Ibrahim El-Batout. He made headlines in 2011 when he boycotted the Cannes screening of \"18 Days\" (he starred in and produced one of the short vignettes in the film) because of the festival\'s inclusion of certain anti-revolutionary figures. ','7 August 1970','https://media.elcinema.com/uploads/_315x420_976e8d9005dfe59d72b7f431e12b44fb3b099d801cf90666069597fdf001829d.jpg'),('Shady Al Ramly',1082135,'Egypt','شادي لينين الرملي ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('سيد شعبان',1082145,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Wafik',1082499,'Egypt','Egypt','Mohamed Wafiq is an Egyptian actor who has appeared in over 16 films and 100 television series. He was born in Alexandria to a father who worked as a college professor. He finished his high-school education in Alexandria, then received a bachelor\'s degree in theatrical arts in 1967, in the same class that contained Nour Elsherif, Magdy Wahba and Abdel Aziz Makhyoun. During his years at the High Institute of Theatrical Arts, and while he was working in the Television Theater as a trainee for extra money, he acted as a surrogate to Hussein Elsherbiny, who was absent one day, and took his role of a United Nations soldiers. The director of the show was impressed, and gave him the part instead of Elsherbiny. He then participated in the play “Sindbad”, during which he was approached by Youssef Chahin for a lead role in a film project that was later halted. Wafiq\'s big break came with his role in the television series “Almorshedy Antar” and “Alketaba Ala Lahm Yahtariq” (Writing on Burning Flesh) in which he played the role of Aldhahir Beibars. He also appeared as the Islamic leader Amr Ibn Al-Aas in the Prophet Muhammad biopic “Al Ressala” (The Message) which was directed by Mostafa Al-Aqqad. In the q980s, Wafiq performed his most famous role to date, that of the Egyptian Intelligence officer Aziz Al-gibaly in the three-season espionage series “Raafat El-Haggan”. His most notable role on film was in “Al Horub” (The Escape) alongside Ahmed Zaki.','24 September 1947','https://media.elcinema.com/uploads/_315x420_46a10753d38f5dbd666db3aa84ede695defa1f20df2d733f04c101727199f96b.jpg'),('Ahmed Shahm',1082589,'Egypt','Egypt','NONE','24 March 1979','https://media.elcinema.com/uploads/_315x420_2dcbe8c1652097cc4fcd1ae283d0546559c23325c631526e8e4984e89369fe96.jpg'),('محمود الصافى',1082609,'Egypt','Egypt','NONE','30 November 2014','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sayed Hamed',1082726,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a193ee981db49f67345b8a8ba899f18f8c15b74aa3c597480e9a725c0f1c2a52.jpg'),('Youssef Hussain',1082738,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fd519a04c08733f342ac99ddb197afc0c0a3b84a6c448fd5ef89abbdad35a598.jpg'),('Hend Sabry',1082742,'Tunisia','Tunisia','Hend Sabry is a Tunisian actress. She was born in Kebili province in Tunisia, and holds a degree in Intellectual Property. She started to become a recognized actress since she appeared in the films “Mousem Alregal” (Men\'s Season) and “Samt Alqosur” (Silence of the Palaces) by director Mofida Altelaly. She attracted the attention of Egyptian director Inas Eldegheidy, and she eventually cast her as the lead in her film “Mozakirat Morahiqa” (Diary of an Adolescent) in 2001. Among her most notable roles were those in films like Dawood Abdel Sayed\'s “Mowaten we Mokhber we Haramy” (A Citizen, an Informant and a Thief) “Ayez Haqy” (I Want my Rights), “Ahla El Awa\'at” (Best Times), and the television series “Aywa Atgawez” (I Want to Get Married) and “Embratoreyet Meen” (Who\'s Empire?).','20 November 1979','https://media.elcinema.com/uploads/_315x420_3be9ceb8a1fd0b21c76e9f61364a220f3824c20c85cae443370e59705b47ded6.jpg'),('Youssef Dawood',1082768,'Egypt','24 June 2012','Youssef Girgis Salib was born in (the neighborhood) of Seiyouf Shamaa in Alexandria. He graduated in 1960 from the (electronic engineering division of the faculty of engineering). Thereafter he worked as an engineer before devoting himself to (acting) in 1985.\nAfter (undertaking general studies) for a year he performed his acting debut in the theatrical production “Zqaq al Madaq”.\nAmong the television productions that he has participated in are “Al Souq”, “(Kasabna) Al Qadiyah” and “Al Dish wa Al Mish”. Youssef’s roles have varied from comic ones to portrayals of a police officer and a family head.\n','10 March 1938','https://media.elcinema.com/uploads/_315x420_98ae20adf1269dd04543d4719f3426e81826967786bab8cf44e8e68f442db7d2.jpg'),('Somaya El Khashab',1082826,'Egypt','Egypt','Summaya Sa’eed al-Sayyid Fathiyya was born in Alexandria. She studied at the faculty of commerce. Summaya has taken part in theatrical productions such as “Ballo” and “Kharbasha” (Scribbles) in addition to the television series “al-Hissab” (The Account), “Sammihny Makansh Asdee” (Forgive Me, I didn’t Mean to), “’Aaillat al-Hajj Metwally” (The Household of Hajj Metwally), “Haddrat al-Muhtarram” (Sir) and “al-Dawwe al-Sharrid” (Stray Light).','20 October 1966','https://media.elcinema.com/uploads/_315x420_67613bbbbf61c90d76a79c68a2fdbcba46549df06690b657992c4df133f04a7d.jpg'),('Samira El Hawary',1082855,'Morocco','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0b495d2f2f8582bcfcc8565d22e471af749a20d9fbe1bb99f29004559001886a.jpg'),('Amir Shahen',1083191,'Egypt','Egypt','NONE','1 January 1977','https://media.elcinema.com/uploads/_315x420_0e259b1fe4f5a24c3a0e8f5d653a748fae048f3a8bec40842e13c1f66111fcdf.jpg'),('Ali Abd al-Rahim',1083228,'Egypt','Egypt','NONE','13 May 1961','https://media.elcinema.com/uploads/_315x420_51257b7819868297c0fbf5ea8bce47eb6769c6f25bbc30124d0d84f8bb6f6ec5.jpg'),('Fawzy Al-Awamry',1083264,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4764ca63a0e29500c0c31c4c687b2b279dcb1b5ff315598966cc744049f4f660.jpg'),('Galeela Mahmoud',1083465,'Egypt','Egypt','Galeela Mahmoud Abdul Raheem is an Egyptian actor who studied at the High Institute of Dramatic Arts. She played several roles in cinema and theatre. She is more famous for her TV roles, like “Maha” and “Al-shahd wal-domou’ i.e. Honey and tears”.','12 September 1946','https://media.elcinema.com/uploads/_315x420_fcfd585da86daf46ebbda558555672d3ca6d0c730bfc614c14bb255fc9ade422.jpg'),('Sabah Mahmoud',1083680,'Egypt','صباح محمود عبدالعزيز شحاتة ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cf8643868fe1f96d4264ac5595097d51456c4f4a67bc9c4f868e107d3f13c266.jpg'),('Ahmad Attiya',1083779,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b94b6e91d23643ca8b858e5cb19647cbbe857c376099eb1cbae2493a36210bcc.jpg'),('Karim Mahmoud Abdelaziz',1083902,'Egypt','Egypt','Karim Mahmoud Abdel Aziz is a young artist known for his handsome face that looks very similar to his father’s at the beginning of his career. He didn’t know that he would be one day be an actor and in the world of cinema, despite the fact that his father is one of the most famous actors in the history of Egyptian cinema, Mahmoud Abdelaziz. Karim got his start by way of a video camera - one of his hobbies was to film and make movies with his friends. His talent led him to boldly interrupt his father’s meetings with directors Essam El Shama and Mohamed Abdelaziz to show them what he’d created with his camera. Essam was impressed with his talent, and after a few days, director Mohamed Abdelaziz chose him to act in the film “Shagaret El Ahlam (Tree of Dreams). Karim insisted on starting his career in cinema without assistance from anyone, even his father who objected to his son’s way of doing things. But Karim’s performance in the TV series “Ragil Min Zaman El Alouma” (Man from the Age of Globalization) made Karim’s father acknowledge his son as an actor. Karim participated in a number of films and TV series, including “El Nazzer” (The Observer) in 2000, the series “Mahmoud El Masry” (Mahmoud the Egyptian) in 2004, and “Ahzan Mariam” (Mary’s Sorrows) in 2006. \n','15 June 1985','https://media.elcinema.com/uploads/_315x420_c7d9b75445f67a831939265238d8d86a0504317022568c9f8ebc0078fd77ff86.jpg'),('Mohamed Abu Al-Hasan',1083969,'Egypt',' 8 June 2014','Mohamed Abo El Hassan was an Egyptiana actor. He was born in Cairo in 1937, and graduated from the faculty of agriculture in 1960. He worked as an agricultural engineer for some time, before landing a job in national television as an actor and director in a show for kids, which was presented by the famous hostess Nagwa Salem in 1971. He then took parts in theatrical plays including “Al Mutazawigun” (The Married Ones), “Min Agl Hefnat Nisaa” (For a Bunch of Women), “Hawel Tefham Ya Zaki” (Try to get It, Idiot). His most famous theatrical role was in the comedy play “Sok Ala Banatak”. Abo El Hassan also worked in television, in highly successful series like “Al Weseya” (The Village) and “Almal Wal Banun” (Fortune and Sons). In 1986, Abo El Hassan suffered from a stroke while shooting in location, and was rushed to fly to Paris as seven of his arteries needed replacement. Since then, his career started a downfall, as disease kept striking him and limiting his abilities, until his death in June of 2014 after suffering from a stroke. ','19 July 1937','https://media.elcinema.com/uploads/_315x420_dcc5cff300b3f220917a367ca874ba42f8b59413f0913b3d4f96717db34d9e96.jpg'),('Adel Alaasar',1083987,'Egypt','Egypt','NONE','28 February 1955','https://media.elcinema.com/uploads/_315x420_a526a5938ab82354baacd704e7cc8cbb4e76e65fce8567779278003936af43f1.jpg'),('Ghassan Matar',1083995,'Palestine','27 February 2015','Ghasan Matar was a Palestinian actor. He was born in Jaffa, and got interested in performing arts at a very early age. His debut as an actor was in the Egyptian television series “Da\'irat Aldaw\'” (The Circle of Light), and due to his unique looks and low-register voice, he was then often cast as a villain in numerous films, television series and theatrical plays. He also served as president of the Arab Artists Union, and wrote several screenplays, including the 1996 Palestinian film “Al Tha\'er” (The Rebel).','8 December 1938','https://media.elcinema.com/uploads/_315x420_414474cd07cb56a0053c9dfe899d8048b8fe8e0ba8eef7c78c42bcaefab98baf.jpg'),('Rania Yousef',1084040,'Egypt','Egypt','Rania Youssef is an Egyptian actress and model. She was born in Cairo in 1973 to an officer and a flight attendant. Prior to her acting career, Rania worked as a model. She\'s appeared in a number of television series, including \"Riyah Al Madina\" (City Winds),y Winds), \"A\'ilat Al Hajj Metwaly\" (The Household of Al Hajj Metwaly), and \"Al Nisaa Qadimat\" (The Women Are Coming). She\'s taken on increasingly controversial and racy film roles, which has ruffled the feathers of many in Egypt and the Middle East. She played a gynecologist in \"Wahed Sahih\" (2012) alongside Hani Salama, Ghada Adel, Kinda Alloush and Yousra Al Lozi. Her personal life has also attracted much attention. She married Egyptian producer Mohammad Mokhtar, with whom she has two daughters. Four months after her divorce from Mokhtar, she surprised everyone by announcing a secret wedding ceremony to an Egyptian businessman.','1 December 1973','https://media.elcinema.com/uploads/_315x420_20d99911c371c8748c9656f4b141e8b703d87d66752144ca1bde041b48a29ba8.jpg'),('Abdalla Mourad',1084141,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4544f08052b52f30c41f0c679b625da3ce54a1d4633b234ae09db11666f52199.jpg'),('Sherif  Mandour',1084154,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2d199f188852941fd9e30d45e1635f16cb03158f841503e8d1a1530569864173.jpg'),('Osama Sobhy',1084171,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Ezz',1084241,'Egypt','Egypt','NONE','7 September 1978','https://media.elcinema.com/uploads/_315x420_08682ba99c036a361c1ef92af0b540a1e4c3db95d7347a21b23f8680002ba4dd.jpg'),('Ahmed Adel',1084484,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_83a6cc8df6a855154dca3ca04cb22162d12422fddbb6160c90db7b60f5e851d6.jpg'),('Ibrahim Haggag',1084543,'Algeria','Algeria','NONE','14 May 1934','https://media.elcinema.com/uploads/_315x420_02970beccf33a68829d724c7c43893fc66ac49b7845bfb2e6c0dda04f585d8a8.jpg'),('Mona Hussein',1084645,'Egypt','Egypt','NONE','20 April 1969','https://media.elcinema.com/uploads/_315x420_cd674f5ff6c766b84dae9187602a20aa2b34cba05b56a882dbaead767001232a.jpg'),('Sherif Mounir',1084658,'Egypt','Egypt','Sherif Mounir is an Egyptian actor who was born in Mansoura, Dakahlia governorate in 1959. Following the advice of poet Salah Jahin, Mounir enrolled in the acting department of the Higher Institute of Theatrical Arts. He started his career in the mid 1980s appearing in the television serials “Rihla El Milion” (Journey of a Million), “Bakeeza We Zaghloul,” and “Leyyali El Haleema” (Nights of El Helmeya), as well as films “El Tawfaan” (The Flood), “Darbet Maalim” (Master Stroke), “Abnaa’ Wa Kutla” (Children and Murderers). Yet his big break came in the 1990s when he played Youssef in the film “El Kit Kat.” Since that time, he has appeared in a significant number of films, including “Diso Disco,” “Romantica,” “Short Wa Fanila Wa Kab” (Shorts, Tanktop, and Hat), “Sihr El Layyali,” (Sleepless Nights), “Welad El ‘Am”, and “Hysteria.”','14 May 1959','https://media.elcinema.com/uploads/_315x420_e8d0120fb5088fcca1f2ce69d5d0bb8b33cf1b2a38c3a878f9d85e57b223a501.jpg'),('Saeed Seddiq',1084751,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ebdbe19de6f2b9e4a6ed650617f7ecc3ca3ea66b07f0de3a2e376ea6de7fffd9.jpg'),('Aida Fahmy',1085012,'Egypt','Egypt','NONE','27 December 1958','https://media.elcinema.com/uploads/_315x420_9935c054553172eac855cfa86db93b465ef941d021b2841b97f3a650cae65676.jpg'),('Sawsan Bader',1085016,'Egypt','Egypt','Sawsan Badr (born Suzan Abu Taleb) is an Egyptian film, stage and television actress who was born in Cairo, Egypt, on September 25, 1957. She graduated from the High Institute of Theatrical Arts in 1979, after discontinuing her studies in the faculty of science. She\'s appeared in many theater productions, including \"Al Wad Sayyid Al Shaghal.\" She got her start in film in the British film “Mot Amira” (Death of a Princess) by British director Antony Thomas in 1980. This film made quite a stir at its premiere in Britain, as it infuriated the Saudi Arabian government for its portrayal of the kingdom’s history. Badr was blacklisted from Egyptian and Saudi television, and for this she lost many roles directly following the film. Though it made her very popular, she did try multiple times to leave Egypt, but finally decided on changing her name to Sawsan Badr. She delivered a memorable performance in her second role in the 1980 film “Habibi Da’iman” (Always My Love) directed by Hussein Kamel. She won the best actress award for the \nplay \"Al Ard La Tanbit Al Zuhur” and for her role in the television series “Dawlat Fahmy,\" as well as a number of international awards for her role in “Al Dawair Al Mughlaqa” in 2001. She received the Best Actress Award at the 34th Cairo International Film Festival. Badr was cast to play Nefertiti in Shady Abdel Salaam’s film about Akhnaton, though the great director passed away before finishing the movie. ','25 September 1957','https://media.elcinema.com/uploads/_315x420_aedb5bf8260161b0f0ec5faf1560ba9deecf946d03ab3f5cf5493ae3304ef6ac.jpg'),('Hatem Jamel',1085020,'Egypt','Egypt','NONE','18 September 1971','https://media.elcinema.com/uploads/_315x420_dd6633e5296e10b5107d927af705a6648336dcec6fa2157c6a28dda39257e0e0.jpg'),('Wafaa Al Sayed',1085077,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_53c19783fb18b6b459cc86afc312f586625e0f299cdf72b2872020ed6de1c196.jpg'),('Manar Hosny',1085158,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_09c3f91ea9c3c2889b41afc1bb76f588578a3890d28c8e60d2260fd435841b10.jpg'),('Akram Farid',1085168,'Egypt','Egypt','Director Akram Farid was actually a veterinarian, graduating veterinary school in 1995 before quitting medicine to pursue his love of film. He graduated from the High Institute of Arts- directing division in 2001, and shortly thereafter made a number of documentaries and small budget independent movies, including \"3 Papers.\"\n\nAfter only 1 year since graduation, he was offered the opportunity to direct a big budget movie, thereby jumping to a position that normally takes his counterparts 15 years to achieve.  He made several big budget \"commercialized\" movies as \"Haha and Tofaha\" \"Omar and Salma\" and \"Love is Like That.\"  Critics received him poorly, citing that these types of films lacked substance, despite being financially successful.\n\nFarid has recently attempted to break free of being type-casted as the \"commercialized director\" by taking on more deep films as \"Mickey\'s Family.\" ','6 March 1972','https://media.elcinema.com/uploads/_315x420_797c109db710c3ea52fc591d3633b2497e52390c46eb0fec8c94b782017217cb.jpg'),('Madiha Anwar',1085218,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_62d4e7134cf3e8366a182a1d78319e96f382b96160a71f40b3b081498ac0b68f.jpg'),('Yasser Ali Maher',1085363,'Egypt','Egypt','Yasser Ali Maher is a talented Egyptian actor. Despite the fact that he\'s mostly portrayed marginal characters, he\'s succeeded in capturing the attention of the audience. ','23 April 1958','https://media.elcinema.com/uploads/_315x420_864b5f107b4544515bef8c2a00f42b2bd0b7471ea0dbff6ae6ea5ebfe009db3c.jpg'),('Maysara',1085366,'Egypt','Egypt','NONE','24 March 1967','https://media.elcinema.com/uploads/_315x420_8765b975eb2e8992dc2507f170261548b1aa6b9fd60401cfced41c9fed8a98fc.jpg'),('Salah Afifi',1085651,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_44d3a6bfd1f7b8a5dd6c83437bc5dad16a4c981bc94578f79a61bd0a3e88d047.jpg'),('Fekry Sadek',1085805,'Egypt','Egypt','NONE','9 January 1945','https://media.elcinema.com/uploads/_315x420_1e7d063cc50b50821332ee41a3ea798419274c462a1c3b87902a01e7ffcfffad.jpg'),('Hany William',1085948,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9e584e09a13aa5c5bed671871de34fbe91a26b94089f09655a993111deac415e.jpg'),('Maha Abou Ouf',1086147,'Egypt','Egypt','Egyptian actor, Maha Abou Ouf is the sister of Dr. Ezzat Abou Ouf the actor and one of the Abou Ouf’s who formed the 4M band at the end of 1970s. 4M performed their original tracks, covered many others and stage played “Mousheera ala baab al-wazeer\" (Mousheera at Al-Wazeer’s gate). Maha studied at the American University in Cairo. Her films include “Ana la aktheb wa lakenny atagammal\" (I Don’t Lie, I Beautify), ”Matloub hayyan aw mayyetan\" (Wanted Dead or Alive), “Ahla al-aw’aat\" (The Best Moments) and “Maalesh ehna benetbahdel\" (We Are Being Tarnished). On TV, Maha has appeared in \"Sayyedat al-fondok\" (The Lady of the Hotel), \"Al-ragol al-aakhar\" (The Other man) and in the sitcom “Raagel we sett settaat\" (A Man and Six Women).','28 November 1959','https://media.elcinema.com/uploads/_315x420_b9b27b8fd97711ffb56ea4d9c4b20e908328601b21ab22ea8ed1248ae0c86015.jpg'),('ibrahim desoky',1086427,'Egypt','Egypt','NONE','21 February 1982','https://media.elcinema.com/uploads/_315x420_4c518da1d2fcce91048e2a65e8f91aa6d63bf8222ae6b8594aa6897048d0a363.jpg'),('essam saber',1086549,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('علاء الكاشف',1086595,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Kamal El Alfy',1086823,'Egypt','29 January 2017','NONE','13 May 1955','https://media.elcinema.com/uploads/_315x420_29d52c8ee548a944efbd86741fecab981ef6d50e585a5744483c0d834ae74146.jpg'),('Salwa Othman',1086924,'Egypt','Egypt','Studied English in the faculty of Arts, Salwa is the daughter of actor Othmaan Muhammad ‘Aly. Through her acting career, which began in 1980, she played several roles in radio, cinema, theatre and TV. Among her famous TV series are; “Al-bashaayer i.e. Tidings”, “Al-hall al-waheed i.e. The only solution”, “Al-nahr la yahtarek i.e. The river never burns”, “Al-dayaa’ i.e. Loss” and “Bawwaabat al-Metwally i.e The gate of al-Metwally”.','20 March 1959','https://media.elcinema.com/uploads/_315x420_13114e2df146575c2fd02b60ea6e93b9a54d7b7721be6f4961fd2a11deb5d67d.jpg'),('أيمن العرب',1086930,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6f81ec376e52ab612193dd0db54576fe3e0bfbb35c152d83234f437390988d2b.jpg'),('Ramez Galal',1086934,'Egypt','Egypt','Ramez Muhammad Tawfeek Galal is the son of the great director Tawfeek Galal and the brother of actor Yaasser Galaal. He went to school at Kasr al-Tefl primary school, Orman preparatory school and Giza secondary school. He joined the Higher Institute of Dramatic Arts to fulfill his great passion of acting, a passion that was developed through accompanying his father during rehearsals. Among his graduating group are: Ahmad al-Sakka, Ahmad Helmy, Muhammad Saad, Magdy Kamel, Manal Afeefy, Manaal Salaama and Ayman Azab. Ramez joined the Infantry for his military service. \nDuring his study he acted in “Goaz we Loaz\"  ( Nuts and Almonds) and other TV productions. After a period of absence, Ramez returned with “Hayaat al-Gohary”, a TV series starring Youssra and Moustafa Fahmy, that brought him fame.\nOn stage Ramez participated in one play: “Feema yabdou saraou Abdou” (It seems they stole Abdou). For children, Raamez presented “Al-shabaka al-mas-houra” (The magic net).\nAlthough for his first film he played a small role in Magdy el Hawwaary’s “55 Esaaf” (Ambulance 55), yet he was able to catch the eyes of the audience. Then came the films “Meedo maashakel” (Meedo troublemaker), “Al Baasha Telmeez” (His Excellency the student) and “Hobbak Naar” (Love burns) that paved his way to become a star.','20 April 1973','https://media.elcinema.com/uploads/_315x420_1af55f6f194ceb7f4a37b73d00dedf9cbcd21fc4c38b7408300c00445351fdff.jpg'),('Wahid Hamed',1087034,'Egypt','Egypt','Wahid is among the best known screenwriters in Egypt. He was born on the 1st of July, 1944 in the village of Beni Quraish in the governorate of Sharqia. Hamed received a Bachelor of Arts degree in sociology in 1965 and began writing drama works in the late 1960s. He first began to realize success through a television series titled “Ahlam Al Fatta Al Taaer” (“Dreams of a Fly Boy”) which aired in 1978 and starred A’del Imam. The series achieved a great deal of success and began a long term collaboration between Imam and Hamed in cinema works that began with the film “Intakhibo Al Doctor Suleiman A’bd Al Bassit” (“Vote for Doctor Suleiman A’bd Al Bassit”) and “Al Insan Ya’eesh Marra Wahda” (“A Person Lives Only Once”) which were released in 1981. The working relationship continued throughout the 1980s. Also in the 1980s Hamed wrote screenplays for the films “Al Takhshiba”, “Al Bareea” (“The Innocent One”), “Al Donnia A’la Gannah Yammama” and “Kashf Al Mastoor” (“Revealing the Hidden One”) which were directed by the renowned director A’tef Al Tayyib . The 1990s saw Hamid collaborate with director Shereef A’rafeh and performer A’del Imam, a collaboration which led to the release of five films titled “Al La’ib ma’a Al Kibar” (“Out of Your League”) (1991), “Al Mansy” (“The Forgotten One”), “Al Irhab wa Al Kabab” (“Terrorism and Kabab”) (1994), “Teyour Al Zhalam” (“Birds of the Night”) (1995) and “Al Noum fee Al A’sal” (“Carefree Sleep”).\nLater in 2006 Hamid penned the screenplay for “A’marrat Ya’coubian” (“The Ya’coubian Building”) which adapted the novel by the same name which was authored by A’laa Al Asswany. That production featured the involvement of a large number of stars including A’del Imam and Nour El Shereef. The work was also the first directing experience of Hamed’s son, Marwan Hamed. Hamed’s last cinema work was “Ehky ya Scheherazade” (“Tell us, Scheherazade”) which was directed by renowned director Yousry Nasr Allah. The writer’s last television work was a series titled “Al Gama’a” (“The Community”) which aired in Ramadan 2010. That series is a biographical work about Imam Hassan Al Banna who founded the Muslim Brotherhood. Hamid is known for his opposition of religious fundamentalism and is considered a staunch opponent of the Muslim Brotherhood. He is married to Zeinab Al Suweidan who heads Egyptian television. The couple have one son named Marwan.\n','1 July 1944','https://media.elcinema.com/uploads/_315x420_52931b884320e0bc3b70cc312a0845c966d2157b43d0fa091d0846a4ed820182.jpg'),('Othman Abdelmonem',1087051,'Egypt','24 April 2004','Othman Abdel Menaem is an Egyptian actor born in the city of Mansoura in 1941. At the start of his career, he worked for years in theatrical productions. He then moved his career to film, where his overweight body and his low-registered voice were used by filmmakers to portray comic characters in tens of feature films. Though his roles were mainly small or supporting roles, he gained wide popularity among Arab audiences. Among his best known works are “Ahlam Hend we Kamilia” (Hend and Kamilia\'s Dreams), “El Kitkat,” and “Batal men Waraq” (Paper-made Hero).','15 June 1941','https://media.elcinema.com/uploads/_315x420_bec3cdc01990ec21f366160c52c1f0a89b4485cffd6fc1891f6df286c3c0a2d0.jpg'),('فالكون فيلم',1087277,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Khalil',1087348,'Egypt','Egypt','Ahmad Muhammad Ibraheem Khaleel joined “Al-habeeb” Institute after finishing his studies at the High Institute of Cinema in 1965.\nPlayed stage roles like ”Khaadem sayyedayn i.e. A servant for two masters”, “Yasseen we Baheyya i.e. Yasseen and Baheyya” and “Hobb taht al-heraassa i.e. An under guard love”.   \nIn 1970’s, Khaleel travelled to a Gulf country and did not show as an actor then returned heavily to TV in “Yamout al-zammar i.e. Piper dies”, “Hadeeth al-sabaah wal-massaa i.e. Morning and night talk”, “Zaman Alaa al-Deen i.e. The time of Alaa al-Deen”, “Bawwaabet al-Halawaany i.e. Halawaany’s gate” and “Al-forsaan i.e. The knights”.\nParticipated in Haany Lasheen’s film “Al-aragoz i.e. The puppeteer” along with superstar Omar Sharif and among his important roles in cinema; Shaady Abdul Salaam’s “Al-momiaa i.e. The mummy”, Aatef al-Tayyeb’s “Katibat al-e’daam i.e. Execution troop” & “Dedd al-hokouma i.e. Anti-government” and Muhammad Faadel’s “Naaser 56” and “Kawkab al-shark i.e. Orient Star”.   \nAhmad Khaleel played different successful roles in TV yet he did not make the same success in cinema.','15 January 1941','https://media.elcinema.com/uploads/_315x420_8a3d5ebb41572b16a99454d0cce28d66bfd72e6dbf66303bf5181221cb66d439.jpg'),('Kamel Abu Ali',1087938,'Egypt','Egypt','NONE','26 August 1954','https://media.elcinema.com/uploads/_315x420_c37a77daf89823bb8774ac4a2614f408a187013f924490a743b814f33933985b.jpg'),('Salwa Khattab',1087969,'Egypt','Egypt','Salwa Khatab (Salwa Mohamed Morsi Khatab) was born in Cairo in 1964. She graduated from the Higher Institute for Dramatic Arts in 1978. Her acting career began when director Henry Barakat cast her in the film “‘Ashaq Taht El Ashreen” (Love Under 20), but her big break came with the TV series “Hend We El Doctor Noman” (Hend And Doctor Noman). Since that time, Salwa Khatab has alternated between roles in television and cinema. Her cinematic performances include those in: “Shawader,” “Desouky Afendy Fil Mussayef” (Desouky Afendy At the Resort), “Afareet El Asfalt” (Road Demons), and “El Sahir” (The Magician). Some of her television performances include those in: “Raafit El Higan,” “El Dhou El Sharid” (Stray Light), “Hadeeth El Sabah We El Mesaa,” (Morning and Night Talk) and “Neran Sadika” (Friendly Fire). \n','26 February 1959','https://media.elcinema.com/uploads/_315x420_d7042c3ff901fc1693296e157a2d0eaecc8ad52d29b998c6b973bbdb7c91c7a3.jpg'),('Karim Abo zaid',1088023,'Egypt','Egypt','NONE','9 July 1980','https://media.elcinema.com/uploads/_315x420_e43a330208add86e7edbb571f63e4398a22984251aa28de847e0aa74f86690d4.jpg'),('Yasser Abdul Rahman',1088244,'Egypt','Egypt','In 1983, Yaasser graduated from the Higher Institute of Arab Music at the Egyptian Academy of Arts.','22 April 1961','https://media.elcinema.com/uploads/_315x420_e35f90dc9e30dd9094a6e3cff7570b5825c5e4304fa2cc411aaf6b13389aee6d.jpg'),('Mohamed Metwally',1088274,'Egypt','17 February 2018','NONE','11 March 1945','https://media.elcinema.com/uploads/_315x420_1556a0818c004081d9e7dd7a525d2faaebb08f98e80b09b19a470d6ae59c409b.jpg'),('Mohamed Shoman',1088277,'Egypt','Egypt','NONE','25 March 1958','https://media.elcinema.com/uploads/_315x420_13c3212e62df795fdea9d02d00956f53c1a27c192662247b2698bf99347ac830.jpg'),('Omar Naguib',1088389,'Egypt','19 February 2020','NONE','18 June 1982','https://media.elcinema.com/uploads/_315x420_abf87296da3981ee50872c6fa89cf42fbfac67b696e289bde9d44c756b0eca58.jpg'),('Doaa Hegazy',1088393,'Egypt','دعاء عبد الهادى حجازى ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_70cbd8ef86dc97132a5891c8104034d037fd60d697b081e28cbfa97cf33d3e63.jpg'),('Nahed Farid Shawqy',1088394,'Egypt','Egypt','Nahed Farid Shawki is an Egyptian film producer, and the owner of her eponymous production company. Her productions include “Hysteria” (1998) which starred Ahmed Zaki and Abla Kamel and was directed by Adel Adeeb, and “Men Nazret Ein” (From a Glimpse) (2003) which starred Amr Waked and Monza Zaki and was directed by Ihab Lama\'y. She has also worked as an executive producer in several television series.','25 December 1950','https://media.elcinema.com/uploads/_315x420_b96a6eb78a1a1b064e8acd331c453464f19004765140c9f2bac1905bf55b8342.jpg'),('Majed El Masry',1088417,'Egypt','Egypt','A singer and actor who was born in Tanta. He graduated from Al Azhar University and his talent was discovered in school where he studied the art of popular and classical dance and ballet. He started by singing in night clubs with his wife at the time singer “Mona Ish Ish” where they made their own duet called Maged and Mona. \nMaged had compiled a singing album that was released in the market but unfortunately it wasn’t very successful. He was discovered and introduced to the cinema by late director Hussam El Din Mostafa in the movie “Hekmat Fahmi the Spy” \nMaged also did some series such as “The Twins”, “Bird Dreams”, “For Security Reasons”  and “The Shadow’s Image” and he participated in one play. \n','19 March 1963','https://media.elcinema.com/uploads/_315x420_0c10062969aa3160b02fe93123c83c8ddb61938c42ef940efc0a8bd6b8bb6cec.jpg'),('Mohammed El Sadaany',1088539,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5d548fd1482d99bb2457d5000de040cd188b66867533b1cad5470f661cbbee5d.jpg'),('Mostafa Hashish',1089323,'Egypt','Egypt','NONE','13 May 1953','https://media.elcinema.com/uploads/_315x420_32a60afd9785a4a76907d42a2a8dc04b1db751604c543e0b19399a42ee3e3bb1.jpg'),('Ehab Sobhi',1089352,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_03284523a1e677cdd884829d4c6bce433a4c7bb57e2e9c194ce32a3077885048.jpg'),('Ahmed Kamal',1089468,'Egypt','Egypt','Ahmed Kamal is an Egyptian actor and acting coach who was born in 1959. He started working in film during the eighties of last century in several important films like Khairy Beshara\'s \"Youm Mor we Youm Helw\" (A Bitter Day and a Sweet Day) and Dawood Abdelood Abdel Sayed\'s \"El Kit-kat\" and \"Mowaten we Mokhber we Haramy\" (A Citizen, an Informer and a Thief). He also worked in several successful television series like \"Farah Layla\" (Layla\'s Wedding) and \"Zat.\" He has been running his own acting workshop for years. ','22 August 1959','https://media.elcinema.com/uploads/_315x420_86b1be24ee7999e49234d65566f259043880e4db4fa8189543b05a8ab0abb5fc.jpg'),('Ezzat Abu Ouf',1089793,'Egypt',' 1 July 2019','Ezzat Ahmed Shafiq has earned a bachelor’s degree in medicine. \nHe is a member of the family of the (performer Ezzat Abu Ouf) which includes three daughters as well. Together they formed a troupe in the early 1980s that was known as (“The Four Ms”) which assumed roles in several theatrical performances which include “Ashra Alla Bab Al Wazeer”.\nHis sister Maha would later take up acting as a career and after the troupe was disbanded he was free to work on television and cinema projects. \nAmong the acting performances where his talents were most apparent were “Hawanem Garden City”, “Nisf Rabie Al Akhir” and “Ziziniyah”.\nHe is married to someone he met outside of the acting community and he has two children named Kamal and Mariam.\n','21 August 1948','https://media.elcinema.com/uploads/_315x420_eb471342f41c9b6126576073a4a465316849bc3ee59f3db10f3e271ba5b68a0f.jpg'),('Samy Fahmy',1089818,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_aa5094e1034bbdb6fb918720a11e16a46ff0b987b6bf484717c0cfa37eb41eed.jpg'),('Randa Al Behiry',1089829,'Egypt','Egypt','Randa is a young Egyptian actress. She loved theater from an early age and would often go to the theater with her mother, who worked there as a designer. Randa studied the English language at the faculty of arts. Randa began her television career as a model in commercials, and soon transitioned into music videos. Her success and popularity in music videos brought her more and more attention. From 1998 onwards, she began pursuing roles in television, theater and cinema. She has proven herself a performer to watch. Critics and the general public have praised her performances despite the fact that her roles have varied in terms of character and setting. Though she is young and just at the beginning of her career, her success has brought her many important roles. Randa has performed alongside several major actors including Yahya Al Fakhrany, Elham Chahine, Yousra, Ahmed Eid and the Lebanese musician Rola Saad.\n','18 August 1983','https://media.elcinema.com/uploads/_315x420_8b271ce52195b471bea40d2d10c0fa9b808182415445cc4b32412343310b53b7.jpg'),('Raghda',1089996,'Syria','Syria','Raghda’s full name is Raghda Mahmoud Na’na’. She was born and raised in Syria to a Syrian father and an Egyptian mother. She grew up in the Syrian town of Aleppo where her father’s house included 14 children. Raghda enrolled at the Arabic language division of a literature faculty in Cairo. She worked in Syrian cinema before assuming the leading role in the series “A’sr Al Houb” (“The Age of Love”) in 1982. Her activities are varied and include work on theater, television and cinema. Amongst the television productions that she has taken part in are “A’sr Al Houb” (“The Age of Love”), “Istabl A’ntar” (“A’ntar’s Stables”), “Al Dawaer Al Mughlaqa” (“Exclusive Circles”), “La Ilah Ila Allah” (“There is no Deity But God”). Her well known theatrical performances include “Saloumy” and “Al Rahaen” (“The Hostages”). She has assumed roles in several series in Syria, amongst which is a series titled “Al A’bbayid”. In 2002 Raghda worked as an announcer on “Garrat Al Qammar” (“Neighbor to the Moon”). Throughout her career Raghda has utilized her intelligence in order to consciously mould her stardom. Most of the roles that she has undertaken, and in particular those in cinema were directed by Kamal Al Sheikh and  Darid Laham. Raghda\'s most famous roles were in  in “Al Embrator” (“The Emperor”) and “Raghbat” (“Wishes”), and \"Kaborya\" (Crab).','26 November 1957','https://media.elcinema.com/uploads/_315x420_52b435a98b4efaef7693cb7cb696c758a9de6bf7a7868edae819c06b560d2d26.jpg'),('Samy Maghawry',1090208,'Egypt','Egypt','Samy Maghawry is an Egyptian actor. He was born in 1951 in Cairo. He graduated from the faculty of law in 1975. He debuted as an actor in the television series \"Leilet Elqabd Ala Fatma\" (The Night Fatma Was Aressted) in 1982, after which he went on to appear in numerous television series, theater plays and films. His other notable work includes roles in \"Bein El Wasrein\" (Between the Two Palaces) in 1987, \"Ana Wenta We Baba Fel Meshmesh\" in 1989, \"Zezenia\" in 1989 \"Heena Maysara\" in 2007, \"A\'ilat Mickey\" (Mickey\'s Family) in 2010 and \"Moga Harra\" (Heat Wave) in 2013.','16 September 1951','https://media.elcinema.com/uploads/_315x420_fc418fcc34f7f4a8dc3f9fb187dfd99b6d75b580c885d6081998b5d80549e06b.jpg'),('Ismail Gamal',1090281,'Egypt','Egypt','NONE','22 November 1947','https://media.elcinema.com/blank_photos/315x420.jpg'),('Wissam Sabbagh',1090408,'Lebanon','Lebanon','NONE','19 March 1974','https://media.elcinema.com/uploads/_315x420_952972c75d79ac2d1dde622b984354282fbffd1ffbf05fffe51ecda494d5995f.jpg'),('Screen 2000',1090694,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d07c91f0cf985d1418b058f789ad760c87de8263e0a508fe8a754c6188f288bf.jpg'),('Jumana Murad',1090981,'Syria','Syria','Jumana Murad is a prominent Syrian actress. She earned her degree from the University of Damascus, then made her TV debut in 1998 when she began acting on television dramas. She worked on eighteen TV shows for the next decade, until she made her film debut in \"El Shayateen\" (Devils) in 2007. She\'s acted in over thirty productions, including \"El Farah\" (The Wedding) in 2009. Murad also owns her own production company, Jumana International. Murad made headlines this year when she announced she was in a romantic relationship with a man (his nationality remained a secret) whom she did not intend to marry. ','1 April 1973','https://media.elcinema.com/uploads/_315x420_ddd51d1a66fa56a1d20e8786dc6de2e699148d61ac88a08d90e72eef6e61a027.jpg'),('Zahrat Al Oula',1091210,'Egypt','Egypt','Zahra al-‘Oula Bakir was born in the district of Muharram Bey in Alexandia to a family originally from al-Mahala. Her talents for acting and imitation were apparent when she was in secondary school. Her father was a friend of Youssif Wahbi and so he presented her to him and she enrolled at the Acting Institute with the help of Zaki Tuleiman. Zahra acted in several plays including “Hourriyah men al-Mareekh”, “al-Bakheel” (“The Miser”), Mareed bi al-Wahm” (“Illusory Illness”), “Fattish ‘an al-Maraa” (“Look for the Woman”), “al-Ghabi wa Anna” (“The Idiot and Myself”) and “Sab’a Farkhat wa Deek” (“Seven Hens and a Rooster”). Thereafter she was assigned major cinema roles. Zahra enjoyed a romantic aura and she received a diploma from the Higher Institute for Cinema in 1954. Zahra was the first in her class and she continued her stage career on modern theater. Zahra married Salah Zu al-Faqqar and later director Hassan al-Saifi. Among the television series which she has acted in are “Waffiyat Nas Tayebeen”. Zahra was honored at the Feature Films Festival. While a youth, Zahra represented the model of the innocent and suppressed girl. She has not portrayed any evil characters as her appearance does not lend itself to such roles. Zahra also acted in “Radd Qalbi”, “Du’aa al-Karwan” and “Tareeq al-Amal”. Despite the fact that she has acted in some comedies her roles were generally not comedic.','10 June 1934','https://media.elcinema.com/uploads/_315x420_c16f864481a4e36fc4002956583c1995b8111a0ba4cc66c2ac55a56efed107d7.jpg'),('Youssef Shabaan',1091387,'Egypt','Egypt','Egyptian actor, born Youssef Sha’baan Shemeis in Cairo has studied acting. Played several stage roles and caught many an eye. Great cinema director Hassan al-Emaam gave him a leading role in “Al-mo’geza i.e. The miracle” and several roles; “Zokaak al-madakk i.e. Madakk alley”and “Baae’at al-garaaed i.e. The newsgirl”.\nSha’baan excelled in TV series like “Raafat al-Haggaan”, “Haala wal-daraweesh i.e. Haala and the Dervishes”, “Eilet al-Doghry i.e. Doghry’s family” and “Al-taw’am i.e. The twins”.\nYoussef married actress Laila Taaher, actress Sihaam Fat-hy and her Highness Princess Nadia Sherine mother of his daughter Sainaa.\nIn his early life, Youssef Sha’ban was the racehorse in cinema especially in “Miramar” and “Hammaam al-Malateely” then gradually went to TV.\nStarting 1997, Sha’ban was elected Chairman of Egypt’s Actor’ Union for two consecutive periods.','16 July 1936','https://media.elcinema.com/uploads/_315x420_6cb1be9b821fe49b81c72534c3854278331b015103a58ea6a5001de5be722f22.jpg'),('Nour',1091450,'Lebanon','Lebanon','Marianne Philip Aby Habib, known professionally as Nour, is a Lebanese actress.  She began her career as an advertisement model after graduation from the Faculty of Fine Arts in Beirut in 1995.  Her first major film role was in “Short w\' Fanella w\' Kab” (Shorts, T-Shirt and a Cap) opposite Ahmed El Sakka in 2000. She then starred in many Egyptian blockbusters like “Ashab Walla Business” (Friends or Business) in 2001, “Okal,” (2004), “Matab Senaa\'y” (Artificial Speed Bump) and “Zarf Tareq” (Urgent Incident) opposite with Ahmed Helmy in 2006. She also starred in the television series “Al Amil 1001” (Agent 1001) in 2005, and “Domoa\' Al Qamar” (Moon\'s Tears) in 2008.','23 December 1977','https://media.elcinema.com/uploads/_315x420_1712244d400270db5eb3f34e05e7baecbc36b2feb2bfc3c90a5f8f1cdc2ba83d.jpg'),('Islam Yousuf',1091522,'Egypt','Egypt','NONE','27 January 1973','https://media.elcinema.com/uploads/_315x420_bba07e3b3844108ccf8a5de28d427f09557c92cd74b634ea5e19f15bff238c4a.jpg'),('Madiha Al-Bakry',1091563,'Egypt','Egypt','NONE','4 April 1968','https://media.elcinema.com/uploads/_315x420_ecbd68346f7e26f22169506f5ff799de46aa63002430560bdba1ba96dcdf95fb.jpg'),('Hadi Al Jayyar',1091632,'Egypt','Egypt','Hady El Gayar is an Egyptian actor. He studied acting at the High Institute of Theatrical Arts. His breakthrough came with his role in the popular play “Madraset Elmoshaghbeen” (School of Rowdies). He appeared in numerous television series, including “Almal wal Banun” (Fortune and Progeny), “Elraya Elbeida” (The White Flag), “Alnawares wal Soqur” (Albatrosses and Falcons). His notable film roles include those in “Thom Tashreq Alshams” (Then The Sun Rises) (1971) and “Ihtares Esabet Alnisaa” (Watch Out for the Women\'s Clan) (1986).','15 October 1949','https://media.elcinema.com/uploads/_315x420_4f32dc15d8d5389edc04a8054fa3dd37af5d7a19f7bc98b11485c1f80e5db68f.jpg'),('Amr Abd Al-Aziz',1091891,'Egypt','Egypt','NONE','9 December 1982','https://media.elcinema.com/uploads/_315x420_3e07e08bb810554455679a9bdfb866c0a576bacf436a736dc0f060aa1e3ec75d.jpg'),('Ahmed Yousri',1092032,'Egypt','Egypt','NONE','2 June 1975','https://media.elcinema.com/uploads/_315x420_81cb57d7351eab9f40a83ec06a929c63e1a464daccc8b469edb9ea55d57e2575.jpg'),('Mostafa Ali',1092165,'Egypt','Egypt','NONE','5 October 1975','https://media.elcinema.com/uploads/_315x420_7c056d966addda92d8e8b3468d7b3ca703873b5e82f68663be6a3e7e16c0562c.jpg'),('Amira Naif',1092318,'Jordan','Jordan','NONE','20 October 1980','https://media.elcinema.com/uploads/_315x420_e0e69ea142cd08a02418ebcccd2219828d0f6557110595e7b5ac18f5264556bd.jpg'),('Rojina',1092357,'Egypt','Egypt','Egyptian actress, graduated from the High Institute of Dramatic Arts yet never played a stage role. “Al-‘aaela i.e. The family”, “Shayy men al-khawf i.e. Some fear”, “Awraak Mesreyya i.e. Egyptian documents” and “Yawmmeyyaat zowg mo’aasser i.e. Diaries of a modern husband” are among her TV series. Roujina is married to actor and director Ashraf Zaky.','16 April 1973','https://media.elcinema.com/uploads/_315x420_10de3ee047532982ef7f0a73f56e3f40317e05d67c28e505335c6194a23c2b9a.jpg'),('Hani Khalifa',1092421,'Egypt','Egypt','Hani Khalifa originally from upper Egypt started as an assistant director in movies such as “Joy Thief” and “Nut Shells”\nIn 2003 he decided to direct the movie “Sahar Al Layali” or “Staying Up Late Nights” which impressed many, but then he disappeared for a long time, he was offered to direct the movie “Free Time”  but declined due to his disagreement with the producer.\nHe stayed away from the sport lights until 2011 when he directed his series “The University” that impressed many fans and audience.\n','6 March 1970','https://media.elcinema.com/uploads/_315x420_01bcf9223e1d09c7d871a6f98a689ab4ae3779f5061763b78aa43400cb3875fa.jpg'),('Hussein Riad',1092534,'Egypt','17 July 1965','Born 13 January 1897 in al-Sayyeda Zeinab (popular district of Cairo), in 1916 he quit school to start acting and joined the Arab Acting Institute. In 1923 he worked with Youssef Wahby Theatrical Troupe then worked with Abdul Rahman Roushdy, Moneera al-Mahdeyya, al-Reehany, Al-Kassaar, Awlaad ‘Okaasha and Fatma Roushdy Troupes. He worked in silent films starting 1926 and since then he acted in more than 100 films. He received the State Award and Medal of Science and Arts (1963) and died in 1965.','13 January 1897','https://media.elcinema.com/uploads/_315x420_bff8b82c3987a34c76c008a5bcb2d545b7c5d69eaa6ea61418cd5e0964dec17d.jpg'),('Nahed Roshdy',1092795,'Egypt','Egypt','NONE','14 September 1956','https://media.elcinema.com/uploads/_315x420_e1c50dfc4ada073ec0416c0ca912bb431a6f6ec16a0b1d7ace57bc3a8cb82b32.jpg'),('Mostafa Fahmi',1092854,'Egypt','Egypt','Mostafa Fahmi is an Egyptian actor. He was born in 1942, and studied cinematography at the High Institute of Cinema. He then worked as an assistant in \"Amira Hobby Ana\" (Amira My Love) in 1974, and started his acting career the same year with a role in the film film \"Ayna Aqly\" (Where is My Mind?). His breakthrough came two years later, when he appeared in four other films, and since then, he has worked in numerous films and television series.','7 August 1942','https://media.elcinema.com/uploads/_315x420_f861261981165438a283ac11b018a34795f13e85b353f5615f11a1524adc7854.jpg'),('Hussain Ismael',1093004,'Egypt','25 July 1974','The Egyptian actor Hussein Ismaeil was born on the 29th of October 1922. He was known for his supernumeraries\' roles where he presented the Barber, the butcher and the concierge. His brother Abdel Monien Ismaeil was one of his competitors in the artistic field.\nHe passed away on the 25th of July 1974.\n','29 October 1922','https://media.elcinema.com/uploads/_315x420_fe06ec11b5db68e61f8deb9b3471b323b15032539ebbfd7fbab8685bd1c3d638.jpg'),('Mohammed Elshershaby',1093286,'Egypt','Egypt','NONE','27 October 1965','https://media.elcinema.com/uploads/_315x420_aca8119d79a0f8347bb12ca386234e1861c98bf0a748580c787a34b77f03bc76.jpg'),('Mohamed Rady',1093354,'Egypt','11 October 2017','NONE','14 October 1939','https://media.elcinema.com/uploads/_315x420_99dd1b8177cd1e07d1e60c2f56f7cb301b564cff0de45b32905aa5c675ba4649.jpg'),('Shady Ali',1093646,'Egypt','Egypt','Shady Aly is an Egyptian television and film director. He graduated from the cinematography department in the High Cinema Institute in 1997. He is most known for being the cinematographer in films including \"Ezaa\'at Hob\" (Love Broadcast) and \"Bolteya Elya El Ayma\" (Swimming Tilapia). He directed the film \"Hayaty Mebahdela\" and the television series \"Alragol Al-Ennab\" (Hibiscus Man).','20 May 1975','https://media.elcinema.com/uploads/_315x420_bd402202d2bcc7275669f0b75f19b9fea7180fdd1a8a849d286beb16f4b9c070.jpg'),('Maher Essam',1093781,'Egypt','Egypt','Maher Essam was born in Imbaba. He started his acting career when he was only 5 years old with the famous director Youssef Chahine. Hassan Abd El Salam cast him in the adapted play “Zoqaq El Madaa.”','5 October 1979','https://media.elcinema.com/uploads/_315x420_6dd74164b04dbda09e8f610375a02cddb956f208f79786511011a66c906806a3.jpg'),('Elham Shahein',1093917,'Egypt','Egypt','Elham Shaheen was born in Heliopolis, Elham graduated from the Institute of Performing Arts, acting division in 1982.  Director Kamal Yassin launched her career by giving her a role in his made-for-TV-play \"Hooreya men Al Marikh\" (Mermaid from Mars).','3 January 1960','https://media.elcinema.com/uploads/_315x420_b23e2e28e6086733f472d465bb4a6ef70aefd45f2369060884836d5aef0e1005.jpg'),('Nezar Shaker',1094321,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a88960eb2314ee91ba68db18521ffc8f639307bd6397c104ef6fe988576ce710.jpg'),('Farouk El Feshawi',1094402,'Egypt','25 July 2019','Farouk is an Egyptian theatre, cinema and TV actor. Graduate of both the faculty of Arts and the Higher Institute of Dramatic Arts. His booming in TV series “Abnaa’y al-a’ezzaa shokran i.e. My dear children..thank you” and his role in “Al-mashbooh i.e. The suspect” with Aadel Emam, paved his way to stardom.  Among his popular TV series are: “Alf leila we leila i.e. One thousand and one Nights ”, “Al-haawy i.e. The magician”, “’Aly al-Zeibaq”, “Domou’ saahebat algalaala i.e. Her majesty’s tears”, “Laylat al-kabd ‘ala Fatma i.e. The night Fatma was arrested”, “Zeynaat wal-talat banaat i.e. Zeynat and the three daughters”, “Canaria wa shorakah i.e. Canaria and Co.”. Among his stage plays are: “Al-dokhaan i.e. Smoke”, “Tharthara fawk al-neel i.e. A Drift on the Nile”and “Bedaaya wa nehaaya i.e. The Beginning and the End”.  His career included king Farouk and beggers and a variety of roles in between. During the 1980’s and the 1990’s he was the most productive movie star. Farouk married several times. His first wife was Soumayya al-Alfy, mother of his only son actor Ahmad al-Feeshaawy. He also married actor Soheir Ramzy and other women.','5 February 1952','https://media.elcinema.com/uploads/_315x420_01313f471694de88ce22a115a8ecaa0db288198ad4b1fa6d338bc557629a8a05.jpg'),('Ahdy Sadek',1094642,'Egypt','Egypt','Ahdy Sadek is an Egyptian actor. He was born on November 16, 1950. He graduated from the High Institute of theatrical Arts, and started his career in the mid 1970\'s. His career consisted of small and supporting roles in numerous television series, plays and films, and had never landed a lead role throughout his whole career. Among his memorable roles in television series are “Layaly El Helmeya” (El Helmeya Nights), “Raafat El Haggan”, “Bawabet El halawany” (El halawany\'s Gate), and “Arabesque”, and in films are “Al Mutawahisha” (The Savage), “Anyab” (Jaws), “Shahazun wa Nubalaa\'” (Beggars and Nobles) and “Al youm Al Sades” (The Sixth Day). ','16 November 1950','https://media.elcinema.com/uploads/_315x420_63774bdf5ff5b4ab5f8eb2c6558c8f09585062ff54bd8f9fc15655954deb368c.jpg'),('Mohamed Abdul Rahman',1094675,'Egypt','توتا ','Mohamed Abdel Rahman is an Egyptian actor and comedian. Following his graduation from Ain Shams University, he was discovered by Ashraf Abdel Baqy and appeared in his sitcom \"Ragel we Set Settat\" (A Man and Six Women). He is best known for his roles in the series ofes of plays \"Teatro Masr\" and the television series \"El Kebir Awy\".','NONE','https://media.elcinema.com/uploads/_315x420_ea2a3492caa3ea6561dc1e6202dd575daff7be1d51601998826a4cf8c91daf0f.jpg'),('Ahmed Gaber',1094794,'Egypt','Egypt','NONE','12 October 1966','https://media.elcinema.com/uploads/_315x420_99972d3a63510abb2307892aa91178916c789503175f1da8b2043d20b52582d4.jpg'),('Enji Sharaf',1094915,'Egypt','Egypt','NONE','24 November 1978','https://media.elcinema.com/uploads/_315x420_306ed019b6ecb18b99b37a6ed2feae35fbabbf13057ea530fe1a667b96ddb205.jpg'),('Ashraf Barhom',1094932,'Palestine','Palestine','NONE','8 January 1979','https://media.elcinema.com/uploads/_315x420_88dd9c38b02939bb70dd685e677429379a203fb48b6483abc0f5c5625de94b13.jpg'),('Mahmoud Abdallah Bakr',1095095,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_17261b24c729b260de565d23287dc70b489b38ee881bae9d3bc0497765f277a8.jpg'),('Mimi Gamal',1095893,'Egypt','Egypt','Ameena Mostafa Gamaal was born to an Egyptian father and a Greek mother. She started her career in acting at a very young age. She was Emaad Hamdy and Madeeha Youssry’s daughter in “Akwa men al-hobb\" (Stronger than love). Mimi continued acting as a young woman. She worked on stage with Al-Fannaneen al-Mottahedeen  (The United Artists) Troupe and in several individually owned theatre troupes. She became widely known through her numerous TV roles. Among her very successful plays are; “ Nemra etnein yeksab\"(Number two wins), “Al-abeet\" (The fool), “Motreb al-awaatef\" (The emotional singer”,” and ”Esh al-maganeen\" (Coo coo’s nest). Mimi also participated in TV series; “Hawaanem Garden City\" (Ladies of Garden City) and “Al-dawwaama\" (The whirlpool) are two successful examples. \nMimi is married to Hassan Moustafa the actor who was her partner in many plays and she gave him two daughters.','21 June 1941','https://media.elcinema.com/uploads/_315x420_a9f9dbb6a287ef5aaa4fdf2875126fecb5e52b1acf878ad8088baa1979d09597.jpg'),('Nada Bassiouny',1096064,'Egypt','Egypt','Nada Basyouni is an Egyptian actress. She studied acting in the High Institute of Theatrical Arts. Her breakthrough came with her role in the 1988 film \"Algawhara\" (The Jewel). She then embarked on a prolific television and theater career, including notable roles in successful series like \"Hawanem Garden City\" (The Ladies of Garden City).','2 November 1968','https://media.elcinema.com/uploads/_315x420_3b5e4627f5ef170929b65603fe779405834cdbaf73f24a5653d5cc27a4843615.jpg'),('Mohamed Soliman',1096138,'Egypt','Egypt','Mohamed Soliman is an Egyptian actor. He was born in 1977. He studied at the Egyptian Consevatoire until high school, and had a few chances to act on stage there. He then joined the faculty of commerce at Cairo University, and worked in tourism following his graduation. His breakthrough as an actor came after he appeared as a model in a television advertisement, and was cast in Sherif Sabry\'s film “Sabaa Wara\'at Kotshina” (Seven Playing Cards). He went on to star in several films including “Ehna Eta\'belna Abl Keda” (We Have Met Before), “Fattah Eneik” (Open your Eyes), “Leabet Elhob” (The Love Game). He also appeared in several television series including “Dumoa\' Alqamar” (The Moon\'s Tears), “Man Atlaq Alrosas Ala Hend Allam” (Who Shot Hend Allam) and “October Al A\'khar” (The Other October). ','12 October 1977','https://media.elcinema.com/uploads/_315x420_0624f1cd99fd872ea9ecf9fdba7d36cb247ca64b998d44e7d00306f9f41b5d25.jpg'),('Hamdi Al Wazeer',1096178,'Egypt','Egypt','Ahmed Sayed Ahmed El Wazeer was born in Port Said. He achieved a B.Sc. in engineering from Kena University. He worked in the theater directing plays such as “Harb El Basoos” and “Tokoos al isharaat wal tahawolat”. Some of his works for the television include “Al mazad”, “Awarak Masreya” and “Al Koni”. He a multi award winner and comes from a family with artistic background such as actors and directors. Although he had an excellent head start, however, his glamour faded quickly.','29 April 1955','https://media.elcinema.com/uploads/_315x420_e16894de918a55c1458f1bb8439fb26df6333cb9a7ee0124110efa05b0297686.jpg'),('Lamia Adel',1096341,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_429d11cbbce6bbe2a88237cdefc3d4c1a901695091b7518d1c60ddd249f7f2b1.jpg'),('Samira Abdelaziz',1096534,'Egypt','Egypt','Born in Alexandria, Sameera Abdul Azeez studied commerce and then graduated from the High Institute of Dramatic Arts. She married the writer Mahfouz Abdul Rahmaan. Started her career in Alexandria Radio (1957) and presented the famous program “Kaal al-faylassouf i.e. The philosopher’s talk” for Egyptian Radio along with Muhammad al-Sab’.\nAbdul Azeez played many TV roles like; “Dameer abla Hekmat i.e. The conscience of principal Hekmat”, “Om-Kolthoum”, “Banaat Zeinab i.e. Zeinab’s daughters” and “Imam al-do’a i.e. The Imam of Islam advocates”.\nSameera Abdul Azeez is telling children stories in the program “Ahlaam sa’eeda i.e. Sweet dreams” in Egyptian TV channel 3.','5 May 1935','https://media.elcinema.com/uploads/_315x420_d643555a357b3b8cb0c77c170a6ecbf7e5db18c2864b2578842f857bbbe8cc04.jpg'),('Adel Shukri',1096702,'Egypt','Egypt','NONE','25 January 2014','https://media.elcinema.com/uploads/_315x420_b4da4a6c692bb3dda2a08114bba54318b64f89716bc2997ddd58b9eecc30843d.jpg'),('Mohsen Sarhan',1096796,'Egypt',' 7 February 1993','Mohsen Sarhan was an Egyptian actor who was born in Port Said in 1914. He was raised in Port Said, and after graduating from university, he moved to Cairo and worked as an employee for the Ministry of Agriculture until 1939. In 1944, he started taking free classes in theater and cinema, and also joined the National Troupe in the 1940s. The films he acted in include: “Kas El Azzab” (Cup of Agony), “El Liqaa El Akheer” (The Last Meeting), “Samara,” “Baeat El Ward” (The Rose Seller), and “Seraa Fil Jabal” (Struggle in the Mountains). He passed away in 1993 at the age of 79.','6 January 1914','https://media.elcinema.com/uploads/_315x420_b6c098851e553c0ce0fc0eb0b3c2ba83906b002eda3cdae86f4dab4824632df4.jpg'),('Hisham Al Meleji',1097024,'Egypt','Egypt','NONE','1 December 1972','https://media.elcinema.com/uploads/_315x420_d1abfb1f8a1f30677b150fb75ee57d20afffe1e6898c4fc850d121538028787b.jpg'),('Medhat Saleh',1097101,'Egypt','Egypt','Muhyy Mahmoud Saleh was born in Shubra, Egypt. He studied there and memorized the Holy Quraan. His talent was noticed by Dr. Youssif Shawqqy and he spent a while working in a children’s program at the radio broadcast. He successfully performed the songs “Akeed” (“Definitely”), “Kawkab Thanee” (“Another Planet”) and “Hadd Yeqoul li Habiby” (“Someone tell My Lover”). He also performed on Ramadan trivia shows for several years including 2003. The performer has also taken part in the stage productions “Eshta wa ‘Asal” (“Cream and Honey”) and “Hazimny Ya”. Some of his other songs include “Hekayya Wardiyah” (“A Rosy Story”) and “Ghany al-Mizmar” (“Play the Flute”).','2 November 1960','https://media.elcinema.com/uploads/_315x420_2c34d659cff1143efeeb1b9c39cd4e437c84bedeb4efc60a1510eab83144a1cd.jpg'),('Omar Khorsheid',1097108,'Egypt','29 May 1981','NONE','9 April 1945','https://media.elcinema.com/uploads/_315x420_57038716ce110dd88cc59eb24cb407fbe67119e8b5551bd04f778817f7ca4a27.jpg'),('Tarek Kamal',1097168,'Egypt','Egypt','NONE','20 July 1960','https://media.elcinema.com/uploads/_315x420_d7336006f7bc2ffa7c1c38d6af1ae88758dce310b320819cd96ca5caecf813a0.jpg'),('Nourhan',1097185,'Egypt','Egypt','Nourhan is an Egyptian actress who was born in Alexandria in 1982. She graduated from the Faculty of Arts from Alexandria University then started acting at the beginning of the 21st century. Most of her acting appearances have been in television, among them: “‘Aila El Haj Mitwali” (El Haj Mitwali’s Family), “Souq El “Asr” (Market of the Era), “Qassim Amin,” “El “Asseyan” (Disobedience), “El Masrawya.” ','15 January 1982','https://media.elcinema.com/uploads/_315x420_e8864cc07720da71c449df55c1b98945809bbb37def5cc298c3529227c54613b.jpg'),('Ashraf Fayeq',1097310,'Egypt','NONE','Ashraf Fayek began his directing career working as an assistant director for director Mohamed Fadel on the television series “Ana wa Antee wa Baba fee Al Mishmish” which starred Hassan A’bdin. Thereafter, he worked alongside director Nadia Hamza on the film “Hams al Gawaree” and several other titles. \nAshraf’s first experience directing his own film was in 2001 when he directed “Al Labees” which starred Medhat Saleh and Shereef Mounir. Following that film, Ashraf took a hiatus from feature film directing and began directing documentary films and shorts thus distancing himself from the box office.\nSoon afterwards, Ashraf (who graduated from the décor division at the Institute of Cinema) returned to direct “Qisat Al Hob Al Sha’bee” (“A Story of Popular Love”) which was his own brainchild. That film featured the talents of several actors and football stars. Ashraf’s most recent work as director was the film “Al Lemby 8 Gega” which starred Mohamed Sa’ad. \n','NONE','https://media.elcinema.com/uploads/_315x420_e7f411c99887e7132df85685c248f8445a3c61e31d94ca2e56910a404c10ab6d.jpg'),('Hind Abdulhaleem',1097382,'Egypt','Egypt','NONE','7 April 1993','https://media.elcinema.com/uploads/_315x420_cdb9e84064db43faf73914351d8dacb041a18c4f13883091fa7030acc546e06b.jpg'),('Marwa Abdel Monem',1097471,'Egypt','Egypt','Marwa is a young female charismatic actor, who left significant marks in all her TV roles. She considers Yahia al-Fakharaany her actual discoverer. Marwa is still taking slow steps towards the silver screen.','18 November 1978','https://media.elcinema.com/uploads/_315x420_c16bba19417fa62a75cb0f12907aa7da3693cd3f5a34a25cb6c0d8bc4766bd6f.jpg'),('Abdullah Hefni',1097802,'Egypt','15 April 2015','NONE','18 July 1953','https://media.elcinema.com/uploads/_315x420_a4a64ff4ca11c48ccc942f6f1619e1f876b5d9d626815a7063b4979147b995c1.jpg'),('Hany Ramzy',1097878,'Egypt','Egypt','Hany Adel Ramzy Hana was born in Bani Mazar. A business major, he graduated from the Institute of Performing Arts in 1991.  He started his acting career with Mohamed Sobhy in plays such as \"Point of View\" and \"Nonsense\". He also shined in the played in the play \"That\'s Ok\" and tv shows \"Twins\" and \"Ladies of Garden City.\"','26 October 1964','https://media.elcinema.com/uploads/_315x420_2acaa66043489a6e9659b34acfae75b52408df1108a134c12c48f8c823e687bc.jpg'),('Karima Mokhtar',1097924,'Egypt','Egypt','Karima is an Egyptian film and stage actor. Her full name is ‘Attyat Mohamed al-Badry. Karima earned her bachelor’s degree in Theater in 1963 and was active in the Egyptian television entertainment industry since its outset. The actress has taken part in well known television series of the likes of “Abou Dar al-Ghafarry” and “Risalat al-Samaa”. On stage she has presented “al-Ardd” (“The Earth”), “Ayyoub al-Gadeed” and “al-‘Eyal Kibrit” (“The Kids have Grown Up”). Towards her later years on television Karima presented numerous works and stood out in her portrayal of motherly characters. She married actor and director Nour al-Demerdash and the couple have had more than one child who have also went on to make a career in theater and television. \nKarima took part in preparing information segments connected to the national drought campaign. She also received an award from critics for her role in “Wa Mada Qattar al-‘Umr” (“The Train of Time has Passed”). The actress was tied to motherly characters since early in her career and was unable to sway away from that niche despite her skill at portraying the role of the traditional wife in “al-Mustaheel” (“The Impossible”).\n','16 January 1934','https://media.elcinema.com/uploads/_315x420_e6c77f4a72bb8f4b5cecf1156f5ebcfcd547b739c35a866b82ba8fa26f8e5055.jpg'),('Jamal Hejazi',1098083,'Egypt','Egypt','NONE','3 December 1972','https://media.elcinema.com/uploads/_315x420_011d10e78841b555e9f39c9e0be008326cc7b22b201c775e5a5becfd9a5f396b.jpg'),('Fatma Eid',1098237,'Egypt','Egypt','NONE','18 January 1962','https://media.elcinema.com/uploads/_315x420_d271de0feefcd6113dba07f7ae8ffb3d5e240ca230cb9f8d8162153802189a5b.jpg'),('Shawqi Shamekh',1098238,'Egypt','26 March 2009','Mohamed Shawqy Shamekh Mohamed Bayoumi was an Egyptian actor. He was born in Elhelmeya district of central Cairo, and received a bachelor\'s degree in business management from Ein Shams university in 1972. He worked as a accounting auditor in the ministry of education, before starting a career in acting. He first acted on stage in several plays, including “Shahed Mashafsh Haga” (ِ A Witness Who Didn\'t See Anything) and “El Erd” (The Monkey). He then went on to star in numerous television series and films, including “Arabesque”, “Zizenia” and “Raafat Elhaggan”. He died inside the Cardiac Institute\'s hospital of a stroke in 2009.','25 July 1949','https://media.elcinema.com/uploads/_315x420_c57e5713c523ba87755da555b30ca0e42b6f869bc530fc8faa92bf295a23ea47.jpg'),('Abbas Abo El Hassan',1098330,'Egypt','Egypt','Abbas Abo El Hassan is an Egyptian actor and screenwriter. His most famous role as an actor was that of the mafia boss in the action film “Mafia”. He wrote the screenplay for the controversial action film “Ibrahim El Abyad”, which was directed by Marwan Hamed and starred Ahmed El Sakka and Amr Waked. He also wrote the television series “Asia”, which starred Mona Zaki and Bassem Samra. ','1 August 1964','https://media.elcinema.com/uploads/_315x420_336bd38227499515cce56f4052ec48305f7858f165ba081cb64c9320e878074f.jpg'),('Ahmad Bayoumi',1098628,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e08708b7eb9c6b88b70dce2bfc5059ea90f0e89d22eff8cb70737081ba9ff825.jpg'),('Ibrahim Issa',1098660,'Egypt','Egypt','Ibrahim Issa is an Egyptian journalist and television presenter. He started his career in journalism while studying mass communication at the University of Cairo. He had a long history of disputes with the Hosni Mubarak\'s ousted regime, which ended in a reconciliation before the January uprising. He currently presents a talk show on the satellite channel ONTV. Issa is most known for his sarcastic style of writing, and his flashy performance when talking politics in front of the camera.','1 November 1965','https://media.elcinema.com/uploads/_315x420_1a7985ca5755eb07318c238b07e4590fb5dd4737ecb1f3aec74882645d012e64.jpg'),('Tamer Karawan',1099288,'Egypt','Egypt','Tamer Karawan is an Egyptian music composer. He was born in Cairo in 1969, and studied mechanical engineering at the American University In Cairo until 1991. He then studied music at the Royal Music Academy in London, and worked as an editor in the British radio in 1994, then as a documentary film director in Orbit satellite network. Karawan debuted as a film score composer in 1998, by scoring the music for the Youssry Nasrallah film \"El Madina\" (The City). Since then, he scored for numerous films and television series, including \"Bab Elshams\", \"Cabaret\" and \"Segn Elnesa\" (Women\'s Prison).','11 February 1969','https://media.elcinema.com/uploads/_315x420_4e5393faca7c0f5d8f7fbe1616c93c9c42e276ab43b64c11397a51eaaff1b6ad.jpg'),('Ahmed Adam',1099305,'Egypt','Egypt','Born Ahmad al-Sayyed Muhammad Adam in Ghorbaal –Alexandria. Studied Commerce, married with children Eslaam and Sarah. Adam started his career through Children’s Theatre at al-Horreyya Culture Palace in Alexandria, then developed his acting abilities and played comics. He used to mock actors in his early life.\nAl-Karmouty’s role was the milestone for Ahmad Adam in the program “Serr al-ard” in the Egyptian TV. After that, he acted in “Enta horr i.e. You are free”, “Al-Hamagy i.e. The Barbarian” and “Al-mahzouz i.e. The Shaken” with Muhammad Sobhy Troupe. He also played other stages roles; “Al-ghash-shaash i.e. The cheater”, “Al-bo’bo’ i.e. The bugaboo”, “Bahebbak ya mogrem i.e. I love you criminal”, “Atteyya al-erhabeyya i.e. Atteyya, the terrorist”, “Feema yabdou sara’ou Abdou i.e. Apparently they stole Abdou” and “Khally baalak men Gom’a i.e. Take care of Gom’a”. Adam acted in many TV series; “Hayaat al-Gohary”,”Al-nawwa i.e. The storm” and “Hawadeet Fekry Abaaza i.e. The tales of Fekry Abaaza”. Having a great ability of improvising, Adam became a star and took leading comedy and tragedy roles. For cinema, Ahmad Adam acted in “Shagee’ al-ceema i.e. Cinema Hero” and “Al-ragol al-abyad al-motawasset i.e. Mediterranean man”.','15 May 1958','https://media.elcinema.com/uploads/_315x420_e87a16be99fe974febfb6572b59c54b374d91272b6d93ca1bfc1d0e6d3b02cb6.jpg'),('Gaby Khoury',1099451,'Egypt','Egypt','NONE','4 May 1952','https://media.elcinema.com/uploads/_315x420_d7539aebca89d55c0c4bf4685eec871257abfd3832a7791ff2705104e1a80cdf.jpg'),('Sayed Mustafa',1099530,'Egypt','Egypt','Sayed Mostafa is an Egyptian actor, who was born in 1955. He started his career as a silent extra in the seventies of last century, and went on gradually to pick up roles with few dialogue lines in both film and television. He hasn\'t appeared as a lead in any of the productions he took roles in, but he managed to sustain a career of numerous secondary and supporting roles throughout the eighties and the nineties.','20 October 1955','https://media.elcinema.com/uploads/_315x420_93ce6a6973b5856363faf1087e3babe0983627f2344e08790d6db9bc7921847d.jpg'),('Loai Omran',1099833,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e34fbcd6fb4bdf912bebdfb62c3a4a2ba4941b7552571b1933a24f4f7ca3aacd.jpg'),('Mostafa Saad',1099873,'Egypt','Egypt','NONE','7 November 1949','https://media.elcinema.com/uploads/_315x420_ced91564269927269d8cec64a4b1b4ca2f926ee2bce7b3f380a24d5007766216.jpg'),('Misr International Films',1099918,'Egypt','إم. آي.إف ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_53e7ba5efc1dc94fd251748c74f57922537f01f5633473015f9b257321b860c2.jpg'),('Mostafa Elsobky',1099929,'Egypt','NONE','Coming from a massive production family Mustafa El Sobky decided to direct his attention to story and script writing. He was a great success producing some of the finest stories such as “Hassan Tayara”, “Shabab Fee El Mamnoo” or “Forbidden Youth”, “Shagee El Ceema” or “Macho Guy”','NONE','https://media.elcinema.com/uploads/_315x420_4a17d6f6fac2268ecef3b52b229f0f3834d29c8b89763210ef7a5ef0fbdd1fd0.jpg'),('المجموعة المتحدة',1099997,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Thabet',1099999,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Al-Badry',1100000,'Egypt','Egypt','Ahmed Elbadry is a distinguished director with over 20 years of experience in the industry.  He has worked with a number of notable directors including the late Hussein Kamal, Gamal Abdel Hamid, Nader Galal, Sherif Arafa, and Mohamed Abdel Aziz. ','3 October 1954','https://media.elcinema.com/uploads/_315x420_4eb8dfac897aa3b5d8cc946ffda921aefa64d0399e1285ae99913771d3c5c1cf.jpg'),('Saad El Soghayar',1100001,'Egypt','Egypt','Saad El Soghayar is an Egyptian Shaabi singer and actor. He first saw success through his song \"Esha...Fouq\" (Rise and Shine). He was then introduced to the big screen by producer Mohamed El Sobky in the successful film \"Lakhmet Ras\" (Head-spin), a role which made him famous among audience. His songs in the movie became the most heard Shaabi song at the time, and are still played in weddings all over the country. His success in \"Lakhmet Ras\" and the movie being a major box office hit made producers invest in the format, and a streak of movies helmed by Saad El Soghayar and including his hit songs have been released annually since then, specially during the Islamic feast season.','30 January 1970','https://media.elcinema.com/uploads/_315x420_87af4d6bfa803513b0c90a7cd6dc6a5708fb50d60ffa48ec010a450b090eada1.jpg'),('Aya Hemeda',1100006,'Egypt','Egypt','Ayah Hemeida is a young Egyptian actress. She is the daughter of the actor Mahmoud Hemeida. She enjoyed acting from a young age and took part in several (workshops in order to refine her acting skills). \nHer first acting experience was in (Alakat Khasa) and her performance in that role was quite exceptional.\n','3 June 1988','https://media.elcinema.com/uploads/_315x420_2e592e886ac144e1d4ab50ab5f35bf8b20e746985b30a0cebe0149e09ddd5a6b.jpg'),('Ahmad Abu AlNour',1100008,'Egypt','Egypt','NONE','7 July 1979','https://media.elcinema.com/uploads/_315x420_fccde89ea188dd15733a0d0e5ab842eab4d3b3cd2074d091120034a3ceea100c.jpg'),('Tatiana',1100009,'Lebanon','Lebanon','Lebanese actor Tetyana was born in Beirut in 1985. She got her career started as a model, appearing in commercials and music videos as well as fashion shows. In order to pursue greater opportunities in acting, Tetyana moved to Egypt, where she enrolled in a workshop with Dr. Mohammed Abdel Hadi. She worked as a host for the show “Doqi Yaa Mazzika,” which aired on “El Mehwar” TV channel, and went on to pursue film acting. Her first work in cinema was the film “Alaqaat Khasa” (Private Affairs; 2006) directed by Hany Girgis Fawzy. She has since appeared in numerous films such as: “Binat wa Motocyclette” (Girls and Motorcycles; 2008), “Samy Oksed El Carboon” (Samy Carbon Dioxide; 2011), “A\'elat Mickey” (Mickey’s Family; 2010), and “Tom wa Jimmy” (2013). Tetyana has also worked in Egyptian dramas including the television series: “Wanees wa Eyamo” (Wanees and His Days; 2010), “El Safa’a” (Smack; 2012), and “An El Awan” (Now Is the Time).\n','28 April 1985','https://media.elcinema.com/uploads/_315x420_11d4c6eba49b2b8fbf67bb16a0437b97fd99d91ea77f1163a6d3d9ecdc65c8ca.jpg'),('Magdi Alkdash',1100010,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b7f0a3cdda6c50acf13f1164495c0bb3b4f6591c58d74700f13941f2a3c261d1.jpg'),('Ahmad Saleh',1100011,'Egypt','NONE','Director Ahmed Saleh began his career in cinema following his graduation in 2000 from Brentwick University in England with a Bachelor’s degree in the arts. Ahmed has worked as an assistant director for several well known directors such as Shereef Arafeh, Mohamed Abu Seif and Shereef Sabry. \nHis first film was “Harb Italia” (“Italy’s War”) which starred Ahmed El Sekka and Khaled Saleh. Ahmed has also worked as acting director for the film “A’la Ganby Yasta”, which saw him work alongside Sa’eed Hamid. That same film also starred Ashraf A’bd Al Baqee. Ahmed also directed “Al Dealer” which starred Ahmed El Sekka and Khalid Al Nabawwy.\nAside from his work in cinema, Ahmed Saleh (who has an Algerian father and an Egyptian mother) has also directed several television productions including “Lahazat Harija”, “Hurmat ya Baba” and “Tsunami”.\n','NONE','https://media.elcinema.com/uploads/_315x420_027d3619269b989ebb004e590d238a7a3971cfec4172d9333778ece9816fb900.jpg'),('Hisham Abdel Khalek',1100013,'Egypt','Egypt','NONE','25 December 1979','https://media.elcinema.com/uploads/_315x420_4adcab0bafd4031f2220e75f608e2779c48696f99cda1e912efb17c5dbcc4bb3.jpg'),('Feisal Abdul Samad',1100014,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_33ad353a73112ed84b6d650324258ce6eabe1ac013a116f3edef2c95478a2d25.jpg'),('Ahmed Hussein',1100015,'Egypt','Egypt','NONE','14 March 1976','https://media.elcinema.com/uploads/_315x420_1995db35af2efefccfe9a3c530a0580b05dd84d329d6442e75a40fd1cfc6d6a1.jpg'),('Sherine',1100017,'Egypt','Egypt','She is an Egyptian actor, studied Ballet and Law. Well known for her aristocratic roles through TV series “Alf Leila we Leila i.e. Thousand and one nights” and “Aaker al-meshwaar i.e. End of the journey”, plays like “Al motazawwegoon i.e. The Married”, “Haawel tefham ya zaky i.e. Try to understand you clever”, “Ne’oul eih? i.e. What shall we say?” and “Fallaah fee madrasset al-banaat i.e. A farmer in girls school”. Sherine has a daughter “Mirette” from her ex-husband director Muhammad Ussaama.','10 October 1956','https://media.elcinema.com/uploads/_315x420_0ca07af053faa84549d42966e0acd81756a7c8f12b01197e33a14d87baf20e05.jpg'),('Mohamed Amin',1100029,'Egypt','NONE','Mohamed Ameen director and script writer presented a movie in the year 2000 called “Film Thakafi” starring all new cast at that time like Ahmed Rezk, Ahmed Eid and Fathi Abdel Wahab. ','NONE','https://media.elcinema.com/uploads/_315x420_47832299ac4184116e359dc2aca2209b03ebde893d0f1f3b9836d4b4b95d072e.jpg'),('Mai Selim',1100033,'Jordan','Jordan','May Selim is an Egyptian (musician) with Jordanian roots. Her sister is the actress Mais Hamdan. \nMay has achieved a great measure of success as a musician and thus was chosen by Ahmed El Sekka to perform a leading role (alongside) him the film “Al Dealer”.','6 November 1983','https://media.elcinema.com/uploads/_315x420_5b2ba1d37c92cf9f0a447c2b39d34c1fc4e8099ec11bfc4fef390ae96fa622e8.jpg'),('Cyrine Abdel Nour',1100036,'Lebanon','Lebanon','The Lebanese actress has studied at St. Courier. Thereafter she studied accounting before taking classes in fashion design in late 1993. When Sireen later began work as a model, her first modeling work involved presenting Christmas designs to a group of designers including Zuhair Mourad, Abu Mahfouz and others. Sireen also took part in a commercial for a washing detergent – the commercial was filmed in Lebanon but was aired in Saudi Arabia. In early 1998 she began appearing on LBC as an actress taking part in several works including “Marianna”, “Ghadan Youm Akher” (“Tomorrow is another Day”) and others. In 2002 Sireen came first in a large competition involving many models and in 2003 she had her first leading role in a series titled “Ibnatti” (“My Daughter”). More roles followed and the artist had her first forays into music in 2004.','21 February 1977','https://media.elcinema.com/uploads/_315x420_1fb5c68b7a7834ded096d4a43f750ed646325e3dcfb53cdf80aa6c7f3f926bc3.jpg'),('Ahmed Kardous',1100038,'Egypt','Egypt','NONE','1 January 1975','https://media.elcinema.com/uploads/_315x420_0704a2d63b02d6cf46e6efb7270331442b2102a8b17b21dd286a6b5ec3fb18a8.jpg'),('Mohamed Samir',1100039,'Egypt','Egypt','NONE','30 November 1981','https://media.elcinema.com/uploads/_315x420_43ee4b31523ee79b440a7a99d8e2febc24a44d1be46f799927b005d06c6fd501.jpg'),('Ahmad Badawi',1100040,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6353d85a237033f9e788601d4c8904322823696f589cc75f933f2855cd9ba320.jpg'),('Adel Haqqy',1100044,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2317d7bfc0950967f346dba693e2fd23d1d22c522ba702518be8495f2445e3e0.jpg'),('Samih El-Nakash',1100051,'Egypt','سميح محمد رجاء عبد المؤمن النقاش ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_51ea9f4fd9b53c21955ac8ba7409d4c3e29a68f71277f68476bbd2a58404c361.jpg'),('Hani Abdallah',1100054,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_36ff80e958b5fb26d9b59567e46ccbad9b1d0924201aa3a27d737e76515d0eb7.jpg'),('Ahmed Abdallah',1100055,'Egypt','Egypt','Ahmed is an Egyptian performer who began his career with a role in “Howa fee eih”. Thereafter, he also worked on director Ibrahim Al Batbout’s film “A’yn Shams”. Following his work on that film, Ahmed became enamored with the idea of working in independent cinema.\nAhmed presented his first work as an indie cinema writer and director in the film “Heliopolis”, this was followed by “Microphone”.\n','19 December 1979','https://media.elcinema.com/uploads/_315x420_056055fdf3136b178a859608666640b5840eb510b9d829d258ecfdd04cbd7842.jpg'),('Ahmed Owise',1100057,'Egypt','Egypt','NONE','6 July 1977','https://media.elcinema.com/uploads/_315x420_01acd86e402e96028857e09143dbb7da8b3e583423d8cae003a4b0d76f7aa480.jpg'),('Sherif Makkawi',1100059,'Egypt','Egypt','NONE','24 June 1977','https://media.elcinema.com/uploads/_315x420_610403ee612cd65767e163839adb8640eb64820cdf55a1f14dbf95dc6300ae7e.jpg'),('Mamdouh Farag',1100060,'Egypt','16 August 2014','Mamdouh Farag is a sports newscaster and a former Egyptian wrestling star. He was born in 1951 and spent more than 20 years of his life in Austria, where he got his doctorate in Physical Education from Shebroot Institute. He free-style wrestled for many years, and managed to win the world championship 5 times. He continued wrestling even after his return to Egypt in 1996. After his competition with Hercules Fernando, and afterwards, he turned to sports news, where he was the presenter on a number of special TV programs covering wrestling, including: “Masaara’ El Muhtarafeen” (Professional Wrestling), “Lams Aktaf” (Smack Down), “El Darba El Qadiyya” (Knockout), and “El Mosaara’” (The Gladiator). Farag died in 2014 at the age of 63.','16 August 1951','https://media.elcinema.com/uploads/_315x420_f6e36cf1ef74d0a197cf0bbcd5c97187054f39e1415b9560c0f2334e627efd79.jpg'),('Hussein Mamluk',1100063,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_781d5e900df3b5d0072457151f0ded7faaa8eb6ab0501dd5bc83fa83f7dbd22a.jpg'),('Ahmed Abdullah',1100066,'Egypt','Egypt','Scriptwriter Ahmed Abdallah was born in Bein Al-Sarayat in Cairo on April 1st, 1965. He graduated from Cairo University Law school.  While in college, Abdallah did some acting, but mainly directed stage plays based on translated scripts. ','1 April 1965','https://media.elcinema.com/uploads/_315x420_e5b0d2163b7b8d61e274072532187fbd97f27a468def8ee1adc1d2d13cbd8aff.jpg'),('Alaa Atef',1100069,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_af7b039ca034cfc7ef6a59f37f3b9249a0b2e21871563c14e810b8fa003fc436.jpg'),('Youssra Al Lozy',1100071,'Egypt','Egypt','Yousra is an Egyptian actress that was born in her home country. Her father is Egyptian while her mother is Syrian.\n(Her talents were first noticed by the famous director Youssef Chahine who assigned her a role in “Alexandria New York”).\nYousra’s father is the (theater director) Mahmoud El Lozy. Prior to her performance in Youssef Chahine’s cinematic productions she had performed in several plays at the American Univerity in Cairo. Moreover, she has also (provided voice dubbing in Arabic) for several films and television series.\n','8 August 1985','https://media.elcinema.com/uploads/_315x420_202c2bc692af1c9ea07720519c6ee45b785f8fff89a9f1d9d97f52bcf0b91943.jpg'),('Mahmoud El Lozy',1100073,'Egypt','Egypt','Mahmoud El Lozy is an Egyptian stage director, actor, playwright, and professor of drama and theatre at the American University in Cairo. After getting a B.A. and an M.A. in English and comparative literature from AUC, he moved to the United States where he earned his PhD in dramatic arts at the University of California, Santa Barbara. His writing on contemporary Egyptian theatre has brought special attention to the issue of censorship. His daughter is the actress Yousra el Lozy. He\'s starred in Ahmed Abdallah\'s first two features \"Heliopolis\" (2009) and \"Microphone\" (2010) and has co-starred with his daughter in \"Koblat Masrouqa\" (Stolen Kisses) and Youssef Chahine\'s \"Alexandria... New York\" (2004). His other film credits include \"The Situation,\" Mohamed Khan\'s \"Faress el Madina,\" and Maggie Morgan\'s independent ensemble drama \"Asham\" (2013).','9 September 1958','https://media.elcinema.com/uploads/_315x420_aade82ab47033d7f57d2cfedfe889af3ab23c6989acac6a8284eee50036c579c.jpg'),('Atef Youssef',1100075,'Egypt','NONE','Attef is an amateur Egyptian actor who appeared in the title “Heliopolis”. He originally worked in dubbing.','NONE','https://media.elcinema.com/uploads/_315x420_f989ad4f3ebf7d952628731dd4a6ecd907dd5885365d86f294045165270b3863.jpg'),('Aya Soliman',1100076,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1c7754bd1db5912822fc4b33dcd660a4e11f6e80c4bc9ee491f4a632f719ecd3.jpg'),('Mohamed Boraiqa',1100077,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4669a23b636af922fb47e5ccd63e55a388cc900829a653a47a3b90b03aa6425a.jpg'),('Hany Adel',1100079,'Egypt','Egypt','Hany Adel began singing at a young age. He has (been intent) on forming a band since 1999 when he used to sing and play the guitar at (hotels and parties). It should be noted that he could sing in both French and English. Due to the fact that he believed that music and song are best (within the context of a band), he put together the band “Wust Al Balad” which is formed of seven members.\nHany graduated from the faculty of law and has since (achieved a great measure of success) in music. (Thereafter) he progressed to cinema where his good-looks and acting skills have served him well.\n','8 September 1976','https://media.elcinema.com/uploads/_315x420_3d74e7b132fca744896703c67bb06fbceefa9d2882e9c23e6140a84dd4995ab5.jpg'),('Aida El Kashef',1100081,'Egypt','Egypt','Aida El Kashef graduated from the High Cinema Institute in Cairo in 2009, she specialized in film directing. Her graduation project \"Rhapsody In autumn\" won several awards including the Silver Arab Muhr Award at the Dubai International Film Festival. After graduation she worked on her own short projects as a director and producer. First acting experience was in the Egyptian tv series \"Al jam3a\" directed by Hani Khalifa.','17 June 1990','https://media.elcinema.com/uploads/_315x420_77f547efd6d6aa3a4b2e7fe15cd1f6878423418fbfb5c7b04a70940f605d535f.jpg'),('Inas Marzouk',1100083,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Tarek Hefny',1100084,'Egypt','Egypt','NONE','3 October 1983','https://media.elcinema.com/uploads/_315x420_281abf3bd1e2bddc7f273af424afe79ab1fb8f23516ca03e787636be8bdd4a31.jpg'),('هانى صقر',1100085,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2b7f22f027d4d5c6b46eae58e0d1ef812ac556f6c7c2856117887746a62395bd.jpg'),('George Azmy',1100086,'Egypt','Egypt','NONE','4 July 1983','https://media.elcinema.com/uploads/_315x420_7af3d5e746a4418a2f119113f1924bc5ec257b7e52d4a72362a8aa884d390ad8.jpg'),('Ramadan Khater',1100089,'Egypt','28 November 2011','NONE','31 January 1963','https://media.elcinema.com/uploads/_315x420_9c8d9eef128098296fbdfd181586adb641a2d3c2934ef39dc34425c0f2474cc3.jpg'),('Mohammed Hamdi',1100091,'Egypt','Egypt','NONE','29 January 1977','https://media.elcinema.com/uploads/_315x420_b749ed776bf8b85ca3eaa8bf74570e27fc0746b6c007f29f656d958fe2cf89e7.jpg'),('Tamer El Said',1100092,'Egypt','Egypt','Tamer is a well-rounded artist as he performs as well as write scripts. He worked as a screenwriter for the film “A’yn Shams” and acted in “Heliopolis”. \nTamer is an all-round ambitious person who likes a challenge.','14 August 1972','https://media.elcinema.com/uploads/_315x420_53a4ac89ebfaf8dfd00320a26fc0dbce3c4bc62fe86d4447b3355e7670a55bee.jpg'),('Boutros Ghaly',1100093,'Egypt','رؤوف بطرس بطرس غالي ','Acting is a favorite hobby of his and thus he excels at it. He first came to public attention when he took part in the film “A’yn Shams”.\nGhali presents his character with simplicity and ease and his talents have brought him attention. Ghali took part in “Al Mussafir” (“The Traveler”) where he acted alongside a group of distinguished artists.\n','NONE','https://media.elcinema.com/uploads/_315x420_9d1274cdfba041e2b6474dfa606598807e488b598558257ab2407d69279ca3b2.jpg'),('(Mohamed Abdel Fatah (Kalabala',1100096,'Egypt','Egypt','NONE','15 July 1980','https://media.elcinema.com/uploads/_315x420_f4aaa3cf8ccfebb1f3fdf7ff7e11e4b24b1df07626eeda6572511c7ac7890513.jpg'),('Hani Al Metnawi',1100098,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8d7f9cd91046bdb833bab52c401a4140f6e93d87c7f0b71310585548f9fdfe57.jpg'),('Ibrahim El Batout',1100099,'Egypt','Egypt','Ibrahim El-Batout was born on the 20th of September, 1963 in Portsaid, Egypt. He majored in Physics from the American University in Cairo in 1985. ','20 September 1963','https://media.elcinema.com/uploads/_315x420_a3f50bb308781d804a5a401515ffdcb412a401e92b5a0f7e2ead33df9642851f.jpg'),('أمير خلف',1100101,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hisham Saqr',1100105,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_013a566a98bf2283c620bc4e79c613d4105767e7d2272473991ca26a668b7d32.jpg'),('Ahmed Gabr',1100107,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2269355701a93d5924e0dc2ac8365dccad94795dc2c4bf992d3f27038805d298.jpg'),('علي السعيد',1100121,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cb52c9c98927dadaa9fa58383b43b29028a58569cb72b3dac5698de46ca2e94b.jpg'),('Mona Assaad',1100124,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4a10abe3249639a72b8c80a56c8f12cb76fe5b770822698b6495f43356f34064.jpg'),('Ramy Gheit',1100125,'Egypt','Egypt','Ramy Gheit is an Egyptian actor and assistant director. He was born in 1979. He worked as an assistant director in numerous films, and also worked as an actor in several supporting roles that were exclusively comic, including roles in the films “Dokkan Shehata” (Shehata\'s Shop), “Kalemny Shokran” (Please Call Me), “Ana Badiaa Ya Wadiaa” (I\'m Getting Lost, Wadiaa), in addition to a recurring role in the successful television series “Sharea\' Abdel Aziz” (Abdel Aziz Street). ','9 July 1979','https://media.elcinema.com/uploads/_315x420_41d70251acc9cceddc5fd5c60769ea0d6297450cb99ebdc0e776c9b4e3be7d46.jpg'),('Karim elmehy',1100126,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0222eb6279c87511cea07fefada2798fea6639f17f0bc2c7277d0e903137ea87.jpg'),('Chico',1100133,'Egypt','Egypt','During university, he created a production company with his friends called “Tamr Hendi” that produced movies that ridiculed famous Egyptian movies. Most famous was “Men who do not know the impossible” \nThis work attracted the attention of Mohamed Hefzy who at the time was attempting production and he produced their first series “Afeesh wa Tashbeeh” which portrayed one of the Egyptian classics in a cynical way in each episode. \nHefzy then produced for them the movie “Coded Paper” which was a big hit in the box office. \n','4 July 1980','https://media.elcinema.com/uploads/_315x420_cbad85691abd5ff19f6f44f3077ab39d3835967a5b290e3b4faf9444a1921484.jpg'),('Karim Basyouni',1100134,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_35278ca80ace30520dafbe348f9311b68cfb60eeb73500da66d43cff2ab4b69f.jpg'),('Sherif Nagib',1100140,'Egypt','Egypt','An Egyptian script writer who was born in Cairo on the 19th of January 1981. He graduated from the Faculty of Engineering, Cairo University in 2003, and then moved to Canada to study graphics and animation.  He then moved back to Egypt and directed his attention to story writing for movies.\nIn 2010 her wrote episodes for the series “Special Screening” or “Ard Khaas.” He also wrote the script for Ahmed Mekki’s movie “No Retreat No Surrender” , which was a massive success, making more than 25 million Egyptian pounds in the box office. \n','19 January 1981','https://media.elcinema.com/uploads/_315x420_e2f3693e7f1bf32b9364c4fe9a10b359aec54e4b3b63ab00a37c1f2d54e2dec9.jpg'),('Shery Adel',1100150,'Egypt','Egypt','Shereen began her career with appearances on advertisements as a child and thereafter she transitioned to television series. At 15 she had her cinema debut in the title “Hamada Yel’ab” (“Hamada is Playing”) which was followed by roles on several television dramas such as “Hayyati Inta”, “al-Mersyo al-Bahar” and “’Efreet al-Qirsh”. Thereafter Shereen acquired fame following her portrayal of Queen Neriman in the television series “al-Malik Farouk” (“King Farouk”). She then took part in several cinema works including “Kharig a’n al-Qanoon” (“Outlaw”) and “Kalashnikov” before playing a role in the film “Hassan wa Morqoss”. That effort led to her delaying her studies for a little while as she was studying at the French language division of the faculty of commerce. Shereen intends to study at the Institute of Theatrical Arts or at the Institute of Cinema after concluding her present studies.','19 April 1988','https://media.elcinema.com/uploads/_315x420_ccc556bee4e5c4357d63b0799f1dc58d4b0182a52eea0f838a81b0c155b57dc2.jpg'),('Yasser Shama',1100164,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Islam Gouda',1100166,'Egypt','Egypt','NONE','21 October 1977','https://media.elcinema.com/uploads/_315x420_83b2056264610a12cb60b17e4295bf714cb6979930dfc373f4c1a05981214c79.jpg'),('Ahmad Yousef',1100173,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c31bfc260f1f2220a6835df7714c3bc1a2387fb75734270736ae0cb58080b228.jpg'),('Hasan Al-Raddad',1100178,'Egypt','Egypt','Hassan is the son of renowned Egyptian actor Nabil el-Raddad and his full name is Hassan Nabil el-Raddad. The actor was born in the city of Port Said and his debut appearance came about as a minor role in the title “Kheyanna Mashrou’a” (“A Legitimate Betrayal”). Thereafter he assumed a role in the first part of the series “al-Daly” as Bassem al-Daly who was Sa’ad al-Daly’s middle child. He reappeared once again in the second part of that series. The actor made another appearance in the series “Ibn al-Arnadly” where he portrayed ‘Aly al-Arnadly, the son of Yahya al-Fakhran.','2 January 1984','https://media.elcinema.com/uploads/_315x420_6bf0791ce45f6547451fbf922524f73a4f5413571c35f761a5a3b7d3e9d7e014.jpg'),('Abd el-Wahed el-Ashry',1100180,'Egypt','29 December 2013','NONE','16 April 1955','https://media.elcinema.com/uploads/_315x420_960557c8933d38fac4db65b684f5ce31119873acd53f98ea8125c43081e84559.jpg'),('Maged Abdul Azim',1100182,'Egypt','Egypt','NONE','30 August 1969','https://media.elcinema.com/uploads/_315x420_547c6ac18085c614ab64ad4572b938ae49391328e958d90d4d62f2acbba50eb0.jpg'),('Nashaat Nnizmi',1100191,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('دعاء فتحي',1100200,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Al Shakankeery',1100226,'Egypt','Egypt','A talented Egyptian actor who played various TV roles, yet he appeared once on silver screen in the film “Al-‘Aalamy i.e. The International”.\nHis father is TV director Ebraheem al-Shakankeery.','12 September 1973','https://media.elcinema.com/uploads/_315x420_e3f1414655728c6661fa4582b8f8b7bcfeae121549051cddbf24b0c66017601e.jpg'),('Sabry Fawaz',1100227,'Egypt','Egypt','C’est un acteur, écrivain et metteur en scène égyptien. Il a incarné  le  personnage de Baligh Hamdi dans la série de « Oum Kalsoum » et le film « Halim ». Il a également participé à de nombreux rôles dans des feuilletons égyptiens parmi lesquels : « El Wesséya, la  Famille, une Femme de l’ère de l’amour, les Amis,  Moments critiques, les Jardins de Satan,  les Nuits de Hélmiya, la côte Ouest, Question de principe, Une femme de feu, La Proie et le chasseur, et El Masrawéya ; et les films : Mabrouk et Bolbol, les Jours de Sadate, le Sang du chevreuil,  et le gang de Dr Omar. Il a mis en scène de nombreuses pièces : les plus importantes : On va dire encore, Isis, l’écho des échos, les Nuits d’El Husseinieh, Celui qui a peur rentre, la ferme des lapins, Yassin et Bahia, la mariée du Sud, le renfort, Leil Ya Ein et a écrit et mis en scène la pièce « Appel en absence de la part de Hulaco » et a écrit le scénario et le dialogue de la série « Les contes de Bahia ». Il a écrit des articles multiples dans certains journaux et périodiques publiés au Caire.','22 November 1968','https://media.elcinema.com/uploads/_315x420_cebf5e0fccbb586dc5b69114beb147835c8b8682805c72a4c32af8547153afa3.jpg'),('Assem Nagaty',1100228,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d4a465b3cebcb23ad4f7ea76aa6c655a9b69de2f0b68f6dd4d8afb51e4a8d1b3.jpg'),('Sharif Awad',1100229,'Egypt','Egypt','NONE','14 January 1966','https://media.elcinema.com/uploads/_315x420_e0687224c114baaac39307389e35e76b29c86d6b5eba666029007eb552f78393.jpg'),('Ehab Fahmy',1100236,'Egypt','Egypt','NONE','4 June 1969','https://media.elcinema.com/uploads/_315x420_b39d2905161cbc41b8b1f7081df14c162687d200d2d36219beb61299cc033966.jpg'),('طارق مهران',1100238,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Mekky',1100254,'Egypt','Egypt','Ahmed Mekky is a popular Egyptian-Algerian actor, writer, director and rapper. He was born in Algeria to an Algerian father and an Egyptian mother, but grew up in the Cairo neighborhood of Haram. He began his career in cinema after graduating from the directing division at the Institute of Cinema. Mekky started out directing several short films such as “Yabanee Asly” (An Original Japanese) before directing “Al Hassa Al Sab’a” (The Seventh Sense), which starred Ahmed Al Fishawy, in 2005. That work was adapted from a short film that Mekky had previously directed in 2003. Ahmed Mekky has collaborated with his sister Inas Mekky in directing several television productions, including “Lahazat Harija” (Crucial Moments) and “Tamer wa Shawqiyah” (Tamer and Shawqiyah) in which he also played the role of Haitham Dabour. Mekky has found success as a slapstick, comedic actor. In this respect, the manner of speech adopted by Mekky’s characters have proved immensely popular. Mekky stars in the popular Ramadan comedy \"El Kebir Awi\" in which he plays both main characters, two brothers vying for the inheritance of their deceased father. In 2013, the third season of \"El Kebir Awi\" introduces a third brother, also played by Mekky. Besides his career in cinema, Mekky has also continued to write rap songs that he performs in movies or uploads onto the internet.','19 June 1978','https://media.elcinema.com/uploads/_315x420_171fa99c3a1180b2de5282c8b2a31d98708fe9ac70e2310d5e62715ce047536f.jpg'),('Engy Wegdan',1100257,'Egypt','Egypt','Engy Wegdan graduated from the American University of Cairo in 2004, with a major in Mass Comm. and a double minor in architecture and theater. ','7 July 1983','https://media.elcinema.com/uploads/_315x420_1cef704c81ece6aa5690e58136deecfcd355edc769126d55e2db9cf7ce659d79.jpg'),('Sameh Hussein',1100258,'Egypt','Egypt','Sameh is an Egyptian actor who had studied at the theater division of the faculty of law and the arts. The actor also graduated from the Innovation Center at the Opera House. Sameh became well known for his sense of humor and his knack for making audiences laugh despite the fact that he had also presented several minor roles on cinema and television productions. His real beginning came about when he took part in the Egyptian sit com series “Ragel wa Sitt Sittat” (“A Man and Six Women”) where he presented a naive young man, the cousin of ‘Aadel (who was portrayed by Ashraf ‘Abd Al Baqy). Hussein was widely liked by audiences and became well known for the phrase “Dooolat Habiby”. Thus Hussein became one of the keys to the success of the television series. In its turn the show contributed to the fame of Hussein and he thereafter assumed roles in several films and shared the leading role with Ahmed Makky on the film title “H Dabbour”.','16 December 1975','https://media.elcinema.com/uploads/_315x420_eae89001512cad3d2dc4a9e7a734b7f84baf29afcb94003d092114f270173799.jpg'),('Ahmad Afifi',1100259,'Egypt','Egypt','NONE','8 November 1981','https://media.elcinema.com/uploads/_315x420_47e8c2f790b2148de2eaa8953937130ba743bb0d7760b5d59a671cc77859bf78.jpg'),('غادة عز الدين',1100262,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2e46cc307651241e17be9c4e2d3da9a6adc4de2ee32f6bfa2ad9a4053376e89c.jpg'),('حسن جاد',1100263,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sabri Al Sammak',1100264,'Egypt','Egypt','NONE','19 March 1968','https://media.elcinema.com/uploads/_315x420_386f8c321185f8402eb3b9c76ffdb9c521a91f677b3785d0fd67eb8ef6408a91.jpg'),('Abdul Rahim Kamal',1100270,'Egypt','Egypt','He graduated from the High Institute of Cinema majoring in script writing in the year 2000. Some of the stories he wrote were published such as “A Trip to Denmark and other Countries”. He also wrote a novel called “Luxurious Torture”, because he was born in Sohag (Upper Egypt) most of Abdel Rehim Kamal’s writing were describing the socioeconomic environment in this area. ','30 October 1971','https://media.elcinema.com/uploads/_315x420_81ba363c56c4ccaebb04ca59000fd91baabf51a406bfadad5613aeb6125a63d1.jpg'),('Arwa Gouda',1100271,'Egypt','Saudi Arabia','Arwa is a young Egyptian performer who was born in Saudi Arabia. She spent the majority of her life there before returning to Egypt five years ago. Arwa studied marketing at the Naval Academy. She hoped to attain a postgraduate degree but was unable to realize that ambition.n. \nArwa’s career began at the age of 12 when she assumed work as a model. She was selected as the best model in 2004 and thereafter assumed an acting role in the cinematic production “Muntaha al-Laza” where she represented a minor role alongside musician Yuri Marqady and actress Hanan Tourk. The role brought her attention and led to her nomination for a role in the film “Mafeesh Gheir Kidda” (“That’s All there Is” where she appeared alongside screen beauty Nabila and the young performer Khaled Abou al-Nagga. That title was directed by Khaled al-Haggar. Through her role in that production Arwa proved that she has a lot of talent and that she can present singing roles too.\n','27 September 1979','https://media.elcinema.com/uploads/_315x420_991c9f3866f9cfba5bc274373985f356fc7d1f353732089687917186c003bad1.jpg'),('Asser Yassine',1100272,'Egypt','Egypt','Asser Yaseen was raised in a middle class home. His father is from Sohag (but lived) in Alexandria. His mother, Mona Al Dagheidy, is from Port Said.\nHe has a younger brother called Islam and they are both graduated from the faculty of engineering.','25 February 1981','https://media.elcinema.com/uploads/_315x420_7931bc6601f3e97c5fdfaf86728ab9e505b2debd1d58f75a81516931a8a3df71.jpg'),('Dawood Hussein',1100273,'Kuwait','Kuwait','NONE','5 November 1958','https://media.elcinema.com/uploads/_315x420_201effe16bda59fa1e0aa3c95f6209daf06d8fdf2527b88e6411cbd28be61a25.jpg'),('Loai El Sayed',1100278,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5d023e934d985caa59e503a0f3db35112262e930991a0544712698db3464f07b.jpg'),('Haifa Wehbe',1100286,'Lebanon','Lebanon','Haifa Wehbe is a Lebanese artist. Her career began at the tender age of 16 when she took part in the “Miss South Lebanon” beauty contest. That opening provided her with the opportunity to work as a fashion model in addition to granting her with slots in video clips and TV commercials. Haifa soon became among the most famous models active in the Arab World and her stunning beauty and femininity  saw her featured on the covers of many Arab magazines. Haifa thereafter adopted a position as an announcer on the A.R.T. television network. However, Haifa’s love of music and singing meant that she would soon make her first foray into that field by releasing her first album which was titled “Hazza Al Zamman” (“These Times”). Haifa Wehbe has often been dubbed “Malikkat Al Eghraa” (“The Queen of Seduction”).','10 March 1972','https://media.elcinema.com/uploads/_315x420_3d27503d781f583796d783b08e6c56cb8616e36661a57b314103764d731f81dc.jpg'),('Dina Nadim',1100294,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4d075426a43908304f0765cafdd4dd1e8ccc382369c5824d8922e5e58c31dc62.jpg'),('Tareq El Eryan',1100295,'Palestine','Kuwait','Tareq El Eryan is a Palestinian-American director and producer living and working in Cairo, Egypt. He received his high eduction in Egypt, before moving to The United States to study film in the University of South Illinois. He then returned to Egypt and started his career as a director by making several music videos for Egyptian and Arab pop stars and television advertisements for multinational franchises like Coca Cola, LG, and Hyundai. As a film director, El Eryan made a few films that were box office successes and are still highly regarded by fans and critics. These films are “Al Embrator” (The Emperor) (1990), “El Basha” (The Pacha) (1993), “Elselem wel Teaaban” (Snake and Ladder) (2001) and “Tito” (2004). He is married to Syrian singer Assala Nasry, with which he had two sons.','12 September 1963','https://media.elcinema.com/uploads/_315x420_e98d6c3829bf849d1b87fc62ba39855de486be9587051e5e5493e84cf79073a7.jpg'),('Hanaa Atteya',1100296,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_48dce006f1ef141ce8ea0ad2da49020682836bc8c62ca29402f4ef93ccd6804f.jpg'),('Amr Salama',1100299,'Egypt','Egypt','A’mr is an eminent director who graduated from Cairo University’s faculty of Commerce in 2005. A’mr chose not to pursue a career in commerce but rather elected to pursue a career in art. He has nonetheless made use of his education in commerce in making his films. Salama has directed numerous works which include shorts, advertisements, documentaries and video clips. He has also managed the art divisions of several production companies including the Affkar Company for Media Services.','22 November 1982','https://media.elcinema.com/uploads/_315x420_2254544bebcfc14daf702484cbf155947e5058dc1ceb594ffa6d9cce0c400193.jpg'),('Amr Zaki',1100301,'Egypt','Egypt','NONE','1 April 1983','https://media.elcinema.com/uploads/_315x420_123fc43c7cab6aad7df1c6d41d700bdd76447407c2c5631dc0670047796efe36.jpg'),('Shady Shamel',1100307,'Egypt','Egypt','Shady Shamel is an Egyptian actor. His talents came to the public’s attention when he participated and won in a contest to choose the lead actor for a series about the life of Andaleeb Abd Al Hakeem. The uncanny resemblance between himself and the departed (performer) helped secure his win.','1 January 1982','https://media.elcinema.com/uploads/_315x420_1bd68cdb92d97fa4f2df2bebaad3c36857101477452b0e191d2be7badf556f57.jpg'),('Eman Ayoub',1100308,'Egypt','Egypt','Is a graduate of the High Institute of Dramatic Arts who started her career on the stage. She acquired her experience by working with great stage actors like Sameer Ghaanem and Sanaa Younes. Her  popularity after her role in TV series “Hayaat al-Gohary” lead to another role in “’Eesh Ayyamak i.e. Live your life” that has proved her talent in playing the most difficult roles. Although she disappeared for a while for family reasons after her proven success, yet she is back again.','18 January 1978','https://media.elcinema.com/uploads/_315x420_885d696632932469321d00ad4707556728d28a41416520150620e8401462b6ee.jpg'),('Ismail Farouk',1100310,'Egypt','Egypt','An Egyptian director born in May 3, 1974, Esma’eel Farouk is known for his B-films, low budget and technically poor films, made for the sake of money. Starting “90 dakeeka i.e. 90 minutes”, the film produced by “Waleed al-Tab’yee” to apologize to his wife “Ghaada Abdul Raazek”, through “Eb’a aabelny i.e. Impossible to happen”, Sa’d al-Soghayyar’s “Welaad al-balad i.e. Good guys” and “Al-Academeyya i.e. The Academy”.\n\nCritics consider him an extension to the - so-called - the 1980s B-films of the Egyptian Cinema. ','3 May 1974','https://media.elcinema.com/uploads/_315x420_aae1f903573e45474bdf58543b894587e6c60c0713356de859f7d091545a7a10.jpg'),('Hana Shiha',1100312,'Egypt','Egypt','She is a new actor daughter of artist Ahmed Thu El Fakar Sheeha  she has 3 sisters in the field of acting and cinema Hala , Maya  and Inas. ','25 December 1985','https://media.elcinema.com/uploads/_315x420_8642824a94e9eaea33104bbb6c9bf8f3a5bf9ffe6161d07ae82248f237948881.jpg'),('Dorra',1100321,'Tunisia','Tunisia','Dorra is a Tunisian actress. She earned her degree in political science in Tunis. Dorra made her way into the acting arena by joining a theater group. Her first performance was in a play titled “Magnoun” (“Insane”) which  was directed by Tawfiq Al Gibally. Thereafter Dorra assumed several roles in Tunisian cinema in addition to working on international works such as “Collosseum” which was directed by the English director Telman Reem in 2003. In that production Dorra portrayed the role of the Emperor’s consort. She also took part in another foreign work titled “Louisa’s Journey” which was directed by French director Patrick Foulsan in 2005. Dorra assumed the role of a woman named “A’isha” in that work. As of 2007, Dorra has started participating in Egyptian cinematic works.','13 January 1980','https://media.elcinema.com/uploads/_315x420_2efadec115b939a4115ab2ce825743b833637bafd47278ddf571748e16cb0b85.jpg'),('Reem Al Baroudi',1100327,'Egypt','Egypt','Reem El Baroudy is an Egyptian actress who was born on October 6, 1978. Even though she graduated from the Faculty of Tourism and Hotels, she continued to pursue acting, which she started when she was 15 years old when she appeared in commercials. Her first acting role was in the play “Nashnat Ya Naseh” (Aim, Smart Guy). She got her start in television with the TV serial “The Hedgehog” and also appeared in “Hamza We Binato El Khamsa” (Hamza and His Five Daughters), “Hada’iq El Shaytan” (The Devil’s Gardens), “Azhar” (Flowers), “Ahlamak Owamir” (Your Dreams Are Orders), “Jidar El Qalb” (Wall of the Heart), “El Rahaya Hagr El Quloub,” “El Bataniyya,” “Mamlaka El Jabl” (Mountain Kingdom), “Ihna El Talaba” (We’re the Students), and “ِAbed Karman.” She also acted in a number of films, including “Ya Ana Ya Huwa” (Me Or Him), and “El Fil Fel Mandil” (The Elephant in the Handkerchief). ','6 October 1978','https://media.elcinema.com/uploads/_315x420_47d4f97f37b4c7fb8c5a619a6a321740faee277b9b797e0e989fa046bc130ae3.jpg'),('Basmala Emad',1100328,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_15acd503e68863e23a2533232a24673f6eb59b42ce42a5562d5a98585d25a7cb.jpg'),('Nesrine Imam',1100333,'Egypt','Egypt','Nesreen Studied at the Marine academy in Cairo and became a professor at this same university for 2 months. \nNesreen Imam started her acting career after one of her friends recommended her to director Inas Bakr who was preparing for the miniseries “Nostalgia and Tenderness” starring Omar Al Sharif.\nNesreen also attended an acting crash course with theatrical director Kamal Atteya, who put her on the right track. From there she picked up her pace and acted in the series “Dead Heart” for Magdi Abu Emaira and actor Sherif Monir.\nShe also worked with Sherif and Magdi again in Ramadan 2010 in the series “Outside the World” \n\n','22 January 1986','https://media.elcinema.com/uploads/_315x420_6a2c72c6b2aa9a0644fe3fbcad4e4efecf102b708e2e6375532948908eaa33c9.jpg'),('Emmy',1100334,'Egypt','Egypt','Emmy is an Egyptian singer and actress. Following a brief singing career, she started appearing in short films, until she had her breakthrough in 2005 with her role in the romantic drama \"Ahlam Omrena\" (The Dreams of Our Lives). She then went on to star in many films and television series, including \"Ma Tigy Nora\'os\" (Let\'s Dance), \"Qadeyet Nasab\" (Parentage Case) and \"El Amaleyya Messi\" (Operation Messi).','9 February 1982','https://media.elcinema.com/uploads/_315x420_bcd6c3fbab3dd35c3cc4c890f4c0c08dcb25a9d650d5e6ccb6a3aa04d32f5307.jpg'),('Hasnaa Saif  Aldeen',1100343,'Egypt','Morocco','She is Hassnaa Seif El Din Al Kelany granddaughter of the Jordanian ex minister of housing and construction. Her first appearance on screen was playing the role of actress Youssra’s sister in the series “Embarrassing moments” in 2007. She also acted in the movie “ Feminine moments” and in several series such as “The Night Of The Foxes” along side actor Farouk El Fishawy in 2007 and “Girls in their 30’s” featuring Mahmoud Kabeel and “The Shadow of a Fighter” featuring Hesham Selim.','24 October 1976','https://media.elcinema.com/uploads/_315x420_8f20d7604e7e72ec2f4fd01c18df833f22921ef3523c32fde75ba161f66a2413.jpg'),('Tamer Mursy',1100347,'Egypt','Egypt','Tamer Morsi is one of the biggest producers that presents work involving many celebrities. He is also considered on the highest paying wages. He produced work such as series “Outside the World” for actor Sherif Monir and series “The Beach” and many others. ','28 August 1968','https://media.elcinema.com/uploads/_315x420_232e73d40b795e03f104e1d5ce8b073f3423243666c97939d67a7cd73fc22304.jpg'),('Sherif Abdin',1100354,'Egypt','Egypt','NONE','13 February 1977','https://media.elcinema.com/uploads/_315x420_95c90b6fd40cd0b264bdf380a17759d26ac0724b7e2a50b62cf1941e4ab3aba3.jpg'),('Madeline Matar',1100356,'Lebanon','Lebanon','Madeline Michel Matar a Lebanese singer born in Gabal Lebanon in 1972. She studied eastern singing in the “national high institute for music.” The legendary “Wadee El Safi” heard her and liked her voice and asked her to join him in a charity fund raiser for Lebanon in London. This was her first step towards being a star then upon returning to Lebanon she was involved in a program on the LBC  called “Star Trophies”  then a record company helped her  record her first single which was a hit called “to describe” .','29 August 1972','https://media.elcinema.com/uploads/_315x420_311e26a4daab757804b09d217c5d7864857f1d589fa3189ed1bb9c5a5b80951a.jpg'),('Robert Bechara',1100358,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_eff328f3ac5799ae81aad52bcd51856692eedef6fd5b74b0b7c9268109d04d79.jpg'),('Heba Magdy',1100362,'Egypt','Egypt','Heba Magdy is a young Egyptian actress who graduated from the Faculty of Arts at the University of Ain Shams in the department of theater criticism. She also studied Arab music in the Academy of Art, and was a ballet dancer. Heba started acting when she joined the Egyptian Opera House under the leadership of Dr. Gamal Salaama, and then trained under Maestro Salah Aram. Afterwards, Heba appeared in TV series “Boogy We Tamtam” (Boogy and Tamtam) and in “Fawazeer Amo Fouad” between 1998 and 2003. \n\nHeba’s first experience in television was in the TV serial “El Aid Al Wan,” directed by Mohammed Regany when she was still young. Heba also appeared in several children’s TV programs, including Fathy Abd El Wahab and Rania Farid Shoky’s “A’ila Magnuna Gedan” (A Really Crazy Family). Heba’s career really took off with the TV series “Ana We Ha’ola’” (Me and These Guys) with the famous actor Mohamed Sobhy. Afterwards, she appeared in the series “El Farisa We El Seyad” (The Prey and the Hunter) with actor Mamdouh Abdelalim and director Khairy Beshara. In the past few years, Heba has increased her television appearances, which has made her one of the most famous TV stars. ','28 July 1988','https://media.elcinema.com/uploads/_315x420_aefa874a521a2f3780ce4ea790e836ee3dfd5a38880c1e223dcb5331219f71d1.jpg'),('Eyad Nassar',1100363,'Jordan','Jordan','Eyad Nassar is a Jordanian actor and director. He was born in Amman in 1974, and worked as a teacher, before switching his career to art. He started by working as an assistant director in many television series, after which he directed theater plays. Nassar\'s acting talent appeared strongly in the popular Syrian series “Al Amin wal Ma\'moun,” after which he moved to live in Cairo and started a new phase in his career through working in Egyptian television dramas like “Sarkhet Ontha” (A Female\'s Cry). His breakthrough performance was that of the Muslim Brotherhood leader Hassan El Banna in the historical series “Al Gama\'a” (The Community). He received wide critical acclaim for his depiction of the Brotherhood leader and earned a big fan base in Egypt. From then on, his work shifted majorly to Egyptian television series, and he went on to play successful roles in series like “Al Mowaten X” (Citizen X) and “Moga Harra” (Heat Wave). Nassar also worked in film, starring in works like “Bentein min Masr” (Two Girls from Egypt) and “Basra.”','9 November 1971','https://media.elcinema.com/uploads/_315x420_a3e934f836b651685aece8863c9a3114e076b42fd4bcc87978a5e1abd7b0fb2a.jpg'),('Sanaa Muzian',1100365,'Morocco','Morocco','NONE','4 November 1970','https://media.elcinema.com/uploads/_315x420_ada5d0804f7f8fdc46e6e8f029a138a3c8154cc5cd4c6e8bb679087abc21d825.jpg'),('Ahmed Shaker',1100371,'Egypt','Egypt','He is the son of director Abel Latif Shaker. He presented many roles whether in the cinema, theater or television. He portrayed many characters the best known one was the portrayal of Farid in the series “Asmahaan”','7 June 1970','https://media.elcinema.com/uploads/_315x420_a4a685eef7529abf8f7eae896a1fec636dfc577ba58c1fca19b4807c3fccee6e.jpg'),('Sabry Fahmy',1100382,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3aaaf960bccb4cd4368008626bb6dabd5f92c722e88275362c148781b420fc4a.jpg'),('Omar Zahran',1100383,'Egypt','Egypt','NONE','19 October 1963','https://media.elcinema.com/uploads/_315x420_bba30d4ee8862652fe2eb3b77ca4c5cf884b4fb2ecbc142738b66c5a7f2b1767.jpg'),('Monia Fath El Bab',1100385,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3f1d012a4eef4b630c9851ba820ad404a0d1c5b4919a8af6d26913457d60ff11.jpg'),('تامر جوزيف',1100386,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_77257956679f23668959e108f777043f8d4b5eb4b807ad3f49746940b24f80d6.jpg'),('حسين خليل',1100390,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('ماجد يوسف',1100391,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nadia Kamel',1100413,'Egypt','Egypt','NONE','28 September 1961','https://media.elcinema.com/uploads/_315x420_3eda75005b77ba0bcd2507fe8adf0abf6af9d5861950816b890d1e70a57588f4.jpg'),('Esam Ismaiel',1100446,'Egypt','Egypt','NONE','8 February 1975','https://media.elcinema.com/uploads/_315x420_ecdbcfcb02982dc43074f9478fab83e960cbfad9bbaaa42f99b0a058b80e3bf6.jpg'),('Mohamed Ahmed Maher',1100447,'Egypt','Egypt','Mohamed Ahmed Maher was born in October 6, 1981. He is the son of actor Ahmed Maher and graduated from the Faculty of Science. He began his acting career with the TV series “Amira Fi Abdeen” (Princess in Abdeen) for which actress Samira Ahmed suggested him for the role. Mohamed quickly proved himself within the acting world. He appeared in the series “El Sanderella” (Cinderella), “Canaria We Shoraka” (Canaria & Co.), “Souq El Khodar” (The Vegetable Market), and others. One of his most recent successes was his performance of the role “Kareem” in the series “El Hara” during the 2010 Ramadan season. ','6 October 1981','https://media.elcinema.com/uploads/_315x420_6a98e22db1f34c4bf75c595990e6459d500981c58079ddc27dc2c799cd3c89f5.jpg'),('Amr Al Qadi',1100455,'Egypt','Egypt','NONE','12 September 1974','https://media.elcinema.com/uploads/_315x420_0706ac6a16e3ed0209c8da8300b0395776ea07df1f717fc648a41192a889adcf.jpg'),('Yahya Zakariya',1100456,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_97265295de59e53ffd92a1ec3e200032b2389dcde7c7e17304f5a580264dd3a9.jpg'),('Amr Mamdouh',1100457,'Egypt','Egypt','NONE','4 January 1980','https://media.elcinema.com/uploads/_315x420_8a509f4df61737f13350e1e7322baa6ab644236f44d56d32b985895a2e104e0e.jpg'),('Mamdouh Maddah',1100458,'Egypt','12 February 2015','Mamdouh Madah was an Egyptian actor. He graduated from Cairo University\'s faculty of law in 1990, and worked as a lawyer after his graduation, before switching his career to art. He participated in Al Haraka troupe\'s theatrical shows in the Cairo Opera House, and landed his cinematic debut in the 1999 comedy “Aboud Alal Hodoud” (Aboud On The Borders). He then started appearing frequently in films like “Kalemny Shokran” (Please Call Me), “Al Saher” (The Magician) and “Kaf Elqamar” (Moon\'s Palm). He died in February of 2015.','1 February 1958','https://media.elcinema.com/uploads/_315x420_0ee351b556edf46d089d64a38207ead77e2824676cf1163db80d0607220e414d.jpg'),('Muhammad Farouk',1100460,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_636fc80cc97b864744ce2a69bb510cfedfd2e12cae59f433140b0c6bdc46ab6f.jpg'),('Ahmad Ouda',1100461,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mahmoud Ezzat',1100462,'Egypt','Egypt','NONE','3 October 1974','https://media.elcinema.com/uploads/_315x420_c95c22b016446fe4710032d0002e7a14690744f943dbe9fb88ee1ae6fac833bc.jpg'),('Magdy Munir',1100463,'Egypt','محمد مجدي منير ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_05a2b05a5c5a7207ca4016365133271a715ed946a8d3656bf431a514e8ec0862.jpg'),('Eslam Wifky',1100464,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_396bce134284c72491bd47af7f9e4808538ed3fea22ef8706956cba026157e41.jpg'),('Ahmad Ibrahim',1100465,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b5600732de043b418b5bfe569b401a5ab92362578855ed8dc9b02e67d96f12e0.jpg'),('Marwan Musallam',1100466,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a320f2a431d1970de2bbc0a10fc8082fdf2244b687255e09a08c5976661fe5f9.jpg'),('Osama Abdullah',1100467,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_658481428a06873afcf7a64e49314f09f6e3427f0ca5cce4d4f329c06db373a7.jpg'),('Ibrahim Aboalata',1100469,'Egypt','Egypt','NONE','19 July 1978','https://media.elcinema.com/uploads/_315x420_075253562750754d49bd45fb4006ad6636bb08b8e94c59b78d689715f09a5586.jpg'),('Heidi Sleim',1100472,'Egypt','NONE','Heidi Sleim is an Egyptian actress who began her career with the film “Ma’ali El Wazir” (His Excellency, the Minister) in 2002. Afterwards, she acted in a number of other films, including “Howa Fi Eih” in 2002, “El Rayes Omar Harb” in 2008, and “El Alamy” in 2009. She also appeared in a number of TV serials, including: “Mahmoud El Masry” in 2004, “Adham El Sharkawy” in 2008, “Qanun El Maraghy” in 2009, and “Doktor Amradh Nesaa” (Gynecologist) in 2014, among others. ','NONE','https://media.elcinema.com/uploads/_315x420_9dcfd0fb654f8923fbeb866ce4a691bab91dcb819c7fd04a718242d7e58bbe47.jpg'),('Hesham Hassanein',1100474,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7a1737fd8e1dddc7dd3f9e45efd1f281f4d8bdc29112467318e501e07bc838be.jpg'),('mahmoud zahran',1100475,'Egypt','Egypt','NONE','15 January 1986','https://media.elcinema.com/uploads/_315x420_3247975359abee46eb960537076cd3da84952b78733544d1fbf61d8ac8cc3082.jpg'),('Nadine Salib',1100476,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Tamer Nassar',1100477,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_852388a290a70be37be173925600bf2c55bc089cb3e50f225c9e3eb76e76d2ae.jpg'),('Tamer Eldessouki',1100479,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_655bef6c963bef98f2b81a2e556cf206193e3f63be5e7193672915580105c0ba.jpg'),('wael nabil',1100481,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_71e0429d4a72fe9f87ec8a00fd75c25f7309ea88f9fb0e79d6965ed77848cb10.jpg'),('أحمد جمعة',1100482,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ouf Abd Elrahaman',1100485,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cc5fc5e8a7c6263725eca09bed51290c1e8cae8b3200249756cc0e4d2606a89e.jpg'),('جيهان مشير',1100492,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('طارق علوش',1100521,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5e03d4e1a6fa74dcfe1fbec63b9531b682de740ac0ab9de5ceee8ff640f624ad.jpg'),('Amr Assem',1100536,'Egypt','Egypt','NONE','18 August 1975','https://media.elcinema.com/uploads/_315x420_fa0544a2f24205404c3675b32b25edf7c506352633e61d14e84f617dea3fa0ff.jpg'),('Doaa Teama',1100546,'Egypt','Egypt','NONE','2 May 1982','https://media.elcinema.com/uploads/_315x420_4b4ecc75430a7c95b22f15362a87e957dff2afe323dab32a634910e22ddaf4a6.jpg'),('Shady Khalaf',1100547,'Egypt','Egypt','Shady is the son of renowned poet Nabil Khalaf. He appeared in one of Youssif Chahine’s latest works “Heyya Fawda” (“Chaos”) and the experience was a sort of launch point for his career in cinema. ','13 October 1977','https://media.elcinema.com/uploads/_315x420_f4b62d04a378fbe90437af9357ede19e38171e3f1df955398ada67399a3b5cf5.jpg'),('Nermin Maher',1100548,'Egypt','Egypt','Nirmeen Maher is an Egyptian actress. She started her career as a model in television advertisements and music videos, until she debuted on film in Adel Imam\'s comedy “El Sefara fel Emara” (The Embassy in The Block) in 2005. She also co-starred in the comedy film “Dars Khosusy” (Private Lesson) in the same year, and “El Eyal Herbet” (The Children Have Escaped) in the year after. Among her other notable film roles are “El Zamahlaweya”, “Qoblat Masruqa” (Stolen Kisses) and the television series “Dawaran Shubra” (Shubra Square).','9 October 1984','https://media.elcinema.com/uploads/_315x420_3c30e5b65e2785a931f30a321452083023ce54e008b62357fcb5f59e7b5cd942.jpg'),('Mohamed Karim',1100552,'Egypt','Egypt','Mohamed Karim is an Egyptian actor. He was born in 1980, and started working in the arts in Los Angeles after finishing his high school. He started appearing in television series like \"Ahlam Moa\'agala\" (postponed Dreams) and \"Banat Afkary\" (My Dear\" (My Dear Thoughts) and \"Mas\'alet Mabdaa\'\" (A Matter of Concept). His real breakthrough came with his roles in Khaled Youssef\'s films, like \"Hina Maysara\" and \"Dukkan Shehata\".','2 January 1980','https://media.elcinema.com/uploads/_315x420_96df23de7dd7c16f9a791857f3a25d8ffc118ef00ba238de80c333aa43cf7714.jpg'),('Darina Al Joundi',1100554,'Syria','Syria','NONE','25 February 1968','https://media.elcinema.com/uploads/_315x420_a63a4b83e3a124ba763a1d7eff1907ecaebf24ab7509cf3954fb533d0286cc10.jpg'),('Mohamed Abdel Khalek ',1100567,'Egypt','Egypt','NONE','18 June 1969','https://media.elcinema.com/uploads/_315x420_01b0a2c32d5bd398c3ec8aa71deaf371815c2e980908ba7d11b288f595e4c8c2.jpg'),('Hany Hussien',1100569,'Egypt','Egypt','NONE','15 May 1980','https://media.elcinema.com/uploads/_315x420_4bdaf40fae03da4c1ff99b2cd5a4a78d96b035f08198f509077b974a042795cc.jpg'),('Marwa',1100602,'Lebanon','Lebanon','Marwa is a Lebanese musician who can perform the role of the temptress. She headed to acting when she collaborated with producer Mohamed al-Sobkky and thus she has performed the role of the temptress with limited acting talent.','15 July 1974','https://media.elcinema.com/uploads/_315x420_64e391a9bcd85155a4584a92fec5b672380323dcf7f1ecd33918b656b784468f.jpg'),('Ehab Amr',1100611,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Nour',1100612,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f69183f24df5d4de5698e3ed1a6532b0f710089f68426e0514e7f0769e2e777d.jpg'),('Tamer Eissa',1100613,'Egypt','Egypt','NONE','8 January 1984','https://media.elcinema.com/uploads/_315x420_1bc82606fa44b7b236aa741f158ac6540abbc283db6f98fe9fb38dfffd86e034.jpg'),('Hamdi El-Tunisi',1100614,'Egypt','NONE','Egyptian actor and director, Hamdi El-Tunisi began his career in theatre with the play, “El Milad” (The Birth) in 1997. In 2002 appeared in television series “Faris Bila Gowad” (A Knight Without a Horse). El-Tunisi has since appeared in several films including: “Dem El Ghazal” (Blood of the Gazelle; 2005), “Amara Yacoubian” (The Yacoubian Building; 2006), “El Showq” (The Passion; 2011) and “Farsh wa Ghata” (Rags and Tatters; 2013). In 2011, he also appeared in the television series, “Dawaran Shubra\" (Shubra Square). El-Tunisi also worked as the assistant director on the film “Qoblat Masrouqa” (Stolen Kisses) in 2008.\n','NONE','https://media.elcinema.com/uploads/_315x420_4e352a18a4c180945cb40bac42d327c52118c65f386348cd9138e582bf5d0c60.jpg'),('خالد الشيخ',1100617,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمد جابر',1100618,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Heba Othman',1100621,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9d91b0543f6e203d6f436a4bbd1962c783742ffc073a352ed6fa96d56736f496.jpg'),('Ehab Mahrous',1100622,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hitham Dahab',1100623,'Egypt','Egypt','NONE','20 June 1985','https://media.elcinema.com/uploads/_315x420_812c925a72df1138884a944b73a88ff30df82a721842a60c2398d4934488c10d.jpg'),('Samih Gamal',1100624,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b04b9884311c96858a34dc2210fd7221ad90ec7f8844efd7bba010261d40f5af.jpg'),('Khaled Khalil',1100669,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sayed Al Jazzar',1100671,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_28cb9ebfc41d2003fabf749c267255c1e2937de846f8fe27d0e2d52987070eb6.jpg'),('Muhammad Adel',1100673,'Egypt','Egypt','NONE','14 April 1986','https://media.elcinema.com/uploads/_315x420_bd796ad1900ffd9e67dcaeb368bffff4f0b6ad09bc2748b5f5dc7d26818449ef.jpg'),('Ayten Amer',1100677,'Egypt','Egypt','Samar Ahmed Abd El Ghaffar was born in Alexandria and moved to Cairo when she was 4-years-old. She\'s the sister of the Egyptian actress Wafaa Amer. She studied Acting and directing in Cairo and worked as a model which benefited her to overcome her fear of the camera. Her first true step was her role in “Hadret El Motaham Aby” (Mr. Lawyer, my Father) with Nour El Sherif. From there she was cast in many movies and series like: “Ramy El Itesamy,” (Sit-in Ramy), “Share\' El Haram,” (El Haram str.) “Banat El Am,” (Female Cousins) “Hassal Kheir,” (It\'s Alright), “Sa\'a we Nos” (An Hour and a Half) and “Harag We Marag\" (Hubbub).','22 November 1986','https://media.elcinema.com/uploads/_315x420_a26a034a0c4325ab39a450d2fc82b3a10379c8f8d92d3898707c46aa9b8f8169.jpg'),('Mahmoud Kamel',1100681,'Egypt','Egypt','NONE','21 September 1975','https://media.elcinema.com/uploads/_315x420_ece2fff94c72972893afa6e3b7388db1184573d4bb865ab2ad0951d8f8af2041.jpg'),('جورج رمسيس',1100687,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('نسرين فهيم',1100701,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Heba El Sisi',1100704,'Egypt','Egypt','Heba Alsisy was a law student at Mansoura University who entered the spotlight after moving to Cairo where she began working as a model and dancer. She became well-known after appearing in several commercials, and she later represented Egypt in several international beauty pageants. In 2004, Alsisy was named Miss Egypt. She then took courses in singing and acting and began working in the entertainment industry.','28 April 1983','https://media.elcinema.com/uploads/_315x420_edd7326244027c53dc6c59cd6f499a49df53ec220ee22ab3845448791836217e.jpg'),('جمال إبراهيم',1100707,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ayman Bahgat Amar',1100721,'Egypt','Egypt','Ayman is a poet and a musician. He is among the most prolific poets of the contemporary period and he is the son of renowned playwright Bahgat Qammar. Ayman has authored yrics to some of Egypt and the Arab World’s most distinguished artists. Ayman also has experience writing cinema screenplays including “Bahebek” (“I Love You”) and “Anna Kaman” (“Me Too”) in 2003 for Mostafa Qammar, “’Andaleeb al-Dokky” in 2007 for Mohamed Heneidy, “Assif ‘ala al-Iz’ag” (“Sorry for the Disturbance”) in 2008 for Ahmed Helmy. Moreover Ayman has also been credited for several film songs along with opening and closing themes for television series. \nAt the start of his career Ayaman used to write lyrics for songs used in advertisements for mobile phones and electronics. Thereafter Ayman got to know a couple of youths who were working on a music album titled “Akhadatho al-Seema” in 1991, however Ayman did not feel accomplished through that effort. Nonetheless he felt that the project was a good way to achieve recognition. Afterwards Ayman got to know the composer Hassan Donya who helped him make his way into the music tape industry. Thereafter Ayman had the chance to collaborate with a number of musicians of the likes of Samira Sa’eed, Faris, Ehab Tawfiq, ‘Amr Diab and others.\n','15 April 1974','https://media.elcinema.com/uploads/_315x420_02444b188c6a0d057d88212bc4b3d92b0a0ec9a1a0fccb6f05671903a7af5845.jpg'),('Ahmad Al-Sayed',1100732,'Egypt',' 9 December 2018','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8aa1ccebff3f9c50d044b3cfb4167576a12c44f3135e855c81636fea88de4e1d.jpg'),('Nabil Sobhy',1100733,'Egypt','نبيل صبحي علي ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f835c9f3d6b4dee6c337dbb3341db171034279b57a18961ad49b9d186cbdca72.jpg'),('محمد عكاشة',1100734,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('وليد جابر',1100735,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ba7cb24c3e88928ba34caa048fc26e8d8f11e5c0e96d624dbc3502d444891d90.jpg'),('Malak Zulfaqar',1100737,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e616499ca2714a1fe3a902623bbc68499855d02fee636eb5570d1b15a3d8a679.jpg'),('Amin  Gamal',1100742,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b3f21f6991fb7b450e41ba0a54b9d056c8cdea369a269c6ca7d7a7b0d4b99f88.jpg'),('يوسف بارود',1100744,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0f177992a0c97679fe9a646cc33597daf66937d5181f23617fa8a93ededbf430.jpg'),('تامر ربيع',1100745,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('صالح القاضي',1100747,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمود الخراط',1100750,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('خالد الفخراني',1100751,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Medhat Shalaby',1100766,'Egypt','Egypt','Medhat Shalaby is an Egyptian television presenter specializing in football. He started his career in the Egyptian ministry of interior affairs as a police officer, where he also started his failed attempts at playing football alongside the ministry\'s team. Shalaby stayed at the ministry until he reached the rank of major general, and then retired to focus on working in the media. He first worked with the Egyptian television as a presenter in several contest shows, while also working as a football coach in a number of infamous League 2 and League 3 teams. After failing as a football coach, he started working in the Egyptian Football Association, and since 2007, he has been working solely as a football programs presenter.','22 November 1944','https://media.elcinema.com/uploads/_315x420_e2fa6dcdf197343e4be1994a327deb475d240482763d85fa935f469e6421ea18.jpg'),('Raouf Abdul Aziz',1100767,'Egypt','NONE','Raouf Abdel Aziz is an Egyptian director and cinematographer. He started his career in \"Kheyana Mashroua\" (Licit Infidelity), then as a focus puller in \"45 Youm\" (45 Days). He worked as a cinematographer in television series including \"Bab Elkhalq\"b Elkhalq\" and \"Saheb El Saada\", and films including \"Asham\" and \"Wahed Seaidy\". He debuted as a director in the television series \"Alf Leila we Leila\" (One Thousand and One Nights).','NONE','https://media.elcinema.com/uploads/_315x420_596fa192ae39aaa94c37a46aa5bc685a672625f6fc67f7074097dae4a3e6427c.jpg'),('Hassan Harb',1100771,'Egypt','Egypt','NONE','17 October 1979','https://media.elcinema.com/uploads/_315x420_d1aaa9a9573d7912038d4701f5d96b93def81d8e6e832b14cd76b97802876255.jpg'),('Yassmin Jamal',1100774,'Egypt','Egypt','NONE','15 June 1984','https://media.elcinema.com/uploads/_315x420_ad628c7de666ddd348f07d9c2c3e7e07f9198963b6087c3fe00fd249e45fc6d7.jpg'),('Youssef Othman',1100776,'Egypt','Egypt','NONE','14 July 1994','https://media.elcinema.com/uploads/_315x420_a9d7d0c76aa5ccb79c62693c2a2d1b83fcfd53c9e197f2d01aa6018fa5e573ea.jpg'),('Hossam ElHusseini',1100778,'Egypt','حسام مجدي الحسيني ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_da601812d485623bff5891a050219e2770e33ada9d7378979296624bbf7fc346.jpg'),('Ahmed Yousef',1100783,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Fahmi',1100784,'Egypt','Egypt','Ahmed Fahmy is a young Egyptian actor who began his artistic career as a musician in the group “Wama”. Through relying on his abilities as a musician and his training at the conservatory Fahmy achieved a great measure of success when he assumed his first acting role. After his first acting break, Ahmed went on to achieve one success after another.','17 March 1980','https://media.elcinema.com/uploads/_315x420_a68d8074ccb28ef5f7d13c8036fd66687650930930f94597af57232e3059accf.jpg'),('Maryan Khoury',1100796,'Egypt','Egypt','NONE','2 October 1958','https://media.elcinema.com/uploads/_315x420_ce3336ce35ca13d5652247a01982241075041c7229c384672e19af199641e970.jpg'),('Mohammed Nader',1100798,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1f66dab785a169c9e29ecf5f72b0eb5f7ee6ff98810932eaa60e1a48085dd2f0.jpg'),('Omar Hassan',1100802,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Muhammad Atef',1100808,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4d93ee2bb1c6d61e88e1bfeafb01c375ebe067a7396c883024c5b074735b3ffa.jpg'),('Amira Hany',1100810,'Egypt','Egypt','Amira Hany is an Egyptian actress. She started her career in 2003 while still a student at high school, through a role in the successful television series \"El Amma Nour\" (Aunt Nour). She then went on to appear in the series \"Mahmoud El masry\" the next year, then took a hiatus until she finished her graduate studies. She came back to appear in television series and films including \"Saa\'a we Nos\" (An Hour and a Half), \"Ebn El Arandaly\" and \"Camp\".','5 July 1985','https://media.elcinema.com/uploads/_315x420_43808f2eabb4667c6f0a2a1c75d8d10996346239fba37fc49b5eafefddce32a4.jpg'),('Abdul Aziz Hashad',1100811,'Egypt','Egypt','NONE','6 November 1979','https://media.elcinema.com/uploads/_315x420_9f166419d09f1fe938a1d1b05726eee6de23e6557a3541afb75e1db36247bb32.jpg'),('Haitham Wahid',1100812,'Egypt','هيثم وحيد محمود ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_080333f614c468ba4f7ae19e592d3b078ae56c8bb7f929531ccbfd790a6d2069.jpg'),('Adel Karam',1100817,'Lebanon','Lebanon','NONE','20 August 1972','https://media.elcinema.com/uploads/_315x420_a5cb0036423479cd8f4e101425a052a222faaf3811a8a19b9e1ec40e714df058.jpg'),('Fatma Safa',1100820,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_785781edc88afb91525ea0da46f09cc526262aae77c9646f7a522633f7156b41.jpg'),('yousra karam',1100835,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9645f9a83942acc9e7a57af64cc4ee69ba7b268b8390fe2376a39b57138b3ec8.jpg'),('Hazem Fouda',1100845,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_423a82c91b0596a4abe7223eed14740174ab2f1f86f20c7ebb0e7986bfefcb38.jpg'),('Ayman Shawky',1100846,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_07968ee427eba4c9da1b6994866042e381b22ee604d2bad73b76235e78ee0edd.jpg'),('Feryal Youssef',1100848,'Tunisia','Tunisia','Firyal Youssif is a Tunisian actress, her real name is Firyal Farageh. Firyal began her acting career in Tunisia with a television series titled “Qamrat Sayyidi Mahrous” (“Master Mahrous’ Cabin”). She subsequently spent 12 years acting on Tunisian television before transferring to Egypt where she performed in the film “Bi Al Alwan Al Tabee’yha” (“In Natural Color”).\nDespite the former being Firyal’s first work in Egypt it has nonetheless led her to receive an award at the Alexandria Film Festival. Thereafter Firyal took part in the television series “Kallam Niswan” (“Girl Talk”) and “Malikah fee Al Manfa” (“Queen in Exile”). Her most recent work was “Al Ragol Al Ghamid be Salamatoh” (“A Mysterious Man”) which saw her work alongside Hany Ramzy and Nelly Karim.\n','11 December 1980','https://media.elcinema.com/uploads/_315x420_5283d9fe70a4d91526ffcfad61a497840bf6f7652adbb2f5794fdbfe1d4e4561.jpg'),('Mohsen Mansour',1100851,'Egypt','Egypt','Mohsen Mansour is a talented Egyptian actor who participated in many supporting roles. He attracted attention through his role in film \"Tito\".','1 March 1973','https://media.elcinema.com/uploads/_315x420_c9c23cf1ee71bbe112e6dde1903c0cf1ff2dccd092cc2b8d03324898e956a2dd.jpg'),('Islam Khairy',1100854,'Egypt','NONE','Islam Khairy is an Egyptian director. He started his career as an assistant director in the film \"Ahlam Omrena\" (The Dreams of Our Lives) in 2005. He also worked in the films \"Keda Reda\" and \"Khareg Ala Elqanun\" (The Outlaw). He debuted as a director in 2010 by becoming one of the directors of the first season of the television series \"El Kebir\".','NONE','https://media.elcinema.com/uploads/_315x420_8c896dda26981a9d0a0c80e13a64b40a44743b91542265c7f19d4b46a82c299f.jpg'),('حسن السيد',1100855,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('مروان صابر',1100856,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_519fff58c50da6ee9fc01695b2cfe390deb525ef178ce625a2e54ec7bd77abad.jpg'),('Khalid Hassan',1100858,'Egypt','Egypt','NONE','9 May 1976','https://media.elcinema.com/uploads/_315x420_685bea5120bacdb705ac674fc4ccd7e585633fed8a2f06303cc47729b3904eff.jpg'),('محمد عبدالغني',1100859,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Saba Mubarak',1100865,'Jordan','Jordan','Saba Mubarak is a Jordanian actress who was born in 1976 in the village of Ajlun in Jordan. She received a bachelor\'s degree in theater acting and directing from Yarmouk University in 2001. She started her career in the series “Sihr wa Qamar” (Magic and a Moon) in 1998, after which she scored several successful roles in Jordanian and Syrian television like “Omar al Khayam,” “Belqeis” and “Al Arwah Al Mohajira” (The Immigrating Spirits). Saba\'s debut in Jordanian cinema was in 2003 through the film “Sifr Al Ganha.” She also appeared in the films “Khareg Al Taghtiya” (Out of Coverage) and “Mamlakat Al Naml” (Kingdom of the Ants). Saba started working in Egypt in 2010 with her role in the film “Bentein min Masr” (Two Girls from Egypt), and she also appeared in several Egyptian television series including “Sharbat Louz” (Almond Sherbet), “Hikayat Banat” (Girls Tales) and “Nassim El Rouh” (Breeze of the Spirits).','10 April 1976','https://media.elcinema.com/uploads/_315x420_1d32e5cab09d85cb9da7e795c624f8178435e3adb2e3a31b4c113334beec63ba.jpg'),('Ezzat Badran',1100867,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fc451ecb2d5d524f82ce29806b291f7a1a9e84a7b0caab89192c733785ba2733.jpg'),('Abdulhameed Sanad',1100868,'Egypt','Egypt','NONE','24 February 1976','https://media.elcinema.com/uploads/_315x420_f58e3400565c1f4ca398acdc236c920955b4a18a452957bc99a5137f249fdfb6.jpg'),('Walid Youssef',1100869,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nadia Al Iraqiya',1100870,'Iraq','Iraq','Nadia Al Iraqiya ','3 August 1963','https://media.elcinema.com/uploads/_315x420_3bd2a969fc90b3a87e4a6d1d126ce6498d7bd485333cf134f767980f2d2d9c19.jpg'),('Sameh Abu Al-Ghar',1100871,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d95fcf940f9c5f9be3ff5b715d9b5262b42d53e3c13318138ee02276fe1a1a1e.jpg'),('Ahmed El Shamy',1100873,'Egypt','Egypt','NONE','12 September 1979','https://media.elcinema.com/uploads/_315x420_e075234d4cc33aebad0acd14b379eb9ecbc3edff25afff7ff8089569c5c795a6.jpg'),('Eid Abu Al-Hamd',1100876,'Egypt','NONE','Eid Abul Hamd\'s simple features have played a big role in his success in playing labor-intensive, brutish roles. He\'s become famous in Egyptian cinema for playing mostly poor, rough and tumble characters, both on stage and on television. Abul Hamd has worked with many top actors and directors. ','NONE','https://media.elcinema.com/uploads/_315x420_fcde49b7287bcdddefb70e8e34ec09ccfe6a0bc8485b28411ced8a3c8f27fb62.jpg'),('Mahmoud el-Khawaga',1100880,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمود القط',1100881,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3cc61cef21c83ab3934040f9b42ea424c79149ba21f568e4a2d5a5808dd0a260.jpg'),('Nabil Prince',1100883,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Omnia Wagih',1100885,'Egypt','أمنيه وجيه خيري ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('وائل خلف',1100886,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b84a923e4281b5b8bf0c7b79d1e36e6609eb8a2efe15d0aba4df6278905b6535.jpg'),('محمد مصطفى',1100888,'Egypt','Egypt','NONE','1 July 2016','https://media.elcinema.com/blank_photos/315x420.jpg'),('عادل الليثي',1100892,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمد حسن',1100897,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('عماد صبحي',1100903,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Elbeh',1100906,'Egypt','Egypt','Screenwriter Ahmed Al Baih had his writing debut with the 1990 film “Shabab A’la Kaff A’freit” (“Youths in the Palm of a Demon”). Later in 1997, Ahmed wrote the film “Al Isma’iliyah Raieh Gayy” (“Two-Way Ticket to Isma’iliyah”). The film served to contribute to the fame of all those involved in the production, including Ahmed Al Baih.','29 March 1969','https://media.elcinema.com/uploads/_315x420_6bd3b8a94a157cb73ea179172630bf8671e9a9d9d7d53d301e1ae7b01b0231d1.jpg'),('Karla Boutros',1100924,'Lebanon','Lebanon','NONE','1 July 1967','https://media.elcinema.com/uploads/_315x420_6a211f25cc603b780dbb78be6e6a01550003994ffc7487b40d5bc3c516db7762.jpg'),('هيثم حسني',1100929,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_33aa4476326b809e64f4f78fef459d94c5227a39b98c8567825bb6d03ec157c4.jpg'),('رفاء العويل',1100935,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Fawwaz Mahmoud',1100938,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_42323bba7e4defde4b76969a74dd609160ea4caf29b9bdc993aa9b23ba8a1eb2.jpg'),('Samir El-Hamamy',1100939,'Egypt',' 8 April 2013','NONE','15 February 1955','https://media.elcinema.com/uploads/_315x420_19d6344a7a7a852831ab7dbf4a64b6068f672d1373601d9fe04629a661a8f4ec.jpg'),('عماد الخضري',1100941,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Entisar Hassan',1100946,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_017c4272829560b61027f4056ee282cb66645537074762a9e8946af1a522b843.jpg'),('Moawad Ismail',1100948,'Egypt','Egypt','NONE','18 December 1982','https://media.elcinema.com/uploads/_315x420_e0d66c2218010779cfe79a82eca965429319ce6746685994188ca967142a170d.jpg'),('Sayed Al Tayeb',1100981,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_dc947c8e302515b43f37237ba6055ef4cbafd841ac7327a983695a52f1c71e63.jpg'),('Muhyalddin Abdulhameed',1100982,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bfd8592f9800c880e2658492aa4debd8a0995c9e28ea259338c374adfe8be7c7.jpg'),('Noha Ismail',1100983,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4768603e59b4b13fdecfd3718c9db04f92f923f5d14988a32d33f0f96ec5bc6a.jpg'),('Adel Al Kumi',1100986,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0ca580adc7b4673a45f71f6cad05435855146470115a0a62c3de34abf89b6b77.jpg'),('Susan Negm Eldein',1100991,'Syria','Syria','Suzan Negm El Deen is a Syrian actress born in Duraykish – Tartous where she finished her school studies before moving to Damascus to study architecture.\nIn 1990s, Suzan started her acting career by some small roles in TV, he first role was in Saalem al-Kourdy’s “Al-dakheela i.e. The stranger” with Jihaad Sa’d and Radwaan ‘Akeely.\n“Nehaayat rajol shoujaa’ i.e. The end of a courageous man”, “Al-kawaasser i.e. The birds of prey”, “Al-thourayya i.e. The pleaides”, “Khaan al-hareer i.e. The silk inn”, “Haneen”, “Saladin”, “Ommahaat i.e. Mothers”, “Al-Zaaher Beibars”, “Molouk al-tawaa’ef i.e. Kings of Tribes”, “Toyour al-shakk i.e. Birds of   doubt”, “Zawj al-sett i.e. The lady’s husband” and “Forsat ‘omr i.e. Lifetime opportunity”.\n\nSuzan is married to a businessman with two boys and two girls. She owns a fitness club “The champions” in Maza - Damascus and has her own production company. \n','24 November 1973','https://media.elcinema.com/uploads/_315x420_1dbc06e3985399876b2052d8db7377b7ea84edd2b67de83792b0eec749e34aa7.jpg'),('Essam Shahin',1101004,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7f96844577a5d9b7d4bb5e304d33480caf9d99f27cc5b740ee54ffc4185c14d8.jpg'),('أشرف محمد',1101009,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c7885bf128eb5f6548a205d343556c7a44ef87167b499a8c0d971d500db4a886.jpg'),('Rania Shaheen',1101029,'Egypt','Egypt','NONE','22 August 1981','https://media.elcinema.com/uploads/_315x420_e7ea246c7cbae5aa675819cb96dd91fc5d12aee69651fffb6380c9a361f8b910.jpg'),('Yara Goubran',1101067,'Egypt','Egypt','Yara graduated in the summer of 2004 from the American University of Cairo where she had studied media and theater. She took part in several theatrical productions whilst at college and thereby gained stage acting experience. \nYara’s cinema debut occurred through “Basra”. The title received the award for best screenplay at the Cairo International Film Festival, a screenplay which was authored by Ahmed Rashwan. Besides her role in “Basra”, Yara Gobran has taken part in the works of esteemed directors of the like of A’ly Idrees, Kamla Abou Zikry and Shereef A’rafeh.\n','NONE','https://media.elcinema.com/uploads/_315x420_747485e292279477e37a3581613495c8f4d7f09e69d02fd6de74463869fe34a1.jpg'),('Moataz Abdelwahab',1101079,'Egypt','Egypt','NONE','12 June 1977','https://media.elcinema.com/uploads/_315x420_f5fecfc2352d058bf360f01ae0c3038abe348b90c0d3f7de46ce6ca7a84ca67f.jpg'),('Tariq Tamim',1101097,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d28eed2cecb842d16fd5335bea320cd4640a2633311c256c806dd16dc6993c00.jpg'),('Mahmoud Gharib',1101104,'Egypt','Egypt','NONE','15 September 1977','https://media.elcinema.com/uploads/_315x420_793974cc059a2965d797a24a8f1910a6f88eb045b371b954ad03521a3b833f14.jpg'),('Moataz El Tony',1101153,'Egypt','Egypt','NONE','14 July 1979','https://media.elcinema.com/uploads/_315x420_3430c56c340e8bcf38443fe5e571aef1a17a45a17352eec73c94b0eb66fff122.jpg'),('Eiad Saleh',1101154,'Egypt','Egypt','NONE','27 August 1985','https://media.elcinema.com/uploads/_315x420_40105469875224bb4a2b44f70f91ca21719d628c45a7046eb13a662eeca5f7dc.jpg'),('منى الزرقاني',1101155,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mariam Naoum',1101172,'Egypt','مريم نبيل نعوم ','Mariam Naoum is an Egyptian screenwriter. She stopped studying economics in France to return to Egypt and study screenwriting at the High Institute of Cinema. Following her graduation, she started working in the advertisement field, before writing her critically acclaimed film debut \"Wahed Sefr\" (One Nill). She then went on to become one of Egypt\'s most acclaimed screenwriters, with screenplays like \"Segn El Nesa\" (Women\'s Prison) and the adaptation of the novel of the same name by Ibrahim Aslan \"Zat\".','NONE','https://media.elcinema.com/uploads/_315x420_a0ab5f43b63f9cd3c4cb03120c98906c3899d6320b69553902a3025af00e7caf.jpg'),('Donia Samir Ghanem',1101175,'Egypt','Egypt','Donia Samir Ghanem is an Egyptian actress. She is the daughter of the performers Dalal Abd Al Aziz and Samir Ghanem.\nDonia completed her university education at MSA university in Egypt and she has assumed roles in several cinematic and television productions. She has also presented several songs.\nHer profile was raised by her performances in “Cabareh” and “Al Farah”. More recently, she has acted in “Teer Enta” and has become recognized as one of the premier performers of her generation.\n','1 January 1985','https://media.elcinema.com/uploads/_315x420_5a8312ee83cc01fb1a1480928dfcc57e95a2864e70945d96c40fa6eae8f236ba.jpg'),('Mohamed Al-Ahmedy',1101177,'Egypt','Egypt','NONE','16 August 1981','https://media.elcinema.com/uploads/_315x420_00d48f92baa5d07b15d96db5cd47526ef4fb737ecf84fb79d0389f592ced6145.jpg'),('Nahed El Sebai',1101178,'Egypt','Egypt','Nahed is an Egyptian actress who has assumed several minor roles in Egyptian cinema.','27 May 1987','https://media.elcinema.com/uploads/_315x420_3aa03878518e86eafea1c3a54a8d7fb5a65dab61cfe3743eac1e62e8c9b0afd1.jpg'),('Youssef Bazaza',1101182,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Andrea Abu Zeid',1101188,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_44f69747ec8ff0f5f6012cedb9186c4839cc8f4d9ec617779b00af6b2ae4438e.jpg'),('Amr Baiyoumi',1101200,'Egypt','Egypt','NONE','13 September 1962','https://media.elcinema.com/uploads/_315x420_f2a8ca22e1d250ed67d3a2d7f6fdb332ad2b4822753dd214203bd8f5bf7676b3.jpg'),('Laila Samy',1101202,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1e0851fb48b4e3865bad18b0c78f87fc65aa2a8e900b060e1030f3f24f00c068.jpg'),('Reem Helal',1101210,'Egypt','Egypt','NONE','4 July 1982','https://media.elcinema.com/uploads/_315x420_469760eb0c921a63b4bb8bb7118a42fcad7e9cd219b26c2bbd52fdfdc0479ddd.jpg'),('كريم يونس',1101212,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hossam Suleiman',1101213,'Egypt','Egypt','NONE','6 June 1985','https://media.elcinema.com/uploads/_315x420_1ce684f4faaf44b74ac100436a225dd0f68f488e076d4fbeb713af228f6059ab.jpg'),('حسام حسين',1101215,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Saad',1101216,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Taim Hassan',1101223,'Syria','Syria','Tim Hassan was born on the 17th of February in 1976 in the coastal city of Tartous, Syria in an area known as ‘Sheikh Badr\'. In 1980, Hassan moved to the capital Damascus with his family, where he lived and studied to join the Higher Institute of Drama &Theater; (specialized in acting). He was firstly rejected, and then re-applied to be admitted at the same time when Actor Gamal Soliman was the head of the judging panel. He finished his studies and graduated in 2001','17 February 1976','https://media.elcinema.com/uploads/_315x420_565389c32c260081d6e9ae478bbe02e1961a1338784763cffbdf3c585f438dcd.jpg'),('Emad Al Arousi',1101226,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_848575d4ca78de4f21be06d28884d3af61646d0f73a3e338a5fc89f9c748db6b.jpg'),('Ashraf Nar',1101240,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2d56ef6ee9694ffd20cfc6a3c267e723841435eb108090a4e51a5471b394a15a.jpg'),('Wael Hamdy',1101253,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b6cd058fdfd21f70b0371d789d482a421662da358265f7df032b578944687a3d.jpg'),('Emad El Gazwy',1101265,'Egypt','Egypt','NONE','4 November 1985','https://media.elcinema.com/uploads/_315x420_996b2cfddabe5ff2a57dee44875688bdcd901921469a766bec81f093b7595eff.jpg'),('Rushdy El Shamy',1101268,'Egypt','Egypt','NONE','28 March 1958','https://media.elcinema.com/uploads/_315x420_2fedc872331650e6aa7eb5eab879dbaf5649d6de5202c5a02020b534035873af.jpg'),('Mahmoud Al-Banna',1101269,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0e1b0ca639e14cfb7621f685d956c3de9b1f610241e202f612dce8cdc304342b.jpg'),('Hisham Al Sherbini',1101270,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8638c8d818eeed26865559012a3855258ae327ba75bb36954865f6a1261b65ac.jpg'),('Ahmed Salah Al-Saadany',1101294,'Egypt','Egypt','Ahmed is a young Egyptian actor. His father, Salah Elsaadany, provided him with his first opportunity to act alongside him in a television series entitled \"A Man from the Globalization Era.\" Ahmed proved successful as an actor, but was restricted to television roles as the series \"Who fired the Shot at Hind Allam?\" and \"Words of Truth\" until he was given his first role  on the silver screen alongside Adel Imam in the film “Morgan Ahmed Morgan”.\n\nSince then, Ahmed\'s career has taken off and his been in several other films including \"Best of Friends\"\n','16 July 1979','https://media.elcinema.com/uploads/_315x420_8e50cf45a31450cd6b0222a1996054bbafd680a478b2bd55a3cbed77b67de81b.jpg'),('Eman Al Assy',1101295,'Egypt','Egypt','Pre stardom, Eman El Aassy studied Business Administration for she had no intention to join the cinema world. Her introduction though to the movie industry came by sheer coincidence when she took part of a photo shoot session that ended with the photographer’s admiration with one of her shots, asking her permission to publish it in a female magazine. Eman agreed, for the shot was a respectable one that expressed and reflected who she truly was.\n\nThe shot was later published as magazine cover that was seen by renowned director Khaled Bahgat, nominating her to take part in the TV series ‘Ams la yamoot’, co-starring with ‘Raghda’and ’Ryad Al Kholy’. The nomination was based on Aasi’s resemblance in looks with ‘Raghda’ whom she was to play her daughter in the series. Eman was once again nominated by director Haitham Hakky to cast in the TV series ‘Ragol w emraatan’ co-starring with Samira Ahmed.\n \nEman then took part in the TV series ‘Ahlam fel Bawaba’, playing both Dalal Abd El Aziz and Farouk El Fishawy’s daughter. She also took part in the TV series ‘Daawt Farah’ to co-star once again with Samira Ahmed.\n\nHer golden opportunity came, when director Rabab Hussien nominated her to co-star with Nour El Sherif in the renowned TV series ‘Hadret El Motaham Abby’, where Hussien insisted due to her absolute conviction and belief in Eman’s talent to wait for Eman until she finishes her busy schedule at the time to take part of her hit series.','28 August 1985','https://media.elcinema.com/uploads/_315x420_0fd1e23cbff7f05862de58e7375f6e6363ad7308698a95ab33afd5f435bb4e3f.jpg'),('Khaled Galal',1101296,'Egypt','Egypt','NONE','3 November 1967','https://media.elcinema.com/uploads/_315x420_efe97f7e1001ec8f54b50bd6893fcaa0ed64e10ab68ab721ca6349299b74f2d2.jpg'),('محمد إبراهيم طه',1101297,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9aa69018a83c1c8bde3ecc449f5a5cef99c0cf722ca16268b70f1c97b3c0b5cf.jpg'),('Wael Alaa',1101306,'Egypt','Egypt','An Egyptian comedian actor who appeared in many advertisements. He participated in many Sitcoms where he achieved a huge success and proved himself.','3 October 1976','https://media.elcinema.com/uploads/_315x420_1912adce1c48f1db111c71962cf83bd01566c75b3871bf2764b9d4983e33cedb.jpg'),('Amr Ramzy',1101307,'Egypt','Egypt','Amr Ramzy is an Egyptian actor and television presenter. He was born in 1981 in Mansoura, and studied law at the University of Mansoura. He started his artistic career by joining an acting troupe, then worked as an assistant director in the satellite channel OTV. He rose to fame when he presented the prank show \"Helhom Benhom\" in 2007, after which he went on to appear as an actor in several films and television series, including \"Ferqet Najy Atallah\" (Najy Atallah\'s Squad), \"Fazzaa\" and \"Haramt Ya Baba\".','17 July 1981','https://media.elcinema.com/uploads/_315x420_c742e49f4529638d124b2abc48e4b4ab44ed60da8edb724f092ced7cbace6d01.jpg'),('Sayed El Sobky',1101308,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_11b39a115b48a32151afa9c0889c86367724df8b2c0d7c67d4f9989af893aa50.jpg'),('Nadine Khan',1101311,'Egypt','Egypt','NONE','11 November 1981','https://media.elcinema.com/uploads/_315x420_cec397a0a2fb6ecf3af0bc7f97309a82f26a04fb78ad62a70386af05a5ff39e4.jpg'),('Tamer Diai',1101312,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_d125ddb0544bca485f828ffc1ac7b284b0260316f048cde4063245390a091880.jpg'),('Mohamed Nayer',1101325,'Egypt','Egypt','He graduated from University of pharmacy Helwan University in 2005 ','10 November 1982','https://media.elcinema.com/uploads/_315x420_b0c3403040374814e6206717da180a97759262a07f48d4578c252c689bdc69a3.jpg'),('Bahgat Adly',1101332,'Egypt','Egypt','NONE','22 September 1971','https://media.elcinema.com/uploads/_315x420_7ab241fc70dd7c568ff2447b3a25ab031a73f6f47ff71a3afe2e8170c714b9af.jpg'),('Mazen Gabali',1101471,'Egypt','Egypt','NONE','20 May 1969','https://media.elcinema.com/uploads/_315x420_4213d85fb1adb6d4b34d18e17c577348d0acc3953a5861a4b356ce7233742e55.jpg'),('Bakr Mahmoud',1101488,'Egypt','Egypt','NONE','1 July 1972','https://media.elcinema.com/uploads/_315x420_b2fa99c72d22e36f7f8f27bd53a540541a14541b24761952adbdf3bbd6ae6eec.jpg'),('Walid Elnagar',1101489,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_75ed6325a43e953a343291fbe668f5c929bc5c0f761ed3936a9fc4b173cdfb90.jpg'),('صلاح الشاذلي',1101490,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Rashid Masharawi ',1101620,'Palestine','Palestine','NONE','18 January 1962','https://media.elcinema.com/uploads/_315x420_77ee653cc0f568e29bcf6fb5c209b4c7ddd7aaf3dbc4ab3c5e856665a63cfd7d.jpg'),('Osama Elabd',1101627,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9899406f9c0f17f64600fcc9f1779b8c24b576f82e591e96eae5f4ffe924ccf0.jpg'),('Sherif Madkour',1101628,'Egypt','Egypt','NONE','17 September 1972','https://media.elcinema.com/uploads/_315x420_a2b1ae98fcc7e0056e472921104a05a380bab2d38b9de1099c7eaf0c093fa83f.jpg'),('Eva',1101633,'Egypt','Egypt','NONE','16 April 1953','https://media.elcinema.com/uploads/_315x420_5d0207f918a858852bea6d27cc1b9e0475a0a59c20b117fb581b5d48e8826d77.jpg'),('Mohammed Saeed',1101642,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nesreen Tafesh',1101646,'Syria','Syria','Nisreen Youssif Tafesh is among the most beautiful Syrian actors. Her father is Saudi Arabian in origin while her mother is Algerian with Moroccan roots. Thus Nisreen carries traits from across various parts of the Arab World. She has thus far been successful in her works and has attracted positive attention to her name. Her latest work is the Syrian production “Sabbaya” (“Youths”). Nisreen has received a number of awards.','15 February 1982','https://media.elcinema.com/uploads/_315x420_75b08d8ac563e0b0133d80456b2799e64beb180e24670897548ca89b77c3026b.jpg'),('Kosai Khauli',1101647,'Syria','Syria','Qusay’s father was the journalist A’meed Al Khouly. He graduated from the Higher Theater Institute in 1999. Prior to that Qusay had spent two years studying law. Natural talent drew Qusay to acting and despite his family’s strong objections Qusay insisted on enrolling at the Higher Theater Institute. The resultant  dispute with his family led to his leaving his home for two months. Although Qusay is a gifted actor he is nonetheless modest. Among the theatrical performances he has participated in are “Kusoor”, “Madinat Al Kharab” (“The City of Ruins”), “Al Diblomassiyoun” (“The Diplomats”) and “Al Rahan Caligula”. He has also participated in the cinematic productions “Roaa Halimma” (“Dreamy Visions”) and “Al Ou’shaq” (“The Lovers”).\nQusay graduated from the Higher Theater Institute in the company of distinguished actors such as Bassil Al Khayyat, Sulaffa Me’mar, Raghda Shu’ayrany. Whilst at the institute, Qusay studied under Ghassan. \nIn 2006 Qusay won the award for Best Arab Actor for his role in “Ghuzzlan fee Ghabbat Al Ziaab” (“Deer in the Wolves’ Forest).\n','1 April 1976','https://media.elcinema.com/uploads/_315x420_31f499289771b0e1ae613bc46c2bf75d0663f02bf076c0d1485fe220deffee2a.jpg'),('Hosam Al-Gendy',1101665,'Egypt','Egypt','Hossam El Gendy is an Egyptian actor. He was born in 1981, and started working by the beginning of the 21st century. His television roles include \"Boshra Sara\" (Good Omen) and \"Marka Mosagala\" (Registered Trademark). His film roles include \"Bentein min min Masr\" (Two Girls from Egypt) and \"Hogum Montasaf Elleil\" (Midnight Attack).','29 May 1981','https://media.elcinema.com/uploads/_315x420_42724265f9ed54f7fdc40d5873c568f443ef406158cc80b6b62780982fdd85be.jpg'),('Ramez Amir',1101669,'Egypt','Egypt','NONE','1 December 1988','https://media.elcinema.com/uploads/_315x420_ea90c2682f290148658830e29bb1788ab9be9cfd5432a14a695c1d1d719a7ca2.jpg'),('Amal Rizk',1101695,'Egypt','Egypt','Amal Rezk is an Egyptian actress. She was born on January 13, 1969. Her resume of television roles is long and extensive; she\'s appeared in \"Asmahan\" (2008), \"El Anida\" (2011), and \"Adam\" (2011). Her film credits, usually in dramatic or comedic or comedic roles, include \"Game Over\" (2012) and \"Black February\" (2013). ','13 January 1969','https://media.elcinema.com/uploads/_315x420_e133d8e163b1b040c4c86d503ac84ef25bea34079e74e5b44483802a3eadb560.jpg'),('Mohsen Rezq',1101699,'Egypt','محسن رزق ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1cd1e4cb87084c29667eb6623d808d9175dee00d1bf7df6f526c2928de8cf991.jpg'),('Amr Youssef',1101708,'Egypt','Egypt','Amr is a young Egyptian actor. He was born on December 23, 1980. His career in entertainment began with television commercials and music videos. Thereafter, Nour Al Shereef brought his talents to the public’s attention when he cast him in the television series “Al Daly” in 2007. Following this crucial step forward, Amr’s career as movie star took off. Since then, he\'s appeared in \"Nour Ainy\" (2010), \"Rad Fa\'al\" (2011), and the popular 2013 Ramadan drama \"Niran Sadeeka\" (Friendly Fire). ','23 December 1980','https://media.elcinema.com/uploads/_315x420_5b4eaf3a08969571ecee60492002b14d29db69f424408179227bda71d8306a17.jpg'),('Ahmed Elekiaby',1101718,'Egypt','Egypt','NONE','31 July 1987','https://media.elcinema.com/uploads/_315x420_3257d55d7dd30570ee7dd1a46fb8b853b075349f02d13de4fc0cec96d2d3597a.jpg'),('Ahmed Khaled',1101727,'Egypt','Egypt','He is considered one of those directors who are very active in the field of independent cinema. He participated in many European and Arabic festivals. He presented 2 short documentaries “The Fifth Pound” and “Eye of the Fish”. He also directed a lot of television advertisementsts and documentaries.\n','1 April 1979','https://media.elcinema.com/uploads/_315x420_414442b7a56ae453a5e821b6e034eeed20d1e58283154ce3736e65fff625b922.jpg'),('Mohammed Hammad',1101728,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Husam Fares',1101729,'Egypt','Egypt','NONE','16 August 1977','https://media.elcinema.com/uploads/_315x420_0da3accfb34292605da07ae935e49329ad69b9e58d1ad652572441cde464298e.jpg'),('Khairy Salem',1101740,'Egypt','Egypt','NONE','19 March 1973','https://media.elcinema.com/uploads/_315x420_e20422e40b93f1756081619b4cb21c940f6c452d3564f95e2c4f052017132388.jpg'),('Maya Haddad',1101741,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_afb4311079e5775b2f081bfe358917b30d7b7a286cd016c3af7a8cabeac04deb.jpg'),('Emad Kassem',1101743,'Egypt','Egypt','خريج كليه الفنون التطبيقية عام ١٩٩٤ بدا فن التصوير الفوتوغرافي سنة ١٩٩٨ قام بتصوير عدد كبير من اغلفة المجلات \nقام بتصوير عدد من الافيشات منها امير الظلام \nمرجان احمد مرجان\nبوبوس\nاللمبي\nالي بالي بالك\nبوحه \nعوكل\nمافيا\nملاكي اسكندرية\nخلي الدماغ صاحي\nاللمبي ٧ جيجا\nابن القنصل\nاعسل٧ جيجا\nابن القنصل\nاعسل اسود\nاكس لارج\nالف مبروك\nزكي شان\nكده رضا\nجعلتني مجرما\nميدو مشاكل\nمن ٣٠ سنه\n','25 July 1972','https://media.elcinema.com/uploads/_315x420_3ec02ff1f80a33da315851233b1ac243aa5e5d4c7e3d8558dc4c9774356d1523.jpg'),('مجدي أندراوس',1101744,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمد مراد',1101745,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Seif Youssef',1101746,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_eda011d11da4d153e6a7d2552b51a8d6af2199b23848f38183c3312eb9e168f5.jpg'),('Ramy Darrag',1101747,'Egypt','Egypt','NONE','15 September 1978','https://media.elcinema.com/uploads/_315x420_24b6060df3013fcb3b04ce15cc639eb2a8f99c0c4ad7545e318a1b16894eee4c.jpg'),('Rabab Ibrahim',1101750,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_30d26a99067d8b14a93cdbeef3ff1dfa2ad7122cf97ceeb6ffb53b88d53eb5f9.jpg'),('ناصر خليل',1101755,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Al-Daly',1101756,'Egypt','Egypt','NONE','1 August 1983','https://media.elcinema.com/uploads/_315x420_ffdaf49be66b788941c4cd1b1fdf6867ce0505be2b262f045009ea40ca3ab6ee.jpg'),('Amr Rajab',1101757,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_93ed51e526e8e58cb1042e5f343ccb90d4c38e517af6958bb9b0b0ceaec17014.jpg'),('Mohamed Samir Mabrouk',1101764,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_510e91811c3296474caadd455f8eeba7314e941652c4bc917b140b3f41eb24d3.jpg'),('Mohammed El-Zawawi',1101785,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9b16458b2f1c32cda0fbfb478a05ec73f5ab95d9a36781a416e26ad1e4f40771.jpg'),('Mohamed Ramadan',1101790,'Egypt','Egypt','Mohamed Ramadan began acting while at school. He has received the award for greatest nationwide talent three times consecutively – an unprecedented achievement. He started his career with small roles in TV series like “The Cindrella,” until he had his big break in Yousry Nasrallah\'s “Ehky Ya Sharazad” (Tell me, Shahrazad). He then went on to star in blockbusters produced by the the famous Egyptian producers Mohamed and Ahmed El Sobky, which made him one of the most valuable actors in the middle east. Mohamed Ramadan is perhaps the only Egyptian actor to have been praised by the internationally renowned performer ‘Umar el-Shereef who stated that he had chosen Mohamed to perpetuate his acting legacy. ','23 May 1988','https://media.elcinema.com/uploads/_315x420_8201852370be98bd27dd646a851d93b99fa898fdd0254211ad7356d018ddcdf4.jpg'),('Abdel Imam Abdalla',1101812,'Kuwait','Kuwait','Kuwaiti actor Abdel Imam Abdalla has appeared in a number of artistic works throughout Kuwait, Saudi Arabia and Egypt. He is considered one of the top actors from the Gulf to work in the Egyptian industry. Abdalla is known for his performance in Gulf television series such as: “Dunya El Muhabeel” (The Crazy People’s World, 1977), “El Zeer Salim” (1980), “Zawaj Bidoun Rasid” (Marriage Without Balance; 1985), and “El Madi wa Kharif El Amr” (The Last Autumn Years; 1992). He has also appeared in several Egyptian television series including:  \"Qissat Al Ams\" (Yesterday’s Story; 2008), “El Hara” (The Neighborhood; 2010) and “Dila’a Binat” (Girls’ Indulgence; 2014). With regard to cinema, his works include “Cabaret” (2008) and “Sarkhet Nimla” (Cry of an Ant; 2011). In addition, Abdalla has been in many successful plays including: “Almakshouf” (Exposed), “Sah Elnom ya Arab” (Wake Up, Arabs), and “Hami El Diyar.” (The Home Protector).\n','15 August 1947','https://media.elcinema.com/uploads/_315x420_6e2c87363b9978fb4c462f4e5e8cf19cbc53a717cb5daf3fb075279c091f2ecc.jpg'),('Hesham Elshafei',1101818,'Egypt','Egypt','NONE','10 April 1965','https://media.elcinema.com/uploads/_315x420_c864715a8d07bb8288c96ed92b20b899d85e1ce0c21216d77d52ce165527089d.jpg'),('Nadine Shams',1101819,'Egypt','22 March 2014','Nadia Shams (Known as Nadine Shams) was an Egyptian novel and screen writer. She was born in 1972, and graduated from the screen-writing section of the High Cinema Institute of Cairo. Her bibliography includes many novels and short stories, among which is her famous short story “El Dakhel wel Khareg” (The Entering and Exiting). Nadine started writing for the screen recently. She co-wrote the television series “Qanun Al Maraghy” (Al maraghy Law). Her most known script for film is “Ehna Eta\'belna Abl Keda” (We Have Met Before). In 2013, Nadine was part of the writing workshop of the series “Moga Hara” (Heat Wave), which was met with acclaim from critics and audience alike. Shams died on March 22, 2014 at the age of 41 after a mistake during a surgical operation led to fatal complications. ','1 January 1972','https://media.elcinema.com/uploads/_315x420_3eb3704eb6557d34699688560c6c19916777965dba5c6b9c399be2a7b24ab5ac.jpg'),('Amr Gamal',1101822,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3750e9cd00a72f77a1d681cff91fcc9077d6d924aea3c932da059ca7283b46dc.jpg'),('Hussein el Qala',1101823,'Palestine','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4f2d5630ab03e3b635f8bf9c51523b3c775147ae0fa83286c7f8fcf24b958cea.jpg'),('Ahmed Anan (Ahmed Khaled)',1101827,'Egypt','Egypt','NONE','16 August 2000','https://media.elcinema.com/uploads/_315x420_427d587952aa6245d23ac22935e1d789ec4ac302ca68f823623c6d9cd0aa7716.jpg'),('Hasan Eid',1101828,'Egypt','Egypt','NONE','15 May 1983','https://media.elcinema.com/uploads/_315x420_c57b1ce284946efaabf1d594071557ed6bb234173b310e15afd91807b46a6533.jpg'),('Omar Gamal',1101833,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f8590c4af259fac29be83caf1f8ddd21f4603a3dd178ef92c15655f348f8f742.jpg'),('Sameh Al Khouli',1101859,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bfa67c757fb4c9459cca524a69e924caf6809ac3dbf446b65465960ff41ae673.jpg'),('Nancy Abdul Fattah',1101860,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7cec4805599c0a3b2912f2fe2bb625b7f2c0bb7599c5f516f7331d16d2c8d21d.jpg'),('Samya Atef',1101868,'Egypt','Egypt','NONE','11 February 1982','https://media.elcinema.com/uploads/_315x420_9f029978e34f22abaee1b44c786dbd92049b54f52c9abbe9a062ccd6e8acfce0.jpg'),('Ayman Salama',1101878,'Egypt','NONE','Script writer Ayman Salama graduated from the High Institute of theatrical drama, majoring in drama, graduating with honor in the year 1989. Achieving a degree in theatrical drama Ayman Salama won tens of awards in Egypt and the Arab world, most importantly best composer in the TV and Radio festival of 2006. A lot of his works targeted television, radio and theater.His most predominant mini series were ,\"Nights\" starring actress \"Zeina\" also \"The case of Safeya\" starring actress \"May Ezz el Din\",also \"A woman in jeopardy\" starring actress \"Ilham Shaheen\" and for the radio he composed \"Beautiful Days\" starring actress \"Somaya el khashaab\" and \"Shamoos El Nasr\" starring \"Yehia El Fakharani\"  ','NONE','https://media.elcinema.com/uploads/_315x420_eb54588a4447d4ff36676267aa8216be07e387b99d746f74eb3bc3117aaa24e4.jpg'),('Hossam Mousa',1101881,'Egypt','Egypt','NONE','5 June 1973','https://media.elcinema.com/uploads/_315x420_16c58677a6bc5afae24a3543b0ddf33faa156dfbda3fc588e1f6c7d579d0f6eb.jpg'),('Ahmed Ossama Abdelkhalik',1101883,'Egypt','Egypt','NONE','2 November 1980','https://media.elcinema.com/uploads/_315x420_081cc22a988851703e5856c4e841a7beca305ffa2dedc070a6158ce8feadfe39.jpg'),('tarek abo  el fatouh',1101901,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_472e146751ad959304efed7ec91764324e562a7bbb971592683bdd58e072f4ea.jpg'),('هاني جمال',1101907,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Laila Fahmy',1101916,'Egypt','Egypt','NONE','28 June 1947','https://media.elcinema.com/uploads/_315x420_a45879d7bde7fb333af0007678954b50c9a32274f0ed1e52919d62a2fb27fc7f.jpg'),('احمد شحات',1101918,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Reem Sami',1101919,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_35fc51d843ce237326e40ccc5b4f01410b8db6044db5472ce3f64f92a7fd17a8.jpg'),('Basem Aly',1101922,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Abbas',1101933,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Tariq Al Ali',1101965,'Kuwait','Kuwait','NONE','18 January 1966','https://media.elcinema.com/uploads/_315x420_6ebd6544b5057983958393945b574bbe98b9e21dc443999b3c900d0c47fc1e90.jpg'),('هشام دهب',1102014,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mahmoud Al Laithy',1102046,'Egypt','Egypt','NONE','12 June 1979','https://media.elcinema.com/uploads/_315x420_371d86ee28fe69c8d7a8bedd6743