','https://media.elcinema.com/uploads/_315x420_58b286bbbe6909d0a623ca4e55ba37d2e05426b5b606aa27419afa0c440992bd.jpg'),('Raafat Wajdi',1102122,'Egypt','NONE','Raafat Wajdi is an Egyptian assistant director, who has worked in films including “Lamh El Basar” (A Glimpse) (2009) and “Zarf Sehhy” (Medical Situation) (2014).','NONE','https://media.elcinema.com/uploads/_315x420_a568e96b96cf55a203452f6ee309ad664102fa872523ed065f948069c9b6ae04.jpg'),('Hazem El Sheikh',1102123,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e5ebd2a9b326ca440dfeedded722413c0329466b980b45f5be453bd8efd01e08.jpg'),('Mohammad Qabil',1102124,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_55e783f5317ea36d6ade9332497d46e2363f7ccba5cbcaba19fd028ad9b473bd.jpg'),('Doaa Agrama',1102125,'Egypt','Egypt','NONE','28 October 1974','https://media.elcinema.com/uploads/_315x420_2241e6bc9428fce8b8f4e0a16dd56adaaa382229bb10a04c5921170165057204.jpg'),('عبدالرحمن مجدي',1102127,'Egypt','Egypt','NONE','5 September 2015','https://media.elcinema.com/uploads/_315x420_8900f9498c7719de3ad764674d6e4552733f6fbbfa03b7f0eec4144881be6f1e.jpg'),('محمود دهموش',1102128,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Tayseer Abdulaziz',1102144,'Egypt','Egypt','NONE','25 November 1984','https://media.elcinema.com/uploads/_315x420_59ae2fd0137bd1e1db0b36d725e001d39023d0f58c225126a71d577852af36c4.jpg'),('إيهاب حامد',1102145,'Egypt','Egypt','NONE','25 January 1978','https://media.elcinema.com/uploads/_315x420_f7104e76a5ffeab7a17a78196279c7e499bad3d8def8766b00fb41eec4296522.jpg'),('Walaa Sherif',1102172,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_52dce49fe736cf092f30b881132363b57c857cf9f0b68942ca925fb7f8d506b2.jpg'),('Mourad Sadek',1102185,'Egypt','Egypt','Mourad Sadek was born on October 1, 1981. He studied directing at film school and has worked in a number of fields from drama to cinema and radio. Sadek has appeared in the films “Magnoun Amira” (Crazy Amira; 2009) and “El Almani” (The German; 2012), as well as various television series such as: “El Seif El Madi” (Last Summer; 2010), “Hayati Enta” (My Life; 2006), “El Raks Maal Zahur” (The Dance with Flowers; 2005).','1 October 1981','https://media.elcinema.com/uploads/_315x420_9606504abe721fa69bbb7d19b235fd657b9b9694b640d1d285e98fae169c8402.jpg'),('Mohamed Al-Sharnuby',1102189,'Egypt','Egypt','NONE','4 January 1995','https://media.elcinema.com/uploads/_315x420_7e789ef60f29c8de053e64a4774353a6efc8f6734c9997459156e003fc0333ee.jpg'),('Amr Yousri',1102195,'Egypt','Egypt','NONE','18 March 1969','https://media.elcinema.com/uploads/_315x420_f637876b5c8ae96acadb707fe7f982214e95118c6c1478b9cc50638bf4cb7474.jpg'),('Ayman Saqer',1102201,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e5ca5503b3148d4a2543d572190a7054a1d1aedb7a57cd4f631e0b391dc7728c.jpg'),('Fayez Al-Malki',1102205,'Saudi Arabia','Saudi Arabia','NONE','12 September 1969','https://media.elcinema.com/uploads/_315x420_fbd333150d63a2c4d12e72b3ef51ddaec5e085cc8ca694b4603abb3d5d8a40e2.jpg'),('Mohsen Hadid',1102213,'Egypt','Egypt','NONE','17 January 1980','https://media.elcinema.com/uploads/_315x420_e00140f94051d4d884b3e1344398ca44a3aeb61bbbea2593e415a8600c20d1d3.jpg'),('ياسر النجار',1102214,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b3619913d35b445198b8ccda7a332bcff56289c28b199d80a697b2e82685a0ac.jpg'),('Mostafa Fahmi',1102219,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_37da9a9dec8921ea383e3584508d15d589063e70db29014fbfc0c30122c6a332.jpg'),('Amr Samir Atef',1102225,'Egypt','Egypt','‘Amr was born in the city of Dummyat. He concluded his higher studies at the English language division of the faculty of education and thereafter headed to Cairo where he received a diploma in Theater Arts from Cairo University. ‘Amr began his career in screenwriting, the first of his works to draw attention was the animated production “al-Sindibad al-Bahry” (“Sindibad the Sailor”). The work was directed by Mona Abou al-Nasr and received more than 27 local and international awards. Thereafter ‘Amr continued working on children’s productions, one of the most important of which was the series “Bakkar” which involved nine parts. The screenwriter also contributed to the writing of the well known series “’Alam Simsim” (“Simsim’s World”). Thereafter ‘Amr transitioned to writing sitcoms and put together the first professional writing workshop in the Arab World. Under his supervision the workshop turned out the series “Ragel wa Sit Sittat” (“A Man and Six Women”) which involved five parts, “Tamer wa Shawqqiyah” – four parts, “al-E’yadah” (“The Clinic”) – two parts and “’Aailat al-Ustaz Amin” (“The Family of Professor Amin”). Those productions are considered among the region’s most important sitcoms, they have contributed to changing television comedy in the Arab World.\nThereafter ‘Amr moved to writing for cinema and his first such work was the film “Awlad al-‘Am” (“Cousins”) which was directed by Sherif ‘Arafa and features the performances of Kareem ‘Abd Al ‘Azeez, Sherif Mounir and Mona Zakky. \n','27 November 1971','https://media.elcinema.com/uploads/_315x420_052926b28319f3d037601d9a5a4d27537515a3fcf3fd056092809cbadd83c97b.jpg'),('Tamer Mohsen',1102229,'Egypt','Egypt','Tamer Mohsen is a film director, who studied directing at the Higher Institute of Cinema after graduating from architecture. He worked as an architect for seven years before devoting himself to cinema. Mohsen showed interest in several fields in the film industry alongside directing such as screenwriting, editing, production and landscape design. His work also varied between writing, directing, theater acting, creating and directing puppet drama shows for children. Mohsen also wrote and directed several short films that have won a number of awards, both locally and internationally. For ten years, he has worked on a large number of documentaries as a director, screenwriter, editor and producer. He then worked on developing creative ideas and directing TV commercials.','NONE','https://media.elcinema.com/uploads/_315x420_3d6ae158db7930c970095398a145fa12101dc937910f36652c7e182450c603cd.jpg'),('Badr sabry',1102230,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b6408d5adce6e2652813093eff84c8fd03bdbb891f739a99542950b7b0f4e63d.jpg'),('Nermine Zazza',1102232,'Egypt','Egypt','NONE','1 January 1972','https://media.elcinema.com/uploads/_315x420_e5448dd19bdf73115d54b24457f43336c07eb6a7f1f2221856af80b7779ede5d.jpg'),('Muhammad Nasr',1102271,'Egypt','Egypt','NONE','7 December 1969','https://media.elcinema.com/uploads/_315x420_31cea74c9374e9b3d92a61b85e827c783d884459ca9816bc8e6aefc4b62298d4.jpg'),('سامر الجمال',1102279,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('M. H. R Films',1102300,'Egypt','شركة أفلام النصر (حسن رمزي وشركاه) ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_04a8454eaf2e8e234e8b34d52d1025f4ed76b0a066fc1833ec835f4385e2082f.jpg'),('Hosny Saleh',1102306,'Egypt','NONE','Hosny Saaleh studied Cinematography at the Faculty of Applied Arts. He started his career in 1982 as director of photography with TV director Esma’eel Abdul Haafez, but the dream of becoming a director did not stop anticipating him. He worked also as technical production manager with al-Gabry company, where he participated in a number of drama works, like “’Amr Ebn-al-‘Aas”, where he met superstar Nour al-Shereef and they became friends. Al-Shereef surprised Saaleh by choosing him to direct his TV series “Al-rahaaya i.e. The quern”.','NONE','https://media.elcinema.com/uploads/_315x420_f54d89c0c2ce3fa42ee550e60237f470315509a939d46037ae65902db036157f.jpg'),('Mahmoud Azzazy',1102310,'Egypt','Egypt','NONE','16 October 1983','https://media.elcinema.com/uploads/_315x420_bc7e41805d5ac7d4f776d46dbf6791199fa16b2aa9664bd459fe1b9374a4b5f8.jpg'),('محمد أمين',1102312,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hesham Magdy',1102313,'Egypt','NONE','Hesham’s love for acting was evident from a young age. His acting career began when the director Ali Abd Al Khaleq assigned him a role in the film “Al Gentil”. (Thereafter his career progressed forward).','NONE','https://media.elcinema.com/uploads/_315x420_c9cc78a4a65c770369859cce8e3873db80445d570d7f5f35a814c757563925ca.jpg'),('خالد شكري',1102321,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5483af0ad55b76500d7e1bdf5292d084f6fc24adef6d0803c5f171069015cf69.jpg'),('Al-Adl Group',1102323,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_397f8e37abd9fbaee99c4d7bdfca9bb136b3893f9f1348455b1386d0a844aa8f.jpg'),('Haitham Mohamed',1102326,'Egypt','Egypt','NONE','1 January 1988','https://media.elcinema.com/uploads/_315x420_67583bb47acbffa3afc8839c834d158dffbe08fdb96acf2da7ae119ff498d507.jpg'),('Afaf  Hamdy',1102327,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5cd256c71759eaa3e78715a1baf84c2f6d0ce8edac71496814f8b151722e29b9.jpg'),('Ahmed osman',1102330,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_98145cb27802e7b31e68ade9283157cceb9681a2d9ea8bc1f146dd98af901c96.jpg'),('Doaa Adel',1102331,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a06e596a22a23249c36629af31e2e47f53e0565cc38642b4d8302a335f84222b.jpg'),('Nader Hamdy',1102336,'Egypt','Egypt','Nader Hamdy is an Egyptian musician and music producer. He was born in an artistic family, to singer Ahmed Hamdy and actress Afaf Hamdy. He started studying music at the Academy of Arts, where he learned playing the piano, and performed in numerous international venues. He co-founded the singing band WAMA, which released several pop hits during the early 2000s. He also worked as a musical producer with many singing stars, including Amr Diab, Samira Said, Mohamed Fouad, Assala and Sherin Abdel Wahab. His debut as an actor was in the film \"Al Academeya\" (The Academy).','17 September 1979','https://media.elcinema.com/uploads/_315x420_fe20b52733e38e5803355fc98f47171d1743a7b05234cfb4527e1b89d2076da6.jpg'),('Verdi Production House',1102337,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_94384e8706a484aa754cb0ff16f95ad4bc9eba65bf41a9418701c831efbfdb77.jpg'),('Rozaika El Taresh',1102378,'United Arab Emirates','United Arab Emirates','NONE','6 March 1954','https://media.elcinema.com/uploads/_315x420_67dca3aaa1b566d7c6b0fdc471cbed01f93bff1211e4d3313dc71af4dbb08ac8.jpg'),('Ghada Ragab',1102413,'Egypt','Egypt','NONE','26 December 1979','https://media.elcinema.com/uploads/_315x420_3bbd7535123451bde77a7c4453d542f10105e3177efa75e1457cb4fc34a49628.jpg'),('مازن المتجول',1102418,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7217e15b30892dcb5e01245934057ac93508ae658d3b564ffdb84b5110728bd9.jpg'),('وائل درويش',1102422,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b1d271d8fa027acfdea11daa9cbb49933d4939cc516a7e823863c72ce06ba183.jpg'),('Hamad Shusha',1102424,'Egypt','Egypt','NONE','11 September 1959','https://media.elcinema.com/uploads/_315x420_1e50a83bb0a1c1e7c87ccef1572b7e6909a170721a3afea133aba5bdb24afb27.jpg'),('إميل عبدالمسيح',1102481,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Fadell',1102485,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmad Rajab',1102487,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b7724766b26a14cb978e66b10659b74cb9a8bf3f9c80063df67f4d20ae21c377.jpg'),('Karim Hanafy',1102507,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_95cd62ceee31b40391e28ef582d9578876e224e6ed7664c7f1d6734117010162.jpg'),('John Hakiem',1102508,'Egypt','Egypt','NONE','25 December 1979','https://media.elcinema.com/uploads/_315x420_07f45c3107200d2bb1982f45f7b103908fef168f209594e3da459e11ae1161fd.jpg'),('Ahmed El-Sawy',1102509,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_84a087823dde2954fe317025917ab19ef70b1661d94e144369f57acc6a78b0b5.jpg'),('Emad Barour',1102514,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1eb5fa125ac3edfb0b07e567436f41c836fdcf7699231fb95941478e25c9297b.jpg'),('Mohamed Mohamed',1102523,'Egypt','Egypt','NONE','25 April 1983','https://media.elcinema.com/uploads/_315x420_0c0aaa54472da6d6474d7fd23fabd2180f59e950e600c81e372f19e44ca67bc2.jpg'),('Mohamed Ismail',1102528,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a9b46e2f4865799c102fd68f02e76925c562be5d6e4590dffc26b85a70147b2c.jpg'),('Mohammed Tahon',1102534,'Egypt','Egypt','NONE','9 December 1979','https://media.elcinema.com/uploads/_315x420_6754437ffda69c59abcad9befedd40f2062ec80a4db6269beeb0992fd74f34a7.jpg'),('Mina El Naggar',1102576,'Egypt','Egypt','Mina Elnagar is an Egyptian stage and film actor, radio voice actor, and theatre director. he graduated from medical school in 2008 with a BS in Medicine and Surgery. Following this he pursued theatre, with roles in a number of theatre productions like “Om el Donya,” an Egyptian production of Mikhail Roman’s “Al Mazad” (The Auction) in 2008. Film wise, he’s appeared in Hisham Saqr’s short film “Bakara” (Hymen), “Borg el Hammam,” and Maggie Morgan’s independent feature “Asham” (2013). Elnagar also voiced the role of Fahmy in the BBC4 radio production of Naguib Mahfouz’s “Cairo Trilogy.” Elnagar has also pursued his passion for theatre directing with “Coma” (2003), “The Mirror” (2005), “Sin Number 5” (2006) and “Pleasure” (2008).','25 August 1985','https://media.elcinema.com/uploads/_315x420_617204d24caf0305b21fa0b001c6ead4dd396c666a411b5b01dbd63e3667f8d1.jpg'),('زاد للانتاج الاعلامي',1102578,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Maha Sabry',1102581,'Egypt','NONE','Maha Sabry is an Egyptian actress. She has appeared in numerous television series, including \"Al-Daly\", \"El-Batneyya\" and \"Amaked Fel Alb\" (Places in the Heart).','NONE','https://media.elcinema.com/uploads/_315x420_e7a8bba56c51c0a489354e715c4d1a5179b9a37c13dfb9707cb69751cdbefca7.jpg'),('Mohamed Gomaa',1102627,'Egypt','Egypt','NONE','9 December 1978','https://media.elcinema.com/uploads/_315x420_79ad3fc5bf7609d0fc64f3ae2c546b9da036ce9554159187b6ad9f3f7123afda.jpg'),('Ahmed El-Tohami',1102635,'Egypt','Egypt','NONE','27 October 1976','https://media.elcinema.com/uploads/_315x420_d1a737e098555e7051e436fbfb0527217bd8326016427fd5e8320b8511bb8460.jpg'),('Engy Khattab',1102641,'Egypt','Egypt','NONE','2 August 1984','https://media.elcinema.com/uploads/_315x420_d3ac4ee6397265390e13a8298d8842bf40163971312a62b83cb0ce0bf19252a8.jpg'),('Ali Kamalo',1102645,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_611220ba4e3934ab60b8298afd18ec505d130b835dd2e3f3d2eb0913eb5faa40.jpg'),('Ali Saif',1102663,'Egypt','Egypt','NONE','9 June 1980','https://media.elcinema.com/uploads/_315x420_6790a32d132ca700dcb001b94f161ae7eb8a2c89d93cc8329075cc7cdcd03241.jpg'),('Ali Al Ghreer',1102674,'Bahrain','12 January 2020','NONE','30 September 1972','https://media.elcinema.com/uploads/_315x420_59a21eaededdb44914dd9ba2de2860fd1a3782800f3a301aa360f5053d3ff7ca.jpg'),('Shaimaa Sabat',1102700,'Bahrain','Bahrain','Shaimaa Sabat is a Bahraini actress. She was born in 1977, and started her career in 1988 through acting in stage plays made for children. She then went on to appear in numerous television series and theater plays, including \"Oyoun min Zugag\" (Glass Eyes), and), and \"Al-Harir wal Nar\" (Silk and Fire).','26 October 1977','https://media.elcinema.com/uploads/_315x420_a4a8015a59cf30c5ef4349f3bd695b7d66a3b490a390232b13995d92fb97c3d5.jpg'),('Shehab Hajeia',1102703,'Kuwait','Kuwait','NONE','1 April 1963','https://media.elcinema.com/uploads/_315x420_9897d8189cf082