fed8e9585d9206.jpg'),('Mohamed Shahin',1102915,'Egypt','Egypt','Mohamed Shahin is an Egyptian actor. He was born on February 13, 1980, and graduated from the faculty of commerce in Cairo University, where he started acting on stage. He then joined Khaled Galal\'s creative acting workshop. Shahin\'s film debut was in the comedy “Harem Karim” (Karim\'s Harem) and “Halim” in the years 2005 and 2006. His breakthrough role was in the sitcom “Tamer we Shawqeya”, in which he appeared in the complete run of four seasons and was met with praise from audience. He then formed a duo with Ahmed Mekky and co-starred with him in the series “El Kebir Awy” (The Very Grand) and the film “La Taragoa\' wa La Esteslam” (No Reatreat and No Surrender) and “Sima Ali Baba” “Cinema Ali Baba”. In 2013 and 2014 he appeared in several television series that were highly successful, including “Niran Sadiqa” (Friendly Fires) and “El Sabaa Wasaya” (The Seven Commandments). ','13 February 1980','https://media.elcinema.com/uploads/_315x420_ec3f3e49887d5abd67715187ea03a2f5005e8ad1ccfdff8e649c998638a59301.jpg'),('Rania Al Najjar',1102939,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('مصطفى فوزي',1103017,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Farrag',1103043,'Egypt','Egypt','Mohamed Farrag is an Egyptian actor. He was born in 1982. He joined the High Cinema Institute, but was forced to quit it and join the faculty of commerce in Cairo. He also joined Khaled Galal\'s acting workshop in Cairo\'s creativity center, and participated in the actingting troupe\'s play “Ahwa Sada” (Black Coffee) in 2009, which premiered to widespread acclaim from audience and critics alike. He then went on to land supporting roles in television series and films, including “Elrahina” (The Hostage) and “Alf Mabrook” (Congratulations) alongside Ahmed Helmy. In 2013, Farrag made his debut leading role in the action film “El Qashah” (The Sweeper).','15 November 1982','https://media.elcinema.com/uploads/_315x420_672397206ead5cd86867164bfccde1b388d8e499dcd96f9f170c47fe06620989.jpg'),('Mai Mishal',1103045,'Palestine','10 July 2020','NONE','20 September 1958','https://media.elcinema.com/uploads/_315x420_fda42dcb70f888c9d461fbeb3e7bf194ce81698c7fbdf75ce5950e138c5e8137.jpg'),('Anoushka',1103050,'Egypt','Egypt','Born in Heliopolis in 1960 to an Egyptian father and Armenian mother. She graduated from AUC Business Management and Administration. She worked as a secretary and an advertisement singer in Tarek Nour\'s company. ','9 March 1960','https://media.elcinema.com/uploads/_315x420_3ed2d8054a41122b66c30634163c4afc7234b85835e6e96a8bdde2a5faec36a8.jpg'),('Farhan Al Ali',1103094,'Pakistan','Pakistan','NONE','5 April 1972','https://media.elcinema.com/uploads/_315x420_9eab754a4c6600eb2f1239f492959aa7edf4ad4c2f16efc229240539f87cf0e4.jpg'),('Amr El Daly',1103109,'Egypt','Egypt','NONE','3 July 1981','https://media.elcinema.com/uploads/_315x420_86690032311c13adc3e07d5cc9dfbb9337855690c7e3d1887bbec9fc2f9b7a22.jpg'),('Hossam Saleh',1103113,'Egypt','Egypt','NONE','6 January 1967','https://media.elcinema.com/uploads/_315x420_e7a7463fb02dc617dcf23fab5057b3db596dd06a4f55d4ea8acfb8239abc0e08.jpg'),('Essaf',1103157,'Egypt','Egypt','Essaf grew up with a love of music ranging from rock to the classics. He was discovered by his neighbor who encouraged him to study music to cement his natural talent as a singer. This encouragement led Essaf to try out for the reality TV show \"Star Maker\" where he was chosen by the audience during season 2 as a crowd favorite.\n\nAfter winning Star Maker, he was supposed to sign on with them for 1 year, but the two parties were unable to resolve their differences in the contract, and thus parted amicably. \n\nEssaf suffered a personal tragedy when he lost his mother and disappeared from public view for a year. A year later, he met with producer Ahmed Eldessouky and negotiated a contract for his next album, which was delayed when Essaf again faced a personal tragedy with the loss of his father in the same year.  His first major album \"Has My Heart\" was released in 2007, and contains a song entitled \"Everyday\" which he has dedicated to his deceased father. ','23 October 1977','https://media.elcinema.com/uploads/_315x420_f00a292979fd5a4a921168a4361f74ca9a865378ac81403bec8d1fd0dc7252ce.jpg'),('Ahmed ELTmana',1103167,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_81ea1ba20586b39eddb89f6f5995515f00f10ec9d67ec9e78f053134c719ab9b.jpg'),('Yasser Al Massri',1103183,'Jordan','Kuwait','Yasser Al Masri is a Jordanian actor born in Kuwait in 1970. He graduated from the Jordanian Academy of Music. His breakthrough role was in the series “Nimr bin Udwan,” in which he played the lead. He played roles in other television series with historical or nomadic settings, like “Abu Ja\'afar Almansour” and “Thy Qar.” His first role in an Egyptian series was in “Taht El Ard” (Underground) in 2013. ','22 November 1970','https://media.elcinema.com/uploads/_315x420_44e5bb8de96f5289e243c83af5cde7261eb39b09bd334a011dab0ae78e2ba0c6.jpg'),('Manzer Reyahna',1103187,'Jordan','Jordan','Monzer Reyahna is a Jordanian actor. He was born in 1978, and started acting while studying in Yarmouk University, where he was a student of television and theater directing. He graduated in 2004, and went on to work in several television series, including “Akher El Forsan” (The Last of the Knights), “Khalid ibn Alwalid,” and “Al Igtiyah” (Breaking and Entering).  Reyahna also worked in Egyptian television series like “Khutoot Hamraa\'” (Red Lines) and “Al Aqrab” (The Scorpion). His first lead role in a film was in the Egyptian film “Garsoneira” alongside Ghada Abdel Razeq.','8 April 1979','https://media.elcinema.com/uploads/_315x420_195d53cffacd3725d34c6cfb1c8f30483fa0ed28765e5d2a63ff3bfbc7ec5767.jpg'),('Samah Alsaed',1103231,'Egypt','Egypt','NONE','20 September 1967','https://m