hotels and tourism, specializing in tour guiding. As an undergraduate, Sameer worked in the faculty\'s thatrical productions. In 1997, he made his professional acting debut in the play “Hikayat 1882” (1882 Stories) with director Roger Assaf. He also worked as a model from 1996 to 2008, and hosted on the satellite channel Nile Drama for a year and a half. From 2001 to 2003, Sameer worked as a post-production supervisor in a film studio, and since 2003 he has been working in editing, post production and visual effects. His television series roles include “Tamer we Shawqeya,” “Fi Ghamdet Ein” (In the Blink of an Eye) and “Heba Regl Elghorab” (Heba the Crow\'s Leg). ','13 February 1977','https://media.elcinema.com/uploads/_315x420_a21299a14586c0f2f79754de28c96bc4051321d073498ba41df16c495aff5cb7.jpg'),('Abdul Hamid Abu Shady',1103573,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Magdi Khalaf',1103578,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7784cdb46952d02fcaaed780a839c1d83c8b00f3dd6504d4595235c4575af6f4.jpg'),('Sherif Helmy',1103584,'Egypt','Egypt','Shereef Helmy is a prominent actor who proved himself repeatedly in several soap operas.','24 February 1969','https://media.elcinema.com/uploads/_315x420_ab7e4434ddfa0009a0ae0883fc9ee45c67804f7decd47d58a783188342443656.jpg'),('Islam Abdelsamie',1103591,'Egypt','Egypt','NONE','10 December 1979','https://media.elcinema.com/uploads/_315x420_c6feb2be4386ff8615c59fd6cb387f58013cf919f375ae611840028e12744aa2.jpg'),('عمر فتحي',1103592,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Belal Abdallah',1103600,'United Arab Emirates','United Arab Emirates','NONE','2 September 1966','https://media.elcinema.com/uploads/_315x420_a3687153d5aaba0dfa72d0774a71c73835d57d795db633d320dd2ac3cabbe642.jpg'),('Hanaa Abdel Fattah',1103621,'Egypt','19 October 2012','NONE','13 December 1944','https://media.elcinema.com/uploads/_315x420_d20fcfc9a