en, like “Yalla Bina” (Let\'s Go) and several educational programs. Her first acting role in a major film was with singer Mohamed Fouad in the film “Ghawy Hob” (Love Addict).','11 January 1993','https://media.elcinema.com/uploads/_315x420_f349de7711f90517637b92c0ad735d5bb4d4d2b8fd039a3ca5d55b6ad0f044e3.jpg'),('Injy Al Moqaddem',1103774,'Egypt','Egypt','Injy El Mokkaddem is an Egyptian actress and TV host who studied psychology at the American University in Cairo. In the beginning of her career, she worked as a TV host and presenter on the Orbit TV network on the program “El Salem We El Thaaban” (Snake and Ladder). She also participated in presenting the show “Mesaa’k Sukr Ziyada” (Your Evening Is Extra Sugar) on the OTV station, owned by businessman Naguib Sawiris. Injy started acting in 2006 with the TV comedy “Ahmed Itgawiz Muna” (Ahmed Married Mona). Following the show, she acted in: “Lahazat Harega” (Critical Moments), “Haramet Ya Baba,” “Si Omar We Layla Afendy,” “Qulub” (Hearts), and Heba Rigll El Gharab” (Heba the Crow’s Foot). ','23 July 1977','https://media.elcinema.com/uploads/_315x420_80ce53ed57d4f563e480a296f4ea191b2caf07d068fec1d900df38ab59098872.jpg'),('خالد سعد',1103795,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Attia Amin',1103816,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fb9024f4b307225fe043a5ed23a76a49213b6ad1b4aa347faf74181df0dd1083.jpg'),('أحمد حسن',1103823,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('كولاج بوست',1103825,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mayar El Gheity',1103841,'Egypt','Egypt','Mayar El Gheity is an Egyptian actress who was born on June 7, 1992. Al Gheity is the daughter of screenwriter Mohamed El Gheity, and took part in her first production at age 5 on the 1997 show \"Al Haseida.\" She made her second screen appearance in 2008 with pop star Tamer Hosni in \"Captain Hema,\" after which she veered towards more television roles than film. \" Her performance in \"Captain\" was well received, and the young talent followed the film with her third role in the show \"Bint min Zaman Di.\" She plays Shawkeya, the sister of Shorouq, who is a poor girl working as a maid and hoping to find a young man in her social class to marry. Her next role could not have been more different: in \"Qalb Meet\" (Dead Heart), she plays Ghada, an aristocratic and romantic girl who loves Haitham, who died in front of her eyes. Her other credits include \"Ayam El Hob wel Raab\" (Days of Love and Terror). In 2012, she appeared in the film \"Black February.\"  ','7 June 1992','https://media.elcinema.com/uploads/_315x420_e4cdc7624c90b2b4ded278a0894844b7c27f8115ba46707b8490eb4cd2a7805e.jpg'),('Ahmad Fawzy',1103849,'Egypt','Egypt','NONE','25 March 2021','https://media.elcinema.com/uploads/_315x420_c1fe8ced926418f62b6d91099746222ce216762553d5c20db3af44181248924a.jpg'),('Basma Yasser',1103868,'Egypt','Egypt','NONE','17 December 1985','https://media.elcinema.com/uploads/_315x420_9f8056e75e166a7fce128f7aeb9e647a87097c82f900a1c52220a3454b23ff9d.jpg'),('Essam Abdel Hamid',1103876,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_03512f225c995def077879e7fbf834538114a313736dfdd49596d129c6d8ee29.jpg'),('عبير الضمراني',1103891,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Yousrya El Maghraby',1103953,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c2c3bc909745e44ede2b21f255b4141768a9896610b7a176cf67060005e9aece.jpg'),('محمود غسان',1103987,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ali Hamdi',1104052,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_438af95fd2e9d0bd35ea0cee173d7b7767bcbe52c7c89ebd15bba70ac95188ae.jpg'),('Ahmad Hanafy',1104074,'Egypt','Egypt','NONE','22 September 1984','https://media.elcinema.com/uploads/_315x420_4028b594d2ac7d40fbc6aeccba49803462884f908e3d2f0d1de6e296b12f5ca9.jpg'),('Ahmed Gamal',1104096,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Dina Fouad',1104097,'Egypt','Egypt','Donia Fouad began her career as a presenter on the al-Hurra network. Thereafter a half hour meeting with Nour el-Shereef in his office was to change her life forever as a few days later the veteran actor nominated her for a role on the television series “al-Daly”. Thus Donia was introduced to audiences in the role of “Heba”, daughter of “Sa’ad al-Daly” and took part in the aforementioned series alongside Nour el-Shereef. Through this participation Donia became one of the junior actors introduced by Nour el-Shereef through his works. Following that endeavor Donia took part in cinema productions and performed alongside Hamada Hilal, Tawfik ‘Abd Al Hameed and Hala Fakher in the film “Helm al-‘Umr” (“Dream of a Lifetime”).','25 July 1987','https://media.elcinema.com/uploads/_315x420_b7978be9f6fee7ad1d1c3f07d5ae573894f82a32ad7c6bd24a1e18cdaf3e6220.jpg'),('Waleed Hosny',1104098,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Noureen Amin',1104099,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_07c8b34ecdf23dcb03696120f4d807c024f619ee788ab14512205491b185ec63.jpg'),('Nesma Jalal',1104101,'Egypt','Egypt','NONE','26 September 1989','https://media.elcinema.com/uploads/_315x420_04455481eb2069f49d2e9efdfe4a5cf3740ce75fe4a4f36b6bf94a34b9e25f50.jpg'),('Mohamed El Keblawy',1104104,'Egypt','Egypt','NONE','30 July 1983','https://media.elcinema.com/uploads/_315x420_972ac59ef6c4dbacf693cdb32ce288a31ef27113eb256e7521e48e6fa4ff5571.jpg'),('Samy Abdel Halim',1104175,'Egypt','Egypt','Samy Abdel Halim is an Egyptian actor. He is known for playing minor and supportive roles in television series and theatrical plays. His most famous roles were in the series “Khalty Safeya wel Deir” (Aunt Safeya and the Monastery), “Qassem Amin” and “El Seera el Ashuriya” (The Ashuryan Stories), and the playes “El Joker” (The Joker), “Tabib Raghm Anfo” (Forced to be a Doctor) and “Ateya Al Irhabeya” (Ateya the Terrorist).  ','15 November 1951','https://media.elcinema.com/uploads/_315x420_f142e44da41e62063792f50c451682624e9ab42aee77440d7b0f0bc1651ad780.jpg'),('Jalal Abdulqader',1104176,'Egypt','Egypt','NONE','12 December 1955','https://media.elcinema.com/uploads/_315x420_2ede79e2b2050e5a657d7f736f6d68137c3ace2443c6b05c1d5f37c1c0836f58.jpg'),('Kinda Alloush',1104201,'Syria','Syria','Kinda A’loush is a rising Syrian actress. She received an award for her role in the television drama “Hidou Nisbee” (“Relative Silence”) and thereafter progressed to a cinema role where she performed alongside Shereef Arafeh in “Wilad al-A’am” (“Cousins”).','27 March 1982','https://media.elcinema.com/uploads/_315x420_d0854a5ad2e8890cd35dcf6587e6e9a84c3290f1cb518abe34f15fd8c0f2ae0e.jpg'),('KingTut for Media Production',1104223,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5edca08ddeacaed95a1dffdd86738d0d7105722ac604d2cdaea0d9a90c0eddf0.jpg'),('سمر يعقوب',1104225,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('يوسف لبيب',1104297,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_85306b5901e294b2d53a38d022c6de1380bca14e5f6f97382e7bf0989e5ac75f.jpg'),('Samah Yousry',1104307,'Egypt','Egypt','NONE','11 January 1965','https://media.elcinema.com/uploads/_315x420_f8f3e14efe5106e15e18378511b89e4c069f8501c18a12b63bba116fe6fdaab7.jpg'),('Moustapha El Halawany',1104312,'Egypt','Egypt','NONE','18 September 1981','https://media.elcinema.com/uploads/_315x420_7abeeac9b66be8497f74199580fc901216ab56b1f0c83c573409521e8fbacc16.jpg'),('Noura Al Balushi',1104453,'Bahrain','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_e392552736689a7d25c4f37001f4d7be318af66eb6c69257462c481e5b86670d.jpg'),('Mahmoud Samir',1104469,'Egypt'