420_5927c4ee355de97143e0b6207155c978829d67c6692e5e0131dffde25af94159.jpg'),('Eman Lotfy',1106211,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_761f3e998c6d93a00017ff9f291e9a3268eac085590336ab2145e879576a23bb.jpg'),('Hosam Dagher',1106212,'Egypt','Kuwait','Hossam Dagher is an Egyptian actor and director. He was born in Kuwait in 1980, and then moved to live in Egypt, where he received a bachelor\'s degree in medicine from Cairo University in 2002, followed by a master\'s degree in blood and immune system diseases in 2006. He then studied acting in TVI Actor Studio NY in New York until 2009, and flew back to Egypt to join Khaled Galal\'s acting workshop in Cairo Opera House\'s Creativity Center, where he had his big break, performing in the highly successful and controversial play “Ahwa Sada” (Black Coffee) in 2011, which was shoen in several Arab countries besides Egypt. Dagher continued his acting career afterwards through roles in numerous films and TV series, including the films “Safari” and “Amir Albehar” (Prince of the Seas), and the series “Ayza Atgawwez” (I Need to Get Married), “Khorm Ebra” (Pin Hole) and “Ibn Halal” (A Good Guy). ','26 April 1979','https://media.elcinema.com/uploads/_315x420_063c20fd76760823f8a8192399f6db31f4745432f01c66e522a5b7e4988bd5ad.jpg'),('Laila Nagaty',1106213,'Egypt','Egypt','NONE','10 May 1966','https://media.elcinema.com/uploads/_315x420_3375b70a1856b606c9666c01e1698eeaeaaa1d436b26ca771e4ae4918a53c906.jpg'),('Magdy Abd El Rahman',1106215,'Egypt','Egypt','NONE','7 April 2017','https://media.elcinema.com/blank_photos/315x420.jpg'),('عماد حمدي',1106222,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('شريف مصطفى',1106237,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('احمد البرنس',1106238,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Amr Mcgyver',1106242,'Egypt','عمرو سيد محمود ','NONE','NONE',