involved in some Tunisian work such as: (The eye and the night) directed by Mohamed Ali Mayhoob, (Shatr mahaba) directed by Kalthoom Bernaz, (The accident) directed by Rasheeb Fershio.\n\nAs for her roles in European cinema, she starred in: The Mysterious Roman, Delilah, Saint Augustine, Chritian Dugai. She was also involved in Tunisian television series such as; Life and hopes for director Mohamed El Ghadban, He who sold his parents for director Al Habib Al Gemni, The White Nights for Al Habib Al Mesalemani and many more. \nFinally so of her involvements in Arabic drama included: “Sadak Waado” for director Mohamed Azizeya, “Sleep Walking” for Mohamed Fadel. In 2007 she won the best rising actress award at the Cairo Arabic Media Festival for her role in the series “White Nights”\n','27 April 1983','https://media.elcinema.com/uploads/_315x420_280b15a93f9969f5cd3cfdc627860a72c6e929967364c32c76c2a15fb835cd42.jpg'),('محمود سامي',1107919,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('أحمد جمعة',1107939,'Egypt','Egypt','NONE','10 March 1983','https://media.elcinema.com/uploads/_315x420_0977cd742a8950f4f4d626519e3df0e896a5c190c7ef815b2708039c69983a2b.jpg'),('Khaled Elish',1107948,'Egypt','Egypt','NONE','22 May 1986','https://media.elcinema.com/uploads/_315x420_849527f2cc1e72b1e1b0c82051f6e23d90d9507d0f18e5b9ff78272951a0eb1b.jpg'),('Sahar Abdulhameed',1107949,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_102b8e4e9672ee0859e837aa4961555d304c8670330dfcc04e2c2f72074a17b5.jpg'),('Mohamed Rashad',1107952,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Ashour',1108001,'Egypt','Egypt','NONE','1 January 1981','https://media.elcinema.com/uploads/_315x420_91e0dd8ad9f7c40af072835829ae0207fd640e3089df42111f4c4d961286a04e.jpg'),('Rania Elkhatib',1108052,'Egypt','Egypt','NONE','25 January 1987','https://media.elcinema.com/uploads/_315x420_eb103485a56667062020ae115a2053f1df2009c8