 the dialogue program “90 Daqeeqah” (“90 Minutes”) which is broadcast on the al-Mehwar satellite network. Prior to that position Moataz worked as a presenter on the weekly analysis and news program “Anbaa wa Araa” (“News and Opinions”). The program was aired on Egyptian television channel 2 on Friday afternoons.','NONE','https://media.elcinema.com/uploads/_315x420_09e820a3cb0cd3403e7de8c3657971c281688af6defbc84115c528133c846f8e.jpg'),('Naglaa Badr',1108352,'Egypt','Egypt','Naglaa Badr graduated from Mass Communication school in 1996. She was the first Egyptian hostess to present aired programs in Oman, where she worked with Mohamed El Margeby in “Leka\' El Zahira.” (Afternoon Date). Television shows were her access to movies and series. She hosted shows like “Tashkileya,” “Sowareya,” “Enta wel Million,” (You and the Million) and the Arabic version of “Money Drop,” on Al Mehwar channel. She acted in many movies and series like “Share\' Abd El Aziz,” (Abdel Aziz Street), “Rich Naam,” (Ostrich feathers), “El Zoga El Tanya,” (The Second Wife) and “Gedo Habiby.” (Grandpa, I Love You). Her most acclaimed role was that of a corrupt minister in \"Taraf Talet\" (Third Party). Her most recent appearances were in the TV series \"Bedoon Zikr Asmaa\" (Anonymously), \"Hekayet Kayat\" (The Story of Hayat) and \"El Zowga El Tanya\" (The Second Wife).','6 October 1974','https://media.elcinema.com/uploads/_315x420_c0ac72875485ffa48df1c668fb88663ead1691c2af714fb6a16db81a4b27f5eb.jpg'),('Rahma Hassan',1108354,'Egypt','Egypt','Rahma Hassan is an Egyptian actress who was born on the 15th of December 1988. She started her career as a model in two of Nadeem Nour\'s music videos, as well as some commercials. Her first role in a movie was in “Alf Mabrouk” (Congratulations) with Ahmed Helmy in 2009, followed by breakthrough role as a co-star in “Al Alamy” with Youssef El Sherif. From there, she went on to star in “Samir we Shahir we Bahir” in 2010, then in multiple drama series like “Azmet Sokkar” (Sokkar\'s Crisis), “Al Da\'eya” (The Preacher), and “Moga Harra” (Heat Wave) in 2013.','15 December 1988','https://media.elcinema.com/uploads/_315x420_fb0929dd70b992a477e8ac302b322c1702fa5107df4bab66887f0cdd12cea294.jpg'),('Amin Al Sayegh',1108376,'Bahrain','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_483f37f6b08bf2144f2194c4c3a70a210ed21df34dba769169b5a72e91957184.jpg'),('Ahmed Azmy',1108421,'Egypt','أحمد عزمي مصطفى ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Waleed El Sebaie',1108447,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Khaled Hajjaj',1108451,'Egypt','خالد حجاج عبدالعظيم ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cfa1f4e686628e04ac5d0b8c4564e1103127b5d4564c34d6ef903456b74701b5.jpg'),('Adel Anwar',1108466,'Egypt','Egypt','NONE','9 January 1965','https://media.elcinema.com/uploads/_315x420_ecd2b6b288d3bdf732f8822151f6ca5fbab25531a160cc0d85a93a4ea44d206a.jpg'),('Mahmoud Taymour',1108480,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Abeer Farouq',1108488,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7018904c337eecdaa78546173824ca433549cb061c33905c29f848347ae6f6be.jpg'),('Sherif Gamal',1108490,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmad Sadiq',1108494,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6eb121edfa4f037a78221e27b018ac6be5f07558829c1b3ac3ac18fe28830b5a.jpg'),('Tamer Abdul Hamid',1108529,'Egypt','Saudi Arabia','NONE','24 September 1977','https://media.elcinema.com/uploads/_315x420_84a17fb9daf58473d3177cb0c65db16307d07bbec1a77815e9686bb0f47ef423.jpg'),('Hasan Al-Bugegy',1108545,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_69ecd66e223ebf869b81dbaf3e3d578765d7af834652e582201094f51050845d.jpg'),('Samer Elminyawi',1108546,'Egypt','Egypt','NONE','NONE','https://media.elcinema