e, Tell Me a Story). Afterwards, she appeared in a number of TV serials, including “Abwab El Khof” (Doors of Fear), “Sharbat Louz” (Almond Syrup), “Zaat,” “El Sabaa Wesaya” (The Seven Commandments), and “Segn El Nisaa” (Womens’ Prison). ','9 March 1984','https://media.elcinema.com/uploads/_315x420_22c42df6d7e943f7a65601261cd413174c969fda14e03d564b3f0ceca0334244.jpg'),('Fatma Nasser',1109040,'Tunisia','Tunisia','NONE','18 October 1973','https://media.elcinema.com/uploads/_315x420_027feffa007b39bc2fa7f263f90a45946edc98beb22c7cad1c44d5b542dca10a.jpg'),('ضياء جاويش',1109043,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('سامح خليفة',1109044,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Zaazaa',1109047,'Egypt','Egypt','NONE','9 April 1975','https://media.elcinema.com/uploads/_315x420_e9c44d3b18f093a9f0991423c460700befde2422a7f6e82b0766a195316556f4.jpg'),('Aya Ramadan',1109072,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7c7e1d4d283119e4a1e3386ceae87476af26e58f83bbec4b5c2b0dd9bdee8efd.jpg'),('Magda Mounir',1109092,'Egypt','Egypt','Magda Mounir is an Egyptian actress and theater artist. She graduated from Cairo University\'s faculty of agriculture, and worked afterwards as an actress and director in many plays, as well as several televisions series including “Om Kulthum”, “Alqadaa\' fil Islam” (Judiciary in Islam), “Qassem Amin” and “Bel Shamaa El Ahmar” (With Red Wax).  ','NONE','https://media.elcinema.com/uploads/_315x420_010127e0c054e1e0ff5e5116b92e8619ff3337515d7640e2195e559c98642b83.jpg'),('Tarek Abd elMoty',1109093,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c0214096252fd3f9a65ef95ac3d7c498aaff8b0807dab88a6fe3d4957440ae3d.jpg'),('Ashraf Shahata',1109097,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Viola',1109098,'Egypt','فيوليت بشري ','NONE','NONE','https://media.elcinema.com/uploads/