pg'),('عمرو شلبي',1109541,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Lubna Abdulaziz',1109544,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_885773eb18bc5132ae59367046c5f8dca4de0eb1a43d0e81a3fc6579f6a8e3cb.jpg'),('وائل عبدالله',1109546,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_322fb3901f6dc8ade4cade334ec32730c189c463fed6fa478302b3a0fe132a6a.jpg'),('محمود بدوي',1109547,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Omar Abu Al Naga',1109559,'Egypt','عمر مظهر أبو النجا ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b52a020e86473023e8cecfc94cbb5a32c02ccb48a2d3c957e7c6550933223c4e.jpg'),('أوسكار فيديو فيلم',1109599,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_28c20fe7859caf1c87389920ddfd34bbfa8c00752ab4411ae12eb9ffe238511c.jpg'),('Essam Ibrahim',1109645,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6213a8ae2cab6271328a1c9b6c86852a8d48399041e892a38d32ab7dfe8c7130.jpg'),('Khaled Diab',1109666,'Egypt','Egypt','Khaled Diab’s father was a surgeon while his mother was a housewife. In sharp contrast to his nature as a child, Khaled’s character today is vibrant and lively. \nAs a child, he always looked up to his brother the screenwriter Mohamed Diab as a role model.\nAs Khaled grew up, his personality changed gradually so that by the time he was in the preparatory and secondary stages he had become quite daring and willing to experiment. This new character helped sustain him while he was attending university in Cairo and living away from his parents. Thus, the bold character that had come to characterize him helped him to live alone and to take decisions independently.\nHe originally intended to enroll in the faculty of engineering but due to the fact that his test scores were only two points shy of the admission cut-off, he would enroll instead in the architecture division of the faculty of fine arts. He had a miserable time there as he felt lacking after years of superior academic performance in his previous academic stages.\nIn his second year, he decided to travel to the United States in order to seek new experiences there. His father financed his trip with the understanding that he would repay his father following the trip. Khaled ended his academic career feeling that he had not accomplished enough.\n','5 March 1979','https://media.elcinema.com/uploads/_315x420_a1d4a21ce1670b4c478f101e2b4cb74ef033485b40200acd1f85dfc7d783ccf5.jpg'),('Sandy Ali',1109674,'Tunisia','Tunisia','Sandy is a Tunisian actress born in a family of five members. She was famous for playing volley ball in Tunisia. She graduated from Commerce Faculty in 2003 and head to Cairo. She started her career through a supporting role in \"Malalki Alexandria\" followed by film film \"Zarf Tarek\". The director Khaled Youssef presented her through his movie \"Kheyana Mashrouaa\"-\"Legal Betrayal\" where she proved her talent.','12 February 1981','https://media.elcinema.com/uploads/_315x420_f7ec55f5573343df8b8c093d1ef7287643fe2afdfc1cca22e0cc385332cfcd87.jpg'),('Ahmed Fahmy Abdul Zaher',1109681,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_3d4c3c34cb19ae85537e1cbb027e6d168ae6d2fc1ad7bdcf98671e5457d83e86.jpg'),('Eman Ragaey',1109684,'Egypt','Egypt','NONE','1 December 1983','https://media.elcinema.com/uploads/_315x420_251c7702359e6e953a16a1f6beab5ff030422bfbff81d590ff55c0a89aac44ef.jpg'),('Maha Al-Ashqar',1109710,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_11e252f85956c7109d4027f7534d3438b0ab1dcc6f021ffd8b975dbc1399b6ad.jpg'),('Karim Maghawry',1109766,'Egypt','Egypt','NONE','4 December 1985','https://media.elcinema.com/uploads/_315x420_f60869d5462001dbba20810b3c9a4116b4b515298b5988b8ca2a14384dc5ac27.jpg'),('Walid El-Zourkany',1109786,'Egypt','Egypt','NONE','26 October 1982','https://media.elcinema.com/uploads/_315x420_51b2dbe84b8a6d1d8e4b716f908c54a4c9cbe913802a43d379aa84cdc40156bd.jpg'),('Lamitta Frangieh',1109891,'Lebanon','Lebanon','Lamita is a Lebanese model, TV host and actor. In 2004, she participated in “Miss Lebanon beauty pageant”. She acted in LBC’s series “Asr al-Hareem i.e. Harem age”. Raamez Galaal chose her to play the female leading role in his film “Hadd saame’ haaga i.e. Anybody hears anything?” Thus giving her the chance to excel and draw the attention to her.','15 November 1981','https://media.elcinema.com/uploads/_315x420_1b1771d8c42aa6fb8792cf6871616d0df609642e15af350cd4c2a0adeb7c8e26.jpg'),('Spot 2000 for the production of film (Video 2000) Safwat Ghattas',1110013,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_4d5c8240b89dbb0ce3a95747a56b7a87529036c4cdddfdaa4e1c6c1efee1779c.jpg'),('Bayyumy Fouad',1110017,'Egypt','Egypt','Egyptian actor, Bayoumi Fouad was born in Cairo on June 16, 1965. He was part of the first class at the Center for Creative Arts and graduated from the Directing Department. Fouad got his start playing supporting roles in films including: “Ihki ya Scheherazade” (Sherazade, Tell Me a Story; 2009), “678” (2010) and “Asmaa” (2011). He also appeared in several television series such as: “Abwab El Khouf” (Gates of Fear; 2011), “Raqm Maghoul” (Unknown Number; 2012), and “Ism Mua’at” (Temporary Name; 2013). Fouad gained fame when he appeared the television series “El Kebir Awi,” which ran for four seasons (2010-2014). He is also well-known for his role in the series “Mawjet Hara” (Heatwave; 2013).\n','16 June 1965','https://media.elcinema.com/uploads/_315x420_a6433715ca9ed28ecfd50a2f9e015a1cfc71661c7c870126b78a76ff1f52e6c0.jpg'),('Riham Ayman',1110018,'Egypt','Egypt','Riham Ayman is an Egyptian actress. She started her career at a young age, appearing as a model in commercials. She turned to singing, and started as a member of the female trio “Virus.” She then changed her career once again to acting, as she was introduced to actor Karim Mahmoud Abdel Aziz, who referred her to play a role in the hit series “Mahmoud El Masry” alongside Karim\'s father Mahmoud Abdel Aziz. She then went on to take many roles in popular TV shows, like “Hekayat Banat” (Tales of Girls) and “Al Araaf” (The Oracle).','19 November 1988','https://media.elcinema.com/uploads/_315x420_e61480ccd88a1947eb5ffc81908ef5ae1c43c9493e7ebad9301e2222b7405b3a.jpg'),('Rafal',1110024,'Syria','Syria','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c8d96fca66b1ec280276866f30a90ff092e9a3ebf1d605692b28cda019a032e1.jpg'),('Ahmad Thabit',1110026,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_7b0e64f0d89248dc1b7cda7856ebd89ca8c9c8210d3d30277c1864a1cd8aaee7.jpg'),('Mohamed Mamdouh',1110027,'Egypt','Kuwait','Mohamed Mamdouh is an Egyptian actor. He started acting on stage, and came to prominence in the early 2010\'s with roles in films like \"Bebo we Beshir\" (Bebo and Beshir) and \"Elfeel El Azraq\" (The Blue Elephant). He also starred in several television serieseries including \"Niran Sadiqa\" (Friendly Fire) and \"Embratoreyyet Min\" (Who\'s Empire).','9 May 1981','https://media.elcinema.com/uploads/_315x420_b63976b13480694234a629bc792d8d84e32b3c7bbf7032b3d3a72fe0aa458417.jpg'),('Shady Abu Shady',1110029,'Egypt','Egypt','NONE','15 September 1986','https://media.elcinema.com/uploads/_315x420_6837efcca217b9f8a22234295aaee42aea5d5dcf0beaf20ce8de2741b3b49605.jpg'),('Hi sham Ali Abdul Khaliq',1110034,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohammed Abdullah',1110037,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f00959ad4d743540bd93353375ef037f7c86b03f904c637cd98f4c2c18f0da6c.jpg'),('Horeya Farghaly',1110041,'Egypt','United Arab Emirates','Horeya Farghaly is an Egyptian actress who was born in the United Emirates in 1977. She studied business management in the U.K, and started her acting career in 2010 with her appearance in the Khaled Youssef film “Kalemny Shokran” (Please Call Me). She then joined the Marwa Gebril school for acting where she studied for a year. Her second appearance was in the TV series “Al Shawarea\' Al Khalfeya” (Back Streets) in 2011. She later went on to play a variety of roles, from the local low-class girl to the sophisticated lady, and a belly dancer in “Kaf Al Qamar” (Moon\'s Palm). In her most recent roles to date she was the lead female in the TV series “Al Montaqem” (The Avenger), the blockbuster “Qalb al Assad” (Lion Heart) and “Al Qashash” (The Sweeper).','18 October 1976','https://media.elcinema.com/uploads/_315x420_dd9c4f19f4cb249bf5c16cd2d3326ce5a7bfda636762476330eb8f3511f06753.jpg'),('Marwa Abdelsamie',1110042,'Egypt','Egypt','NONE','18 April 1978','https://media.elcinema.com/uploads/_315x420_fc5589eab1d7bbd407d2b968283aeb9324e4d972067f0edfe6dfe57123a3754d.jpg'),('Sulafa NourAlddin',1110043,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_16b302380210e428c6eb769a6d03ec0a28fecc806480fee1f1031443b124a476.jpg'),('Tareq Hasan',1110053,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_964bd33af35ebd9c3c5d317869cb1e3ea20b5bbf1a40f9ebbc03e3e68528cbfc.jpg'),('Ahmed Ebada',1110055,'Egypt','28 March 2020','NONE','9 May 1962','https://media.elcinema.com/uploads/_315x420_5460408ebac57db2e236209c3462c0c80579785ca1ff3c46d1f09e10c544ff22.jpg'),('Walid Fawaz',1110058,'Egypt','Egypt','Waleed Fawaz (Waleed Fawaz Abdelaziz El Sayyed) is an Egyptian actor who was born on December 17, 1980. He graduated from the Higher Institute of Dramatic Arts, department of drama and theater criticism. He began his career as a stand-up comedian. Of his most notable performances in TV drama include those in: “Qatil Bila Ogr” (Murderer Without Pay) in 2009, “Ahl Cairo” (People of Cairo) in 2010, “Abwab El Khof” (Doors of Fear) in 2011, and “Raqm Maghol” (Unknown Number) in 2012. His big break came after performing the role Moatama