gypt','Egypt','Ahmed Abdel Aziz is an Egyptian actor. He studied computer sciences and graduated from the Modern Academy. He started working as an actor in 2008. His film roles include \"Helm El Omr\" (Life\'s Dream), \"Habiby Na\'iman\" (Sleeping Beauty) anding Beauty) and \"Saa\'a we Nos\" (An Hour and a Half). His television roles include \"El Kebir Awy\" and \"Aghla Min Hayaty\" (More Precious Than My Life).','8 April 1984','https://media.elcinema.com/uploads/_315x420_b560c03b943f23a93cc7bd097f9b0c236f83bdaa0260a872209055f6e4ff6208.jpg'),('Sayed Al-Sherwedy',1113292,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_25269e1c240654cb72b61199d0a4b23fd75c986424a19192578058c8a06e7495.jpg'),('وائل أبو السعود',1113293,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Dominique Hourani',1113313,'Lebanon','Lebanon','The Lebanese singer actress, model and designer \"Dominique Youssef Hourani\" was born on the 7th of August 1985. She got her Masters Degree in Business Administration from the Lebanese American University along with two other degrees in psychology and accounting. She. She married \"Ali Reza Almassi\" in November 2007. ','7 August 1985','https://media.elcinema.com/uploads/_315x420_ae0530f831c8c7f1058e09e9096c71a673228d6c70070b7e69c4f36cb94685c1.jpg'),('Michell Abu Suleiman',1113316,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_f79d851dadace7a31d6da9f300b771af5bdeb60d5209dcc3eaa83f32110b866b.jpg'),('Ramy Ramzy',1113337,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمد حمدي',1144629,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Claudia Hanna',1518189,'Iraq','Iraq','Claudia is an Arab musician with Iraqi roots. She was born on the 25th of April in Baghdad. Apart from her work in music Claudia also acts. She currently lives in Egypt and attends the American University in Cairo where she is enrolled in a literature program. Claudia’s career began as a child when she worked as an announcer for children’s shows in Iraq and Jordan, she also did some theater work at that stage. At some point Claudia was nominated for a spot on a beauty pageant that was held in Switzerland and at the age of 14, Claudia began working as a model for several years. In 2006 Claudia took part in a pan-Arab beauty contest that was held in Sharm El Sheikh. Claudia joined the competition as Miss Iraq and subsequently won the title. Worthy of note is the fact that Claudia is the first Iraqi model. Following that competition Claudia joined “Qafillat Al Kheir”, a philanthropic organization that took her across the Arab World. Thereafter Claudia assumed her first acting role which was on a television series titled “Masha’er fee Al Borsa” (“Passions at the Stock Exchange”). That role was followed by work on her first album which is titled “Al Waqqt Dah” (“This Time”). The album is unique in that it employs both Egyptian and Iraqi dialects.','25 April 1988','https://media.elcinema.com/uploads/_315x420_b382963cc7e4fca5da1ed35052fd47078e5e0423520907b58d0970bcda789b5b.jpg'),('Sherif Elkhayam',1636652,'Egypt','Egypt','NONE','22 September 1982','https://media.elcinema.com/uploads/_315x420_883f62263533d3cf045a8c190a8b788a08d04482eeba1b6d85172985f17940c3.jpg'),('Mohammed Yasin',1689919,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_a370b11affc609619aed250ca9cc9bd4607095dad0ead1eb67e31454cbfde7cc.jpg'),('Dana Hamdan',1697027,'Jordan','Jordan','NONE','1 July 1979','https://media.elcinema.com/uploads/_315x420_fd681ae8487d4435f32e4dd64767289275a1353588a5817012b56449ca6188d2.jpg'),('Mohamed Hamza',1722256,'Egypt','18 June 2010','NONE','20 June 1922','https://media.elcinema.com/uploads/_315x420_1af52e39c045312212c4e2b5d5a2025a15319d3e962e0ef273b64b87eabaef41.jpg'),('Inas Ali',1734303,'Tunisia','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bd384bd46f351e459810ab2553840ed373a989893c922b77d2503431a5bc59db.jpg'),('Mohamed Soliman Abdul Malek',1755885,'Egypt','Egypt','Mohamed Soliman Abdel Malek is an Egyptian screenwriter and author. He studied medicine at the Suez Canal University, where he started writing, beginning with a series of short stories. He also worked in independent journalism, before focusing on screenwriting through participating in writing workshops for sitcoms including \"El Eyada\" (The Clinic) and \"Tamer we Shawqeyya\" (Tamer and Shawqeyya). Since 2007, he started developing his own television series and films, including \"Ism Moa\'akat\" (Temporary Name) and \"Shadd Agzaa\" (Gun Racking).','1 May 1979','https://media.elcinema.com/uploads/_315x420_4a489a5641ca10af311c87f2640db132386db5d22f16bb0d5723521bfb62f9db.jpg'),('Nader Abul Leif',1852996,'Egypt','Egypt','Nader Abul Leif is an Egyptian singer. He was born in Alexandria in 1968, and studied violin in the conservatory. After a lot of attempts to appear in the field, he moved to Libya seeking various careers, in which he also failed and eventually returned to Egypt. Following his return, his friend Ayman Bahgat Amar offered him to assist him in making a debut album, which they eventually did and released, to overwhelming commercial success.','30 April 1968','https://media.elcinema.com/uploads/_315x420_4e9748c7e585a47ed1817f776308f086f07e70be57769d67faccf2989670cbd4.jpg'),('Elissa',1935807,'Lebanon','Lebanon','Elissa is a Lebanese musician with a melodious voice. She achieved moderate success in Lebanon before moving to Cairo at the turn of the new century where she succeeded greatly and established herself as one of the great singing voice of the Arab World.','27 October 1972','https://media.elcinema.com/uploads/_315x420_86885d2aa5eb030adc1aa706acd68e72b3fc182c75b43a3b41195897d7fc7ced.jpg'),('Ahmed Al-Gawhary',1976865,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_cefc6f231ad17dd0170b5498b2f9c6a4088fc1678fe917cd6111bc1c42f40d34.jpg'),('Ali El-Gendy',1976871,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Cinderella',1976878,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_007aa167fd224bd6581f709c2d8dabc11bbdeff37f848732e43c47e28bda8a79.jpg'),('Ahmed Amin',1976884,'Egypt','Egypt','NONE','11 July 1980','https://media.elcinema.com/uploads/_315x420_e23792bf24dcfc72143fdde876f98632ccabd45b7c7fe54023986d7aef08dacc.jpg'),('أوسم إمام',1976894,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('احمد تاعب',1976900,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Bassem Mounir',1976902,'Egypt','Egypt','NONE','22 August 1974','https://media.elcinema.com/uploads/_315x420_0187ca3688dc72bb8cb412f20a6decc55fa85c594b40034317f018d177aabb74.jpg'),('Rami Ayash',1976947,'Lebanon','Lebanon','A Lebanese pop start, who shined during the 90’s. He produced many songs that put him on the top of the chart and sang with legendary local singer “Ahmed Adaweya” in the famous duet “AL Naas Al Rayaa” or “The Cool People” which was a hit during that time. He dreams of acting but has not made up his mind yet.','18 August 1980','https://media.elcinema.com/uploads/_315x420_a497f86b3ce0bbf7859c20dbfe9dabd3c496d11d77e90846f04add57e81d932c.jpg'),('Victor Credi',1976949,'Egypt','Egypt','NONE','23 January 1983','https://media.elcinema.com/uploads/_315x420_a8f005f127a9acf48bf6a0ad29c889dbd8344e61d3552b7d0bf2a792831c4c4a.jpg'),('Sharif Al Wissemi',1976950,'Egypt','Egypt','NONE','3 December 1982','https://media.elcinema.com/uploads/_315x420_a79e130dd441b15d35785cb290fd8a321b7c0a728f86a0e979b060dcad8b5743.jpg'),('Mohab Ezz',1976951,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c364a3c21b8b4b144ca6e5b9209b4a0497538003a4921ed94309520df3e51bb5.jpg'),('Abd El Rahamn Mahmoud',1976952,'Egypt','Egypt','NONE','10 August 1985','https://media.elcinema.com/uploads/_315x420_f9520d0f75575869c4c06f0624776745b4ba049e86944da12aeef57d8eede484.jpg'),('Moustafa Shaaban',1976953,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_fe37cbbf24d40838e8731b9cb09da9d3eed62443bbc5dde430d8662ffaabbf66.jpg'),('Ahmad Al-Awady',1976955,'Egypt','Egypt','Egyptian actor Ahmed Al-Awadi graduated from the College of Business at Helwan University in 2006. He was discovered by well-known actor Nour El Sherif who offered him a role on the television series “Matkhafoush” (Don’t Be Afraid; 2009). Al-Awadi has also appeared in several other television series including: “Al Daly 3” (2011), “Mirath El-Reeh” (Legacy of the Wind; 2013), and “El-Seba’a Wisaya” (The Seven Commandments; 2014).','12 December 1985','https://media.elcinema.com/uploads/_315x420_0d11d897ee512c63c71530074fb6ebad31c88694d1d0deefa05168a9b02cb998.jpg'),('Sahar Al Sayegh',1976956,'Egypt','Egypt','Sahar El Sayegh is an Egyptian actress who was born in 1990. She began acting in TV serials when she was a child, the most famous of which was “Om Kolthom” which starred Sabreen in 1999. In the series, Sahar played Om Kolthoom as a young girlه. The role was Sahar’s “big break into the world of acting, which she pursued alongside studying at the Faculty of Dentistry. In 2008, she appeared in the TV serial “Fi Ed Amina” (In Amina’s Hand) alongside the actress Yousra. She also acted with Yousra in the series “Khas Gedan” (Very Special) in 2009 after having been proposed for the part by producer Gamal El Adl. In 2010, she appeared with a star-studded cast in the most famous TV series she has acted in, “El Hara.”','1 January 1990','https://media.elcinema.com/uploads/_315x420_724b90ea30cdefb2d31056aeb56d8db74b8de71adb5606f3380e0c3b5b8e8a47.jpg'),('Ahmed Gamal Saeed',1976958,'Egypt','Egypt','NONE','21 January 1989','https://media.elcinema.com/uploads/_315x420_3a57c3df5c91339a0d7dbacf03c6d24bcfece444396b8ebde62c8c2119ddfce5.jpg'),('سماح عوض',1976984,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c8255606a201e1475c67f7a74bcd84a57f98e72960610c8d4b38e879ce6bdab3.jpg'),('أحمد عبدالخالق',1977038,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mohamed Fahim',1977048,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6ffb4c971a1dfcadbd373408107ea998ee62fe0ca70c8ea30978d1b42c08d202.jpg'),('Amr Saeed',1977085,'Egypt','عمرو سعيد محمد ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Alaa Hosny',1977128,'Egypt','Egypt','Alaa Hosni is an Egyptian actor. He earned his bachelor\'s degree in accounting then another degree from the Institute of Theatre Arts in acting and directing. He\'s appeared in a number of television series, notably \"Moled we Sahbo Ghayeb\" (2012). In 2013, he stars in the mystery thriller \"Al Hafla\" starring Ahmed Ezz and Ruby. ','NONE','https://media.elcinema.com/uploads/_315x420_f0019598310a2b0a232a6602f20db28689651cff54fbbc3bcbee2e8ad7e03520.jpg'),('Dina El Sherbiny',1977129,'Egypt','Egypt','Dina El Sherbiny is an Egyptian actress. She started as a TV host for the program “Shababeek” on Dream satellite channel, but her growing admiration to acting made her join the Marwa Gebril acting school, where she studied for a year. She then auditioned for the TV show “Ard Khas” (Special Screening), where she was chosen to play her real life character. After that she went on to star in TV series like “Moga Harra” (Heat Wave), “Taht el Ard” (Underground) and films like Al Hafla (The Party) and “Sameer Abu Elneel.”','17 March 1985','https://media.elcinema.com/uploads/_315x420_63c470badecf6c8d9d48be1d7e64ae8002219fe50fc924aa31a01f930917b2df.jpg'),('Karim Fahmy',1977130,'Egypt','Egypt','Karim Fahmy is an Egyptian actor, and brother of screenwriter Ahmed Fahmy. He studied in the Faculty of Dentistry in Cairo. He then entered the media after being selected to participate in the TV show “Ard Khas” (Special Screening), playing his real life character: a dentist dreaming of becoming an artist and leaves his job to pursue this dream. However, Fahmy never left his occupation as a dentist. Fahmy also wrote feature film scripts like “Bebo we Basher,” “Mr. and Mrs. Eweys,” and “Hatoli Ragel” (I Need a Man), in which he also starred.','3 December 1982','https://media.elcinema.com/uploads/_315x420_7e18fb6017d6ac23bcf2ab775af0ddca8c1477d6c99d0c6704563138e6254e3f.jpg'),('Yasmin Raeis',1977131,'Egypt','Egypt','Egyptian Actress, She was born in Cairo in 1985, After Working Several Years as a model, she decided to start her Acting Career in 2010 With TV-Series (Special Screening) and later Participated in Several Movies, Including: (X Large, A Whole One, The Benefit), But she drew a lot of attention when she collaborated with Director Mohamed Khan in Movie (Factory Girl) in the main role, which made her gain several awards including Best Actress Award from Dubai International Film Festival.','15 September 1985','https://media.elcinema.com/uploads/_315x420_76a49c58785bc980bf1e60234646e1e9c4574179d3fa6679482badce10e95ace.jpg'),('Mustafa Al-Ridi',1977132,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_46d7a23860212cf90d933bf16e3175a5c7a15cb851e9b88da6e0a055f2dcbdb7.jpg'),('Mohamed Shaker Khodeir',1977134,'Egypt','Egypt','Mohamed Shaker Khodeir is an Egyptian director. He directed the programs \"Khatawat Elshaytan\" (The Devil\'s Steps) and \"Rehlat AL Yaqin\" (The Journey of Certainty) with Islamic preacher Moaez Massoud. He also directed the mini-series \"Ard Khas\" (Special Screening) and the film \"Hatuly Ragel\" (Bring Me a Man).','2 February 1983','https://media.elcinema.com/uploads/_315x420_8d935497f37cea90ae10d4ffa5e453fa569b7bfbae726c9d5ae2f94ed655b5d0.jpg'),('Muhammad Al-Hady',1977136,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hani Osama',1977139,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b470c3a8a8dbef03046643662a94f86cc610cb30922c4ef566819c98138bac9b.jpg'),('The Producers',1977140,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bd8b004dd17064efdd243ecab60e9baa15fc44c2f55173d90936b7003ff8e1dd.jpg'),('زيد فريد',1977311,'Jordan','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hany El Behairy',1977338,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_1ff2c46f4230080c1484a57ee2560a38a573615265e8685a55006ae689cda69e.jpg'),('Rana El-Sobki',1977340,'Egypt','Egypt','NONE','10 September 1987','https://media.elcinema.com/uploads/_315x420_03b7b2cd66fcc917c6f9dc08ec292e9bbef346baf8fd37ce278a3ea0d61dcc3f.jpg'),('شريف الكومي',1977342,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_854b1fdd8f6b402fcd2a0c12f39560fbd92930be54c18840b29ba2dfef8217a2.jpg'),('Gamal Haggag',1977352,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_41b1fe881bdfbdb1538b06289db389935b5f45187dcde8e86921d2d321e80edd.jpg'),('Waheed Sobhi',1977369,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_023c4b3e0a123bcfc3d2b7ee493afe12ca8dee9e4e39ece2b9a2dae0c0eb4a3d.jpg'),('nehad samy',1977370,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6da4eaa0b72e6355ec980659f16ce27d2cd55124e6a8922e4fe3d7decc9edd3e.jpg'),('صلاح البربري',1977380,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('ايمن الشاهد',1977381,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('إسلام حنفي',1977383,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('حسن الشحات',1977388,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('كريم شاتيلا',1977389,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('مارك وجيه',1977391,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hesham Dowaik',1977394,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_05c011e182337e31600a8a6e39c0498ac97b316b5c51451234508c433b35f5e4.jpg'),('Ahmed Abdel Hay',1977398,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_082f9f605aa55ba4a572f05e2f7c9d8fb9d8b5d94ae8758fab0833e16886c5f7.jpg'),('أحمد يعقوب',1977405,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ef544fc614ac61dfdff14ee9d312796f451b3f89acc90e196f3a8ecd62437925.jpg'),('Wael Salah',1977416,'Egypt','Egypt','NONE','1 August 1983','https://media.elcinema.com/uploads/_315x420_03efe7372230a5f4c8d6c525d0667a6a4629f5de6209a9adde62f8d74d95f2a6.jpg'),('Youssef El Gharib',1977420,'Egypt','Egypt','NONE','15 February 1996','https://media.elcinema.com/uploads/_315x420_075fa956b702947c14226e03d8663fec65976816005550e1ca3339a2bd12cf0e.jpg'),('Ahmed Magdy',1977421,'Egypt','Egypt','Ahmed Magdy graduated from the law faculty at ‘Ain Shams University but did not work as a lawyer. Rather Magdy joined the al-Tamy theater troupe and worked as an actor, assistant director and actor trainer for many performances over a period of three years. His first film was the independent six-minute 2007 documentary work “Magra al-Seil” (“Riverbed”). Thereafter Magdy took part in a workshop titled “al-Zatt wa al-Madina – al-Qahira” (“The Self and the City- Cairo”) which was produced by the European Union and al-Sammat production company which saw the direction of a 9 minute documentary work titled “Zeezo”. Magdy also joined the Cairo Jesuit Cinema School for a year and directed three low budget short titles.\nMagdy has taken part as an actor or assistant cameraman in more than 30 independent works. He was also in the 10 minute narrative film work “Keika Sagheera” (“Small Cake”). The title was his graduation project that was submitted to the workshop and received an honor from the judging committee at the Algeria Independent Cinema Festival.\nMagdy’s final work as a director was “Illa al-Bahr…” (“To the Sea…”), the title was produced by the Forced Migration and Refugee Studies department at the American University in Cairo. Magdy also participated as an actor in “’Asafeer al-Neel” (“Birds of the Nile”). That title also starred Fathy ‘Abd Al Wahab and was directed by Magdy Ahmed ‘Aly. The work was adapted from a literature work by the same name which was authored by the renowned writer Ibrahim Aslan.\n','4 May 1986','https://media.elcinema.com/uploads/_315x420_5a14e2344d5e2598656929364b190afaf3c2abc76de5de68d3ac79d4f6195576.jpg'),('Murad Makram',1977426,'Egypt','Egypt','NONE','16 April 1975','https://media.elcinema.com/uploads/_315x420_c02b0fd2f5fc22e75a26ecfbbe06c0c5d06f0f9d3f1da0b43cc25bca8b561b15.jpg'),('Habi M. Seoud',1977432,'Egypt','Egypt','NONE','7 May 1984','https://media.elcinema.com/uploads/_315x420_24c4469b170ee625b562d03a667b51b372c0c1e1232496deeabf40ab13ab2e28.jpg'),('Mohamed Jamaica',1977443,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmad Fahmy',1977444,'Egypt','Egypt','Satirical writer and actor, Ahmed Fahmy, graduated with a degree in political science and economics. He began his career in acting as an amateur in an independent film group called \"Tamr Hendy\" during his college years. Tamr Hendy produced many satirical films, among the most famous \"Regal la Ta3rif Elmostaheel\" a parody of the Egyptian movie \"Eltareeq Ila Ilat\"  which quickly spread on the internet and was screened in many local cafes. \n\n\"Regal la Ta3rif Elmostaheel\" captured the interest of writer Mohamed Hefzy, who was making the transition into movie production at the time.  After meeting with Fahmy, Hefzy decided to produce his work \"Affiche we Tashbeeh,\" a TV series that makes fun of various Egyptian films in each episode. Later on, Hefzy would produce Fahmy\'s movie \"Waraqit Shafra\" which Fahmy wrote and acted in, along side his Tamr Hendy colleagues and long time friends Hisham Maged and Chico.  All 3 actors won the critic\'s choice award in 2003 for Best New Actors.  \n\nFahmy also wrote the screenplay for \"Keda Reda\" starring Ahmed Hilmy, as well as \"Sameer, Shaheer, & Baheer\" in which the Tamr Hendy trio costarred once again. \n','6 November 1980','https://media.elcinema.com/uploads/_315x420_de012af3fcb3c73c273a812e8f2325809aeb406c9e1f19ccad4250de9db5310a.jpg'),('Nahla Zaki',1977459,'Egypt','Egypt','Nahla Zakky is a young Egyptian actress. Her cinema debut came in 2009 when she assumed a role alongside Imam Mohamed Imam in “al-Bey Romansy” (“Romantic Beyy”). Critics welcomed her as a promising new edition to cinema with characteristic and beautiful Egyptian features.','9 August 1987','https://media.elcinema.com/uploads/_315x420_a338930efb46a61c2762ced003e6c9e4831d8d712ab4bc7edcf83088aa7c9fbc.jpg'),('Khlaed',1977461,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Marwa Gebreil',1977465,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2899b96bc766ad97e3ad5057d462cfd2360d19c48e73859be802789fdbf65c02.jpg'),('Amro Salah',1977468,'Egypt','Egypt','NONE','20 February 1982','https://media.elcinema.com/uploads/_315x420_2e4e6a442c805303f35397bff15388b9292a024b7305c9633cf8fae89dfaaf1f.jpg'),('Khader Mohammed Khader',1977509,'Egypt','Egypt','NONE','29 April 1980','https://media.elcinema.com/uploads/_315x420_13fe68679acff70efd2e5f4847ffd5b70d3ac84ae3b1d2ce0ba4b524ff9b51c5.jpg'),('Diamond Bou Abboud',1977514,'Lebanon','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bbd48c54c004b5258e6e655b65191689bc4ffde0cc27aa782d60c17c82046065.jpg'),('Amir El Masry',1977525,'Egypt','Egypt','NONE','2 August 1990','https://media.elcinema.com/uploads/_315x420_9dea5fcd4ea0d41cee6d4438701dbd76b8ceb97c0931455cc83acea6e8d8398b.jpg'),('Omar Mustafa  Metwally',1977526,'Egypt','Egypt','Omar Mustafa Metwally is an Egyptian actor who was born on August 1, 1983 in Cairo. His father is the actor Mustafa Metwally and his uncle is the producer Essam Imam, brother of actor Adil Imam. He began his acting career with the film “Ramadan Mabrook Abo El Alamein Hamouda” in 2008, and then appeared in several films including “Safari” in 2010, “Saa Wi Nos” (Hour and a Half) in 2012, “Tattah” in 2013, and “Qalb El Assad” (Lion Heart) in 2013. He also was the star of the TV series “9 Gameat El Dowal” in 2012.','1 August 1983','https://media.elcinema.com/uploads/_315x420_ca59a69b1e29743cb963608a4e1ad72dce75da6354bb87baa2fa9c12d0b2e1e4.jpg'),('Ziad El Weshahy',1977527,'Egypt','Egypt','Ziad El Weshahy is an Egyptian Film director. He has worked as an assistant director since 1997, mainly in feature films and TV series.','3 September 1980','https://media.elcinema.com/uploads/_315x420_e6345c6d5cc57900be1064f766ab807023be9b957507a972702ba404a731b8f3.jpg'),('Maryam Saeed Saleh',1977528,'Egypt','Egypt','NONE','25 May 1969','https://media.elcinema.com/uploads/_315x420_8a020edb1de2640ce5d3f51e2f61cd7f2ff1fd94bdaa2550ffaab83f761548f7.jpg'),('Mohamed Hazeen',1977530,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Farouk Abd Al-Latif',1977534,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_72578fdb3465d426864aff76d6cf92782919fc1655b046ccae896b6ce788a47c.jpg'),('Diaa Habib',1977535,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_97094b59e7b545c987c8485cf78bd4638e8c094a665b7b4cb97915d940511cc9.jpg'),('Hosam Algazar',1977536,'Egypt','Egypt','NONE','6 February 1986','https://media.elcinema.com/uploads/_315x420_d9592ac862ce1da3ab7dccbe4adc5f3c55d54b1d01380f19dba86b2d8c097105.jpg'),('Malak Adel',1977538,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8ba21fa1f57da7a231cab81711364ce14366a60087c88f90be0dd85d85cc673f.jpg'),('Karim Abo Elfotoh',1977545,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_eface836fb5d17dd441342baac0a766fe8a5cf2c960e7ba8e2438af9d533b8a5.jpg'),('Ahmed Afifi',19