 known as (Bradley Hume) in the English drama series (Holby City), and (Ed Russell) in the English series (Mile High) and (Hector) in the movie (the Expendables 2) bombarded with many action stars, he also started in the TV series (Dangerfield) and (Hollyoaks), in addition to many other movies. Adkins born in (Sutton Field) Southeast (Birmingham), England in 1976. His interest in compact arts began at age of ten, when he visited his father and his brother, at a local judo club; afterwards, he began training in the garage of their home, where he used to bend to a picture of (Bruce Lee). His interests in compact arts increased when he considered famous martial arts actors like (Bruce Lee) and (Van Damme) his mentors. He began training on taekwondo and earned the black belt at the age of nineteen. He also trained himself on the kickboxing since the age of sixteen. As well as training in Ninjutsu sports, judo, karate, Jojotsu, wushu, Alkrav Maga, Alkubira, Jeet Kune Do and athletics. Since childhood, he decided to study drama at the College (Sutton Field) and the difficulty faced him in the beginning facing people in public due to his shyness. At the age of twenty-one, he began to study acting in (Webber Douglas) Academy, for performing arts, but did not manage to get a certificate, and he thought this is the end of his acting career, however, his chance came when he was offered a role in a movie named (Dei Seung Chui Keung) or (blatant challenge) in 2001. He drew the attention of (Wai Tong) Director and Chairman of the Hong Kong takers association, as well as (Bai Logan), an expert movie maker from Hong Kong. Adkins continued his work in the Middle of working with a group of senior directors of action movies such as (Woo-ping Yuen), (Corey Yuen), (Sammo Hong Kam-Po) and the legend (Jackie Chan). In 2000, his biggest hit came, when he was offered the role of guest of honor in the series (Doctors), a couple of episodes of the series (City Central), (City Central) and then was offered a major role in the series (Mile High) in 2003, and then continues to the role of the Series ( Holby City). In 2006, he was able to enter the world of Hollywood through his role in (Undisputed II: Last Man Standing). In 2008, he stood before (Van Damme), one of his childhood heroes in the movie (The Shepherd: Border Patrol (2008)) the role of the main opponent! In 2012 also starred in the movie (Zero Dark Thirty). In 2014 he acted as the king (Omfitrion) in the 3D imaginary movie (The Legend of Hercules).','17 June 1976','https://media.elcinema.com/uploads/_315x420_2a88a47c19a0cb0ec473b9c2e386877ae48d3531398c310bc1348b138cf819cb.jpg'),('Muhammad Ahmad',1980838,'Egypt','Egypt','NONE','30 May 2016','https://media.elcinema.com/uploads/_315x420_a8316b8d23d0f5ac79be5c9966754c7f90b2bdb14f08fef56f36e677479462ff.jpg'),('Awad Badawy',1980839,'Egypt','Egypt','NONE','6 September 1961','https://media.elcinema.com/uploads/_315x420_3f6a921e2eff799d926d5c9aace4e793e65e9dd5ef44f6fc5f2ce27c3b0f4f25.jpg'),('محسن عبدالوهاب',1980874,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('حسن ابو سيف',1980876,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('محمد الشاعر',1980885,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Fadi Foukaih',1980887,'Egypt','Egypt','NONE','10 December 1956','https://media.elcinema.com/uploads/_315x420_922c1102b3263bab62915a2aa82bcc53e4d2bf5b9589e12cc6690ede07043d54.jpg'),('Mahmoud Al Sherbini',1980912,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_141971a918050d319af4a5a7eb238ba6845588ed4807a12889c20bd34517cf0d.jpg'),('Sayed Abdo',1980935,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Bardees',1980941,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_32462cc75093e40fad40cfb2908185d88926ac8bb544d03ecaa2f1de81d2d5e2.jpg'),('Latifa Fahmy',1981074,'Egypt'