 Nasry, Assaala\'s father, was a well-known Syrian composer and singer. Asala began her musical career by performing patriotic, religious and children\'s songs when she was four years old. She sang the theme song \"Qessas al-Sho\'oub i.e. Strories of People\") of the cartoon show “Hekaayat ‘aalamiyah i.e. Global tales”. In 1986, Moustafa died after suffering of internal bleeding in a car accident. Aged 17 she helped her mother in taking care of her siblings, Reem, Amaany, Ayman and Ayham.\nAssaala\'s commercial musical debut was in 1993 with “Law te\'rafou i.e. If you know”. The album had 4 songs in the oriental operatic TARAB style composed by great Egyptian composers. The album was an instant hit with heartbreaking songs like “Ya sabra yana i.e. How patient I am!” and “Samehtak ketir i.e. I forgave a lot”. She quickly cemented her presence in a growing industry brimming with new, young talents like Najwa Karam, Saber Rebai, Angham, and Abdelmajeed Abdullah. \nAssaala booked herself a place along with the Arab singing legends among great albums through two decades. Among her most famous albums are “Eghdab i.e. Get angry”, “Wala tessadda’ i.e. Don’t believe”, “Alby beyertahlak i.e. My heart feels at home with you”, “Ya mag-noun i.e. Oh madman”, “Moshtaa’a i.e. I am missing you”, “Yameen Allah i.e. I swear”, “Add al-horouf i.e. As much as letters”, “Hayaaty i.e. My life” and “Noss haala i.e. A half situation” and “Kanoun kaifek i.e. The law of your fancy”. \n\nAssaala participated in many Arab songs festivalsand won numerous awards where she earned a prize for the best singer (1994) in Dubai, Oscar of the Middle East (Golden Knight -1995) and the prize for best fus-ha Arabic song ( Abu Dhabi - 1996). , She was awarded the Emirati radio and television prize (1998), in addition to numerous honors and awards.','15 May 1969','https://media.elcinema.com/uploads/_315x420_7647b51ae45a009f71c6a3ffbc3d325d5f1b9f6bbf77b6e026082e89bdb89ff5.jpg'),('Ilham Ouaziz',1993814,'Morocco