student in the faculty of commerce, Ashraf performed in several theatrical productions as part of the faculty’s acting troupe and the amateur acting troupe. Ashraf took part in about 800 plays between 1979 and 1984.\nAhmed’s talents were noticed by the director Hany Mutaw’e who watched him act in the play “Khashab Al Ward”. At the time Ahmed worked as a contractor working out of his factory which specialized in aluminum and décor.\nRaafat Al Mehy was the first to introduce Ashraf to the cinema industry. Ashraf closed down his factory after he began acting. \nAmong his best known theatrical productions are “Pallo”, “Shabura”, “Bashweesh”, “Lama Baba Yenam” (“When Dad Goes to Bed”), “Rud Qardi” (“Cancel My Debt”). Among the most important television productions he has participated in are “Hadrat Al Muhtaram” and “Yawmyat Zawg Mu’assir” (“Memoirs of a Modern Husband”).\n','11 September 1963','https://media.elcinema.com/uploads/_315x420_b1de234afb19a1b9089ceafe4bdb23869da38e58d7706c8ee5f0c7d3de6b829c.jpg'),('Hassan El-Prince',1994588,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_8eac6b08bef03e0c8fa4b7808fd3a5f929bf43fbdada6ea694a7f9dc0ffdaa13.jpg'),('Khaled Abdalla',1994743,'Egypt','Egypt','NONE','30 December 1980','https://media.elcinema.com/uploads/_315x420_b88d64e52f2dedd92686b913930f6135aa0d8ff3a8790051ea1aecf9267a85af.jpg'),('Dalia Al Hawary',1994769,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Saeed Tawfik',1994788,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('tarek emad',1994896,'Egypt','Egypt','NONE','24 March 1989','https://media.elcinema.com/uploads/_315x420_2481da0e8354e7a7184b025ac376984a5887bebc97a19e3d1a7933cf2f8b8104.jpg'),('Mohammed Al-Mohandes',1995066,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Haitham Yahya',1995069,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hussam Elwan',1995155,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_6db29854821d6e5ea07c2254d17ccbe8eb7049e64e055d661635b9cb908d12e9.jpg'),('Maii Zayed',1995165,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Nermeen Salem',1995166,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hind Bakr',1995169,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0a843d848fb7a4e73b8facfc543b9c4e1f70f0be1099342b7dff26ef52499b7f.jpg'),('Ahmed Elghoneimy',1995172,'Egypt','أحمد إيهاب الغنيمي ','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Mina Nabil',1995173,'Egypt','Egypt','مينا نبيل هو مدير تصوير، مخرج من الإسكندرية ومصر وحصل في عام 2011 علر درجة البكالوريوس في الاخراج السينمائي وفى ٢٠١٧ تخرج من مدرسة الفنون السينمائية بجامعة كاليفورنيا. مينا هو أيضًا أحد المؤسسين لشركة فيج ليف ستوديو . وقد عمل كمتخصص في الميزات ، والسراويل القصيرة ، والأفلام الوثائقية ، والإعلانات التجارية مثل\nجوجل ، الفيسبوك ، الأمم المتحدة وغيرها.\n\nحضر عدة برامج  مثل البرنامج الوثائقي 2014 Berlin و Beirut Talents 2015 وجائزة روبرت بوش Stiftung للفيلم في مرشح Berlinale في عام 2016 وبرنامج AFS في USC 2017 Los Angeles و Film Independent Fellow Doc Lab 2018 Los Angeles.\n شارك مينا أيضًا في مهرجانات كبرى مثل كان وبرلينالي والبندقية. حاليا ، يقوم مينا بالتدريس كمحاضر  لمدرسة الفيلم الوثائقي سينيديلتا  لأول مرة في الإسكندرية.\n حصل مؤخرًا على جائزتين من مهرجان الجونة السينمائي عن فيلمه الوثائقي القادم \"أنا فتاة سيناريو\" وكان عضوًا في لجنة تحكيم مهرجان الأفلام الوثائقية الدولي الثاني والعشرين في بوزنان ، بولندا.','9 April 1989','https://media.elcinema.com/uploads/_315x420_2cb879aa7544e78de686a365e2aa358729a11342090a32c910938373ccf496ea.jpg'),('Massar Egbari',1995176,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_120ddeef721296aab6c59b4e426c3ce84dadc8f2464e0eb1b391d160add96fc5.jpg'),('Mark Lutfi',1995179,'Egypt','NONE','NONE','NONE','https://