d \"Hazra Maznuqa\".','1 October 1982','https://media.elcinema.com/uploads/_315x420_0461396771b251f39afb14ec7c2d1370f48175cd00893e32436e17db237fb1b4.jpg'),('Muhammad Yahya',1999167,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c05be3747f983ef2a44d99ecdde09e46ba84f02ef56d8cf276279566a444faa5.jpg'),('Sawsan Taha',1999168,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2c44f00b3c5063b07a0d3d34ae621cfaf712f95f006d3c9d4fed95010b8f1560.jpg'),('Nageh Naeem',1999198,'Egypt','Egypt','NONE','3 June 1961','https://media.elcinema.com/uploads/_315x420_9aef2736ca5e9e2408e2922ece0605ef50cd46e7e69c406dceac92868a8a4834.jpg'),('Essam Al Ghannam',1999201,'Egypt','Egypt','NONE','17 January 1958','https://media.elcinema.com/uploads/_315x420_bf1ce6bdefe66145ff3ee9b4a99a03a669cc4e35b3edacd00cad1b4614326949.jpg'),('Samir Hakim',1999204,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b087597e42a6df4fbbea62e6cf303649a87fccfa23aef1e0bc1e26754a7935b4.jpg'),('Badie Gerges',1999205,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Raouf El Deeb',1999211,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_17a36f10d5e0bd95dda93decb8cb33475738f2a0a7486ac8be769a0b4ca40cb2.jpg'),('Majdi Tawfiq',1999212,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_85452083d9d4414482e4cb560d01b2d6bd466b33f0d5cb7f2a779a978d74ea99.jpg'),('Amr Shamis',1999215,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_bb049832425bc607623a85b4b345d35e1941312c980279c4adfb7fd1e65d5f01.jpg'),('نادر فرنسيس',1999216,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Adel Zohdi',1999221,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Brett Cullen',1999255,'US','US','Brett Cullen is an American film and television actor who\'s had a long career in TV, with major roles in \"Falcon Crest\" (1986-1988), \"The Thorn Birds\" (1983). He\'s worked on a host of made-for-television movies and has had an impressive number of guest appearances on major television programs. He\'s played two real-life astronauts: William Pogue in \"Apollo 13\" (1995) and David Scott in the HBO mini-series \"From the Earth to the Moon\" (1998). He had a guest spot on \"The West Wing\" in 2005 playing Ray Sullivan, a West Virginia governor and Vice Presidential candidate. In 2007, he played the father of a football player in the massively popular series \"Friday Night Lights.\" In recent years he\'s played in \"Ghost Rider\" (2007) and had a small part in \"The Dark Knight Rises\" (2012). In February 2011, Cullen was named the official spokesman for Houston Works, which helps Houston, Texas, residents with job training and placement, scholarships, consulting, technical initiatives focusing on science, technology, engineering and mathematics and summer job programs. ','26 August 1956','https://media.elcinema.com/uploads/_315x420_0b496cf240f75c4f0ab1a5fe24fc2d2327f5af5a7911db11f335d15c51839fda.jpg'),('Ahmed Shobair',1999489,'Egypt','Egypt','Ahmed Shobair is a television presenter and a former football goalkeeper. He was born in Tanta in 1960, and started playing with Al-Ahly club in 1984. He also participated in Egypt\'s second qualification to the World Cup in 1990. Following his retirement from football, he started working in the media, presenting shows about football and politics at the same time.','28 September 1960','https://media.elcinema.com/uploads/_315x420_8761096f8a671714b4ca4776a67281634e3e25f6f50a19cea91bd2ed8b9d1db2.jpg'),('Reham Farouq',1999583,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_be423f82585738de924c4468ba2863f18f8eb6381f469f142e90814080d59ab2.jpg'),('Youssef Khaled',1999596,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Yassin Fathi',1999597,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_eaab30c67fcacef726da5eac4cc47947f67b5a30b352468ada841a6445c2f222.jpg'),('Tara Emad',1999634,'Egypt','Egypt','Tara Emad is an Egyptian actress and model who was born in Cairo in 1993 to an Egyptian father and Yugoslavian mother. She started her career when she was 4-years-old when she appeared in a number of commercials. She started working as a clothing model at the age of 14. In 2010 when she was 17, she participated in the Miss World beauty pageant for teenagers that was held that year in Brazil. She returned to Egypt with the title “Miss Africa” and the first-runner up for Miss World for Teens. After high school, Tara enrolled in Business Administration at the American University in Cairo and pursued “acting workshops” with actor Ahmed Kamal and online with American organizations. Her first acting experience was in 2011 in the TV series “El Gama’a” (University) directed by Hani Khalifa in which she acted alongside other young actors. In 2012, she was in the series “Zey El Wuroud” (Like Roses) directed by Saad Hendawy. ','11 May 1993','https://media.elcinema.com/uploads/_315x420_42358eee29eccff3d1513699159ffb9fa6536ede99528a6086ec811c4772dd3e.jpg'),('Ayman Bishay',1999639,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ee124a428fcce99fc3c63c95eb144b06af8d7e5b8964a42eade4a421ed19d58f.jpg'),('Mohammad Azar',1999643,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b6e18dd65563552a28eeefdb2bcd0d084bb26a370c6b704e3c106c1041409b6a.jpg'),('Islam Shawqy',1999898,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_2471b9a65ed52e3760b2527b18dc366334018d3d877847426f212be640d6629b.jpg'),('Moatz Ezz',1999981,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_203136a1cc701f263a236f3478fac3a2fd70e34141759f375e097fdb475d579f.jpg'),('Maha Othman',1999987,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_b630ea6f1d2fcbfdbc061ccf1e4