in 2005. In 2006, she won the Charleson Award for exceptional classical stage performances from actors under 30 for her performance in \"Miss Julie\" in \"Measure for Measure.\" Her star has steadily been on the rise ever since, with appearances in an eclectic mix of films from indie darling \"Happy-Go-Lucky
\" (2008), to \"Never Let Me Go\" (2010), \"W.E.\" (2011) directed by Madonna, IRA drama \"Shadow Dancer\" (2012) with Clive Owen, \"Oblivion\" (2013) with Tom Cruise, and \"Disconnect\" (2013) an unsettling ensemble drama about the destructive and pervasive presence of the internet and technology in our daily lives. Riseborough was nominated for a BAFTA in 2009 for playing the title character in \"Margaret Thatcher: The Long Walk to Finchley.\" She won Best Actress at the British Independent Film Awards for \"Shadow Dancer\" in 2012. ','27 October 1981','https://media.elcinema.com/uploads/_315x420_efc7b1f99c772099a17b3d41a1ce2655f68e3ae4d172d0cac39bad9bea8bc80d.jpg'),('Amani Souissi',2006758,'Tunisia','Tunisia','NONE','11 April 1984','https://media.elcinema.com/uploads/_315x420_5265617a4e5896b293555a776f605ca56545d3a489a8ef8cfb2ea90b1705ad87.jpg'),('Yasser El Sherif',2006760,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Basem Yousef',2006817,'Egypt','Egypt','Bassem Youssef is an Egyptian comedian and cardiothoracic surgeon. He graduated from the Faculty of Medicine, Cairo University, where he also earned his PhD. In cardiothoracic surgery, and worked shortly as a professor. He traveled to the United States and Europe to work in the cardiac surgery and transplant technologies field, and earned his surgeon license in the United Stated in 2005. Bassem\'s breakthrough in comedy was through his satirical show “The B+ Show,” that was inspired by the  Egyptian Revolution of 2011, which he launched on Youtube to earn five million views in less than three months. He went on to sign with the Egyptian satellite channel ONTV, where he started hosting  “Al Bernameg” (The Program), with a budget of half a million dollars. The show was then renewwed for a second season on another channel, CBC, and the production studio was changed to Radio theater in Cairo. The second season consisted of 29 episodes and has recorded one of the highest viewership ratings on both TV and internet with 40 million viewers on TV and more than 120 million combined views for his show on YouTube alone. Due to legal conflicts with the channel, Bassem\'s contract with CBC was terminated after completing one season and three episodes. The third season of the show has aired on MBC MASR. In 2013, Bassem was named one of the \"100 most influential people in the world\" by TIME magazine and one of Foreign Policy magazine 100 Leading Global Thinkers. He was also awarded with the International Press Freedom Award of 2013 from the Committee to Protect Journalists and was announced the most searched figure in 2013 by Google. Al Bernameg was chosen by South by Southwest, one of the largest international interactive festivals, as the first and most successful internet to TV conversion story in the Middle East. Al Bernameg YouTube channel was the first channel in the MENA region to reach one million subscribers and was awarded the gold button trophy.','21 March 1974','https://media.elcinema.com/uploads/_315x420_80dce631dbab402a84cf9cfb6387de39f74c574e8d73d8bbc2d2c0fde9b83a54.jpg'),('ساندرا جيزي',2006827,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Murad Alzaknda',2006965,'Morocco','Morocco','NONE','30 October 1980','https://media.elcinema.com/blank_photos/315x420.jpg'),('Omar Sharqawi',2007065,'Palestine','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_c249b1eebf842dc5ca3fe4067dbf8a8ca160ae1027fe6faecda02c9d5aabb86e.jpg'),('Stefano Savona',2007122,'Italy','Italy','NONE','18 December 1969','https://media.elcinema.com/uploads/_315x420_82256628565f0b1aba0d762746e26353fc43b802f84ea6999e11b74ca4388a3b.jpg'),('Mohammed Swed',2007127,'Egypt','Egypt','NONE','1 May 1988','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Mazen',2007144,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9e2ee4dd239e78d162d2802a48efbabf0b99dccd8cb33afb4579f53705777218.jpg'),(