ting and recycling village lies. In association with D.A. Penneabaker, she made “Startup.com,” a film that tells the story of the dot com phenomenon and its eventual end by following Noujaim\'s classmate at Harvard, Kaleil Tuzman as he establishes \'govworks\' with his high school friend Tom Herman. Two weeks before the Iraq war, Noujaim gained access to both Al Jazeera and the US military\'s central offices in Qatar. She caught the onset and outbreak of the Iraq war on film. The result of this experience was the movie “Control Room,” an attempt to tell the story of how information is gathered, edited and eventually recreated by those who present it. In 2006, she won TED Prize for her talk about her “wish to bring the world together for one day a year through the power of film.” Noujaim actually realized this wish in 2008, when millions gathered around the world to watch Pangea Day, a 4-hour program of short films with inspirational talks and global music connecting people from Cairo, London, Mumbai, Rio de Janeiro and elsewhere. Noujaim bore witness to the 2011 revolution in Egypt, which would be the subject of her next documentary \"The Square\" or \"Al Midan,\" released in 2013. It follows six individuals, all of whom are young revolutionaries in Tahrir, from the euphoria of Mubarak\'s step down to the uncertainty of the transitional period under military rule.','17 May 1974','https://media.elcinema.com/uploads/_315x420_b4243261a53cdf8cd09cb6294540a9679c16b5cf2d9c203f9015371375ecce8c.jpg'),('mahmoud abaza',2018034,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_273347a2de6ea0c6d5f629fbbd24ae5ab1e52982969d83507e36b33a01ad15bd.jpg'),('Muhammad Attiya',2018062,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_25a95d7e3f51ea68dfea866784470fa4021d60aa51a74ff5a9333280fc249b83.jpg'),('Ziad Salem',2018087,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sally Hammad',2018088,'Egypt','