INSERT INTO `castmember` VALUES ('ناظم عصام',2023511,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('مصطفى العزبي',2023512,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('علا أشرف',2023513,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_95ef02419fcf78293c7a8f964df0f5e0ab5e5445fe9391c0fcfb0cb483d13e96.jpg'),('أدهم عزام',2023514,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('أحمد الزرقاء',2023516,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Cynthia Khalifeh',2023555,'Lebanon','Lebanon','Born into a family of art-lovers and spending most of her childhood in the authentic sea town of Batroun in Lebanon, the talented Cynthia Khalifeh was also pursuing a Filmmaking degree at IESAV-USJ (Institut d\'Etudes Scenetiques, Audio-Visuelles et Cinematographiques) and at Notre-Dame University. Most recently, Cynthia completed an intensive Creative Acting course at the renowned Actors Space in Barcelona. \nCynthia Khalifeh’s acting career began at the age of 11 when she landed a supporting role on the popular Lebanese sitcom Abdo w Abdo (2003). She then pursued her early passion for acting through numerous projects and productions, such as Ruby (2012) with stars Amir Karara and Dina El Sherbiny, and Jouzour (2013), in addition to Nemra Etnein (This Other Thing), alongside stars Asser Yassin and Arwa Gouda. Nemra Etnein aired on Shahid platform in 2020.\nCynthia quickly started nourishing her talent by appearing on Killer Karaoke 1 & 2 (Abu Dhabi TV - Alhayat Egypt) with Egyptian star Ahmad Al Fishawy. She also took part in several TV shows on Lebanese channel MTV such as MTV, NRJ Music Videos, NRJ Spinmag, Go Green, and Preview.\nThe year 2017 saw Cynthia’s career skyrocket with her performance in the award-winning short film Cargo (2017), which received numerous prestigious awards in over 40 international festivals, including Best Short Film award at the Cairo International Film Festival. \nHer first step in the international scene came soon after, through two popular shows in France that were aired on M6 in 2018. One of those shows was the French version of Survivor; Moundir et Les Apprentis (2018), in which she reached the semi-final, further solidifying her position as a force to be reckoned with. \nThe year 2020 witnessed Cynthia’s biggest UK and EU break yet, after being signed by the Los Angeles renowned actors’ manager Chuck Binder and the London-based boutique agency MLInternational Talent.\n\nMost recently, Cynthia made the smart decision by moving to Egypt for more reach in the Arab region, and is now being mentored by marketing guru Siza Zayed. Cynthia stars the new Arab TV series Wadi Al Jinn, produced by and aired on Viu. Cynthia Khalifeh is joining Ramadan 2021 by two TV dramas; Harb Ahlya alongside the super star Yousra, and Ded El Kasr with Nelly Karim. ','16 February 1992','https://media.elcinema.com/uploads/_315x420_d586f5cc39257973d8080e80e97caefdaf504af3c8f4646e91c2e7c8142faaed.jpg'),('Salma Hanafi',2023618,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_5b64c65f9f802b1602c76ce8768f194abb5501b0d2ae448577236f61a80fa032.jpg'),('Rizq Ramadan',2023622,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_9ec0ce24c49a0456b72ed23dedfd723eabf64bd1e90a7ef68104176eb1bd3601.jpg'),('Muhammad Al Hamamsi',2023630,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_174e6d1d95ce4b9081a606fdeefe5f2878169ddb0b7985d08eb0c8271b26bbae.jpg'),('Mohamed sarhan',2023631,'Egypt','محمد حسن سرحان ','NONE','NONE','https://media.elcinema.com/uploads/_315x420_32751cc0be9dcb664030b8a5ed9056f11f4e214b55fe2edd642a2fd41477ad42.jpg'),('Essam Fauzi',2023636,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Shaimaa Ellessi',2023651,'Egypt','NONE','NONE','NONE','https://media.el