Egypt','Mena Massoud is a Canadian actor of Egyptian origin. He was born on September 19, 1992 in Cairo to Egyptian parents and was raised in Ontario, Canada. Massoud currently resides between Toronto and Los Angeles. His career started in 2011 when he participated in the movie (What Happens Next) and the animated series (The 99). He gained popularity when he joined the cast of the Canadian/American TV series (Open Heart) in 2015. Massoud also participated in the movie (Strange but True) with Amy Ryan, Greg Kinnear and Nick Robinson, after which Disney announce that he will be joining the movie (Aladdin). Massoud also voiced the video game (Watch Dogs 2). \n\n','17 September 1991','https://media.elcinema.com/uploads/_315x420_4a01e57ca74638ea7a34a44ac938022da20b0653fdb9f3d7adf46010513173db.jpg'),('rowaida bibers',2120761,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_03577381b845bec4266c972d581c6dabaf32394da7aeadbc8a1687ced1a224d9.jpg'),('Ola Ammar',2120762,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_ffefc78ec74e5f4601ccb6156a550bd229d99a5f143a3b1917bf86c4dedbf274.jpg'),('dalia fakhr',2120763,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_66182b81201cdf9a36669a2c8e37d48341b4b65e374a6178a4d34714ae5866ec.jpg'),('yara shahwan',2120764,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_0f1bd703737b4b3416c60b2ae0a3a08ba00e165f8ca6210354b0bd6e33b5b522.jpg'),('aya saad',2120766,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_468200e1b758f878f0bcb551c65c76fad7b08be7cfe55f3ac3b4a4c66aade3c7.jpg'),('جميل سعيد',2120775,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Pakinam Edris',2120781,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_71718ca8a266cabc29ce95f972e4e6b24ebad53d49d00af06cdf7c8d594035f4.jpg'),('Hana Moussa',2120782,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/