u Shnab is an Egyptian actor who was born with a pretty cool mustache which helped him become an actor. He never considered acting at first because he was more interested in becoming a microbus driver because he loved reading folklore sayings on the back of microbuses and wanted to write his own and inspire people who read it!','NONE','https://media.elcinema.com/uploads/_315x420_0ec8b80768bf9acae8512611c5dc860c2c534562884b87fe7c659c204aa5a246.jpg'),('I-TODO',2133493,'Egypt','Egypt','I-TODO is an Egyptian actor and wannabe inventor who happened to actually invent some things either by accident or out of laziness! He resents women because he once fell in love with a woman who turned out not to like chocolate. I-TODO decided that he would invent a robo-woman and that he’d marry her, which is pretty much how he ended up in the acting field when his invention flew him into a movie set and when the director saw him, he decided that he should add him to the movie.','NONE','https://media.elcinema.com/uploads/_315x420_77a1e8a8c0b0cb64cea5470a3247f115db25cb1072f3cb65abfc729fca4807a3.jpg'),('TODO Msh Ana',2133494,'Egypt','Egypt','TODO Msh Ana is an Egyptian actor, writer and director, who graduated from law school and worked as a lawyer for a while. He is known as the peacemaker between his friends. TODO Msh Ana was married after a very strong love story that began in the courthouse, when he divorced a woman from her husband. Unfortunately, she also divorced him.','NONE','https://media.elcinema.com/uploads/_315x420_0b2474c9b8f0a61aee245283fe197f8efe5a8914264e1df9aa9a35212a4c16dd.jpg'),('TODO .. Wmsh Faker Elbaqy',2133495,'Egypt','Egypt','TODO Wmsh Faker Elbaqy is an Egyptian actor who appears in roles where the director needs an improvising actor. When he was a kid, he had a speech problem which drove him to shorten the things he says, or maybe because he forgot what he wanted to say! No one’s really sure! This caused him to forget his name, and some people say that laziness is the reason behind it.','NONE','https://media.elcinema.com/uploads/_315x420_37d048c9b7f7ac15ed507422db8a1e62d86fb06103a707d62918eb7219dc8a81.jpg'),('وائل رمزي',2133501,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Sameh Hassan',2133556,'Egypt','Egypt','NONE','24 May 1977','https://media.elcinema.com/blank_photos/315x420.jpg'),('Reem Saleh',2133659,'NONE','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_649f75253e89542cf4e8e74b73a10b1f598fa8fc5f3cc1ad186e892102b517a9.jpg'),('Johanna Domke',2133676,'NONE','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Hussein Walaa',2133705,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Penelope Bortoluzzi',2133749,'NONE','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Cécile Lestrade',2133750,'NONE','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Giulia Tagliavia',2133751,'NONE','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Ahmed Mostafa',2133785,'Egypt','Egypt','NONE','NONE','https://media.elcinema.com/uploads/_315x420_324834fd49f3c08d63f8e2d8659374952849962ea4aa0eda32f4cd492143d7b8.jpg'),('Ahmed Ragab',2134128,'Egypt','Egypt','NONE','20 March 1990','https://media.elcinema.com/uploads/_315x420_c93d71e2d5fddb75dbe4803ec1c6102d6f33ad0933af62135da826406927599d.jpg'),('Shahir Majed',2134172,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_79057d499a68853e4352392f56d32ad0cfd706b84eae5c66d301e7b6d64b7de7.jpg'),('Floriane Kalz',2134174,'Germany','NONE','NONE','NONE','https://media.elcinema.com/uploads/_315x420_acc665216cc83d49eb924fcb58ea545999861dae4cf5ec6a3cb1b644b0d3c428.jpg'),('Ahmad Abu Zaid',2134177,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Afnan Shaher',2134222,'Egypt','NONE','NONE','NONE','https://media.elcinema.com/blank_photos/315x420.jpg'),('Moh